--
-- Procedures
--
CREATE DEFINER=`u603366588_hehe`@`10.4.1.52` PROCEDURE `report` (IN `_sic_code` INT, IN `_name` VARCHAR(100), IN `_sector` INT, IN `_sub_sector` INT, IN `_country` INT, IN `_profile` TEXT, IN `_start_year` YEAR, IN `_end_year` YEAR, IN `_gm_percent` INT)  BEGIN
SET @sql = NULL;

SELECT
    GROUP_CONCAT(
        DISTINCT CONCAT(
        'MAX(CASE WHEN f.year = ''',
        year,
        ''' THEN f.gm_percent ELSE NULL END) AS ',
        CONCAT('`',year, '`')
        )
    ) INTO @sql
FROM finances;

SET @sql = CONCAT(
    'SELECT  
        c.sic_code,
        c.name,
        c.sector,
        c.sub_sector,
        c.country,
        c.exchange,
        c.website,
        c.profile,
    ', @sql, 
    'FROM
        companies c
    INNER JOIN
        finances f
    ON
        c.id = f.company_id
    WHERE 
        CASE 
            # 5 param
            WHEN
                (''',_sector,''')  != 0 AND
                (''',_sub_sector,''')  != 0 AND
                (''',_country,''')  != 0 AND
                (''',_start_year,''')  != 0 AND
                (''',_end_year,''')  != 0
            THEN 
                c.sector = (''',_sector,''') AND
                c.sub_sector = (''',_sub_sector,''') AND
                c.country = (''',_country,''') AND
                f.year BETWEEN (''',_start_year,''') AND (''',_end_year,''')
            # 3 param
            WHEN
                (''',_sector,''')  != 0 AND
                (''',_sub_sector,''')  != 0 AND
                (''',_country,''')  != 0
            THEN 
                c.sector = (''',_sector,''') AND
                c.sub_sector = (''',_sub_sector,''') AND
                c.country = (''',_country,''')
            # 2 param
            WHEN
                (''',_sector,''')  != 0 AND
                (''',_sub_sector,''')  != 0
            THEN 
                c.sector = (''',_sector,''') AND
                c.sub_sector = (''',_sub_sector,''')
            WHEN
                (''',_sector,''')  != 0 AND
                (''',_country,''')  != 0
            THEN 
                c.sector = (''',_sector,''') AND
                c.country = (''',_country,''')
            WHEN
                (''',_start_year,''')  != 0 AND
                (''',_end_year,''')  != 0
            THEN 
                f.year BETWEEN (''',_start_year,''') AND (''',_end_year,''')
            # 1 param
            WHEN
                (''',_sic_code,''') != 0
            THEN 
                c.sic_code = (''',_sic_code,''')
            WHEN
                (''',_name,''') != "0"
            THEN 
                c.name like(''%',_name,'%'')
            WHEN
                (''',_sector,''') != 0
            THEN 
                c.sector = (''',_sector,''')
            WHEN
                (''',_country,''') != 0
            THEN 
                c.country = (''',_country,''')
            WHEN
                (''',_profile,''') != "0"
            THEN 
                c.profile like(''%',_profile,'%'')
            WHEN
                (''',_gm_percent,''') != 0
            THEN 
                f.gm_percent = (''',_gm_percent,''')
            ELSE 
                1=1
         END
      GROUP BY
         c.sic_code
');

PREPARE stmt FROM @sql;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;
END$$

