(16, 1, 'Abist Co. Ltd. (6087)', 4, 26, 114, '-', 'https://www.abist.co.jp', 'Abist Co., Ltd. engages in industrial design technology and three dimensional (3D) computer-aided design (CAD) businesses. It operates through the following segments: Design Development Outsourcing, Hydrogen Water Production and Sales, and Others. The Design Development Outsourcing segment deals with the design and software development of machinery and machine parts using 3D CAD. The Hydrogen Water Production and Sales segment manufactures and sells hydrogen water for drinking. The Others segment includes real estate leasing business. The company was founded on February 1, 1998 and is headquartered in Tokyo, Japan.', '2019-09-27 07:23:23', '2019-09-27 07:23:23', 1, 1),
(17, 1, 'ABM Industries Inc. (ABM)', 4, 26, 250, '-', '-', '-', '2019-09-27 07:23:23', '2019-09-27 07:23:23', 1, 1),
