(51, 1, 'Advance Information Marketing Bhd (AIM)', 4, 26, 136, '-', 'https://aimnet.2be-rewarded.com', 'Advance Information Marketing Bhd. is a holding company which engages in the provision of management services ranging from consultation, technology infrastructure and technical support to procurement and logistics to companies. It operates through the following segments: Managed Customer Loyalty Services; Distribution of Health and Beauty Care Products; and Others. The Managed Customer Loyalty Services segment refers to the sales and marketing services, client relationship management, and outsourced contact centre management. The Distribution of Health and Beauty Care Products segment refers to the distribution of HABA brand of health and beauty care products from Japan through its subsidiary, which holds the exclusive distribution rights for Malaysia. The Others segment is the outsourced procurement services, investment holding, and corporate level activities. The company was founded on March 8, 2004 and is headquartered in Kuala Lumpur, Malaysia.', '2019-09-27 07:23:27', '2019-09-27 07:23:27', 1, 1),
