(55, 1, 'Advanced Share Registry Ltd. (ASW)', 4, 26, 13, '-', 'https://www.advancedshare.com.au', 'Advanced Share Registry Ltd. engages in the provision of share registry business which offers share registry and associated services to listed and unlisted clients on a state and national basis. The company was founded in May 1996 and is headquartered in Perth, Australia.', '2019-09-27 07:23:27', '2019-09-27 07:23:27', 1, 1),
(56, 1, 'Advancer Global Ltd. (43Q)', 4, 26, 210, '-', 'http://advancer.sg', 'Advancer Global Ltd. operates as an investment holding company, which provides integrated services offering workforce solutions and services in Singapore. It operates through the following segments: Employment Services Business, Building Management Services Business, and Security Services Business. The Employment Services Business segment offers services for the sourcing, employment and training of foreign domestic workers to households, as well as the sourcing and employment of foreign workers to, amongst others, corporations and organizations. The Building Management Services Business segment provides integrated building facility management services including property consultancy, property and facilities management services, property valuation, investment sales, cleaning and stewarding, waste management, landscape, pest control and fumigation services. The Security Services Business segment includes manpower and technology for security solutions and services to, amongst others, commercial, industrial and residential properties, as well as security escort services, remote surveillance and security consultancy services such as crisis management. The company was founded on February 2, 2016 and is headquartered in Singapore.', '2019-09-27 07:23:27', '2019-09-27 07:23:27', 1, 1),
(57, 1, 'Advantage Risk Management Co. Ltd. (8769)', 4, 26, 114, '-', 'http://www.armg.jp', 'Advantage Risk Management Co., Ltd. engages in the mental healthcare business. It operates through the following segments: Mental Healthcare, Disability Support, and Risk Financing. The Mental Healthcare segment provides general mental health solutions through its Advantage Employee Assistance Program, Advantage Toughness, Advantage Insight, and Emotional Quotient Training Program services. The Disability Support segment deals with the sale of group long-term disability insurance and its incidental services. The Risk Financing segment handles non-life and life insurance products agency. The company was founded in March 1999 and is headquartered in Tokyo, Japan.', '2019-09-27 07:23:27', '2019-09-27 07:23:27', 1, 1),
