(61, 1, 'Aeon Delight Co. Ltd. (9787)', 4, 26, 114, '-', 'https://www.aeondelight.co.jp', 'AEON DELIGHT CO., LTD. engages in the business of comprehensive facility management services. It operates through the following segments: Facilities Management, Security Services, Cleaning Services, Construction Work, Materials/Supplies Sourcing Services, Vending Machine Services, and Support Services. The Facilities Management segment conducts the preservation, inspection, and maintenance of building facilities. The Security Services segment provides security services for facilities, crowd handling, traffic, and valuable goods. The Cleaning Services segment offers building and facilities cleaning. The Construction Work segment renders renovation and interior design work, environmental load reduction proposals, and energy data management services. The Materials/Supplies Sourcing Services segment deals with the procurement of materials. The Vending Machine Services segment operates beverage vending machines and maintains air purification units. The Support Services segment includes retail stores, technical training, temporary staffing, travel agency, household chores support services and real estate leasing businesses. The company was founded on November 16, 1972 and is headquartered in Osaka, Japan.', '2019-09-27 07:23:28', '2019-09-27 07:23:28', 1, 1),
