(76, 1, 'Ajcon Global Services Ltd. (511692)', 4, 26, 105, '-', 'https://www.ajcononline.com', 'Ajcon Global Services Ltd. engages in the provision of financial services. Its services includes stock broking, commodity broking, depository services, projects consultancy, market research, loan syndication and corporate advisory services. The company was founded by Ashok Kumar Ajmera on December 19, 1986 and is headquartered in Mumbai, India.', '2019-09-27 07:23:29', '2019-09-27 07:23:29', 1, 1),
(77, 1, 'Ajis Co. Ltd. (4659)', 4, 26, 114, '-', 'https://www.ajis.jp', 'AJIS Co., Ltd. engages in the provision of inventory and retail support services. It operates through the following segments: Domestic Inventory Services, Overseas Inventory Services and Retail Support Services. The Domestic Inventory Services segment offers physical inventory services. The Overseas Inventory Services segment includes the physical inventory of overseas affiliates. The Retail Support Services segment handles the temporary staffing, merchandising, and customer services. The company was founded on May 23, 1978 and is headquartered in Chiba, Japan.', '2019-09-27 07:23:29', '2019-09-27 07:23:29', 1, 1),
