(81, 1, 'Akkhie Prakarn PCL (AKP)', 4, 26, 231, '-', 'http://www.akkhie.com/index.php', 'Akkhie Prakarn Public Co., Ltd. is engaged waste management system service. It operates an industrial waste incinerator and is capable of disposing of waste via combustion. The company also facilitates pollution control systems such as the dry lime and activated carbon injection system and the acid gas reduction system, among others, and houses a laboratory for hazardous waste analysis. Akkhie Prakarn was founded on January 25, 2008 and is headquartered in Samut Prakarn, Thailand.', '2019-09-27 07:23:30', '2019-09-27 07:23:30', 1, 1),
