(88, 1, 'Albert Inc. (3906)', 4, 26, 114, '-', 'https://www.albert2005.co.jp', 'Albert, Inc. engages in the provision of analytical marketing solutions. Its solutions include marketing research, multivariate statistics, data mining, analytical text and image analysis, big data processing, solutions development, platform building, and engineering optimization modeling. The company also offers recommendation engine, which shows optimized items to the visitor; optimization of advertisement by ad-technologies; and customer relationship management solutions through website, email, contact centers, and fliers. The company was founded by Yoshisuke Yamakawa and Takashi Uemura on July 1, 2005 and is headquartered in Tokyo, Japan.', '2019-09-27 07:23:31', '2019-09-27 07:23:31', 1, 1),
(89, 1, 'Alfred Herbert (India) Ltd. (505216)', 4, 26, 105, '-', 'http://www.alfredherbert.co.in', 'Alfred Herbert (India) Ltd. engages in the non-banking financial services. It operates through the two divisions: Realty and Business Services; and Sales and Marketing. The Realty and Business Services division invests in, develops, and markets real estate properties. The Sales and Marketing division produces and sells machinery and spare parts. The company was founded on December 2, 1919 and is headquartered in Kolkata, India.', '2019-09-27 07:23:31', '2019-09-27 07:23:31', 1, 1),
