(97, 1, 'Allied Sustainability & Environmental Consultants Group Ltd. (8320)', 4, 26, 102, '-', 'https://www.asecg.com/en/', 'Allied Sustainability & Environmental Consultants Group Ltd. is an investment holding company, which engages in the provision of environmental consulting services. It operates through the following segments: Green Building Certification Consultancy; Sustainability and Environmental Consultancy; Acoustics, Noise and Vibration Control, and Audio-Visual Design Consultancy; and Environmental, Social, Governance Reporting, and Consultancy. The Green Building Certification Consultancy segment provides consultancy services on the application of green building certification for new buildings, existing buildings, and building interiors. The Sustainability and Environmental Consultancy segment offers consultancy services that involves the process of environmental impact assessment to identify, predict, evaluate, and mitigate the biophysical, social, and other relevant effects of property development proposal prior to major decisions being taken and commitments made. The Acoustics, Noise and Vibration Control, and Audio-Visual Design Consultancy segment includes architectural acoustic design; sound insulation design; mechanical, electrical, and plumbing services noise and vibration control; design and construction supervision of acoustic treatment and noise mitigation design; and audio-visual design. The ESG Reporting and Consultancy segment conducts assessment of the ESG system of clients. The company was founded on November 11, 2015 and is headquartered in Hong Kong.', '2019-09-27 07:23:31', '2019-09-27 07:23:31', 1, 1),
(98, 1, 'Alpha Co. Ltd. (4760)', 4, 26, 114, '-', 'http://www.popalpha.co.jp', 'Alpha Co., Ltd. engages in the provision of general sales promotional services. Its offers point of purchase (POP) advertising that caters to supermarkets, electronic stores, and other retailers. It provides posters, banners, decorations, and event goods. The company was founded on January 5, 1984 and is headquartered in Okayama, Japan.', '2019-09-27 07:23:32', '2019-09-27 07:23:32', 1, 1),
