(101, 1, 'ALS Ltd. (ALQ)', 4, 26, 13, '-', 'http://www.alsglobal.com', 'ALS Ltd. provides testing services which focuses manufacturing and marketing commercial chemicals and industrial cleaning agents throughout Australia and the Pacific. It also distributes non-food consumables. It operates through the following segments: Life Sciences, Industrial, Commodities, Oil and Gas Labs. The Life Sciences segment provides analytical testing and sampling services and remote monitoring for the Environmental, Food, Pharmaceutical, and Consumer Products markets. The Industrial segment is a leading provider of diagnostic testing and engineering solutions for the energy, resources, transportation and infrastructure sectors. The Commodities segment leads as a full-service provider of testing services for the global mining industry in four key service areas-Geochemistry, Metallurgy, Inspection, and Coal Quality-with an extensive client base of explorers, miners, and traders. The Oil and Gas Labs segment delivers quality technical solutions and products to the oil and gas industries. The company was founded in 1863 and is headquartered in Brisbane, Australia.', '2019-09-27 07:23:32', '2019-09-27 07:23:32', 1, 1),
