(114, 1, 'Amita Holdings Co. Ltd. (2195)', 4, 26, 114, '-', 'https://www.amita-hd.co.jp', 'Amita Holdings Co., Ltd engages in environmental solutions, certification business, and consulting services. It operates through the following business segments: Land Resource Business and Environmental Solutions Business. The Land Resource Business segment includes land resource production, sale, recycling operation, and resource marketing services. The Environmental Solutions Business segment deals with environmental support and information management, environmental consulting, survey and research, and Forest Stewardship Council (FSC) and Programme for the Endorsement of Forest Certification Schemes (PEFC) certification services. It also offers Chain of Custody (COC) certification which provides for the manufacturers (of paper, furniture, building materials, homes, lumber and paper products, packaging, etc.), distributors, printers, retailers, etc; Forest Management (FM) certification which provides to forestry associations, governments, companies, etc; and Project Certification (PC) which provides for the building companies, construction firms, manufacturers (of furniture, building materials, homes and lumbe, etc.), event organizers, etc. The company was founded by Eisuke Kumano on January 4, 2010 and is headquartered in Tokyo, Japan.', '2019-09-27 07:23:33', '2019-09-27 07:23:33', 1, 1),
