(118, 1, 'Amuse Inc. (4301)', 4, 26, 114, '-', 'http://www.amuse.co.jp', 'Amuse Inc. engages in the business of entertainment. Its operations are carried out through the following segments: Artist Management, Media Visual, and Contents. The Artist Management segment deals with the artists'' activities such as concerts, stage performances, and events. It also handles fan clubs, sale of goods and products, production and distribution of record masters, and management of copyrights. The Media Visual segment involves production of programs for television and other media, production and distribution of films, and purchase, production, and sale of film productions, music CDs and DVDs, and other media. The Contents segment manages master rights and copyrights of old music, and utilization of films and visual software. The company was founded by Kuniko Osato on October 16, 1978 and is headquartered in Tokyo, Japan.', '2019-09-27 07:23:33', '2019-09-27 07:23:33', 1, 1),
(119, 1, 'AnaeCo Ltd. (ANQ)', 4, 26, 13, '-', 'http://www.anaeco.com', 'AnaeCo Ltd. engages in the provision of waste management. It specializes in the design and development of advanced resource recovery and recycling systems based on the patented AnaeCo™ System. It offers sorting, recycling, anaerobic digestion and aerobic composting to recycle municipal solid waste (MSW) into renewable energy from biogas, organic fertiliser and recyclables such as steel, aluminium, glass and plastics. The company was founded by Thomas Rudas and Richard Rudas on April 21, 1999 and is headquartered in Bentley, Australia.', '2019-09-27 07:23:33', '2019-09-27 07:23:33', 1, 1),
(120, 1, 'Analabs Resources Bhd (ANALABS)', 4, 26, 136, '-', 'http://www.analabs.com.my', 'Analabs Resources Bhd. is an investment holding company, which engages in the provision of management services. It operates through the following segments: Manufacturing, Formulation, Sale of Resin, Chemicals, and Building Materials; Recovery and Sale of Recycled Products; Culture and Sale of Prawns; Investment Holding and Property Letting; and Contract Work, Pipe, Laying, and Rehabilitation. The Manufacturing, Formulation, Sale of Resin, Chemicals, and Building Materials segment trades tiles. The Recovery and Sale of Recycled Products; Culture and Sale of Prawns segment collects. treats, and recovers and sells industrial waste and products. The Culture and Sale of Prawns segment breeds and retails prawns. The Investment Holding and Property Letting segment covers the investment holding, management services, and property letting services. The Contract Work, Pipe, Laying, and Rehabilitation segment offers general contracting. The company was founded in 1965 and is headquartered in Kuala Lumpur, Malaysia.', '2019-09-27 07:23:33', '2019-09-27 07:23:33', 1, 1),
