(127, 1, 'Appen Ltd. (APX)', 4, 26, 13, '-', 'https://appen.com', 'Appen Ltd. engages in the development of human-annotated datasets for machine learning and artificial intelligence. It operates through the following segments: Content Relevance, Language Resources, and Other. The Content Relevance segment offers annotated data used in search technology for improving relevance and accuracy of search results. The Language Resources segment comprises of data used in speech recognizers, machine translation, speech synthesizers and other machine-learning technologies resulting in more engaging and fluent devices including internet-connected devices, in-car automotive systems and speech-enabled consumer electronics. The company was founded in 2011 and is headquartered in Sydney, Australia.', '2019-09-27 07:23:34', '2019-09-27 07:23:34', 1, 1),
