(130, 1, 'Aptech Ltd. (532475)', 4, 26, 105, '-', 'https://www.aptech-worldwide.com', 'Aptech Ltd. is a holding company, which engages in the business of education training and assessment solution services. It operates through Retail, and Non-retail segments. The Retail segment consists of network of vocational, and pre-scholl learning centres under various brands as Aptech, primarily run with a franchise model. The Non-retail segment offers corporate, institutional, and government sectors. The company was founded in 1986 and is headquartered in Mumbai, India.', '2019-09-27 07:23:34', '2019-09-27 07:23:34', 1, 1),
