(132, 1, 'Aqualine Ltd. (6173)', 4, 26, 114, '-', 'http://www.aqualine.jp', 'Aqualine Ltd. engages in the management and sale of mineral water and water dispensers. It operates through the Water Supply Product Emergency Repair Service and Mineral Water segments.The Water Supply Product Emergency Repair Service segment covers the emergency trouble repair and correspondence around water, sales, installation of water-related products, and other related repair works. The Mineral Water segment sells mineral water and handles water dispensers. The company was founded by Takeshi Okochi on November 1, 1995 and is headquartered in Hiroshima, Japan.', '2019-09-27 07:23:34', '2019-09-27 07:23:34', 1, 1),
