(140, 1, 'Arealink Co. Ltd. (8914)', 4, 26, 114, '-', 'http://www.arealink.co.jp', 'Arealink Co., Ltd. engages in the provision of storage space leasing services. It operates through the Property Management Service and Property Revitalization & Liquidation Service segments. The Property Management Service segment includes storage management and liquidation, parking, asset, and office businesses. The Property Revitalization & Liquidation Service segment engages in the buying and selling of real estate. The company was founded by Naomichi Hayashi on April 21, 1995 and is headquartered in Tokyo, Japan.', '2019-09-27 07:23:35', '2019-09-27 07:23:35', 1, 1),
