(142, 1, 'Arowana International Ltd. (AWN)', 4, 26, 13, '-', 'https://arowanaco.com', 'Arowana International Ltd. is a holding company, which engages in enterprise office, diagnostic testing, and training and events businesses. It operates its business through three divisions: Enterprise Office, Operating Companies and Funds Management. The Enterprise Office segment provides strategic, operational, financial, human resources support to the operating entities within the group. The Operating Companies segment operates houses business units and underlying businesses. The Funds Management segment manages listed and unlisted funds that have either permanent capital or semi permanent capital. Arowana International was founded in 1984 by Tser Fah Chin and is headquartered in North Sydney, Australia.', '2019-09-27 07:23:35', '2019-09-27 07:23:35', 1, 1),
