(144, 1, 'Artefact Projects Ltd. (531297)', 4, 26, 105, '-', 'http://www.artefactprojects.com', 'Artefact Projects Ltd. engages in the provision of engineering, architectural, and project management services. It provides services to highways, urban infrastructures, and airports. THe company was founded on October 6, 1987 and is headquartered in Nagpur, India.', '2019-09-27 07:23:35', '2019-09-27 07:23:35', 1, 1),
