(146, 1, 'Artner Co. Ltd. (2163)', 4, 26, 114, '-', 'https://www.artner.co.jp', 'Artner Co., Ltd. engages in the general personnel dispatch and charged employment placement businesses. It specializes in the fields of machine design, electric and electronics design, and software development. It operates in Engineer Dispatching and Outsourcing and Consignment businesses. The Engineer Dispatching business conducts full-time employee contracts with engineers and dispatches the same to corporate clients. The Outsourcing and Consignment business handles various requests of corporate clients related to design and development work to design and engineering work. The company was founded in August 1953 and is headquartered in Osaka, Japan.', '2019-09-27 07:23:36', '2019-09-27 07:23:36', 1, 1),
(147, 1, 'ARTS Group Co. Ltd. A (603017)', 4, 26, 47, '-', '-', 'ARTS Group Co., Ltd. engages in the provision of engineering and technical services. Its business activities include construction engineering design, engineering general contracting, and engineering supervision and project management. Its Engineering Design division offers project design, preliminary design, construction design, and related technical advisory services. Its Engineering General Contracting Division involves in the survey, design, and procurement of the engineering projects. Its Engineering Supervision and Project Management division provides construction monitoring and management services. The company was founded on April 8, 1995 and is headquartered in Suzhou, China.', '2019-09-27 07:23:36', '2019-09-27 07:23:36', 1, 1),
(148, 1, 'Asaka Riken Co. Ltd. (5724)', 4, 26, 114, '-', 'http://www.asaka.co.jp', 'Asaka Riken Co., Ltd. engages in the collection and refinement of precious metals and manufacturing of industrial chemicals. It operates through the following business segments: Precious Metal Business, Environmental Business, System Business and Others. The Precious Metal Business segment collects, refines, and processes gold, silver, palladium and other metals; and cleans and recycles various tools and functional parts. The Environmental Business segment collects ferric chloride solution and used wastes; and sells water treatment chemicals, etching solutions, photo catalysts, copper pellets and powders. The System Business segment covers system contract development. The Others segment includes industrial chemical transportation; and wastage collection and transport. The company was founded on August 25, 1969 and is headquartered in Koriyama, Japan.', '2019-09-27 07:23:36', '2019-09-27 07:23:36', 1, 1),
