(151, 1, 'Ashley Services Group Ltd. (ASH)', 4, 26, 13, '-', 'http://www.ashleyservicesgroup.com.au', 'Ashley Services Group Ltd. engages in the provision of workforce solutions. It specializes in training, recruitment, and labor hire. It operates through the Labour Hire and Training segment.The company was founded by Ross Shrimpton in 1968 and is headquartered in Sydney, Australia.', '2019-09-27 07:23:36', '2019-09-27 07:23:36', 1, 1),
