(156, 1, 'Asia Air Survey Co. Ltd. (9233)', 4, 26, 114, '-', 'https://www.ajiko.co.jp', 'Asia Air Survey Co., Ltd. engages in the business of information systems and construction consultant services. It operates through the Social Infrastructure Management and Homeland Conservation Consultant business divisions. The Social Infrastructure Management business division handles infrastructure management of roads, railways, and other public facilities. It also deals with energy related business. The Homeland Conservation Consultant business division provides consulting services on rivers, forestry, soil and underground pollution control, and environmental conservation. The company was founded on December 15, 1949 and is headquartered in Tokyo, Japan.', '2019-09-27 07:23:37', '2019-09-27 07:23:37', 1, 1),
(157, 1, 'Asia Media Group Bhd (AMEDIA)', 4, 26, 136, '-', 'http://www.asiamedia.net.my', 'Asia Media Group Bhd. engages in the provision of media services. It operates through the following segments: Investment holding, Multimedia advertising services, and Production and marketing of electronic audio and visual media. The company involved in the Digital Out-of Home advertising industry. It focuses on transit media advertising, allowing its clients to target users of public transportation in Malaysia by providing infotainments, advertisements, and contents via its Transit-TV Network System. The company was founded by Wong Shee Kai on April 9, 2008 and is headquartered in Puchong, Malaysia.', '2019-09-27 07:23:37', '2019-09-27 07:23:37', 1, 1),
