(159, 1, 'Asia Plastic Recycling Holding Ltd. (1337)', 4, 26, 228, '-', 'http://www.asia-recycle.com', 'Asia Plastic Recycling Holding Ltd. engages in the sale, manufacture, research and development of recycling plastic materials. Its products include ethylene vinyl acetate, low density polyethylene, fireproof, anti-static, rubber and plastic foam. The company was founded on January 8, 2010 and is headquartered in Kaohsiung, Taiwan.', '2019-09-27 07:23:37', '2019-09-27 07:23:37', 1, 1),
