(163, 1, 'Asiaray Media Group Ltd. (1993)', 4, 26, 102, '-', 'https://www.asiaray.com/en/home/', 'Asiaray Media Group Ltd. engages in the development and operations of out-of-home advertising media, including advertising in airports, metro lines, billboards, and building solutions. It operates through the following business segments: Airport Business, Metro Lines Business, and Billboards and Building Solutions. The Airports Business segment operates advertising services in airports. The Metro Lines Business segment manages the advertising business in metro lines. The Billboards and Building Solutions segment handles the advertising services on billboards and building solutions. The company was founded in 1993 and is headquartered in Hong Kong.', '2019-09-27 07:23:37', '2019-09-27 07:23:37', 1, 1),
