(171, 1, 'Atharv Enterprises Ltd. (530187)', 4, 26, 105, '-', '-', 'Atharv Enterprises Ltd. engages in yarn trading and investments. It operates through the following segments: Trading Fabric Cloth, Investment, and Finance. The company was founded on December 26, 1990 and is headquartered in Kolhapur, India.', '2019-09-27 07:23:38', '2019-09-27 07:23:38', 1, 1),
(172, 1, 'Athena Global Technologies Ltd. (517429)', 4, 26, 105, '-', 'http://www.athenagt.com', 'Athena Global Technologies Ltd. engages in the business of software development. It offers application development and maintenance, quality assurance and testing, and staff augmentation. The company was founded by Jalagam Venkat Rao and Satyendra Manchala on May 6, 1992 and is headquartered in Hyderabad, India.', '2019-09-27 07:23:38', '2019-09-27 07:23:38', 1, 1),
(173, 1, 'Atrae Inc. (6194)', 4, 26, 114, '-', 'https://atrae.co.jp', 'Atrae, Inc. engages in the business of employment services. Its operations are carried out through the following business divisions: Green, yenta, and wevox. The Green division provides matching services for job seekers and recruitment companies. The Yenta division is a matching application that utilizes artificial intelligence technology to help connect business professionals. The wevox division conducts surveys to analyze company employee engagement. The company was founded by Yoshihide Arai on October 24, 2003 and is headquartered in Tokyo, Japan.', '2019-09-27 07:23:39', '2019-09-27 07:23:39', 1, 1),
