(175, 1, 'Aun Consulting Inc. (2459)', 4, 26, 114, '-', 'https://www.auncon.co.jp', 'Aun Consulting, Inc. engages in the provision of search engine marketing (SEM) consulting services. It operates through the following segments: Marketing and Asset. The Marketing segment offers advertising marketing service. The Asset segment provides property leasing, brokerage brokerage and rental brokerage. The company was founded on June 8, 1998 and is headquartered in Tokyo, Japan.', '2019-09-27 07:23:39', '2019-09-27 07:23:39', 1, 1),
