(177, 1, 'AusGroup Ltd. (5GJ)', 4, 26, 210, '-', 'https://www.ausgroupltd.com', 'AusGroup Ltd. is an investment holding company, which engages in the provision of fabrication, construction, and integrated services. It operates through the following segments: Projects, Access services, Maintenance Services, and Port and Marine Services. The Projects segment provides structural, mechanical, piping, scaffolding and painting, insulation, and fireproofing services. The Access Services segment Provide access services include scaffolding, engineering and design, labour supply and stock control, logistics, transportation and rope services. The Maintenance Services segment provides preventative and breakdown maintenance services as well as shut down services and sustaining capital works. The Port and Marine Services segment provides support services to the offshore oil and gas and military industries through the provision of marine services including door to door transport of high, wide and heavy cargoes to remote, undeveloped and environmentally sensitive locations. The company was founded in 1988 and is headquartered in Perth, Australia.', '2019-09-27 07:23:39', '2019-09-27 07:23:39', 1, 1),
