(183, 1, 'AWC Bhd (AWC)', 4, 26, 136, '-', 'http://www.awc.com.my', 'AWC Bhd. is an investment holding company, which engages in the provision of integrated facilities management and engineering services. It operates through the following segments: Investment Holding, Facilities, Engineering, and Environment. The Investment Holding segment provides group-level corporate services. The Facilities segment comprises integrated range of maintenance services for office, commercial, industrial, residential, and administrative buildings. The Engineering segment caters various mechanical and electrical engineering services for the building industry. The Environment offers environmentally-friendly solutions to waste collection system management. The company was founded on June 13, 2001 and is headquartered in Subang Jaya, Malaysia.', '2019-09-27 07:23:39', '2019-09-27 07:23:39', 1, 1),
(184, 1, 'AWF Madison Group Ltd. (AWF)', 4, 26, 164, '-', '-', '-', '2019-09-27 07:23:39', '2019-09-27 07:23:39', 1, 1),
(185, 1, 'Axcelasia Inc. (42U)', 4, 26, 210, '-', 'http://www.axcelasia.com', 'Axcelasia, Inc. is an investment holding company, which engages in the provision of integrated professional services to government-linked entities, private and public listed companies, and multinational corporations. It operates through the following business segments: Corporate Office, Tax Advisory, Business Consultancy, EMS Application, and Business Support. The Corporate Office segment covers investment holding activities.The Tax Advisory segment provides corporate and individual tax compliance, training, and knowledge management services. The Business Consultancy segment relates to governance and compliance assessment, internal audit services, business continuity management, and financial management. The EMS Application segment sells license of the Enterprises Risk Management software. The Business Support segment offers corporate secretarial services, accounting, payroll, and administration support. The company was founded on August 21, 2015 and is headquartered in Kuala Lumpur, Malaysia.', '2019-09-27 07:23:39', '2019-09-27 07:23:39', 1, 1),
(186, 1, 'Axel Mark Inc. (3624)', 4, 26, 114, '-', 'https://www.axelmark.co.jp', 'Axel Mark, Inc. engages in the mobile content business. It operates through the following segments: Game, Advertising, and and Experience. The Game segment handles the planning, development and management of mobile games. The Advertising segment covers the planning, production, and management of online advertisements. The and Experience segment offers services such as "croscrea", a costume production service, "Kujikore", an online lottery service, and ".yell plus", a communication application that connects with celebrities. The company was founded on March 22, 1994 and is headquartered in Tokyo, Japan.', '2019-09-27 07:23:39', '2019-09-27 07:23:39', 1, 1),
(187, 1, 'Axel Polymers Ltd. (513642)', 4, 26, 105, '-', 'http://www.axelindia.com', 'Axel Polymers Ltd. engages in the manufacture and sale of compounds, blends, and alloys of engineering polymers. It specializes in toll compounding, repellants-bed nets, and thermoplastic compounds. The company was founded on May 21, 1992 and is headquartered in Vadodara, India.', '2019-09-27 07:23:40', '2019-09-27 07:23:40', 1, 1),
