(190, 1, 'Axon Ventures Ltd. (505506)', 4, 26, 105, '-', '-', 'Axon Ventures Ltd. engages in the provision of financial services. The company also manufactures, trade, agents, supply, import, export, and deal all kinds of fabrics, yarn, and clothes. It operates through the Dealers in Commodity, and Finance and Investment Activities segments. The company was founded on August 7, 1982 and is headquartered in Mumbai, India.', '2019-09-27 07:23:40', '2019-09-27 07:23:40', 1, 1),
(191, 1, 'Axtel Industries Ltd. (523850)', 4, 26, 105, '-', 'http://www.axtelindia.com', 'Axtel Industries Ltd. engages in the manufacture of custom designed food processing plants and machineries. It supplies process engineering equipment and turnkey systems to the food and pharmaceutical industries. Its portfolio includes the following categories of equipment: solids handling, storage and dsicharge, sieving and straining, size reduction, mixing and blending, and specialized proccess equipment. The company was founded on June 24, 1975 and is headquartered in Halol, India.', '2019-09-27 07:23:40', '2019-09-27 07:23:40', 1, 1),
