(198, 1, 'Baguio Green Group Ltd. (1397)', 4, 26, 102, '-', 'http://www.baguio.com.hk', 'Baguio Green Group Ltd. is an investment holding company, which engages in the provision of environmental services. It operates through the following segments: Cleaning Services Business; Landscaping Services Business; Pest Management Business; and Waste Management and Recycling Business. The Cleaning Services Business segment provides cleaning and public hygiene services to commercial and industrial buildings; residential premises; cultural, leisure, and recreation venues; shopping malls; and education institutions. The Landscaping Services Business segment includes tree survey and arboricultural works; horticultural maintenance; landscape and green projects; lawn maintenance; and supply of plants, trees, and landscape materials. The Pest Management Business segment comprises of termite, rodent, cockroach, mosquito and fly, red fire ant, flea, leisure places pest, bird nuisance, and other common urban pests control. The Waste Management and Recycling Business segment manages commercial and industrial, municipal, construction, food, green, liquid, chemical, and clinical wastes; materials recovery; and waste management projects. The company was founded by Wing Hong Ng and Wing Sun Ng in 1980 and is headquartered in Hong Kong.', '2019-09-27 07:23:40', '2019-09-27 07:23:40', 1, 1),
(199, 1, 'Bamboos Health Care Holdings Ltd. (8216)', 4, 26, 102, '-', 'http://www.bamboos.com.hk', 'Bamboos Health Care Holdings Ltd. provides healthcare staffing solution services. It provides services on a temporary basis to individuals and institutional clients in a timely manner as well as duty opportunities to self-employed healthcare personnel registration. The company''s healthcare personnel consists of nurses, mid-wives, clinic assistants, physiotherapists, doctors, and personal care workers. Bamboos Health Care Holdings was founded on November 23, 2012 and is headquartered in Hong Kong.', '2019-09-27 07:23:40', '2019-09-27 07:23:40', 1, 1),
