(204, 1, 'BayCurrent Consulting Inc. (6532)', 4, 26, 114, '-', 'https://www.baycurrent.co.jp', 'BayCurrent Consulting, Inc. engages in the provision of consulting services. It offers Strategy Business Process Consulting, Information Technology (IT) Consulting, and System Integration. The Strategy Business Process Consulting covers company or business strategy, M&A alliances, digital strategy, turn-around, globalization, innovation, and marketing or sales strategy. The IT Consulting includes IT strategy, governance, organizational improvement, cost optimization, architecture, asset evaluation, talent development, and Request For Proposal (RFP) creation. The System Integration handles system design, development and infrastructure operation and maintenance. The company was founded on March 25, 1998 and is headquartered in Tokyo, Japan.', '2019-09-27 07:23:41', '2019-09-27 07:23:41', 1, 1),
(205, 1, 'BBX Minerals Ltd. (BBX)', 4, 26, 13, '-', 'http://bbxminerals.com.au', 'BBX Minerals Ltd. engages in the exploration and development of mining assets in Brazil and South America. Its projects include Juma East Ema, Tres Estados, Pombos, and Eldorado do Juma. The company was founded in April 1993 and is headquartered in West Perth, Australia.', '2019-09-27 07:23:41', '2019-09-27 07:23:41', 1, 1),
