(208, 1, 'Beauty Garage Inc. (3180)', 4, 26, 114, '-', 'https://www.beautygarage.co.jp', 'Beauty Garage, Inc. engages in the beauty salon business. It operates through the following segments: Product Sales, Store Design, and Other Solutions. The Product Sales segment deals with purchase and sale of hairdressing equipment and cosmetics. The Store Design segment conducts design, construction, and supervision related to interior work of shops. The Other Solutions segment offers real estate brokerage, start-up assistance, information technology support, and insurance services. The company was founded by Hideki Nomura and Shuichi Tomoda on April 24, 2003 and is headquartered in Tokyo, Japan.', '2019-09-27 07:23:41', '2019-09-27 07:23:41', 1, 1),
