(210, 1, 'Beijing Enterprises Environment Group Ltd. (0154)', 4, 26, 102, '-', 'http://www.beegl.com.hk', 'Beijing Enterprises Environment Group Ltd. operates as an investment holding company, with interests in waste management, and information technology. It operates through the Solid Waste Treatment, and Corporate and Others segments. The Solid Waste Treatment segment refers to the construction and operation of waste incineration plants, waste treatment and the sale of electricity and steam generated from waste incineration. The Corporate and Others segment comprises property investment and corporate income, and expense items. The company was founded on May 28, 1963 and is headquartered in Hong Kong.', '2019-09-27 07:23:42', '2019-09-27 07:23:42', 1, 1),
(211, 1, 'Beijing GeoEnviron Engineering & Technology Inc. (603588)', 4, 26, 47, '-', 'http://www.bgechina.cn', 'Beijing GeoEnviron Engineering & Technology, Inc. engages in the environmental technology research and provision of systematic solution for pollution prevention and treatment. The company offers management system mainly composed of industrial environmental services, urban environmental services, and environmental remediation. It also involves in pollution prevention and treatment technologies of solid waste management and liquid waste management and other related services. The company was founded on August 28, 1992 and is headquartered in Beijing, China.', '2019-09-27 07:23:42', '2019-09-27 07:23:42', 1, 1),
(212, 1, 'Beijing Media Corp. Ltd. (1000)', 4, 26, 102, '-', 'http://www.bjmedia.com.cn', 'Beijing Media Corp. Ltd. engages in the provision of advertising services. It operates through the following segments: Advertising, Printing, Trading of Print-related Material, Distribution, and Network technical Services. The Advertising segment includes the sale of advertising spaces and outdoor advertising. The Printing segment provides services related to printing. The Trading of Print-related Material segment sells paper, ink, lubricant, film, pre-coating photosensitive liquid plate and rubber plate used for printing, and other print-related materials. The Distribution segment supplies newspaper published by Chongqing Youth Daily. The Network Technical Services segment provides network technical support and maintenance service for online gaming. The company was founded on April 25, 2001 and is headquartered in Hong Kong.', '2019-09-27 07:23:42', '2019-09-27 07:23:42', 1, 1),
