(214, 1, 'Beijing Originwater Technology Co. Ltd. (300070)', 4, 26, 47, '-', 'http://www.originwater.com', 'Beijing OriginWater Technology Co., Ltd. engages in the development of solutions for environmental problems. It provides solutions for polluted water, water scarcity, and water safety using self-innovated membrane technology. The company engages in the business of membrane technology R&D, membrane equipment production, municipal and industrial waste water treatment, solid waste and sludge treatment, drinking water treatment, seawater desalination, water engineering building and construction, water industry investment and financing, as well as domestic and commercial water reclamation facilities. The company was founded on July 17, 2001 and is headquartered in Beijing, China.', '2019-09-27 07:23:42', '2019-09-27 07:23:42', 1, 1),
(215, 1, 'Beijing Tensyn Digital Marketing Technology JSC (300392)', 4, 26, 47, '-', 'http://www.tensynchina.com', 'Beijing Tensyn Digital Marketing Technology JSC engages in the provision of internet advertising and public relations services. Its business is divided into internet advertising and Internet public relations services. The internet advertising services business including strategy development; media procurement; advertising; website construction and creative planning; and advertising effectiveness, monitoring, and optimization services. The internet public relations services business including public relations strategy development, and monitoring and social media marketing. The company was founded on December 6, 2001 and is headquartered in Beijing, China.', '2019-09-27 07:23:42', '2019-09-27 07:23:42', 1, 1),
