(302, 1, 'Cardinal Co. Ltd. (7855)', 4, 26, 114, '-', 'https://www.cardinal.co.jp', 'Cardinal Co., Ltd. engages in the manufacture and sale of cards. It offers plastic, prepaid, pet and paper card; and card system related equipment. It also involves in software business such as point card customer management system and mobile mail delivery system. The company was founded on October 4, 1967 and is headquartered in Osaka, Japan.', '2019-09-27 07:23:56', '2019-09-27 07:23:56', 1, 1),
