(304, 1, 'Cardno Ltd. (CDD)', 4, 26, 13, '-', 'https://www.cardno.com', 'Cardno Ltd. engages in the development of physical and social infrastructure for communities. It operates through the following segments: Asia Pacific Engineering and Environmental; Americas Engineering and Environmental; International Development; Other. The Asia Pacific Engineering and Environmental segment provides services in civil, structural, water, environmental, coastal, bridge, geotechnical, subsurface utility, traffic and transport engineering as well as environmental science, surveying, landscape architecture, planning, and asset management. The Americas Engineering and Environmental segment delivers expertise to private and public sector client across the environmental, water, transportation, energy and resources, land, buildings, and management services sectors. The International Development segment designs and implements solutions for development assistance agencies and private clients. The Other segment consists of Construction Science, LATAM, PPI, and group head office. The company was founded in 1945 and is headquartered in Brisbane, Australia.', '2019-09-27 07:23:56', '2019-09-27 07:23:56', 1, 1),
(305, 1, 'Cardtronics PLC Cl A (CATM)', 4, 26, 250, '-', '-', '-', '2019-09-27 07:23:56', '2019-09-27 07:23:56', 1, 1),
(306, 1, 'Career Bank Co. Ltd. (4834)', 4, 26, 114, '-', 'http://www.career-bank.co.jp', 'Career Bank Co., Ltd. engages in worker dispatch and paid placement business. It operates through the following segments: Human Resource (HR) Dispatch related, HR Dispatch related (Kanto), Recruitment, Re-Employment Support, Payroll, and Others. The HR Dispatch related segment both in main and Kanto areas handle general workers dispatch, medical industry personnel, and outsourcing services. The Recruitment segment handles employment placement business. The Re-Employment Support segment offers management and labor consultancy, as well as, personnel training, career change support, and job opportunity development. The Payroll segment provides payroll management services. The Others segment offers stress check services and language training. The company was founded in November 1987 and is headquartered in Sapporo, Japan.', '2019-09-27 07:23:57', '2019-09-27 07:23:57', 1, 1),
(307, 1, 'Career Co. Ltd. (6198)', 4, 26, 114, '-', 'http://www.careergift.co.jp', 'Career Co. Ltd. engages in human resources services specialized for senior people. It includes senior work, office support, senior care, and recruitment businesses. The company was founded on April 28, 2009 and is headquartered in Tokyo, Japan.', '2019-09-27 07:23:57', '2019-09-27 07:23:57', 1, 1),
(308, 1, 'CAREERLINK Co. Ltd. (6070)', 4, 26, 114, '-', 'http://www.careerlink.co.jp', 'Careerlink Co., Ltd. engages in the provision of executive search services. It operates through the Administrative Personnel Services and Manufacturing Personnel Services segments. The Administrative Personnel Services segment includes Business Process Outsourcing (BPO)-related, Customer Relationship Management (CRM)-related, and general affairs businesses. The Manufacturing Personnel Services segment handles food processing and distribution to retailers. The company was founded on October 1, 1996 and is headquartered in Tokyo, Japan.', '2019-09-27 07:23:57', '2019-09-27 07:23:57', 1, 1),
