(311, 1, 'carsales.com Ltd. (CAR)', 4, 26, 13, '-', 'https://www.carsales.com.au', 'carsales.com Ltd. engages in the operation of online automotive, motorcycle and marine classifieds business. It provides car buying and selling services in Australia. The company also provides provide online advertising solutions to media agencies and its clients, dealers, industry organizations and many other businesses. It operates through following segments: Online Advertising, Data and Research, International, Finance and Related Services. The Online Advertising Services segment comprises of classified advertising, which allows customers to advertise automotive and non-automotive goods and services for sale across the carsales network; and display advertising, which displays the product or service offerings of the corporate advertiser. The Data and Research Services segment offers software, analysis, research and reporting, valuation services, website development and hosting as well as photography services. The International and Finance segment operates in overseas countries through subsidiaries and equity accounted associate investments. The company was founded by Gregory Paul Roebuck on June 18, 1996 and is headquartered in Richmond, Australia.', '2019-09-27 07:23:58', '2019-09-27 07:23:58', 1, 1),
