(321, 1, 'CCID Consulting Co. Ltd. (8235)', 4, 26, 102, '-', 'http://www.ccidconsulting.com', 'CCID Consulting Co. Ltd. engages in the provision of market research and management consultancy services. It operates through the following segments: Management and Strategy Consultancy Services, Market Consultancy Services, and Information Engineering Supervision Services. The Management and Strategy Consultancy Services segment involves in the corporate development strategy and planning, human resources strategy and management, management and control and operation, merger and reorganization, municipal investment and finance, private finance, investment decision, information design system, information technology (IT) management system, and corporate information management solution. The Market Consultancy Services segment includes the market customized investigation and research, analysis and forecast, marketing strategy and research, development strategy and planning, value assessment of the business and product portfolio, and industry development strategy. The Information Engineering Supervision Services segment supervises the government and enterprises for the provision of software, network, communications and information security, and IT inspection projects. The company was founded on March 14, 2001 and is headquartered in Beijing, China.', '2019-09-27 07:23:59', '2019-09-27 07:23:59', 1, 1);
