(325, 1, 'CDS Co. Ltd. (2169)', 4, 26, 114, '-', 'http://www.cds-japan.jp', 'CDS Co., Ltd. engages in the planning, editing, translation and publication of technical publications. This also includes document system and information processing business database construction. It also offers analysis and computer software development services. It operates through the following segments: Documentation, Engineering, and Technical Systems Development. The Documentation segment creates technical documents such as operation manuals, parts guides, maintenance reference, web contents, computer graphic animation, electronic learning, technical presentation materials, and multilingual translations. The Engineering segment offers product and equipment design support, robot and system manufacturing, factory automation engineering, and mechatronics materials. The Technology Systems Development segment develops and operates technological systems in the automotive sector. The company was founded in February 1980 and is headquartered in Okazaki, Japan.', '2019-09-27 07:24:00', '2019-09-27 07:24:00', 1, 1),
