(327, 1, 'CEC Environmental Protection Co. Ltd. (300172)', 4, 26, 47, '-', 'http://www.njcec.com/Index.aspx', 'CEC Environmental Protection Co., Ltd. engages in the business of industrial water treatment, municipal sewage treatment, solid and hazardous waste disposal, flue gas treatment and industrial technology innovation platform. It provides specialized comprehensive solutions for industrial and urban environmental protection, R&D, system integration, general contracting, operation and maintenance, investment and financing. The company was founded by Zheng Fu Wang, Gu Ping Zhou, Hui Sheng Lin and Guo Ping Huan on January 18, 2001 and is headquartered in Nanjing, China.', '2019-09-27 07:24:01', '2019-09-27 07:24:01', 1, 1),
