(329, 1, 'Centre Testing International Group Co. Ltd. A (300012)', 4, 26, 47, '-', 'http://www.cti-cert.com', 'Centre Testing International Group Co., Ltd. engages in consumer product testing, inspection, certification, and consultation. It also offers hazardous substance testing, safety inspection, electro magnetic compatibility (EMC) testing, environment security testing, reliability and failure analysis of electrical and electronic products, material reliability and failure analysis, metal and non-metallic materials analysis, testing for textiles, shoes and leather, toy testing, construction material and light industrial product testing, and vehicle and spare parts testing. The company was founded on December 23, 2003 and is headquartered in Shenzhen, China.', '2019-09-27 07:24:01', '2019-09-27 07:24:01', 1, 1),
