(332, 1, 'Cerespo Co. Ltd. (9625)', 4, 26, 114, '-', 'http://www.cerespo.co.jp', 'CERESPO CO., LTD. engages in the planning, setup, and management of events. It operates through the following divisions: Ceremony, Sports, Promotion, Festival, Convention, and Others. The Ceremony division provides venues for constructions and civil works related ceremonies such as Jichinsai or Shinto ceremony, completion, and opening ceremonies. The Sports division arranges venues for sports events such as national sports festival, high school athletic meets, and golf tournaments. The Promotion division organizes venues for corporate sales promotion events such as exhibits and trade fairs. The Festival division organizes venues for regional development events such as public festivals, industrial festivals, and emergency drills. The Convention division sets up venues for corporate gatherings such as commemorative ceremonies, conferences, and parties. The Others division covers disaster prevention drills, election related matters, and setting up the venue for designated manager projects. The company was founded on July 21, 1977 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:01', '2019-09-27 07:24:01', 1, 1),
