(337, 1, 'Ceylon Printers PLC (CPRTN)', 4, 26, 219, '-', '-', 'Ceylon Printers Plc engages in the commercial printing and trading in computers and computer accessories. It also involves in the preventive maintenance services of computers and software solutions and providing interest bearing loans. The company was founded on June 29, 1958 and is headquartered in Colombo, Sri Lanka.', '2019-09-27 07:24:02', '2019-09-27 07:24:02', 1, 1),
