(339, 1, 'Cheil Worldwide Inc. (030000)', 4, 26, 217, '-', 'http://www.cheil.co.kr/us', 'Cheil Worldwide Inc. is engaged in the advertising services. Its business include promotions, advertising production, media and integrated advertising services. The company was founded on January 17, 1973 and is headquartered in Seoul, South Korea.', '2019-09-27 07:24:03', '2019-09-27 07:24:03', 1, 1),
