(342, 1, 'Chiho-Tiande Group Ltd. (0976)', 4, 26, 102, '-', 'http://www.chihogroup.com', 'Chiho Environmental Group Ltd. is an investment holding company, which engages in the business of metal recycling. It also involves in recycling of mixed metal scrap into copper scrap, steel scrap, aluminum scrap, iron scrap, and other metal scrap. It operates through the Greater China, and Non-Greater China geographical segments. The Greater China includes the legacy and scholz group. The Non-Greater China segment focuses on Europe, and America. The company was founded on May 15, 2008 and is headquartered in Hong Kong.', '2019-09-27 07:24:03', '2019-09-27 07:24:03', 1, 1),
(343, 1, 'Chiho-Tiande Group Ltd. (T4N)', 4, 26, 86, '-', '-', '-', '2019-09-27 07:24:04', '2019-09-27 07:24:04', 1, 1),
(344, 1, 'China 33 Media Group Ltd. (8087)', 4, 26, 102, '-', 'http://www.china33media.com/html/index.php', 'China 33 Media Group Ltd. operates as an investment holding company. It engages in the operation and provision of advertising services of printed media and audio programs for railway networks and advertising spaces on air traffic control towers at airports. It operates through the following business segments: Printed Media Advertising, Outdoor Advertising, and Film Investment. The Printed Media Advertising segment engages in the sale of advertising spaces in magazines and newspapers. The Outdoor Advertising segment sells advertising spaces at designated towers. The Film Investment segment handles the profit sharing on box office movies and the income distribution of television drama in China. The company was founded by Lin Pin Tong, Pei Liang Yang, and Ruan De Qing in September 2002 and is headquartered in Beijing, China.', '2019-09-27 07:24:04', '2019-09-27 07:24:04', 1, 1),
(345, 1, 'China Automation Group Ltd. (3CAA)', 4, 26, 86, '-', '-', '-', '2019-09-27 07:24:04', '2019-09-27 07:24:04', 1, 1),
(346, 1, 'China Automation Group Ltd. (0569)', 4, 26, 102, '-', 'http://www.cag.com.hk/html/index.php', 'China Automation Group Ltd. is an investment holding company, which engages in the provision of safety and critical control system and control valves specialized for petrochemical industries, along with related maintenance and engineering services. It operates through the Petrochemical and Hospital Services segments. The Petrochemical segment include sales of safety and critical control systems, trading of equipment, provision of maintenance and engineering services, design and consulting services, and sales of software products for the petrochemical, chemical, oil and gas, biodiesel and coal chemical industries, manufacture of industrial control valves. The Hospital Services segment comprises healthcare services and sales of pharmaceuticals. The company was founded by Rui Guo Xuan in 1999 and is headquartered in Beijing, China.', '2019-09-27 07:24:04', '2019-09-27 07:24:04', 1, 1),
(347, 1, 'China Automotive Engineering Research Institute Co. Ltd. (601965)', 4, 26, 47, '-', 'http://www.caeri.com.cn', 'China Automotive Engineering Research Institute Co., Ltd. engages in the manufacture, and sale of special vehicles and vehicle parts. Its business scopes consist of research and development, technical consulting, and testing and evaluation services. Its products include engineering dump trucks, concrete mixers, sanitation vehicles, logistics transport vehicles, automotive test equipment, and electric and gas vehicle parts. The company was founded on March 15, 1965 and is headquartered in Chongqing, China.', '2019-09-27 07:24:05', '2019-09-27 07:24:05', 1, 1),
(348, 1, 'China Binary Sale Technology Ltd. (8255)', 4, 26, 102, '-', 'http://www.shenzhoufu.hk', 'China Binary New Fintech Group is an investment holding company, which engages in the provision of online transaction services. It offers an online transaction platform which enables online game players to pay their online game accounts through mobile top-up credits by Shenzhoufu System. It also distributes online game products, operates the Game Review Website, and provides information technology services. In addition, it provides online advertising services through its subsidiaries. The Company mainly operates businesses in China. It was founded on May 11, 2011 and is headquartered in Hong Kong.', '2019-09-27 07:24:05', '2019-09-27 07:24:05', 1, 1),
(349, 1, 'China Customer Relations Centers Inc. (CCRC)', 4, 26, 250, '-', '-', '-', '2019-09-27 07:24:05', '2019-09-27 07:24:05', 1, 1),
(350, 1, 'China Dredging Environment Protection Holdings Ltd. (0871)', 4, 26, 102, '-', 'http://www.cdep.com.hk', 'China Dredging Environment Protection Holdings Ltd. is an investment company, which engages in the provision of dredging services. It operates its business through the following business segments: Capital and Reclamation Dredging Business; Environmental Protection Dredging and Water Management Business; Other Marine Business; and Property Management Business. The Capital and Reclamation Dredging Business segment encompasses the capital and reclamation dredging services and related consultation services. The Environmental Protection Dredging and Water Management Business segment offers dredging or water management services or constructions for promoting environmental interests and water quality mainly for inland rivers. The Other Marine Business segment comprises of marine hoisting, installation, salvaging, and other engineering services. The Property Management Business segment refers to the management and leasing of a shopping mall and the construction of a hotel. The company was founded by Kai Jin Liu on May 31, 2010 and is headquartered in Yancheng, China.', '2019-09-27 07:24:05', '2019-09-27 07:24:05', 1, 1),
(351, 1, 'China E-Learning Group Ltd. (8055)', 4, 26, 102, '-', '-', 'China E-Information Technology Group Ltd. is an investment holding company, which engages in the provides educational services. It provides an internet platform for the facilitation of education programs in Chinese medicine and other advisory and training programs. The company was founded on July 10, 2001 and is headquartered in Hong Kong.', '2019-09-27 07:24:05', '2019-09-27 07:24:05', 1, 1),
(352, 1, 'China Environmental Energy Investment Ltd. (0986)', 4, 26, 102, '-', 'http://www.986.com.hk', 'China Environmental Energy Investment Ltd. engages in a range of services in various sectors. It operates through the following segments: Internet Services, Trading of Gold and Diamond, Money Lending, and Financial Services. The Internet Services segment involves in the online products sales, provision of marketing, web design, and maintenance services. The Trading of Gold and Diamond segment focuses on the purchase and sale of gold and diamond. The Money Lending segment provides loans as money lending. The Financial Services segment comprises financial advisory and intermediary services. The company was founded in 1977 and is headquartered in Hong Kong.', '2019-09-27 07:24:05', '2019-09-27 07:24:05', 1, 1),
(353, 1, 'China Everbright International Ltd. (CHFFF)', 4, 26, 250, '-', '-', '-', '2019-09-27 07:24:06', '2019-09-27 07:24:06', 1, 1),
(354, 1, 'China Everbright International Ltd. (0257)', 4, 26, 102, '-', 'https://www.ebchinaintl.com/tc/global/home.php', 'China Everbright International Ltd. is an investment holding company, which engages in the provision of environmental solution. It operates through the following segments: Environmental Energy Project Construction and Operation; Environmental Water Project Construction and Operation; Greentech Project Construction and Operation; and Envirotech. The Environmental Energy Project Construction and Operation segment involves in the construction and operation waste-to-energy plants, methane-to-energy plants, sludge treatment and disposal project, and food waste treatment projects. The Environmental Water Project Construction and Operation segment focuses on construction, upgrade and operation of waste-water treatment plants, reusable water treatment plants, surface water treatment plants, and waste-water source heat pump projects. The Greentech Project Construction and Operation segment manage the construction and operation of biomass integrated utilization projects, industrial solid waste and hazardous waste treatment projects, solar energy projects, and wind power projects. The Envirotech segment is conducting environmental protection technology research and development projects, the provision of environmental related technological services, design of environmental protection projects and the manufacturing and sales of environmental protection project equipment. The company was founded on July 10, 1961 and is headquartered in Hong Kong.', '2019-09-27 07:24:06', '2019-09-27 07:24:06', 1, 1),
(355, 1, 'China Everbright Water Investments Ltd. (BOTRF)', 4, 26, 250, '-', 'http://www.ebwater.com/s/index.php', 'China Everbright Water Ltd. engages in water environment management, which includes sponge city construction, river-basin ecological, restoration, waste water treatment, water supply, reusable water, waste water source heat pump, sludge treatment and disposal, research and development of water environment technologies and engineering construction. The company was founded on December 12, 2014 and is headquartered in Shenzhen, China.', '2019-09-27 07:24:06', '2019-09-27 07:24:06', 1, 1),
(356, 1, 'China Everbright Water Ltd. (U9E)', 4, 26, 210, '-', 'http://www.ebwater.com/s/index.php', 'China Everbright Water Ltd. engages in water environment management, which includes sponge city construction, river-basin ecological, restoration, waste water treatment, water supply, reusable water, waste water source heat pump, sludge treatment and disposal, research and development of water environment technologies and engineering construction. The company was founded on December 12, 2014 and is headquartered in Shenzhen, China.', '2019-09-27 07:24:06', '2019-09-27 07:24:06', 1, 1),
(357, 1, 'China Grand Resorts Inc. (CGND)', 4, 26, 250, '-', '-', '-', '2019-09-27 07:24:06', '2019-09-27 07:24:06', 1, 1),
(358, 1, 'China Haisum Engineering Co. Ltd. (002116)', 4, 26, 47, '-', 'http://www.haisum.com', 'China Haisum Engineering Co., Ltd. engages in the provision of designing, consulting, supervision, engineering and technical services, and general contracting services for light industry. It specializes in engineering design, consulting, installation and construction, and procurement of construction project complete business chain. Its business areas include textile, construction, urban planning, commercial grain, telecommunications, chemical and petrochemical medicine, machinery, agriculture and forestry, municipal utilities, electric power, and environmental engineering. The company was founded in 1953 and is headquartered in Shanghai, China.', '2019-09-27 07:24:06', '2019-09-27 07:24:06', 1, 1),
(359, 1, 'China Internet Investment Finance Holdings Ltd. (0810)', 4, 26, 102, '-', '-', 'China Internet Investment Finance Holdings Ltd. is an investment company. It invests in equity securities and debt securities of listed and unlisted securities. The company is headquartered in Hong Kong.', '2019-09-27 07:24:06', '2019-09-27 07:24:06', 1, 1),
(360, 1, 'China Machinery Engineering Corp. (1829)', 4, 26, 102, '-', 'http://www.cmec.com', 'China Machinery Engineering Corp. engages in the provision of engineering contract and services. It operates through the following segments: Construction Contracts, Trading Business, and Services Business. The Construction Contracts segment undertakes engineering, procurement and construction contracting business of overseas infrastructure-related construction projects, including hydropower, thermal power or other engineering projects in various countries. The Trading Business segment imports and/or exports various machinery, electrical and instrumental products for domestic and overseas customers. The Services Business segment provides export-import agency services, exhibition services, design services, tendering agency services, and logistics services. The company was founded in May 1978 and is headquartered in Beijing, China.', '2019-09-27 07:24:06', '2019-09-27 07:24:06', 1, 1),
(361, 1, 'China National Culture Group Ltd. (0745)', 4, 26, 102, '-', '-', 'China National Culture Group Ltd. is an investment holding company, which engages in the provision of advertising media services, e-commerce, film production and distribution business. It operates through the following segments: Advertising, Movie, and E-Commerce. The Advertising segment offers advertising and value added services through mobile devices. The Movie segment refers to the trading and production of films and provision of other film related services. The E-commerce segment sells products over the internet. The company was founded on August 27, 2002 and is headquartered in Hong Kong.', '2019-09-27 07:24:07', '2019-09-27 07:24:07', 1, 1),
(362, 1, 'China Parenting Network Holdings Ltd. (8361)', 4, 26, 102, '-', 'http://www.ci123.com', 'China Parenting Network Holdings Ltd. engages in the e-commerce business, and the provision of marketing and promotional services for the mother-child industry. Its platform includes CI Web, mobile CI Web, Mobile Application Software (APPs), and IPTV APPs. The company was founded by Juan Li on October 13, 2014 and is headquartered in Nanjing, China.', '2019-09-27 07:24:07', '2019-09-27 07:24:07', 1, 1),
(363, 1, 'China Resource & Environmental Co. Ltd. A (600217)', 4, 26, 47, '-', 'http://www.qinling.com', 'Zhongzai Resource & Environment Co., Ltd. engages in the recycling and dismantling treatment of waste electrical and electronic products. Its outputs consist of 6 major categories: (1) Metals, include copper and its alloys, aluminum and its alloys, iron and its alloys, and precious metals; (2) Plastics, include polystyrene, polypropylene, acrylonitrile butadiene styrene (ABS) plastics, phenoplasts, and polyurethanes; (3) Liquid wastes, such as refrigerants, lubricants, and waste acid; (4) Glass, such as screen glass and cone glass; (5) Discarded parts, include cathode ray tubes, coils, compressors, motors, capacitors, and circuit boards; (6) Other, such as fiberglass, wire and cable, refrigerator insulation, and rubber. The company was founded on November 6, 1996 and is headquartered in Beijing, China.', '2019-09-27 07:24:07', '2019-09-27 07:24:07', 1, 1),
