(373, 1, 'Chuo Warehouse Co. Ltd. (9319)', 4, 26, 114, '-', 'http://www.chuosoko.co.jp', 'Chuo Warehouse Co., Ltd. engages in the business of warehousing, trucking, and international freight. Its operations are carried out through the following segments: Warehousing, Freight Forwarding, and International Cargo Handling. The Warehousing segment handles storage guarantee, security, and warehouse leasing services. The Freight Forwarding segment provides cargo transport, lorry transport, and insurance services. The International Cargo Handling segment provides packaging and customs brokerage services. The company was founded on October 18, 1927 and is headquartered in Kyoto, Japan.', '2019-09-27 07:24:08', '2019-09-27 07:24:08', 1, 1),
