(382, 1, 'Cleanaway Co. Ltd. (8422)', 4, 26, 228, '-', 'http://www.cleanaway.tw', 'Cleanaway Co., Ltd. engages in the treatment and disposal of hazardous and non-hazardous industrial waste. Its business activities include the cleaning up of contaminated sites, and landfill operations. The company was founded in May 1999 and is headquartered in Kangshan, Taiwan.', '2019-09-27 07:24:08', '2019-09-27 07:24:08', 1, 1),
(383, 1, 'Cleanaway Waste Management Ltd. (CWY)', 4, 26, 13, '-', 'https://www.cleanaway.com.au', 'Cleanaway Waste Management Ltd. engages in the provision of total waste management, industrial, and environment services. It operates through the following segments: Solid Waste Services, Liquid Waste and Industrial Services, and Toxfree. The Solid Waste Services segment includes commercial and industrial, municipal, and residential collection services for all types of solid waste streams; and ownership and management of waste transfer stations and landfills. The Liquid Waste and Industrial Services segment comprises collection, treatment, processing, refining, and recycling of liquid and hazardous waste; and services include plant and asset maintenance capabilities, high pressure cleaning, vacuum loading, hydro excavation and non-destructive digging, site remediation, sludge management, concrete remediation, CCTV, corrosion protection, and emergency response service. The Toxfree segment offers services relating to waste, technical and environmental, industrial, and health. The company was founded by Terrence Elmore Peabody in August 1987 and is headquartered in Melbourne, Australia.', '2019-09-27 07:24:08', '2019-09-27 07:24:08', 1, 1),
