(389, 1, 'CMC Corp. (2185)', 4, 26, 114, '-', 'http://www.cmc.co.jp', 'CMC Corp. engages in marketing and systems development. It operates through the Marketing and Systems Development segments. The Marketing segment includes internal marketing, external marketing, customer support marketing, and total printing operations. The Systems Development segment provides information and communications technology solutions, systems integration, cloud services, software packages, and personnel dispatching services. The company was founded by Kanji Hayashi on May 25, 1962 and is headquartered in Nagoya, Japan.', '2019-09-27 07:24:09', '2019-09-27 07:24:09', 1, 1),
