(392, 1, 'CML Group Ltd. (CGR)', 4, 26, 13, '-', 'http://www.cml-group.com.au', 'CML Group Ltd. engages in the provision of financial management and payroll services. It operates through the following segments: Finance, Equipment Finance, and Other Services. The Finance segment refers to invoice finance or receivables finance which provides an advance payment of up to eighty percent of a client''s invoice. The Equipment Finance segment provides loans secured against equipment. The Other Services segment deals with employment solutions including labour sourcing and project management. The company was founded by Gregory Riley in 2002 and is headquartered in North Sydney, Australia', '2019-09-27 07:24:09', '2019-09-27 07:24:09', 1, 1),
