(432, 1, 'Creek & River Co. Ltd. (4763)', 4, 26, 114, '-', 'http://www.cri.co.jp', 'CREEK & RIVER Co., Ltd. provides consulting, outsourcing, production, and professional agent services for video game and multimedia creators. It operates through the following segments: Creative Field-Japan, Creative Field-South Korea, Medical Field, and Others. The Creative Field-Japan segment offers agency services for movies, games, websites, mobile communications, advertisement, and publishing in Japan. The Creative Field-South Korea segment offers the creative services in South Korea. The Medical Field segment provides doctor agency services with the concept of private medical office. The Others segment includes information technology, legal, and accounting field businesses. It also engages in the education; and rights management and distribution services for copyright and content. The company was founded by Yukihiro Ikawa on March 20, 1990 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:12', '2019-09-27 07:24:12', 1, 1),
(433, 1, 'Crestec Inc. (7812)', 4, 26, 114, '-', 'http://www.crestec.co.jp', 'CRESTEC Inc. engages in the documentation business that includes manual creation, planning, writing, translation, and printing. It provides the following services: Manual-Creation Support, Law Document Support, Document Comparison, and Proofreading Support. The Manual-Creation Support provides cloud service that supports a seamless production process flow, such as writing, translating, and DTP (desktop publishing). The Law Document Support provides products that allow the user to convert large volumes of printed documents into electronic data. The Document Comparison and Proofreading Support provides functions for comparing and proofreading various documents, such as contracts, official documents, manuals, and Web content. Its operations are carried out through the following regional segments: Japan, China, Southeast Asia, and Europe and the Americas. The company was founded by Masashi Ueno on September 17, 1984 and is headquartered in Hamamatsu, Japan.', '2019-09-27 07:24:12', '2019-09-27 07:24:12', 1, 1),
(434, 1, 'Creston PLC (CRE)', 4, 26, 249, '-', '-', '-', '2019-09-27 07:24:12', '2019-09-27 07:24:12', 1, 1),
(435, 1, 'Crie Anabuki Inc. (4336)', 4, 26, 114, '-', 'http://www.crie.co.jp', 'Crie Anabuki Inc. engages in the operation of human resources service related business. It operates through the following segments: Temporary Staffing, Outsourcing, Employment Placement, Recruitment Support, and Others. The Temporary Staffing segment provides worker dispatching services. The Outsourcing segment accepts subcontract work for a variety of non-core jobs. The Employment Placement segment receives referral fees from successful matching of the employment needs of job seekers and employers. The Recruitment Support segment conducts recruitment activities at companies and provides administrative services related to recruitment. The Others segment includes re-employment support, training and measurement services, and consultation of personnel organization. The company was founded on April 11, 1986 and is headquartered in Takamatsu, Japan.', '2019-09-27 07:24:13', '2019-09-27 07:24:13', 1, 1),
