(438, 1, 'Crops Corp. (9428)', 4, 26, 114, '-', 'https://www.crops.ne.jp', 'Crops Corp. engages in the business of mobile telecommunications services. It operates through the following segments: Mobile Telecommunications, Staffing Agency, Building Maintenance, Food store leasing business and Stationery Wholesale. The Mobile Telecommunications segment handles selling of mobile phones and providing mobile phone related services through its direct management stores. The Staffing Agency segment offers temporary employee placement and business contracting. The Building Maintenance segment provides cleaning, maintenance, and security services of equipment and facilities. The Food store leasing business segment provide shop management such as sublease of restaurant. The Stationery Wholesale segment offers planning and wholesale of import stationeries. The company was founded on November 2, 1977 and is headquartered in Nagoya, Japan.', '2019-09-27 07:24:13', '2019-09-27 07:24:13', 1, 1),
