(441, 1, 'Cross-Harbour (Holdings) Ltd. (0032)', 4, 26, 102, '-', 'http://www.crossharbour.com.hk', 'The Cross-Harbour (Holdings) Ltd. is an investment company, which engages in the transport infrastructures. The company operates through the following business segments: Motoring School Operations, Tunnel Operations, Electronic Toll Operations and Treasury. The Motoring School Operations segment invests in subsidiaries which operate three driver training centers. The Tunnel Operations segment invests in associates, which operate the Western Harbour and Tate''s Cairn tunnel franchises. The Electronic Toll Operations segment focuses on a joint venture, which operates an electronic toll collection system and provision of telematics services. The Treasury segment deals with investing and financing activities and receives dividend income and interest income. The company was founded on April 26, 1965 and is headquartered in Hong Kong.', '2019-09-27 07:24:13', '2019-09-27 07:24:13', 1, 1),
(442, 1, 'Crowdworks Inc. (3900)', 4, 26, 114, '-', 'https://crowdworks.co.jp', 'CrowdWorks, Inc. engages in the provision of crowd sourcing solutions. It offers platform services for work matching, and enterprise service for contracting companies. It operates through the following segments: Direct Matching, Agent Matching, Business Solutions, FinTech, Investment Training and Others. The Direct Matching segment covers the platform and Wow! Me online matching. The Agent Matching segment handles the Forge, Crowdtech, Biz Assistant Online, Brain Partner, 3 Star, Saita, SES and other media business. The Business Solutions segment delivers deliverables and services that includes system contract development. The FinTech segment develops and offers financial services targeting individuals such as its product FEEL. The Investment Training segment engages in minor investments and provides investment training for venture companies. The Others segment includes new business development. The company was founded by Koichiro Yoshida on November 11, 2011 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:13', '2019-09-27 07:24:13', 1, 1),
