(445, 1, 'CSS Holdings Ltd. (2304)', 4, 26, 114, '-', 'https://www.css-holdings.jp', 'CSS Holdings, Ltd. engages in the operation and management of its group companies. It operates through the following segments: Steward Business, Food Business, Space Produce Business, and Others. The Steward Business segment develops nationwide dishwashing and management work centered on hotels and restaurants. The Food Business segment handles employee cafeteria and restaurant management contracts through its subsidiaries. The Space Produce Business segment designs, constructs, manages, and sells items related to video, audio, broadcasting, and security. The Others segment includes general affairs, personnel, and management related business. The company was founded on December 19, 1984 and is headquartered in Tokyo, Japan', '2019-09-27 07:24:13', '2019-09-27 07:24:13', 1, 1),
