(447, 1, 'CT Environmental Group Ltd. (1363)', 4, 26, 102, '-', 'http://www.chongto.com', 'CT Environmental Group Ltd. is an investment holding company, which engages in the provision of environmental protection business. It operates through the following segments: Supply of Industrial Water; Provision of Wastewater Treatment Plants Operation Services; BOT Project Construction and Operation Services; Provision of Heating Services and Electricity Generation; Provision of Sludge and Solid Waste Treatment Services; and Provision of Hazardous Waste Treatment Services. The Supply of Industrial Water segment supplies industrial water. The Provision of Wastewater Treatment Plants Operation Services segment focuses on wastewater treatment plants under build-own-operate agreement. The BOT Project Construction and Operation Services segment constructs and operates wastewater, and solid waste treatment plants. The Provision of Heating Services and Electricity Generation segment offers heating services and electricity generation. The Provision of Sludge and Solid Waste Treatment Services segment comprises of sludge, and solid waste treatment services. The Provision of Hazardous Waste Treatment Services segment consists of hazardous waste treatment services. The company was founded by Tsui Cham To on November 30, 2010 and is headquartered in Guangzhou, China.', '2019-09-27 07:24:14', '2019-09-27 07:24:14', 1, 1),
