(455, 1, 'Cypark Resources Bhd (CYPARK)', 4, 26, 136, '-', 'http://www.crbenv.com', 'Cypark Resources Bhd. is an investment holding company, which engages in the closure and restoration of landfills in West Malaysia. It operates through the following segments: Environment Engineering; Landscaping and Infrastructure; Maintenance; Greentech and Renewable Energy. The Environment Engineering segment involves in nature conservation and environmental amelioration for customers; and offer environmental engineering and contract, management, and planning and design services. The Landscaping and Infrastructure offers project management services and infrastructure developments. The Maintenance segment relates to preservation of leachate treatment plants and landscape services for public parks, public amenities, and other developments. The Renewable Energy segment includes the operations of energy business. The company was founded on February 19, 2004 and is headquartered in Petaling Jaya, Malaysia.', '2019-09-27 07:24:14', '2019-09-27 07:24:14', 1, 1),
(456, 1, 'D.A. Consortium Holdings Inc. (6534)', 4, 26, 114, '-', '-', '-', '2019-09-27 07:24:14', '2019-09-27 07:24:14', 1, 1),
(457, 1, 'Dahe Media Co. Ltd. (8243)', 4, 26, 102, '-', 'http://www.dahe-ad.com', 'Dahe Media Co. Ltd. engages in the design, printing, and production of outdoor advertising products. It operates through the following segments: Media Dissemination, Media Production, Terminal Dissemination, and Trading of Artwork. The Media Dissemination segment includes the dissemination and distribution of outdoor advertisements. The Media Production segment provides design and printing of outdoor advertising products. The Terminal Dissemination segment provides terminal services. The Trading of Artwork segment trades artwork. The company was founded by Chao Bing He in 1994 and is headquartered in Nanjing, China.', '2019-09-27 07:24:14', '2019-09-27 07:24:14', 1, 1),
(458, 1, 'Daido Group Ltd. (0544)', 4, 26, 102, '-', 'http://www.daidohk.com/index.asp', 'Daido Group Ltd. is an investment holding company, which engages in the provision of cold storage, logistics services, and related services. It operates through the following segments: Cold Storage and Related Services; Trading and Related Services; and Money Lending Services. The Cold Storage and Related Services segment relates to cold storage, logistics, and industrial ice bars. The Trading and Related Services segment include the supply of a variety of dairy products, fruit juice beverage products and Korean snacks to a network of supermarkets and convenience stores in Mainland China. The company was founded on March 30, 2000 and is headquartered in Hong Kong.', '2019-09-27 07:24:14', '2019-09-27 07:24:14', 1, 1),
(459, 1, 'Daiseki Co. Ltd. (9793)', 4, 26, 114, '-', 'http://www.daiseki.co.jp', 'Daiseki Co., Ltd. engages in the environment-related business. It operates in the following business divisions: Treatment and Recycling of Waste Oil, Treatment and Recycling of Waste Water, Treatment and Recycling of Sludge, and Other Related Businesses. The Treatment and Recycling of Waste Oil business division recycles waste oil to lubricating oil, heavy oil, or supplemental fuel. The Treatment and Recycling of Waste Water business division collects and treats liquid waste such as waste acid, waste alkali, and waste water containing oil through chemical pre-treatment and activated sludge treatment. It also collects and converts copper and nickel for resuse. The Treatment and Recycling of Sludge business division recycles sludge into raw materials for cement or supplemental fuel. The Other Related Businesses business division offers emergency containment due to disasters or accidents; cleaning of machinery and equipment; exchanging transformer and hydraulic oil; and reclamation of polluted soil. The company was founded by Haruo Ito on November 1, 1945 and is headquartered in Nagoya, Japan.', '2019-09-27 07:24:14', '2019-09-27 07:24:14', 1, 1),
(460, 1, 'Daiseki Eco. Solution Co. Ltd. (1712)', 4, 26, 114, '-', 'http://www.daiseki-eco.co.jp', 'Daiseki Eco. Solution Co., Ltd. engages in the provision of contaminated soil treatment services. It operates through the following segments: Soil Pollution Investigation and Treatment, Gypsum Board Recycle, and Others. The Soil Pollution Investigation and Treatment segment offers contaminated soil consultation, soil remediation and soil washing. The Gypsum Board Recycle segment deals with recycling of gypsum board from building demolition. The Others segment includes waste disposal, bio diesel fuel and printed circuit board business, and real estate leasing. The company was founded on November 1, 1996 and is headquartered in Nagoya, Japan.', '2019-09-27 07:24:14', '2019-09-27 07:24:14', 1, 1),
