(465, 1, 'Daohe Global Group Ltd. Parallel (2907)', 4, 26, 102, '-', 'http://www.cpphk1094.com', 'China Public Procurement Ltd. is an investment holding company, which engages in the development and operation of electronic public procurement platforms and energy management contracting, through its subsidiaries. It operates through the following segments: Public Procurement, Trading Business, Provision of Corporate Information Technology Solution, and Rental Income. The Public Procurement segment involves in the provision of public procurement services. The Trading Business segment offers trading of different products. The Provision of Corporate Information Technology Solution segment deals with the development of software and provision of maintenance services to the customers. The Rental Income segment includes leasing of the Group''s investment properties located in Wuhan, Hubei Province, and China. The company was founded in 2009 and is headquartered in Hong Kong.', '2019-09-27 07:24:15', '2019-09-27 07:24:15', 1, 1),
