(497, 1, 'Dohwa Engineering Co. Ltd. (002150)', 4, 26, 217, '-', 'http://www.dohwa.co.kr/main/index.do', 'Dohwa Engineering Co., Ltd. engages in the provision of engineering consultancy services. It offers design, construction management, construction supervision, project management, feasibility studies and technical assistance services. It provides consulting services for water resources, urban community planning and development, energy, infrastructure and transportation, environment, construction supervision and management. The company was founded on May 5, 1962 and is headquartered in Seoul, South Korea.', '2019-09-27 07:24:18', '2019-09-27 07:24:18', 1, 1),
