(502, 1, 'Double Standard Inc. (3925)', 4, 26, 114, '-', 'https://double-std.com', 'Double Standard, Inc. engages in web marketing business. It operates through following business segments: Big Data related and Service Planning Development businesses. The Big Data Related business provides the data related to the operation support and business reduction, as well as the high utilization value content, among others. The Services Planning Development business provides services based on the research of the way of customer and enterprise business process, using the information collection, processing and matching, as well as the data cleansing technology. The company was founded by Masami Nakajima on June 6, 2012 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:18', '2019-09-27 07:24:18', 1, 1),
