(504, 1, 'DRA Consultants Ltd. (540144)', 4, 26, 105, '-', 'https://www.dra.net.in', 'DRA Consultants Limited (DRA) provides wide range of advisory services in Urban and Industrial sector with specialized expertise in 3-R (Reduce-Recycle-Reuse), 3-P (Public–Partnership) & Performance audits apart from other fortes. By devising innovative solutions for improvement in the present utilities, DRA has brought about significant changes. DRA’s projects in water supply, conservation, cost reduction and energy conservation hold testimony to the impact that solutions can have on the herculean challenge the cities of developing countries/Industry faces in the present scenario.Established in the year 1990, DRA Consultants Ltd. is an ISO 9001 – 2008 certified company and distinctly identified as leader of this domain in India. We have emerged as a company, with work ethics that stand as a benchmark for our peers. We have kept our core values intact and are widely recognized for this. DRA Consultants Ltd. is known for its superior technical expertise, reliability and more importantly for providing innovative solutions to the most complex challenges. From the time of its inception for more than two decades, DRA Consultants Ltd. has proved its efficiency in completion of work within scheduled time frame and value for money to its clients.', '2019-09-27 07:24:18', '2019-09-27 07:24:18', 1, 1),
