(510, 1, 'Dynagreen Environmental Protection Group Co. Ltd. (1330)', 4, 26, 102, '-', 'http://www.dynagreen.com.cn', 'Dynagreen Environmental Protection Group Co. Ltd. engages in the provision of environmental protection services. It specializes in the waste-to-energy projects focusing on municipal solid waste treatment. Its activities include project operation, construction, and technical consulting services. The company was founded on March 29, 2000 and is headquartered in Shenzhen, China.', '2019-09-27 07:24:18', '2019-09-27 07:24:18', 1, 1),
