(527, 1, 'Eco-Tek Holdings Ltd. (8169)', 4, 26, 102, '-', 'http://www.eco-tek.com.hk', 'Eco-Tek Holdings Ltd. is an investment company. The company engages in the market; sale servicing; research and development of environmental protection related products and services; holding of intellectual properties; and operations of a water supply plant. It operates through the following segments: General Environmental Protection Related Products and Services; Industrial Environmental Products; and Water Supply Plant. The General Environmental Protection Related Products and Services segment retails particulate removal devices and related ancillary services. The Industrial Environmental Products segment deals with hydraulic components and related accessories. The Water Supply Plant segment involves in the supply of processed water. The company was founded on October 27, 1999 and is headquartered in Hong Kong.', '2019-09-27 07:24:20', '2019-09-27 07:24:20', 1, 1),
(528, 1, 'Ecowise Holdings Ltd. (5CT)', 4, 26, 210, '-', 'https://www.ecowise.com.sg/en/', 'ecoWise Holdings Ltd. is an investment holding company, which engages in the provision of waste management and treatment strategies. It operates through the following segments: Renewable Energy, Resource Recovery, and Integrated Environmental Management Solutions. The Renewable Energy segment involves in the design, building and operation of biomass co-generation systems, generate power for sale, and provision of services related to the applications of heat. The Resource Recovery segment includes process, recycle, and repurpose waste and salvageable materials into environmentally friendly products for industrial applications, such as washed copper slag, compost, and retreaded tires. The Integrated Environmental Management Solutions segment offers resource management and integrated environmental engineering solutions for industrial waste and energy management, including designing, optimizing, engineering, procurement, fabricating, commissioning, managing, and maintenance of waste and energy management facilities. The company was founded by Keng Hua Ong in 1979 and is headquartered in Singapore.', '2019-09-27 07:24:20', '2019-09-27 07:24:20', 1, 1),
