(536, 1, 'Educomp Solutions Ltd. (532696)', 4, 26, 105, '-', '#NUM!', 'Educomp Solutions Ltd. engages in providing software development and online education services. It operates through the following segments: Higher Learning Solutions, School Learning Solutions, K-12 Schools and Online Supplemental & Global business. The Higher Learning Solutions segment comprises higher education, vocational business and professional development. The School Learning Solutions segment comprises SmartClass and Edureach. The K-12 Schools segment comprises preschools and high schools. The Online Supplementary & Global segment comprises online business, such as LearnHub.com, WiZiQ.com; supplemental businesses, such as learning hour, study places, tuition centers; and global businesses, such as Learning.com in the United States and AsknLearn in Singapore. Educomp Solutions was founded by Shantanu Prakash on September 7, 1994 and is headquartered in Gurgaon, India.', '2019-09-27 07:24:20', '2019-09-27 07:24:20', 1, 1),
(537, 1, 'Efficient E-Solutions Bhd (EFFICEN)', 4, 26, 136, '-', 'http://www.efficient.com.my', 'Efficient E-Solutions Bhd. is an investment holding company, which engages in the provision of business process outsourcing services. It operates through the following segments: Records Management, Information Technology Services, and Rental. It offers electronic and physical distribution of data; imaging and data capture; archival and retrieval of documents; and record management. The company was founded on October 27, 2003 and is headquartered in Shah Alam, Malaysia.', '2019-09-27 07:24:20', '2019-09-27 07:24:20', 1, 1),
