(541, 1, 'ELL Environmental Holdings Ltd. (1395)', 4, 26, 102, '-', 'http://www.ellhk.com/about-us/overview/', 'ELL Environmental Holdings Ltd. is an investment company, which engages in the provision of wastewater treatment services and generation of electricity. It operates through the following geographical segment: Hong Kong, PRC, and Indonesia. The company was founded on February 25, 2014 and is headquartered in Nantong, China.', '2019-09-27 07:24:21', '2019-09-27 07:24:21', 1, 1),
(542, 1, 'Elpro International Ltd. (504000)', 4, 26, 105, '-', 'http://www.elpro.co.in', 'Elpro International Ltd. engages in the construction of residential and non-residential buildings including additions and alterations. It operates through the following segments: Electrical Equipment, Real Estate, Investment Activity, and Others. The Electrical Equipment segment includes manufacturing and sales of lightning arresters, varistors, secondary surge arresters, and discharge counter. The Real Estate segment focuses in the development and sale of property and lease of land and premises. The Investment Activity comprises long term investments. The Others segment consists of income generated from windmills. The company was founded on July 27, 1962 and is headquartered in Mumbai, India.', '2019-09-27 07:24:21', '2019-09-27 07:24:21', 1, 1),
(543, 1, 'Emnet Inc. (123570)', 4, 26, 217, '-', 'http://www.emnet.co.kr', 'eMnet, Inc. engages in the provision of online advertising services. Its services include search engine marketing, banner and rich media, global advertisement network, new media, viral marketing, log analysis, strategy adopting and marketing consulting. The company was founded on April 20, 2000 and is headquartered in Seoul, South Korea.', '2019-09-27 07:24:21', '2019-09-27 07:24:21', 1, 1),
