(548, 1, 'EnBio Holdings Inc. (6092)', 4, 26, 114, '-', 'http://enbio-holdings.com', 'EnBio Holdings, Inc. operates as a holding company which provides the environmental business with special focus on soil and groundwater contamination and renewable energy. It operates through the following segments: Soil Pollution Countermeasures, Soil Pollution-Related Equipment & Materials Sales, and Brown Field Utilization. The Soil Pollution Countermeasures segment handles the investigation of soil pollution, design and construction of purification works, and risk consultation. The Soil Pollution-Related Equipment & Materials Sales segment provides equipment, materials, and cleaning agents for research and purification purpose. The Brown Field Utilization segment manages the buying, restoration, and reselling of contaminated lands. The company was founded on June 23, 1999 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:21', '2019-09-27 07:24:21', 1, 1),
