(550, 1, 'Energy Action Ltd. (EAX)', 4, 26, 13, '-', 'https://www.energyaction.com.au', 'Energy Action Ltd. is a management consultancy firm, which engages in the provision of energy procurement and management services. It operates through the following segments: Procurement, Monitoring, and Project Advisory Services. The Procurement segment specializes in buying and negotiation strategies, utilizing reverse auctions, bespore tender models and advising on structured products. The Monitoring segment include contract management and environment reporting such as energy consumption monitoring and costing, energy emissions monitoring, contract administration, detailed technical reporting, desktop energy review, and additional reporting and monitoring. The Project and Advisory Services segment is an energy partnering service which aims to improve and manage on site level of energy efficiency. The company was founded on March 1, 2000 and is headquartered in Sydney, Australia.', '2019-09-27 07:24:22', '2019-09-27 07:24:22', 1, 1),
