(552, 1, 'Enero Group Ltd. (EGG)', 4, 26, 13, '-', '-', 'Enero Group Ltd. engages in the provision of marketing and communication services. Its services include strategy, market research, advertising, public relations, communications planning, graphic design, events management, direct marketing, and corporate communications. The company was founded on February 9, 2000 and is headquartered in Sydney, Australia.', '2019-09-27 07:24:22', '2019-09-27 07:24:22', 1, 1),
