(554, 1, 'Engineers India Ltd. (EQENGINERSIN)', 4, 26, 105, '-', 'http://www.engineersindia.com', 'Engineers India Ltd. engages in the engineering consultancy, and procurement and construction. It operates through the Consultancy and Engineering and Turnkey Projects segments. The company was founded on March 15, 1965 and is headquartered in New Delhi, India.', '2019-09-27 07:24:22', '2019-09-27 07:24:22', 1, 1),
