(556, 1, 'en-japan Inc. (4849)', 4, 26, 114, '-', 'http://www.enjapan.com', 'en-Japan, Inc. engages in the provision of online recruitment services. It provides internet job recruitment services and consultation services on recruitment, employee education and personnel evaluation system. It operates through the Recruitment, and Education and Evaluation business segments. The Recruitment business segment handles the operation of recruitment sites, and staffing and personnel introductions. The Education and Evaluation business segment covers the implementation of fixed rate training, hiring, and provides personnel related system. The company was founded by Michikatsu Ochi on January 14, 2000 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:22', '2019-09-27 07:24:22', 1, 1),
