(560, 1, 'Envipro Holdings Inc. (5698)', 4, 26, 114, '-', 'https://www.envipro.jp', 'Envipro Holdings Inc. engages in the management of its group companies which are in the recycling business. Its services include waste treatment, sale of recycled resources, used car and spare parts trading, dismantling, and export agency. The company was founded on May 21, 2010 and is headquartered in Fujinomiya, Japan.', '2019-09-27 07:24:22', '2019-09-27 07:24:22', 1, 1),
(561, 1, 'Enviro-Hub Holdings Ltd. (L23)', 4, 26, 210, '-', 'http://www.enviro-hub.com', 'Enviro-Hub Holdings Ltd. is an investment company, which engages in the provision of environmental management solutions. It operates through the following segments: Property Investments and Management; Recycling and Refining of Metals; Piling Contracts, Construction, Rental, and Servicing of Machinery; Trading of E-Waste and Metals; and Plastics to Fuel Refining. The Property Investments and Management segment includes rental income and capital appreciation. The Recycling and Refining of Metals segment comprises recycling, extracting, and refining of platinum group metals and copper. The Piling Contracts, Construction, Rental, and Servicing of Machinery segment offers engineering and technical services on equipment products. The Trading of E-Waste and Metals segment recycles and trades electronic waste and metals. The Plastics to Fuel Refining segment converts waste plastic to usable liquid hydrocarbon fuel oil. The company was founded on June 3, 1998 and is headquartered in Singapore.', '2019-09-27 07:24:22', '2019-09-27 07:24:22', 1, 1),
