(563, 1, 'Environmental Control Center Co. Ltd. (4657)', 4, 26, 114, '-', 'https://www.kankyo-kanri.co.jp', 'Environmental Control Center Co., Ltd. engages in the provision of environmental consulting services. It operates through the following divisions: Environmental Monitoring, Business Facilities, Waste, Soil and Groundwater, Consulting, Consignment Study, Asbestos, Others, and Radiation and Radioactivity Analysis. The Environmental Monitoring division public water, air, noise, and road environment monitoring studies. The Business Facilities division engages in the construction and maintenance of research facilities, water purification plants, golf courses, and public facilities. The Waste division includes sewage treatment and waste disposal management activities. The Soil and Groundwater division deals with soil investigation and groundwater contamination survey. The Consulting division provides environmental assessment, planning, nature study, and restoration services. The Consignment Study division includes clean room testing, product development, industry-specific analysis, and funded research activities. The Asbestos division handles measurement of asbestos content of construction materials and asbestos removal work. The Others division offers working environment and air environment measurement services. The Radiation and Radioactivity Analysis division involves measurement of space radioactivity and radioactive substance analysis. The company was founded on July 23, 1971 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:23', '2019-09-27 07:24:23', 1, 1),
