(569, 1, 'Esha Media Research Ltd. (531259)', 4, 26, 105, '-', 'http://eshamedia.com', 'Esha Media Research Ltd. engages in the provision of broadcast monitoring. It develops monitoring and analysis platform to cover research from a range of media mediums including television channels, newspapers and magazines. The company services include broadcast programming, schedules, program profile, program package, air check, and others. It covers in corporate, governments, non-governmental organizations, and researchers. The company was founded on February 8, 1984 and is headquartered in Mumbai, India.', '2019-09-27 07:24:23', '2019-09-27 07:24:23', 1, 1),
(570, 1, 'E-Supportlink Ltd. (2493)', 4, 26, 114, '-', 'https://www.e-supportlink.com', 'E-SUPPORTLINK Ltd. provides information technology business process outsourcing services for the fresh produce industry. It operates through the Operations Support and Agricultural Support segments. The Operations Support segment offers information systems that support fresh produce distribution channels and logistics. It also provides office services such as ordering, accounting, accounts receivable management, shipment, supply adjustment, accounts payable management, and encoding to fresh produce distributors. The Agricultural Support segment buys and sells apples, and provides marketing services for domestic agricultural products. The company was founded in October 1998 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:23', '2019-09-27 07:24:23', 1, 1),
(571, 1, 'ETS Group Ltd. (8031)', 4, 26, 102, '-', '-', 'ETS Group Ltd. is an investment holding company, which engages in the provision of multi-media contact services and contact center system. It operates through the following business segments: Outsourcing Inbound Contact Service, Outsourcing Outbound Contact Service, Staff Insourcing Service, Contact Service Center and Service Center Facilities Management Service, and Others. The Outsourcing Inbound Contact Service segment offers hotlines for general enquiry, promotion, customer service, order, registration, emergency, and helpdesk. The Outsourcing Outbound Contact Service segment includes services such as telemarketing, customer retention, cross-selling, and customer satisfaction surveys. The Staff Insourcing Service segment involves in the contact service staff for customer service, telemarketing, data entry, helpdesk assistance, and other backend support. The Contact Service Centre and Service Centre Facilities Management Service segment comprises leasing of contact center facilities in the form of workstation, hosting service, contact center system hosting solutions, service center facility management. The Others segment consists of system maintenance income, licensing income and sales of system and software income, and financial services including securities broking income. The company was founded on June 29, 2011 and is headquartered in Hong Kong.', '2019-09-27 07:24:24', '2019-09-27 07:24:24', 1, 1),
