(578, 1, 'EVZ Ltd. (EVZ)', 4, 26, 13, '-', 'http://www.evz.com.au', 'EVZ Ltd. operates in the engineering and energy services sectors. It operates through the following segments: Engineering, Power and Water. The Engineering segment designs, manufactures, and installs large steel tanks, silos, cooling towers, pipe spooling, pressure vessels, and fabricates structural steel. The Power segment designs and installs constant load power stations, back-up power generation equipment, and sustainable energy solutions. The Water segment designs syfonic roof drainage systems for large and or complex roof structures, supplies and installs fibreglass panel tanks, and prefabricated hydraulic systems. The company was founded in 1984 and is headquartered at Huntingdale, Australia.', '2019-09-27 07:24:24', '2019-09-27 07:24:24', 1, 1),
