(583, 1, 'F&M Co. Ltd. (4771)', 4, 26, 114, '-', 'https://www.fmltd.co.jp', 'F&M Co., Ltd. engages in the outsourcing business. Its operations are carried out through the following segments: Accounting Service, Consulting, Business Solutions, Real Estate Leasing and Others. The Accounting Service segment offers agency services, which include life insurance sales representatives and book-keeping, to individual entrepreneurs and small business enterprises. The Consulting segment provides general affairs and financial information to small and medium business enterprises. The Business Solutions comprises of the bookkeeping services for the general public through but not limited to tax and certified public accountants. The Real Estate Leasing Business segment leases its headquarters building in Osaka. The Others segment handles system development and franchise coaching businesses. The company was founded on July 30, 1990 and is headquartered in Suita, Japan.', '2019-09-27 07:24:25', '2019-09-27 07:24:25', 1, 1),
(584, 1, 'F@N Communications Inc. (2461)', 4, 26, 114, '-', 'https://www.fancs.com', 'F@N Communications, Inc. engages in the advertising business. It operates through the following segments: Affiliate Advertising Service for Personal Computer, Affiliate Advertising Service for Cellular Phone, Media Business, and Others. The Affiliate Advertising Service for Personal Computer segment operates A8.net. The Affiliate Advertising Service for Cellular Phone segment operates Moba8.net, Nend, and Adcrops. The Media Business segment operates SampleFan.com, auken, and Lyrica. The Other segment provides internet advertising agency services. The company was founded on October 1, 1999 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:25', '2019-09-27 07:24:25', 1, 1),
