(586, 1, 'Far East DDB PCL (FE)', 4, 26, 231, '-', 'http://www.fareastfamelineddb.com/wordpress/', 'Far East Fame Line DDB Public Co., Ltd is engaged in the business of advertising services. It specializes integrated communications. The firm provides advertising materials production service and media planning strategy both traditional and digital media, including coordinating with other subsidiaries and suppliers to create public relations plans and activities, as well as customer relationship management. Its projects covers advertising films and radio spots, creating layouts and producing print ads, direct mails, brochures and digital media. The company also offers coordinating service with production supplies. Far East Fame Line DDB Public was founded by Thiam Chokwatana on February 12, 1964 and is headquartered in Bangkok, Thailand.', '2019-09-27 07:24:25', '2019-09-27 07:24:25', 1, 1),
(587, 1, 'Far East DDB PCL NVDR (FE-R)', 4, 26, 231, '-', 'http://www.fareastfamelineddb.com/wordpress/', 'Far East Fame Line DDB Public Co., Ltd is engaged in the business of advertising services. It specializes integrated communications. The firm provides advertising materials production service and media planning strategy both traditional and digital media, including coordinating with other subsidiaries and suppliers to create public relations plans and activities, as well as customer relationship management. Its projects covers advertising films and radio spots, creating layouts and producing print ads, direct mails, brochures and digital media. The company also offers coordinating service with production supplies. Far East Fame Line DDB Public was founded by Thiam Chokwatana on February 12, 1964 and is headquartered in Bangkok, Thailand.', '2019-09-27 07:24:25', '2019-09-27 07:24:25', 1, 1),
(588, 1, 'Fawer Automotive Parts Co. Ltd. A (000030)', 4, 26, 47, '-', '-', 'Fawer Automotive Parts Ltd. Co. engages in the manufacture, design, research, development, and sale of automotive parts. Its business activities include manufacture and process of equipment; leasing business; provision of property service; and warehouse and distribution operations. Its products are categorized into the following divisions: Environment Control System, Steering and Transmission System, Engine Accessory System, Chassis Accessory System, Suspension and Running System, Brake System, and Others. The company was founded on September 1, 1993 and is headquartered in Changchun, China.', '2019-09-27 07:24:25', '2019-09-27 07:24:25', 1, 1),
