(606, 1, 'Focus Dynamics Group Bhd (FOCUS)', 4, 26, 136, '-', 'http://www.focusdynamics.com.my', 'Focus Dynamics Group Bhd. is an investment holding company, which engages in the design and manufacture of integrated and energy-efficient range of electrical control products.Focus Dynamics Group Bhd. is an investment holding company, which engages in the design and manufacture of integrated and energy-efficient range of electrical control products. It operates through the following business segments: Property Investment & Management, Engineering Services, Food & Beverages and Others. The Property Investment and Management engages in letting of property. The Engineering Services segment includes Implementation and installation of industrial machines and processes, energy efficiency system, research and development of variable speed drives, installation of automation system, providing a range of support services covering project management services, maintenance support, engineering conceptualisation, system audit, energy saving services and other support services. The Food & Beverages segment operates and manages food and beverage outlets. The Others segment includes investment holding, manufacturing, trading and distribution of industrial equipment, machines and processes, and dormant companies. The company was founded on June 14, 2002 and is headquarterd in Petaling Jaya, Malaysia.', '2019-09-27 07:24:26', '2019-09-27 07:24:26', 1, 1),
