(620, 1, 'FSE Engineering Holdings Ltd. (0331)', 4, 26, 102, '-', 'http://www.fseservices.com.hk', 'FSE Services Group Ltd. engages in the provision of engineering, mechanical, environmental engineering services. It operates through Electrical and Mechanical (E&M) Engineering and Environmental Engineering segments. The E&M Engineering segment includes installation works for construction projects as well as maintenance services for buildings and facilities completed, and operates under the trade names of Far East Engineering, Young''s Engineering, and Majestic Engineering. The Environmental Engineering segment comprises of environmentally-related contracting and maintenance services, primarily water treatment services and environmental monitoring. The company was founded on June 22, 2015 and is headquartered in Hong Kong', '2019-09-27 07:24:28', '2019-09-27 07:24:28', 1, 1),
