(624, 1, 'Fujikoh Co. Ltd. (2405)', 4, 26, 114, '-', 'http://www.fujikoh-net.co.jp', 'Fujikoh Co., Ltd. engages in the waste recycling business. It operates through the following business segments: Construction Recycling, Food Recycling, Termite Fumigation, and Forest Generation. The Construction Recycling segment deals with incineration, shredding, and recycling of waste from home builders, factories, warehouses, and shopping centers. The Food Recycling segment consigns to recycle waste of food-related establishments into compost and animal feeds. The Termite Fumigation segment provides termite control and prevention services. The Forest Generation segment supplies energy power to local elementary and junior high schools, public facility offices, and business establishments. It is also regenerates energy from biomass waste. The company was founded in March 1972 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:28', '2019-09-27 07:24:28', 1, 1),
(625, 1, 'Full Speed Inc. (2159)', 4, 26, 114, '-', 'https://www.fullspeed.co.jp', 'Full Speed, Inc. engages in provision of listing, affliate, and social media advertising and marketing. It operates in the following segments: Internet Marketing Business, Ad Technology Business, and Others. The Internet Marketing Business segment provides listing advertising, search engine marketing (SEM) solutions, and other internet advertising agency sales services. The Ad Technology Business segment offers display type ad networks and affiliate service providers (ASP). The Others segment includes information media and creative businesses. The company was founded on January 4, 2001 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:28', '2019-09-27 07:24:28', 1, 1),
(626, 1, 'Fullcast Holdings Co. Ltd. (4848)', 4, 26, 114, '-', 'https://www.fullcastholdings.co.jp', 'Fullcast Holdings Co. Ltd. provides human outsourcing business for various industries and occupations as a forerunner of short term human outsourcing companies in Japan. The company operates through the following divisions: Short-term operational support business, Security business and Sales support business. The Short-term operational support business involves temporary staffing and human resource dispatching. The Security business involves full scale guarding of client firms. The Sales support business involves dispatching engineers and technicians for the designing and development in the manufacturing field. The company was founded on September 14, 1990 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:28', '2019-09-27 07:24:28', 1, 1),
