(662, 1, 'Glory Ltd. (6457)', 4, 26, 114, '-', 'https://www.glory.co.jp', 'Glory Ltd. engages in the development, manufacture, and sale of money handling machines and systems. Its operations are carried out through the following segments: Financial Market, Retail and Transportation Market, Amusement and Gaming Market, Overseas Market, and Others. The Financial Market segment offers open teller systems, coin and banknote recyclers for tellers, money changers for bank lobbies, and security storage systems. The Retail and Transportation Market segment produces coin and banknote recyclers for cashiers, sales proceeds deposit machines, multi-functional banknote changers, cash recyclers for gas stations, and coin-operated lockers. The Amusement and Gaming Market segment provides card systems for local pachinko parlors and casinos. The Overseas Market segment markets banknote recyclers, sorters, and deposit modules for overseas financial institutions, cash-in-transit companies, and casinos. The Others segment deals with products and goods not included in the other segments. The company was founded in March 1918 and is headquartered in Himeji, Japan.', '2019-09-27 07:24:32', '2019-09-27 07:24:32', 1, 1),
