(686, 1, 'Greentown Service Group Co. Ltd. (2869)', 4, 26, 102, '-', 'http://www.lvchengfuwu.com', 'Greentown Service Group Co. Ltd. engages in the provision of residential property management services. It operates through the following geographical segments: Region 1, Region, 2, Region 3, Region 4, and Region 5. The Region 1 segment covers the provicen of Hangzhou including Yuhang. The region 2 segment caters to the Yangtze River Delta Region including Ningbo. The Region 3 segment handles the Pearl River Delta Region. The Region 4 segment manages the Bohai Economic Rim Region. The Region 5 segment presides over the other regions including its offshore locations. The company was founded on November 24, 2014 and is headquartered in Hangzhou, China.', '2019-09-27 07:24:34', '2019-09-27 07:24:34', 1, 1),
(687, 1, 'gremz Inc. (3150)', 4, 26, 114, '-', '-', 'gremz, Inc. is a holding company, which engages in the creation of the management strategy and handles the administration and supervision of its business subsidiaries. It operates through the following segments: Smart House Project, Energy Cost Solutions, and Incubation. The Smart House Project segment deals with the sale of solar power generation system for general household, storage battery and development of renewable energy. The Energy Cost Solutions segment provides corporate consulting services to reduce electric power consumption and handles the sale of LED lighting. The Incubation segment covers the creation of new businesses and product sales from the website being managed by a subsidiary company. The company was founded on July 4, 2005 and is headquartered in Tokyo, Japan', '2019-09-27 07:24:34', '2019-09-27 07:24:34', 1, 1),
