(689, 1, 'G-Resources Group Ltd. (1051)', 4, 26, 102, '-', 'mailto:investor.relations@gresources.com', 'G-Resources Group Ltd. is an investment holding company, which engages in the exploration, mining and sale of gold and silver products. It also engages in the provision of financial services, including securities brokerage services, placing and underwriting services, corporate finance advisory services, provision of margin financing, money lending business, and investment advisory and management services. It operates through the following segments: principal investment business, financial services business, real property business and mining business. The company was founded on January 24, 1994 and is headquartered in Hong Kong.', '2019-09-27 07:24:34', '2019-09-27 07:24:34', 1, 1),
