(697, 1, 'GS Holdings Ltd. (43A)', 4, 26, 210, '-', '-', 'GS Holdings Ltd. GS Holdings Ltd. engages in the provision of end-to-end cleaning services for the food and beverage industry. It offers on-site cleaning and stewarding services, centralized dishware washing, sale of dishware washing related equipment and consumables, and cleaning and dishware washing consultancy services. The company was founded on September 19, 2014 and is headquartered in Singapore.', '2019-09-27 07:24:35', '2019-09-27 07:24:35', 1, 1),
(698, 1, 'Guangdong Advertising Group Co. Ltd. (002400)', 4, 26, 47, '-', 'http://www.gdadc.com', 'Guangdong Advertising Group Co., Ltd. engages in the provision of integrated advertising and marketing services. It operates the businesses through the following segments: Brand management and Media agency business. The Brand management segment provides brand strategy, brand planning, corporate identity system (CIS) design, brand diagnostic, advertising planning, innovation, design and products, market survey, marketing strategy and packaging, shopping mall terminal design as well as promotion, exhibition and public relation services. The Media agency business segment, which includes the establishment of media strategy, media innovation and media placement plans as well as proprietary media business, which includes the operation of bus station billboards, bus advertising and outdoor billboard. The company was founded on May 11, 1981 and is headquartered in Guangzhou, China.', '2019-09-27 07:24:35', '2019-09-27 07:24:35', 1, 1),
(699, 1, 'Guangxi Bossco Environmental Protection Technology Co. Ltd. (300422)', 4, 26, 47, '-', 'http://www.bossco.cc', 'Guangxi Bossco Environmental Protection Technology Co., Ltd. engages in the engineering design and construction, research and development, equipment manufacture and operations and investment operation of environmental protection industry chain. Its business involves wastewater treatment, cleaning production, utilization of solid waste, waste gas denitrification, heavy metal pollution treatment and ecological restoration. The company was founded on April 13, 1999 and is headquartered in Nanning, China', '2019-09-27 07:24:35', '2019-09-27 07:24:35', 1, 1),
