(701, 1, 'Guodian Technology & Environment Group Corp. Ltd. (1296)', 4, 26, 102, '-', 'http://www.khjt.com.cn', 'Guodian Technology & Environment Group Corp. Ltd. is a holding company, which engages in the environmental protection and energy conservation solutions business. It operates through the following segments: Environmental Protection; Energy Conservation Solutions; Wind Power Products and Services; and All Others. The Environmental Protection segment environmental protection products and services which mainly consists of sulphur oxide control technologies, nitrogen oxide control technologies, rental of desulphurisation and denitrification facilities, ash removal with filer bag, water treatment related technologies and products. The Energy Conservation Solutions segment covers the energy saving products and services which mainly consists of plasma ignition and micro-oil ignition equipment and gas turbine improvement services and construction of energy-efficient power plants. The Wind Power Products and Services segment manufactures and sells wind turbine parts and components. The Solar Power Products and Services segment produces and sells solar cells, solar modules and other solar products, constructs solar power stations and provides related system solutions and services to solar power operators. The company was founded on April 6, 2001 and is headquartered in Beijing, China.', '2019-09-27 07:24:35', '2019-09-27 07:24:35', 1, 1),
