(706, 1, 'Hai Leck Holdings Ltd. (BLH)', 4, 26, 210, '-', 'http://www.haileck.com', 'Hai Leck Holdings Ltd. is an investment company, which engages in the provision of managerial, administrative, supervisory, and consultancy services. It operates through the following segments: Project Services, Maintenance Services, and Contract Centre Services. The Project Services segment includes mechanical engineering services, scaffolding, corrosion prevention services, thermal insulation services, refractory and passive fireproofing, and general civil engineering services. The Maintenance Services segment is comprised of routine and turnaround maintenance service. The Contract Centre Services segment pertain to call centre services, telecommunications and information technology services. The company was founded by Buck Poh Cheung in 1975 and is headquartered in Singapore.', '2019-09-27 07:24:36', '2019-09-27 07:24:36', 1, 1),
