(708, 1, 'Hakuhodo DY Holdings Inc. (2433)', 4, 26, 114, '-', 'https://www.hakuhodody-holdings.co.jp', 'Hakuhodo DY Holdings, Inc. engages in advertising operations in various media, primarily newspapers, magazines, radio, television, and digital media. It also provides planning, production, marketing, public relations, and other services related to the presentation of advertising. The company was founded on October 1, 2003 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:36', '2019-09-27 07:24:36', 1, 1),
