(710, 1, 'Hakuten Corp. (2173)', 4, 26, 114, '-', 'https://www.hakuten.co.jp', 'Hakuten Corp. engages in the communication design business. It operates through the Real Experience & Communication segment and the Digital Experience & Communication segment. The Real Experience & Communication segment offers design services optimizing expression, means, and the environment. The Digital Experience & Communication segment offers design services using the internet by developing a business model to strategic website construction and application creation, delivery and management platform including the latest digital technology of robotics and AI. The company was founded by Hiromoto Taguchi in February 1967 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:36', '2019-09-27 07:24:36', 1, 1),
(711, 1, 'Hamakyorex Co. Ltd. (9037)', 4, 26, 114, '-', 'http://www.hamakyorex.co.jp', 'Hamakyorex Co., Ltd. engages in the provision of logistics and warehousing services. It operates through the following segments: Logistics Center and Freight Carrier. The Logistics Center segment operates storage and delivery centers. The Freight Carrier segment includes general cargo and freight services. The company was founded on February 1, 1971 and is headquartered in Hamamatsu, Japan.', '2019-09-27 07:24:36', '2019-09-27 07:24:36', 1, 1),
(712, 1, 'Hansen Technologies Ltd. (HSN)', 4, 26, 13, '-', 'https://www.hansencx.com', 'Hansen Technologies Ltd. engages in the development, integration, and support of billing systems software for the energy and utilities, telecommunications, and pay-tv industries. It operates through the following segments: Billing, IT Outsourcing, and Others. The Billing segment represents the sale of billing applications and the provision of consulting services in regard to billings systems. The IT Outsourcing segment covers the provision of various information technology outsources services covering facilities management, systems and operations support, network services, and business continuity support. The Others segment provides software and services in superannuation administration. The company was founded by Kenneth Hansen in 1971 and is headquartered in Doncaster, Australia.', '2019-09-27 07:24:36', '2019-09-27 07:24:36', 1, 1),
