(715, 1, 'Harima B-Stem Corp. (9780)', 4, 26, 114, '-', 'https://www.bstem.co.jp', 'Harima B.Stem Corp. engages in the building management business. It offers cleaning, facility maintenance and management, security, construction work, reception and helpdesk, catering, and administrative agency services. The company was founded on October 6, 1961 and is headquartered in Yokohama, Japan.', '2019-09-27 07:24:36', '2019-09-27 07:24:36', 1, 1),
