(727, 1, 'Heerim Architects & Planners Co. Ltd. (037440)', 4, 26, 217, '-', 'http://www.heerim.com', 'Heerim Architects & Planners Co., Ltd. engages in the design, plan, construction, and management of architectural structures. Its products and services include architecture, interior design, landscape design, building renewal, urban planning and design, sustainable design, business planning, commercial space planning, architecture research, construction management, construction supervision, and construction administration. The company was founded on January 10, 1970 and is headquartered in Seoul, South Korea.', '2019-09-27 07:24:37', '2019-09-27 07:24:37', 1, 1),
(728, 1, 'Heian Ceremony Service Co. Ltd. (2344)', 4, 26, 114, '-', 'http://www.heian-group.co.jp', 'Heian Ceremony Service Co., Ltd. engages in the provision of ceremonial services. It operates through the following segments: Wedding and Celebration, Funeral, Mutual Aid, Nursing Care, and Others. The Wedding and Celebration segment provides ceremony services for wedding, coming of age and other special events. It also includes rental of facility and costume, photo studio, and costume fitting services. The Funeral segment provides private and corporate funeral services. The Mutual Aid segment operates a mutual aid association which solicits membership subscription and manages members'' information. The Nursing Care segment provides nursing and home care services for the elderly. The Others segment provides logistic services. The company was founded by Kane Soma in August 1969 and is headquartered in Hiratsuka, Japan.', '2019-09-27 07:24:37', '2019-09-27 07:24:37', 1, 1),
