(732, 1, 'Hiap Huat Holdings Bhd (HHHCORP)', 4, 26, 136, '-', 'http://www.hiaphuat.com', 'Hiap Huat Holdings Bhd. is an investment holding company, which engages in the manufacturing, recycling, and refining all kinds of petroleum based products. Its activities include scheduled waste management, laboratory services, distillation tolling, lubricant product manufacturing, paint product manufacturing, and information technology. The company was founded on December 9, 2009 and is headquartered in Petaling Jaya, Malaysia.', '2019-09-27 07:24:38', '2019-09-27 07:24:38', 1, 1),
