(736, 1, 'Hinduja Global Solutions Ltd. (532859)', 4, 26, 105, '-', 'https://www.teamhgs.com', 'Hinduja Global Solutions Ltd. engages in the provision of outsourcing solutions. It operates through the following geographical segments: USA and Canada, India, Europe, and Rest of the World. The company was founded on January 13, 1995 and is headquartered in Bangalore, India.', '2019-09-27 07:24:38', '2019-09-27 07:24:38', 1, 1),
(737, 1, 'HIP Corp. (2136)', 4, 26, 114, '-', 'https://www.hip-pro.co.jp', 'HIP Corp. engages in the provision of technical services in machinery planning, electronic design, and software development. The Outsourcing Business segment offers services for machineries, transportation-related equipment, information communication, precision equipment, semiconductor circuits, electrical and electronic equipment, information processing and software. The company was founded on September 13, 1995 and is headquartered in Yokohama, Japan.\n\n', '2019-09-27 07:24:38', '2019-09-27 07:24:38', 1, 1),
(738, 1, 'Hirayama Corp. (7781)', 4, 26, 114, '-', 'http://www.hirayamastaff.co.jp', 'HIRAYAMA Holdings Co. Ltd. provides manufacturing consulting, factory outsourcing, temporary staffing and job placement services. Its operations are carried out through the following segments: Information, Human Resources and Outsourcing Services. The Information segment provides the data processing and consulting services. The Human Resources segment provides the storage, computing, distribution, and communication for the information required by all or some part of an enterprise. The Outsourcing Services segment provides medical devices and pharmaceuticals, transport equipment and housing equipment and also manufactures food-related products, etc. The company was founded by Joichi Hirayama in December 1955 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:38', '2019-09-27 07:24:38', 1, 1),
(739, 1, 'Hitech Group Australia Ltd. (HIT)', 4, 26, 13, '-', 'http://www.hitechaust.com', 'Hitech Group Australia Ltd. provides recruitment services for permanent and contract staff to the ICT sector. The company was founded by Raymond Hazouri in 993 and is headquartered in Sydney, Australia.', '2019-09-27 07:24:38', '2019-09-27 07:24:38', 1, 1),
(740, 1, 'Hito-Communications Inc. (3654)', 4, 26, 114, '-', 'http://www.hitocom.co.jp', 'HITO-Communications, Inc. engages in the provision of outsourcing and staffing services. It operates through the following segments: Outsourcing, Personnel Placement, Electronic Commerce (EC) and Television Commerce (TC) Support, Wholesale, and Others. The Outsourcing segment handles sales strategy, personnel arrangement, and customer service for manufacturers and communication carriers. The Personnel Placement segment manages personnel dispatchment. The EC and TC Support segment provides sales support for e-commerce and television shopping. The Wholesale segment manufactures and wholesales clothing products. The Others segment includes social welfare service, education training, and limousine service for the wealthy. The company was founded on February 23, 1998 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:38', '2019-09-27 07:24:38', 1, 1),
(741, 1, 'Hogg Robinson Group PLC (HRG)', 4, 26, 249, '-', '-', '-', '2019-09-27 07:24:38', '2019-09-27 07:24:38', 1, 1),
(742, 1, 'Hokkai Electrical Construction Co. Inc. (1832)', 4, 26, 114, '-', 'http://www.hokkaidenki.co.jp', 'Hokkai Electrical Construction Co., Inc. engages in the business civil engineering services. It operates through the following business divisions: Electrical Equipment, Mechanical Equipment, Renewable Energy, Information and Communication, Power Infrastructure, and Insurance Recruitment. The Electrical Equipment division designs and constructs outdoor electric equipment. The Mechanical Equipment division manages thermal source systems which includes air conditioning and hot water supply systems. It also handles sanitation equipment construction. The Renewable Energy division includes power generation equipment such as photovoltaic and wind power generation. It also offers support from design to construction and maintenance for low, high, and special high pressure interconnection equipment. The Information and Communication division provides survey of information infrastructure to design, construction, and maintenance. The Power Infrastructure division handles power distribution facility construction for delivering electricity. The Insurance Recruitment division offers customers with insurance products and services. The company was founded on October 1, 1944 and is headquartered in Sapporo, Japan.', '2019-09-27 07:24:39', '2019-09-27 07:24:39', 1, 1),
(743, 1, 'Hollywall Entertainment Inc. (HWAL)', 4, 26, 250, '-', '-', '-', '2019-09-27 07:24:39', '2019-09-27 07:24:39', 1, 1),
(744, 1, 'Holsin Engineering Consulting Co. Ltd. A (603909)', 4, 26, 47, '-', 'http://www.holsin.cn', 'Holsin Engineering Consulting Group Co., Ltd. engages in the provision of integrated engineering consultancy services. It offers project supervision, test detection, repair and reinforcement, design consulting, project management, and other technical services. It specializes in project management and engineering testing services. It focuses on road, bridge, tunnel, municipal housing construction, and water transport project. The company was founded on October 11, 1995 and is headquartered in Xiamen, China.', '2019-09-27 07:24:39', '2019-09-27 07:24:39', 1, 1),
