(746, 1, 'Honyaku Center Inc. (2483)', 4, 26, 114, '-', 'https://www.honyakuctr.com', 'Honyaku Center, Inc. engages in the language translation services. It operates through the following segments: Translation Business, Temporary Staffing Business, Interpretation Business, Language Education Business, Convention Business, and Other. The Translation Business segment specializes the translation works in patent, medical, industrial, financial, and legal fields. The Temporary Staffing Business segment handles staffing of translators and interpreters. The Interpretation Business segment involves in contract of interpreters for international and corporate conferences. The Language Education Business segment deals with interpreters and translators training. The Convention Business segment engages in international and national conferences, seminars, symposium, and exhibits. The Other segment includes foreign application assistance project. The company was founded in April 1986 and is headquartered in Osaka, Japan.', '2019-09-27 07:24:39', '2019-09-27 07:24:39', 1, 1),
(747, 1, 'Hope Inc. (6195)', 4, 26, 114, '-', 'https://www.zaigenkakuho.com', 'HOPE, INC. engages in public private sharing (PPS) business. It operates through the following services: Funding Source Security Support, Business Process Outsourcing (BPO) Support, Information Platform, and Market Place. The Funding Source Security Support service conducts design and production of dead space service and media creation service. The BPO Support service offers marketing research and business process consultations. The Information Platform service provides information to media outlets. The Market Place service manages the market place "LAMP", which specializes in local government advertisements. The company was founded by Takayasu Tokitsu on February 2, 2005 and is headquartered in Fukuoka, Japan.', '2019-09-27 07:24:39', '2019-09-27 07:24:39', 1, 1),
