(752, 1, 'HRL Holdings Ltd. (HRL)', 4, 26, 13, '-', 'http://hrlholdings.com', 'HRL Holdings Ltd. engages in environmental consulting and hazardous materials analytical laboratory business. Its services include the following: industrial hygiene; asbestos and hazardous materials management; environmental services; building contamination assessment; laboratory analysis; and on-site testing and monitoring. The company operates through two segments: OCTIEF Branded Operations and Precise Consulting Branded Operations. HRL Holdings was founded on August 11, 2006 and is headquartered in Brisbane, Australia.', '2019-09-27 07:24:40', '2019-09-27 07:24:40', 1, 1),
