(758, 1, 'Huationg Global Ltd. (41B)', 4, 26, 210, '-', 'http://www.huationg.com.sg', 'Huationg Global Ltd. is an investment holding company, which engages in the development of real estate properties. It operates through the following segments: Civil Engineering Services, Inland Logistics Support, and Sales of Construction Materials. The Civil Engineering Services segment includes construction projects on earthworks, infrastructure and external works, demolition and excavation works, drainage works, and road diversion. The Inland Logistics Support segment offers rentals of construction equipment including tipper trucks, compactors, and excavators. The Sales of Construction Materials segment supplies liquefied soil stabilizer, as well as other construction related equipment and consumables. The company was founded on September 6, 1983 and is headquartered in Singapore.', '2019-09-27 07:24:40', '2019-09-27 07:24:40', 1, 1),
