(855, 1, 'Invigor Group Ltd. (IVO)', 4, 26, 13, '-', 'https://www.invigorgroup.com', 'Invigor Group Ltd. is an investment company focusing on the information and communication technologies sector. Its services include consulting, experience design, web and mobile development, system integration and online marketing. The company was founded in 1994 and is headquartered in Sydney, Australia.', '2019-09-27 07:24:49', '2019-09-27 07:24:49', 1, 1),
(856, 1, 'IODM Ltd. (IOD)', 4, 26, 13, '-', 'https://www.iodm.com.au', 'IODM Ltd. engages in the development of a cloud-based software platform. It provides an automated tool for receivables and collection management. The company was founded on November 7, 2002 and is headquartered in Melbourne, Australia.', '2019-09-27 07:24:49', '2019-09-27 07:24:49', 1, 1),
