(859, 1, 'iPeople Inc. A (IPO)', 4, 26, 185, '-', '-', 'Innocean Worldwide, Inc. engages in the provision of marketing solutions. Its services include culture marketing, public relations promotion, content dynamics planning, online campaigns, digital platform operations, brand positioning, media services, and communication strategy development. The company was founded on May 17, 2005 and is headquartered in Seoul, South Korea.', '2019-09-27 07:24:50', '2019-09-27 07:24:50', 1, 1),
