(861, 1, 'IPS Securex Holdings Ltd. (42N)', 4, 26, 210, '-', 'https://www.ips-securex.com', 'IPS Securex Holdings Ltd. engages in the consultancy of business and management, provision of services, and trading of security products. It operates through Security Solutions; and Maintenance and Leasing segments. The Security Solutions segment includes the sale of goods and the provision of integrated security solutions to customers. The Maintenance and Leasing segment involves in the maintenance services and rental of security equipment. The company was founded by Chan Tien Lok in 1991 and is headquartered in Singapore.', '2019-09-27 07:24:50', '2019-09-27 07:24:50', 1, 1),
