(865, 1, 'I-Remit Inc. (I)', 4, 26, 185, '-', 'http://iremitglobal.com', 'iRemit, Inc. engages in the provision of fund transfer and remittance services. It operates through the following geographical segments: Philippines, Asia Pacific, Europe, and North America. Its products include bank-to-bank service; door-to-door services; notify-to-pay; visa card; auxiliary services; short messages service via globe and smart padala; and iRemit direct online remitance system. The company was founded on March 5, 2001 and is headquartered in Pasig, Philippines.', '2019-09-27 07:24:51', '2019-09-27 07:24:51', 1, 1),
(866, 1, 'ISDN Holdings Ltd. (I07)', 4, 26, 210, '-', 'http://www.isdnholdings.com', 'ISDN Holdings Ltd. engages in the provision of technical consultancy, training, and management services. It operates through the following business segments: Engineering Solutions-Motion Control; Other Specialized Engineering Solutions; Industrial Computing Solutions; and Others. The Engineering Solutions-Motion Control segment offers a range of motion control systems that incorporate components such as servo motors and drives, mechanical parts, monitors, and industrial computing components which allows for the provision of integrated solutions. The Other Specialized Engineering Solutions segment includes industrial vision, precision gears, gear boxes, laser technologies for precision measurement and cutting as well as for industrial locks and hinges. The Industrial Computing Solutions segment provides hardware and software solutions and complements the engineering solutions business. The company was founded in 1986 and is headquartered in Singapore.', '2019-09-27 07:24:51', '2019-09-27 07:24:51', 1, 1),
(867, 1, 'i-SENS Inc. (099190)', 4, 26, 217, '-', 'http://i-sens.co.kr', 'i-SENS, Inc. engages in development and manufacture of medical, environmental, industrial sensors. Its products include bolld glucose monitoring devices, electrolyte analyzers and cartridges, blood coagulation measuring instrument, connectors, and others. The company was founded by Cha Geun-Sig and Nam Hak-Hyun on May 4, 2000 and is headquartered in Seoul, South Korea.', '2019-09-27 07:24:51', '2019-09-27 07:24:51', 1, 1),
(868, 1, 'iSentia Group Ltd. (ISD)', 4, 26, 13, '-', 'http://www.isentia.com', 'iSentia Group Ltd. engages in the development of software and systems. It operates through the following segments: Software-as-a-Service (SaaS), Value Added Services (VAS) and Content Marketing. The SaaS segment includes flagship Media Portal that provides customers access to information as well as tools to analyze and report on media intelligence. The VAS segment provides social media insights and monitoring, customized quantitative and qualitative analysis, and in depth analysis required by customers. The Content Marketing develops comprehensive content marketing strategies and engaging digital content that empowers brands to increase profitability by communicating effectively with target audiences. The company was founded by Neville Jeffress in 1982 and is headquartered Sydney, Australia.', '2019-09-27 07:24:51', '2019-09-27 07:24:51', 1, 1),
