(881, 1, 'ITL Industries Ltd. (522183)', 4, 26, 105, '-', 'http://www.itl.co.in', 'ITL Industries Ltd. is a holding company, which engages in the manufacture of machine and trading of cutting tools and hydraulic products. It offers blades, bandsaw, circular sawing machine, tube and pipe manufacturing machine, power hacksaw machines, and special purpose machine such as rail slitting machine, gas cylinder neck, aluminum billet, keyway slotting, and heat exchanger cutting machines. The company was founded in 1986 and is headquartered in Indore, India.', '2019-09-27 07:24:54', '2019-09-27 07:24:54', 1, 1),
