(885, 1, 'IVE Group Ltd. (IGL)', 4, 26, 13, '-', 'https://www.ivegroup.com.au', 'IVE Group Ltd. engages in the provision of communication solutions. Its services includes creative services, personalized communications, print production, retail display, promotional merchandising, third party sourcing, logistics and fulfillment and managed solutions. The company was founded in 1997 and is headquartered in Sydney, Australia.', '2019-09-27 07:24:54', '2019-09-27 07:24:54', 1, 1),
