(889, 1, 'JAC Recruitment Co. Ltd. (2124)', 4, 26, 114, '-', 'http://corp.jac-recruitment.jp', 'JAC Recruitment Co., Ltd. engages in recruitment advertising and recruitment services. It operates through the Personnel Introduction Business and Job Advertisement Business segmentsThe Personnel Introduction Business segment handles employee recruitment through introduction to companies. The Job Advertisement Business segment offers recruitment advertisement through the website Career Cross. It operates through the following geographical segments: Tokyo Main Office, Yokohama Branch, Nagoya Branch, Shizuoka Branch, Osaka Branch, Kyoto Branch, Kobe Branch, JAC International, and CC Consulting. The company was founded by Tadayoshi Tazaki and Hiromi Tazaki on March 7, 1988 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:55', '2019-09-27 07:24:55', 1, 1),
