(894, 1, 'JAG Bhd (JAG)', 4, 26, 136, '-', 'http://www.jagb.com.my', 'JAG Bhd. is an investment holding company, which engages in the computer software development, maintenance, and support services. It operates through the following segments: Manufacturing; Trading; Services; Proprietary Solutions and Software Maintenance; Investment, and Property Development. The Manufacturing segment deals with the extraction, production, and refinery of ferrous, non-ferrous, and precious metals. The Trading segment trades ferrous and non-ferrous metals. The Services segment operates the twenty-four hour coin-operated laundry business. The Proprietary Solutions and Software Maintenance segment comprises of computer software development, maintenance, and support services. The Investment segment covers investment holding and trading companies. The Property Development segment buys, sells, rents, and operates self-owned or leased real estate land, property development, and project management. The company was founded in 1991 and is headquartered in Petaling Jaya, Malaysia.', '2019-09-27 07:24:56', '2019-09-27 07:24:56', 1, 1),
(895, 1, 'Japan Reliance Service Corp. (4664)', 4, 26, 114, '-', 'http://www.trsc.co.jp', 'Japan Reliance Service Corp. engages in the provision of comprehensive facilities management, manpower, and nursing care services. These include provision of security to stores, hotels, hospitals, and buildings; cleaning and other office services. It operates through the following segments: Comprehensive Building Management Service, Manpower Service, and Nursing Care Service. The Comprehensive Building Management Service segment provides security, cleaning, equipment management services and office services. The Manpower Service segment offers manpower dispatch services such as information management, filing, and equipment operations. It also engages in paid placement operations. The Nursing Care Service deals with nursing care services. The company was founded on September 10, 1971 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:56', '2019-09-27 07:24:56', 1, 1),
(896, 1, 'Jasuindo Tiga Perkasa (JTPE)', 4, 26, 106, '-', 'http://www.jasuindo.co.id/ina/home/', 'PT Jasuindo Tiga Perkasa Tbk engages in the printing of documents and credit cards. It operates through the Security and Non-Security business segments. The Security segment refers to products that are secured in nature and requires special permit during the production such as book of checks, giro, stocks, and other securities. The Non-Security segment relates to products that are not secured in nature and does not require special permission. The company was founded on November 10, 1990 and is headquartered in Sidoarjo, Indonesia.', '2019-09-27 07:24:56', '2019-09-27 07:24:56', 1, 1),
