(904, 1, 'Jeevan Scientific Technology Ltd. (538837)', 4, 26, 105, '-', 'http://www.jeevanscientific.com/', 'Jeevan Scientific Technology Ltd. is an outsourcing company, which engages in the provision of global management consulting and technology services. It operates through the following segments: Clinical Research Services, Data Management Services, and Information Technology Services. The company was founded on February 2, 1999 and is headquartered in Hyderabad, India.', '2019-09-27 07:24:57', '2019-09-27 07:24:57', 1, 1),
