(907, 1, 'Jian ePayment Systems Ltd. (8165)', 4, 26, 102, '-', 'http://www.jianepayment.com/', 'Jian ePayment Systems Ltd. is an investment holding company. It operates through the following business segments: Car Parking Systems and Intellectual Property Services. The Car Parking Systems segment activities include development and operation of integrated circuit and smart cards; back end electronic receipt and payment; and data recording and processing software system; manufacturing and distribution of the associated commercial application; and trading of electric vehicle charging facilities. The Intellectual Property Services segment activities include licensing of patents and provision of consultancy service on intellectual property management. The company was founded on November 30, 2000 and is headquartered in Shenzhen, China.', '2019-09-27 07:24:57', '2019-09-27 07:24:57', 1, 1),
(908, 1, 'Jibannet Holdings Co. Ltd. (6072)', 4, 26, 114, '-', 'https://jiban-holdings.jp/', 'Jibannet Holdings Co., Ltd. engages in the ground analysis business. Its services include soil analysis, survey, compaction, liquefaction screening, safety system, and quality certification. The company was founded by Tsuyoshi Yamamoto on June 25, 2008 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:58', '2019-09-27 07:24:58', 1, 1),
