(920, 1, 'Jost''s Engineering Co. Ltd. (505750)', 4, 26, 105, '-', 'http://www.josts.com/', 'Jost''s Engineering Co. Ltd. engages in the manufacture and sale of material handling and engineering products. It operates through the Material Handling, and Engineered Products segments. The Material Handling segment refers to innovative material handling solutions for internal material handling needs such as platform truck, tow truck, stacker and others. The Engineered Products segment includes engineered products for commercial and technical support such as sound and vibration, environmental simulation, process instrumentation, components, electrical and nanotechnology and analytical solutions. The company was founded by Carl Jost on May 9, 1907 and is headquartered in Mumbai, India.', '2019-09-27 07:24:58', '2019-09-27 07:24:58', 1, 1),
(921, 1, 'JTEC Corp. (2479)', 4, 26, 114, '-', 'https://www.j-tec-cor.co.jp/', 'JTEC Corp. engages in the technical outsourcing business. It operates through the Technical Job and Intellectual Property Lease and the General Worker and Engineer Dispatch segments. The Technical Job and Intellectual Property Lease segment offers technical personnel focused on machinery design and development, electrical and electronic design, and software development expertise. The General Worker and Engineer Dispatch segment provides general workers and engineers to manufacturing companies including support services from the development stage to manufacturing process. The company was founded on August 16, 1996 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:58', '2019-09-27 07:24:58', 1, 1),
