(923, 1, 'Kaidi Ecological & Environmental Technology Co. Ltd. A (000939)', 4, 26, 47, '-', 'https://www.china-kaidi.com/', 'Kaidi Ecological & Environmental Technology Co., Ltd. engages in the development and application of environmental protection solutions and power engineering technologies. It focuses on biomass generation including wind power and hydropower clean energy platform. It operates biological power plant using forestry and agricultural residues for environmental protection. The company was founded on February 26, 1993 and is headquartered in Wuhan, China.', '2019-09-27 07:24:59', '2019-09-27 07:24:59', 1, 1),
(924, 1, 'Karnimata Cold Storage Ltd. (537784)', 4, 26, 105, '-', 'http://www.karnimatacoldstorage.com/', 'Karnimata Cold Storage Ltd. engages in the provision of cold storage facilities to local potato farmers and traders. Its activities also include trading of agricultural commodities. The company was founded on April 29, 2011 and is headquartered in West Bengal, India.', '2019-09-27 07:24:59', '2019-09-27 07:24:59', 1, 1),
(925, 1, 'Kawanishi Warehouse Co. Ltd. (9322)', 4, 26, 114, '-', 'http://www.kawanishi.co.jp/', 'Kawanishi Warehouse Co., Ltd. engages in the warehousing and transportation business. It operates through the following segments: Domestic Distribution, International Distribution, and Others. The Domestic Distribution segment deals with the warehousing and cargo handling, harbor transport, forwarding, customs clearing, and value processing within Japan. The International Distribution segment engages in the overseas multimodal transport operations, import and export cargo handling, and international operations. The Others segment includes real estate leasing and distribution material sales. The company was founded in June 1903 and is headquartered in Kobe, Japan.', '2019-09-27 07:24:59', '2019-09-27 07:24:59', 1, 1),
(926, 1, 'Kawasaki Geological Engineering Co. Ltd. (4673)', 4, 26, 114, '-', 'http://www.kge.co.jp/', 'Kawasaki Geological Engineering Co., Ltd. engages in the business of geological and soil surveys for environment. Its services include disaster prevention and marine surveys, as well as survey-related business activities, such as the measurement, designing and construction businesses. It offers ground and environment services comprising environmental prediction and evaluation, survey on soil and groundwater contamination, inline multi CT survey, dynamic 2D FEM analysis services; and marine survey services, such as seismic reflection survey, 3D seismic survey, PWC acoustic sounding, and ocean bottom seismograph services. The company was founded on July 22, 1943 and is headquartered in Tokyo, Japan.', '2019-09-27 07:24:59', '2019-09-27 07:24:59', 1, 1),
(927, 1, 'Kawase Computer Supplies Co. Ltd. (7851)', 4, 26, 114, '-', 'https://www.kc-s.co.jp/', 'Kawase Computer Supplies Co., Ltd. engages in the provision of data printing services. It operates through the following segments: Business Forms and Information Processing. The Business Forms segment deals with plate making, printing from design and in house business form production. The Information Processing segment covers consignment data editing and processing, and ink jet and high speed full color printing. The company was founded on May 21, 1955 and is headquartered in Osaka, Japan.', '2019-09-27 07:24:59', '2019-09-27 07:24:59', 1, 1),
