(943, 1, 'Kingsmen Creatives Ltd. (5MZ)', 4, 26, 210, '-', 'http://www.kingsmen-int.com/', 'Kingsmen Creatives Ltd. is an investment holding company that engages in the provision of corporate marketing and other related services. It operates through the following business segments: Exhibitions & Museums; Retail & Corporate Interiors; Research & Design; Alternative Marketing; and Corporate & Others. The Exhibitions & Museums segment produces exhibition displays as well as thematic and scenic display of theme parks. The Retail & Corporate Interiors segment provides interior fitting-out services. The Research & Design segment comprises of design works for upmarket specialty stores, department stores, eateries, museums, centers for visitors, corporate offices, showrooms, trade shows, events, promotional functions, and festivals. The Alternative Marketing segment consists of event management, branding consultancy services, and custom publishing. The Corporate & Others segment relates to group-level corporate services. The company was founded by Chin Sim Ong and Siak Poh Soh in 1976 and is headquartered in Singapore.', '2019-09-27 07:25:00', '2019-09-27 07:25:00', 1, 1),
