(945, 1, 'Kita Koudensha Corp. (1734)', 4, 26, 114, '-', 'http://www.kitakoudensha.co.jp/', 'Kita Koudensha Corp. engages in the purchase and sale of industrial equipment as well as factory automation (FA) housing environment equipment. Its operations are carried out through the following segments: Indoor Wiring Construction, Electric Power-Related Construction, FA Housing Environment Equipment, and Industrial Equipment. The Indoor Wiring Construction segment includes building electrical facility construction works and installation works for water and sewerage system and various industrial machinery plants. The Electric Power-Related Construction segment consists of construction works on electric supply, power substation, underground lines, air conditioning, and telecommunications; and regeneration of storage battery. The FA Housing Environment Equipment segment deals with the sale and brokerage of standard machine equipment, building electric power equipment, environment equipment and facilities, and electronic and electrical equipment. The Industrial Equipment segment handles the sale and brokerage of electric power facilities, generator cars, electric wires and pipe materials, and telecommunication systems. The company was founded by Kunitaro Hirota in March 1910 and is headquartered in Sapporo, Japan.', '2019-09-27 07:25:00', '2019-09-27 07:25:00', 1, 1),
