(1006, 1, 'Lycopodium Ltd. (LYL)', 4, 26, 13, '-', 'http://www.lycopodium.com.au/', 'Lycopodium Ltd. provides engineering consulting services to the mining, metallurgical, and manufacturing industries. It operates its business through the following segments: Corporate Services, Minerals, Project Services and Process Industries. The Corporate Services segment consists of managerial, legal and technical services. The Minerals segment consists of engineering and related services provided to the extractive mining industry. The Project Services segment involves in the provision of commissioning services, project and construction management to the extractive mining industry in Africa. The Process Industries segment offers engineering and related services provided to the manufacturing and renewable energy facilities throughout Australia and South East Asia. The company was founded in 1992 and is headquartered in East Perth, Australia.', '2019-09-27 07:25:05', '2019-09-27 07:25:05', 1, 1),
