(1031, 1, 'Master Ad PCL (MACO)', 4, 26, 231, '-', 'https://www.masterad.com/', 'Master Ad Public Co. Ltd. engages in the business of advertising, leasing of property, and purchase or sale of electronic billboards. The firm also provides out-of-home advertising solution as well as consultancy, planning, and production. It offers include billboard, street furniture, transit, made to order, event, new media, and overseas. The company was founded by Noppadon Tansalarak, Phichet Maneeratanaporn, and Tawat Meeprasertskul on February 18, 1988 and is headquartered in Bangkok, Thailand.', '2019-09-27 07:25:08', '2019-09-27 07:25:08', 1, 1),
