(1033, 1, 'Matching Maximize Solution PCL (MATCH)', 4, 26, 231, '-', 'http://matchinggroup.com/en', 'Matching Maximize Solution Public Co. Ltd engages in the production of television commercials and films as well ass operation of advertising agencies. Together with its subsidiaries, it operates through the following businesses: Television program production, TV commercial production, Equipment Rental Services, Event Organizing, Printing and Post production. The TV program production products programs and broadcast it in the airtime slots bought from the TV channels and sells commercial timeslots to advertising agencies or product owners. The TV commercial production business coordinates and provides services for foreign crews to facilitate filming or shooting activities set in Thailand. The Equipment Rental Services business provides rental equipment for filming, shooting, producing dramas and producing TV commercials as well as supplying skillful personnel. The Event Organizing business plans public relation activities as well as managing events for clients both from state and private sectors. The Printing business produces printing media, magazines and pocket books, both for sale and free. The Post production provides post production services for various kinds of films, all kinds of media as well as relevant businesses. It also engages in Thai film production and management. The company was founded by Thanitsaphong Sasinmanop and Somchai Cheewasutthanon on October 27, 1992 and is headquartered in Bangkok, Thailand.', '2019-09-27 07:25:08', '2019-09-27 07:25:08', 1, 1),
