(1134, 1, 'Mystar Engineering Corp. (4695)', 4, 26, 114, '-', 'http://www.mystar.co.jp/', 'Mystar Engineering Corp. engages in maintaining and engineering of semiconductors manufacturing equipment, various mechatronics devices, and construction facilities. It operates through the following segments: Mechatronics-Related Business, Facility-Related Business, and Contents Service Business. The Mechatronics-Related Business segment deals with the design, production, and maintenance of semiconductor and LCD manufacturing equipment, electronic medical devices, and industrial machineries. It also provides engineers including recruitment and skill training services. The Facility-Related Business segment offers total management services for buildings such as shopping centers and hotels. The Contents Service Business segment handles operational and management services for studio halls. It also provides technical support for broadcasting, maintenance services of equipment for broadcasting, and producing digital contents. The company was founded in February 1969 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:18', '2019-09-27 07:25:18', 1, 1),
