(1182, 1, 'Nextware Ltd. (4814)', 4, 26, 114, '-', 'https://www.nextware.co.jp/', 'Nextware Ltd. engages in the computer system design and software development business. It offers consulting, design, development, operation, and maintenance of computer systems. The company was founded on June 1, 1990 and is headquartered in Osaka, Japan.', '2019-09-27 07:25:22', '2019-09-27 07:25:22', 1, 1),
