(1184, 1, 'Nexyz.Group Corp. (4346)', 4, 26, 114, '-', 'https://www.nexyzgroup.jp/', 'Nexyz.Group Corp. engages in the provision of broadband, information, and communications technology services. It operates through the Energy and Environment-related Business and Electronic Media Business segments. The Energy and Environment-related Business segment sells LED lighting fixtures and manages LED light rental services. The Electronic Media Business segment provides sales promotions, advertising, and consulting services. The company was founded in May 1987 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:22', '2019-09-27 07:25:22', 1, 1),
