(1186, 1, 'NICE Total Cash Management Co. Ltd. (063570)', 4, 26, 217, '-', 'http://www.nicetcm.co.kr/front/main.act', 'NICE Total Cash Management Co., Ltd. engages in the provision of automated teller machine (ATM) related services. It operates through the following business areas: ATM Management, Cash Dispenser Value Added Network (CD VAN), Cash Logistics, Financial Derivative, Card VAN and POS, Kiosk, and Smart Parking. The ATM Management business offers automatic teller machines management services. The CD VAN business provides cash dispenser machines in places such as subways, convenience stores, and terminals. The Cash Logistics business offers cash storage and management services. The Video Surveillance System business provides video monitoring services. It also engages in the unattended parking business. The company was founded on January 11, 2000 and is headquartered in Seoul, South Korea.', '2019-09-27 07:25:22', '2019-09-27 07:25:22', 1, 1),
(1187, 1, 'NichiiGakkan Co. (9792)', 4, 26, 114, '-', 'https://www.nichiigakkan.co.jp/', 'NICHIIGAKKAN CO., LTD. engages in the provision of medical and healthcare services. It operates through the following business segments: Medical, Nursing, Health Care, Education and Other. The Medical segment offers services in medical fee billing, accounting, computer, nursery and medical records management, sterilization, disinfection and sale of medical equipment. The Nursing segment gives home nursing (care plan creation), day care, specific facility (nursing home), dementia cohabitation support (group home), handicapped welfare, visiting nursing and bathing services. It also manages nursery schools and sells and rents out equipment used for welfare. The Health Care segment sells health care products and provides housekeeping, catering, and nursing personnel services. The Education segment gives maternity helper, nursing staff induction and care worker trainings. It also offers medical office courses and English courses. The Other segment involves with data processing; storage and delivery service; publication and sale of books; production and sale of flowers, ornamental plants, seeds and saplings; leasing; personnel service and operation; and management of tourist facilities. The company was founded in December 1968 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:22', '2019-09-27 07:25:22', 1, 1),
