(1189, 1, 'NIIT Ltd. (500304)', 4, 26, 105, '-', 'https://www.niit.com/indonesia/', 'NIIT Ltd. engages in the provision of education and training services. It offers group corporate learning group, skills, careers, and school learning. The company was founded by Rajendra Singh Pawar, Parappil Rajendran and Vijay Kumar Thadani on December 2, 1981 and is headquartered in Gurgaon, India.', '2019-09-27 07:25:22', '2019-09-27 07:25:22', 1, 1),
(1190, 1, 'Nimbus Projects Ltd. (511714)', 4, 26, 105, '-', 'http://www.nimbusprojectsltd.com/', '-', '2019-09-27 07:25:22', '2019-09-27 07:25:22', 1, 1),
(1191, 1, 'Nippon Manufacturing Service Corp. (2162)', 4, 26, 114, '-', 'http://www.n-ms.co.jp/', 'nms Holdings Corp. operates as a holding company which provides group business administration and management services to its subsidiaries engaged in the human resource solutions, electronics manufacturing and power supply business. Its operations are carried out through the following divisions: Human Resource Solution, Electronics Manufacturing Service (EMS), Vision (neo EMS) and Power Supply. The Human Resource Solution division provides human resources solutions for manufacturing, engineer dispatch, repairs and customer services. The EMS division provides electronic devices such as earth-friendly energy-saving home electric appliances and automobile, digitalized amusement devices, and automated and labor-saving devices in production facilities. The Vision (neo EMS) division provides repair, development, distribution, design, substrate mounting and product assembly services to the customers. The Power Supply division engages in the development and manufacturing of various power supply products to suit customer requirements. The company was founded in September 1985 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:23', '2019-09-27 07:25:23', 1, 1),
(1192, 1, 'Nippon Pallet Pool Co. Ltd. (4690)', 4, 26, 114, '-', 'https://www.npp-web.co.jp/', 'Nippon Pallet Pool Co., Ltd. engages in the provision of pallet pool systems. It provides wood pallets, plastic pallets, roll boxes, and other equipment used in cargo handling and transportation. The company was founded on May 13, 1972 and is headquartered in Osaka, Japan.', '2019-09-27 07:25:23', '2019-09-27 07:25:23', 1, 1),
(1193, 1, 'Nippon Parking Development Co. Ltd. (2353)', 4, 26, 114, '-', 'http://www.n-p-d.co.jp/index.php', 'Nippon Parking Development Co., Ltd. engages in the parking lot business. It operates through the following segments: Domestic and Oversea Parking Lot, Ski Resort, Theme park and Others. The Domestic and Oversea Parking Lot segment handles the operation and management of parking lots, leasing car, management business, VA service and car sharing business. Ski Resort segment acquires and operates ski resorts. The Theme park segment manages amusement park and villa facilities. The Others segment includes provide quality education and planning travel businesses. The company was founded in December 1991 and is headquartered in Osaka, Japan.', '2019-09-27 07:25:23', '2019-09-27 07:25:23', 1, 1),
(1194, 1, 'Nippon Ski Resort Development Co. Ltd. (6040)', 4, 26, 114, '-', 'https://www.nippon-ski.jp/', 'Nippon Ski Resort Development Co., Ltd. engages in the management and operation of ski resorts, and relevant facilities and services. Its operations are carried out through the following divisions: Technical Support, Business Support, Retail Business Support and Others. The Technical Support division engages in the provision of maintenance services for cableway facilities, snow grooming vehicle, and artificial snow facilities. The Business Support division engages in the provision of sales promotions; introduction of new services; and existing service improvement services. The Retail Business Support division engages in the provision of delivery of products, price setting and operation services. The Others division offers finance, risk management and succession services to the business. The company was founded on December 22, 2005 and is headquartered in Kitaazumi-gun, Japan.', '2019-09-27 07:25:23', '2019-09-27 07:25:23', 1, 1),
(1195, 1, 'NJS Co. Ltd. (2325)', 4, 26, 114, '-', 'https://www.njs.co.jp/', 'NJS Co., Ltd. engages in the planning and supervision of water supply, sewerage, river, agricultural drainage, wastewater treatment, raw sewerage and waste treatment facilities. It operates through the following business divisions: Water Supply Systems, Sewerage Systems, Storm Water Drainage System and River Environmental Conservation, Solid Waste Management and Environmental Systems Development, Asset Management, Risk Management and Others. The Water Supply Systems division provides technologies and services needed for building safe and stable water supply systems. The Sewerage Systems division protects the regional environment and assure safety. The Storm Water Drainage System and River Environmental Conservation division prevents flooding ad create a rich environment. The Solid Waste Management and Environmental Systems Development division provides the proper solid waste disposal is an essential factor in sanitation and sustaining the environment. The Asset Management division provides water supply and sewerage facilities deteriorate with age causing performance decline, malfunctions and accidents. The Risk Management division engages in the water supply or sewerage system service outages have a serious impact on urban functions and the environment. The Others segment deals with real estate property leasing business. The company was founded on September 3, 1951 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:23', '2019-09-27 07:25:23', 1, 1),
