(1199, 1, 'Nohmi Bosai Ltd. (6744)', 4, 26, 114, '-', 'https://www.nohmi.co.jp/', 'Nohmi Bosai Ltd. engages in the provision of fire protection systems and integrated fire protection services. It operates through the following segments: Fire Alarm Systems, Fire Extinguishing Systems, and Maintenance Services. The Fire Alarm Systems segment develops automatic fire alarm, fire doors, smoke control, and environmental monitoring systems. The Fire Extinguishing Systems segment offers sprinkler and foam systems, and fire protection equipment for large-scale buildings and facilities. The Maintenance Services segment ensures safety by offering maintenance and inspection services such as online monitoring, repair, and telephone support services. The company was founded by Teruichi Nohmi in December 1916 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:23', '2019-09-27 07:25:23', 1, 1),
(1200, 1, 'Nomura Co. Ltd. (9716)', 4, 26, 114, '-', 'https://www.nomurakougei.co.jp/', 'NOMURA Co., Ltd. engages in the research, consulting, planning, design, creation, and construction of facilities that attract visitors. It operates through the Display Business and Food-Drink Sales Business segments. The Display Business segment provides displays to retail shops, restaurants, department stores, and commercial facilities. The Food-Drink Sales Business segment operates food and beverages shops and souvenir shops. The company was founded on March 15, 1892, and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:24', '2019-09-27 07:25:24', 1, 1),
