(1206, 1, 'Novatti Group Ltd. (NOV)', 4, 26, 13, '-', 'http://www.novatti.com/', 'Novatti Group Ltd. provides software technology and systems integration services. The company operates through three segments: Novatti Platform, Transaction Services and Novatti Group Limited. The Novatti Platform segment incorporates enterprise sales and maintenance and support through the Novatti Platform. The Transaction Services segment incorporates Flexewallet Pty Ltd, Pty Ltd and Flexe Payments Ltd. The Novatti Group Limited segment is the legal parent that holds the financial assets for the group. Its products include consumer digital wallet, electronic top up, mobile money, bill payments, remittance services, electronic voucher distribution, voucher management systems. The company was founded on June 19, 2015 and is headquartered in Melbourne, Australia.', '2019-09-27 07:25:24', '2019-09-27 07:25:24', 1, 1),
