(1208, 1, 'Nozaki Insatsu Shigyo Co. Ltd. (7919)', 4, 26, 114, '-', 'https://www.nozakiinsatu.co.jp/', 'Nozaki Insatsu Shigyo Co., Ltd. engages in the printing business. Its operations are carried out through the following business divisions: Commercial Printing, Packaging Materials and Paper Products, Information Equipment and Supplies, and Others. The Commercial Printing division offers posters, catalogs, pamphlets, calendars, direct mail, and high-quality art printing products. The Packaging Materials and Paper Products division handles wrapping paper, paper bags, paper articles, and business forms. The Information Equipment and Supplies division deals with bar code printers, full color card printers, tags, labels, and seals. The Others division includes carry bags and ticket pouches. The company was founded by Moshichi Nozaki in 1868 and is headquartered in Kyoto, Japan.', '2019-09-27 07:25:25', '2019-09-27 07:25:25', 1, 1),
