(1226, 1, 'One to One Contacts PCL (OTO)', 4, 26, 231, '-', 'http://www.onetoonecontacts.com/', 'One to One Contacts PCL engages in the provision of contact center services which includes advice, design, placement, and installation of contact center systems. It operates through the The Outsourced Contact Center Services and System Maintenance; and Turnkey Total Solutions. The Outsourced Contact Center Services and System Maintenance segment provides fully outsourced contact center management; customer service representative outsourcing; and contact center facility outsourcing service. The Turnkey Total Solutions segment offers telemarketing management, customer service academy, hosted solutions, and business process outsourcing. The company was founded on August 7, 2000 and is headquartered in Pak Kret, Thailand.', '2019-09-27 07:25:26', '2019-09-27 07:25:26', 1, 1),
