(1231, 1, 'oOh!Media Ltd. (OML)', 4, 26, 13, '-', 'https://www.oohmedia.com.au/', 'oOh!media Ltd. is an out of home and online media company. Its portfolio of location-based media solutions include large format classic and digital roadside screens; large and small format classic and digital signs located in retail precincts, such as shopping centers; large and small format classic and digital signs in airport terminals and lounges; and classic & digital signs in high dwell time environments, such as cafes, pubs, universities, office buildings, gyms and sporting centers. The company also offers online sites for students, flyers, small businesses and city-based audiences; and owns a native content production company and digital printing operations. oOh!media was founded by Brendon Jon Cook in 1989 and is headquartered in North Sydney, Australia.', '2019-09-27 07:25:27', '2019-09-27 07:25:27', 1, 1),
