(1235, 1, 'Opt Holding Inc. (2389)', 4, 26, 114, '-', 'https://www.optholding.co.jp/', 'OPT Holding, Inc. engages in the strategy planning and management of its group companies that provides electronic marketing services. It operates through the following segments: Marketing, Investment Development, Overseas, and Others. It operates through the following segments: Marketing, Investment Development, Overseas, and Others. The Marketing segment includes advertising and solution business, and database business. The Investment Development segment covers internet related venture company investments. The Overseas segment handles advertising services in Korea and Taiwan, as well as data collection in United States of America. The Others segment covers social and consumer business that deals with E-commerce business, social applications and mobile contents'' planning and development, and Web and Information Technology trainings. The company was founded by Noboru Hachimine in 1993 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:27', '2019-09-27 07:25:27', 1, 1),
