(1237, 1, 'Optimus Finance Ltd. (531254)', 4, 26, 105, '-', '-', 'Optimus Finance Ltd. engages in the provision of non-banking financial services. It operates through the Financing and Investing Activity; and Trading in Chemical segments. It provides loan and investment services. Through its subsidiary, it import and export lubricant oils such as base oils and other chemical products for the automobile, power, and metal manufacturing industries. The company was founded on February 11, 1991 and is headquartered in Vadodara, India.', '2019-09-27 07:25:27', '2019-09-27 07:25:27', 1, 1),
