(1242, 1, 'Orbitech Co. Ltd. (046120)', 4, 26, 217, '-', 'http://www.kndt.co.kr/', 'Orbitech Co., Ltd. engages in the provision of radiation management radioactive waste disposal, and environment analysis instruments. Its businesses include Nuclear Energy, Aerospace, Environment, Non-Destructive Testing and In-Service-Inspection (ISI). The Nuclear Energy business provides radiation management services such as radiation protection, decontamination, radioactive wastes management for various facilities such as nuclear power plants, nuclear fuel processing facilities, laboratories and hospitals. The Aerospace Business offers bulkhead assembly and precision machined parts. The Environment business include process development business which manufactures crystallizer system and design of crystallizer separation process; and analysis business which performs environmental waste analysis services for soil, water, asbestos, marine waste, environmental radiation, polychlorinated biphenyls and cosmetics. The Non-Destructive Testing business provides services for gas pipes, oil pipes, power plants, ships, bridges, buildings, vessel and tanks. The ISI business offers services such as in-service inspection services for steam generator tubes, pipes, components, structures and reactor vessel, nondestructive examination and analysis service for penetration pipe of reactor upper head, visual inspection service for the penetration pipe of upper and lower reactor head, lancing service on the secondary side of steam generator and eddy current examination service for the control rods of wasting house and condenser tubes. The company was founded on March 5, 1991 and is headquartered in Seoul, South Korea.', '2019-09-27 07:25:28', '2019-09-27 07:25:28', 1, 1),
