(1245, 1, 'Oricom Inc. (010470)', 4, 26, 217, '-', 'http://www.oricom.com/main/index.jsp', 'Oricom Co., Ltd. engages in the manufacture, sale of advertisement materials. It operates through the Advertisement and Magazine business divisions. Its products and services include advertising agency, advertisement design, build-transfer-lease service, magazine, and others. The company was founded on February 24, 1975 and is headquartered in Seoul, South Korea.', '2019-09-27 07:25:28', '2019-09-27 07:25:28', 1, 1),
(1246, 1, 'Original Engineering Consultants Co. Ltd. (4642)', 4, 26, 114, '-', 'http://www.oec-solution.co.jp/', 'Original Engineering Consultants Co., Ltd. engages in the provision of engineering consultation services specializing in the fields of water supply, sewerage works, sanitation and solid waste treatment. It operates through the following divisions: Construction Consultant and Information Processing. The Construction Consultant division involves research, planning, implementation design and construction supervision of water sewerage. It also covers the seismic work and design for buildings and structures. The Information Processing division covers urban facilities information management, software development, and the system management support and commission of facility design. The company was founded by Osamu Suga on January 23, 1962 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:28', '2019-09-27 07:25:28', 1, 1),
