(1252, 1, 'Outsourcing Inc. (2427)', 4, 26, 114, '-', 'http://www.outsourcing.co.jp/', 'OUTSOURCING, Inc. engages in the business of outsourcing services. It operates through the following business segments: Manufacture Outsourcing Business, Engineering Outsourcing Business, Administrative Outsourcing Business, Recruitment and Placement Business, Overseas Business, and Other Business. The Manufacture Outsourcing Business segment is involved in the provision of manufacturing technologies and management know-how to manufacturers in the areas of electric and electronic equipment, transportation equipment, food, chemical and drugs, as well as metals. The Engineering Outsourcing Business segment offers services in the IT(Information Technology) and telecommunications sector. The Administrative Outsourcing Business segment performs labor management and re-employment assistance. The Recruitment and Placement Business segment recruits employees for the company and the subsidiaries. The Overseas Business segment handles human resource services. The Other Business segment develops, manufactures, and sells automotive parts. The company was founded by Haruhiko Doi on January 6, 1997 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:29', '2019-09-27 07:25:29', 1, 1),
