(1255, 1, 'PA Co. Ltd. (4766)', 4, 26, 114, '-', 'http://www.pa-co-ltd.co.jp/', 'PA Co., Ltd. engages in the personnel dispatching and advertising business. It operates through the following segments: Information Service Business, Personnel Dispatch Business, Daycare Business, and Others. The Information Service Business segment includes job postings in magazine and smart phone viewable Shop Post Web, newspaper inserts, sales promotion via Keitai Tokupi, and management of media devise job site Jobee. The Personnel Dispatch Business segment provides staffing services. The Daycare segment offers daycare services in Fukushima, Kanagawa, Miyagi, and Tochigi prefectures. The Others segment includes employment agency and leasing guarantee businesses in Vietnam. The company was founded in June 1986 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:29', '2019-09-27 07:25:29', 1, 1),
