(1258, 1, 'Palma Co. Ltd. (3461)', 4, 26, 114, '-', 'http://www.palma.jp/', 'Palma Co., Ltd. provides business consulting and outsourcing services for the self storage business system. Its services include market research and analysis; self storage development; and representing overseas investors and operators through its consulting services business. It also offers outsourcing services for handling application; agreement and eligibility check; rent collection; rent guarantee; delinquent rent management; onsite self storage management; vacating delinquent unit; IT services (portal site and unit inventory control systems); and marketing and promotions. The company was founded on December 27, 1969 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:29', '2019-09-27 07:25:29', 1, 1),
