(1264, 1, 'Pasco Corp. (9232)', 4, 26, 114, '-', 'http://www.pasco.co.jp/', 'Pasco Corp. engages in the provision of geospatial information system services. Its operations are carried out through the Domestic Services and Global Services segments. The Domestic Services segment includes Domestic Public Sector, which provides support for administrative operations in the national and local government agencies; and Domestic Private Sector, which provides system services using geospatial information to various industries including retail, logistics, manufacturing, transportation, and finance. The Global Services segment deals with the development of national land data infrastructure, map maintenance for social infrastructure, and consulting services for developing and emerging countries. The company was founded on July 15, 1949 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:30', '2019-09-27 07:25:30', 1, 1),
(1265, 1, 'Pasona Group Inc. (2168)', 4, 26, 114, '-', 'https://www.pasonagroup.co.jp/', 'Pasona Group Inc. engages in the formulation of strategies for group management, support operation execution, in charge of management and proper allocation of management resources, and development of new businesses related to job creation. It operates through the following segments: Human Resource (HR) Solutions and Others. The Human Resource Solutions segment includes the independent work systems (temporary staffing), in-sourcing (contracting), HR consulting, education and training, global sourcing (overseas), career solutions (placement/recruiting, outplacement) and outsourcing businesses. The Others segment offers life solutions, public solutions, and shared services. The company was founded on February 16, 1976 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:30', '2019-09-27 07:25:30', 1, 1),
