(1267, 1, 'Pasukhas Group Bhd (PASUKGB)', 4, 26, 136, '-', 'http://www.pasukhasgroup.com/', 'Pasukhas Group Bhd. provides mechanical and electrical engineering services. The company operates through following segments: M&E Engineering Services, Manufacturing of LV Switchboard, Trading, Renewable Energy, Rental Property, and Property Development. The M&E Engineering Services segment provides water treatment and sewerage industry, palm oil and sugar mills and refineries, and other factories. The Manufacturing of LV Switchboard segment involves in the sub-distribution for the generation, transmission, distribution, and conversion of electric energy and for the control of equipment that consume electric energy. The Trading segment includes trading of a variety of goods without any particular specialization. The Renewable Energy segment supplies electricity. The Rental Property segment generates income from investment properties. The Property Development segment consists of civil engineering and construction. Pasukhas Group was founded on March 29, 2005 and is headquartered in Seri Kembangan, Malaysia.', '2019-09-27 07:25:30', '2019-09-27 07:25:30', 1, 1),
(1268, 1, 'Paul Merchants Ltd. (539113)', 4, 26, 105, '-', 'http://www.paulmerchants.net/', 'Paul Merchants Ltd. engages in the provision of money transfer services and operation of a travel agency. It also offers financial services, forex, international money transfer, entertainment industry; as well as distribution of telecommunication services, tours, travels and holidays packages, and air ticketing. The company was founded on July 13, 1984 and is headquartered in Chandigarh, India.', '2019-09-27 07:25:30', '2019-09-27 07:25:30', 1, 1),
(1269, 1, 'Paxys Inc. (PAX)', 4, 26, 185, '-', 'http://www.paxys.com/', 'Paxys, Inc. is an investment holding company, which engages in the provision of general transcription, proofreading, data conversion, contact center, and back office outsourcing services. It operates through the following segment: Data Conversion and Others. The Data Conversion segment includes data transcription and scoping services, voice-to-screen message conversion, and electronic data encoding and processing. The Others segment includes holding and investments, which consists of the parent company and Paxys N.V., and the financial information of the non-operating subsidiaries. The company was founded on February 14, 1952 and is headquartered in Makati, Philippines.', '2019-09-27 07:25:30', '2019-09-27 07:25:30', 1, 1),
