(1300, 1, 'PIXTA Inc. (3416)', 4, 26, 114, '-', 'https://www.pixta.co.jp/', 'PIXTA, Inc. operates as a holding company that provides an online creative platform. It operates a marketplace of stock photos, illustrations, vectors, and videos. The firm''s platform is sourced by contributors such as stock photo agencies, photographers, illustrators, and videographers. Its images are used for creative projects including advertisements, web design, publications, and television programs. The company was founded by Daisuke Komata on August 25, 2005 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:33', '2019-09-27 07:25:33', 1, 1),
(1301, 1, 'PJBumi Bhd (PJBUMI)', 4, 26, 136, '-', 'http://www.pjbumi.com.my/', 'PJBumi Bhd. is an investment holding company, which engages in the provision of engineering, procurement, and construction services. It operates through the following segments: Manufacturing; Construction, Maintenance, and Design; Waste Management Services; and Investment. The Manufacturing segment manufactures Fibre Reinforced Plastic (FRP); Reinforced Concrete Sewerage Treatment Plants (STP); and Underground Storage Tanks (UST). The Construction, Maintenance, and Design segment offers construction, maintenance, after-sales support services, and design of FRP, STP, and UST. The Waste Management Services segment covers solid waste management, garbage collection, area cleaning, dump processing, and other related activities. The Investment segment provides investment holding and management services. The company was founded on July 2, 1985 and is headquartered in Shah Alam, Malaysia.', '2019-09-27 07:25:33', '2019-09-27 07:25:33', 1, 1),
(1302, 1, 'Plan B Media PCL (PLANB)', 4, 26, 231, '-', 'https://www.planbmedia.co.th/', 'The company engages in the provision of media services; and consultation on media planning and marketing and content development. It operates through the Advertising Media and Engagement Marketing segments. The Advertising Media segment comprises of production, advertising space, and air time rental services. The Engagement Marketing segment involves the management of the BNK48 members and administration of the benefit contracts with Football Association of Thailand. Its business categories include transit, digital, in-store, online, classic, mall, and airport media. The company was founded by Palin Lojanagosin on March 11, 2005 and is headquartered in Bangkok, Thailand.', '2019-09-27 07:25:33', '2019-09-27 07:25:33', 1, 1),
