(1320, 1, 'PPS International (Holdings) Ltd. (8201)', 4, 26, 102, '-', 'https://www.hkpps.com.hk/', 'PPS International (Holdings) Ltd. is an investment holding company, which engages in the provision of environmental services in Hong Kong. It provide services to commercial and residential buildings, shopping malls, hotels and serviced apartments, public transportation, government properties and facilities, and private clubs. The company operates through the following business segments: Environmental & Cleaning, Investment, and Money Lending. The Environmental & Cleaning segment engages in the provision of environmental and cleaning services in Hong Kong and Shanghai, the People''s Republic of China. The Investment segment invests in financial assets. The Money Lending segment includes money lending business in Hong Kong. PPS International was founded on May 31, 2012 and is headquartered in Hong Kong.', '2019-09-27 07:25:35', '2019-09-27 07:25:35', 1, 1),
(1321, 1, 'PR Times Inc. (3922)', 4, 26, 114, '-', 'http://prtimes.co.jp/', 'PR TIMES Inc. engages in the business of news wire services. It provides announcement of new products, services, events, and campaign announcements. Its services include public relations (PR) planning and media promote, press release delivery, blog and SNS marketing, measurement of PR effectiveness, PR support applications, and digital creation. The company was founded on December 26, 2005 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:35', '2019-09-27 07:25:35', 1, 1),
(1322, 1, 'Praemium Ltd. (PPS)', 4, 26, 13, '-', 'https://www.praemium.com/intl/', 'Praemium Ltd. is engaged in the business of providing investment portfolio technology for portfolio management services. Its technology & services include WealthCraft CRM, V-Wrap portfolio, Administration, SMSF compliance & V-Wrap Forms. The company provides services to accountants, financial advisors, stockbrokers, self-managed superannuation fund administrators and large institutions. Praemium was founded by Arthur Naoumidis on October, 2001 and is headquartered in Melbourne, Australia.', '2019-09-27 07:25:35', '2019-09-27 07:25:35', 1, 1),
(1323, 1, 'Prakit Holdings PCL (PRAKIT)', 4, 26, 231, '-', 'http://www.prakit.com/', 'Prakit Holdings Public Co. Ltd. engages in advertising production, media agency, investing business, and provides management services. It operates through the following segments: Advertising Production, Medis Agency, and Investing Business. The company was founded in 1986 and is headquartered in Bangkok, Thailand.', '2019-09-27 07:25:35', '2019-09-27 07:25:35', 1, 1),
