(1329, 1, 'Pressman Advertising Ltd. (509077)', 4, 26, 105, '-', 'http://www.pressmanadvertising.in/', 'Pressman Advertising Ltd. engages in the provision of advertising and public relations services. Its services include advertising, media planning and buying, market research, public relations, design, and digital services. The company was founded by H. C. Suchanti on February 20, 1970 and is headquartered in Kolkata, India.', '2019-09-27 07:25:35', '2019-09-27 07:25:35', 1, 1),
(1330, 1, 'Prestariang Bhd (PRESBHD)', 4, 26, 136, '-', 'https://www.prestariang.com.my/', 'Prestariang Bhd. is an investment holding company, which engages in the provision of education, training and certification and software license distribution services. It operates through the following segments: Information & Communications Technology (ICT), Concession, Education and Employment Services. The Information and Communications Technology (ICT) segment provides basic and professional ICT training and certification encompassing instructor-led courses and certification examination at the end of the course. The Concession segment delivers solution for the integrated and comprehensive core immigration system includes design, customize, install, configure, test, commission and maintain throughout the concession period. The Education segment offers year foundation studies, degrees, and final year postgraduate masters in pure computer studies programme. The Employment Services segment provide facilities for foreign workers'' recruitment and document services. Prestariang was founded in 2003 and is headquartered in Kuala Lumpur, Malaysia.', '2019-09-27 07:25:35', '2019-09-27 07:25:35', 1, 1),
(1331, 1, 'Prestige International Inc. (4290)', 4, 26, 114, '-', 'http://www.prestigein.com/', 'Prestige International, Inc. engages in the provision of business process outsourcing (BPO) services. It offers the following solutions: Roadside Assistance, Property Assistance, Insurance BPO, Warranty, Information Technology (IT) Solutions, Customer Support, and Temporary Worker or Other. The Roadside Assistance solution covers roadside assistance for nonlife insurance companies and auto industry 24/7 accident response and support. The Property Assistance solution provides home assistance for condominium developers, real estate management and agency companies, and parking assistance for parking operators. The Insurance BPO solution includes claim handling services and health care program. The Warranty solution deals with extended warranties for automobiles, rent guarantees, household equipment warranties, nursing care expense guarantees, and healthcare expense guarantees. The IT solution comprises of supply chain management, IT, and mobile solutions. The Customer Support solution covers customer relationship management services, 24/7 accident response and support and foreign currency based credit card issuing. The Temporary Worker or Other solution deals with temporary staffing, education and training, and nursing care. It operates through the following segments: Japan, Americas and Europe, and Asia and Oceania. The company was founded on October 30, 1986 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:35', '2019-09-27 07:25:35', 1, 1),
