(1346, 1, 'Progressive Impact Corp. Bhd (PICORP)', 4, 26, 136, '-', 'http://www.picorp.com.my/', 'Progressive Impact Corp. Bhd. operates as an investment holding company, which engages in the provision of management and administrative services. It operates through the following business segments: Environmental Consultancy Services & Monitoring Services, Laboratory Testing Services, Waster Management Engineering and Other. The Environmental Consultancy Services segment provides environmental related services. The Laboratory Testing Services & Monitoring Services segment offers chemical testing, consultancy service, and other services of similar nature. The Waster Management Engineering segment involves sewerage and solid waste management systems. The Other segment includes results of the company and investment holding activities. Progressive Impact was founded by Zaid bin Abdullah on August 27, 1990 and is headquartered in Shah Alam, Malaysia.', '2019-09-27 07:25:37', '2019-09-27 07:25:37', 1, 1),
