(1348, 1, 'Pronexus Inc. (7893)', 4, 26, 114, '-', 'https://www.pronexus.co.jp/', 'Pronexus Inc. engages in the provision of corporate disclosure and investor relation support services. Its products are categorized into the following divisions: Listed Company Disclosure, Listed Company Investor Relations (IR), Financial Instruments Disclosure, and Database. The Listed Company Disclosure division provides legal disclosure documents and content production support for listed companies. The Listed Company IR division handles IR tools, content production, production support, and disclosure translation services for listed companies. It also includes paid seminars, consulting services, and support for overseas Japanese companies. The Financial Instruments Disclosure division manages legal disclosure documents, promotion tools production, and production support for investment trusts and real estate investment trust management companies. The Database division includes company information and database for financial information search and legal information retrieval. The company was founded on December 15, 1930 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:37', '2019-09-27 07:25:37', 1, 1),
