(1351, 1, 'Proto Corp. (4298)', 4, 26, 114, '-', 'https://www.proto-g.co.jp/', 'Proto Corp. engages in the provision of automobile and lifestyle-related information through magazines, internet, mobile, and other media. It operates through the following segments: Automobile-related Information, Lifestyle-related Information, Real Estate, and Others. The Automobile-related Information segment offers information on new cars, used cars, parts, accessories, and other automobile-related concerns. The Lifestyle-related Information segment provides goods and information services in the elderly care, social welfare, culture, recruitment, leisure, and recycling industries. The Real Estate segment is involved in the management and maintenance of rental properties. The Others segment deals with business process outsourcing services. The company was founded by Hiroichi Yokoyama in October 1977 and is headquartered in Nagoya, Japan.', '2019-09-27 07:25:37', '2019-09-27 07:25:37', 1, 1),
