(1356, 1, 'Pureprofile Ltd. (PPL)', 4, 26, 13, '-', 'https://www.pureprofile.com/', 'Pureprofile Ltd. engages in provision of online marketing solutions through a platform available in self-service and managed services options. It operates through the Data Insights and Programmatic Media segments. The Data and Insights segment conducts market research and providing research technology platforms. The Programmatic Media segment buys and sell online advertising inventory on behalf of advertisers and publishers. The company was founded by Paul Chan in 2000 and is headquartered in Sydney, Australia.', '2019-09-27 07:25:38', '2019-09-27 07:25:38', 1, 1),
