(1363, 1, 'QANTM Intellectual Property Ltd. (QIP)', 4, 26, 13, '-', 'http://qantmip.com/', 'Qantm Intellectual Property Ltd. is a holding company, which engages in the operation of companies offering intellectual property services. It creates, protects, commercialises, enforces, and manages intellectual property rights. The company was founded on May 17, 2016 and is headquartered in Victoria, Australia.', '2019-09-27 07:25:38', '2019-09-27 07:25:38', 1, 1),
