(1366, 1, 'QMS Media Ltd. (QMS)', 4, 26, 13, '-', 'https://www.qmsmedia.com/', 'QMS Media Ltd. engages in the provision of advertising services. It offers outdoor advertising solutions such as landmark digital billboards, static billboards, retail, street furniture, and transit. The company was founded in 2014 and is headquartered in South Melbourne, Australia.', '2019-09-27 07:25:38', '2019-09-27 07:25:38', 1, 1),
(1367, 1, 'Qualitech PCL (QLT)', 4, 26, 231, '-', 'https://qualitechplc.com/', 'Qualitech PCL engages in the provision of non-destructive testing services, engineering inspection, and certification services. The non-destructive testing services refers to the the method of finding defects or malfunctions in the object without causing any damage to them such as radiography, ultrasonic, magnetic particle, dye and liquid penetrant test, and other advanced tests. The inspection and certification services is a continuous or add-on process from the Non-Destructive Testing by using different testing methods, including non-destructive testing, to inspect objects and evaluate as well as issuing reports certifying the serviceability of the tested samples with a conclusion to ensure the suitability for usage such a inspection and certification pursuant to the laws for liquefied petroleum gas and natural gas vehicle tanks, piping, boilers, fixed tanks oil storage tanks, and fuel. It also offers quality control services to various industries including petrochemicals, oil and gas as well as power generation, as well as inspection and testing services to steel structure during construction, manufacturing, online service and, plant shutdown. The company was founded on February 11, 1991 and is headquartered in Rayong, Thailand.', '2019-09-27 07:25:38', '2019-09-27 07:25:38', 1, 1),
(1368, 1, 'Qualitech PCL NVDR (QLT-R)', 4, 26, 231, '-', 'https://qualitechplc.com/', 'Qualitech PCL engages in the provision of non-destructive testing services, engineering inspection, and certification services. The non-destructive testing services refers to the the method of finding defects or malfunctions in the object without causing any damage to them such as radiography, ultrasonic, magnetic particle, dye and liquid penetrant test, and other advanced tests. The inspection and certification services is a continuous or add-on process from the Non-Destructive Testing by using different testing methods, including non-destructive testing, to inspect objects and evaluate as well as issuing reports certifying the serviceability of the tested samples with a conclusion to ensure the suitability for usage such a inspection and certification pursuant to the laws for liquefied petroleum gas and natural gas vehicle tanks, piping, boilers, fixed tanks oil storage tanks, and fuel. It also offers quality control services to various industries including petrochemicals, oil and gas as well as power generation, as well as inspection and testing services to steel structure during construction, manufacturing, online service and, plant shutdown. The company was founded on February 11, 1991 and is headquartered in Rayong, Thailand.', '2019-09-27 07:25:39', '2019-09-27 07:25:39', 1, 1),
