(1370, 1, 'Quess Corp. Ltd. (539978)', 4, 26, 105, '-', 'https://www.quesscorp.com/', 'Quess Corp. Ltd. is a holding company, which engages in the provision of staffing, recruitment, and human resource services. It operates through the following business segments: Global Technology Solutions, Industrials, Integrated Facilities Management, People and Services, and Internet Business. The Global Technology Solutions provides information technology staffing. The People and Services segment offers staffing services and solutions including general staffing, recruitment and executive search, recruitment process outsourcing, and payroll, compliance, and background verification services. The Integrated Facilities Management segment involves integrated facility management solutions to corporate and other organizations. The Industrial Asset Management segment deals with industrial operations and maintenance services, and related asset record maintenance services under the Hofincons brand. The Internet segment refers to the provision of recruitment solutions. The company was founded on September 19, 2007 and is headquartered in Bengaluru, India.', '2019-09-27 07:25:39', '2019-09-27 07:25:39', 1, 1),
