(1372, 1, 'Quick Co. Ltd. (4318)', 4, 26, 114, '-', 'http://www.919.jp/', 'Quick Co., Ltd. engages in the business of advertising, personnel and labor consulting services. It operates through the following business segments: Recruiting, Human Resources Services, Information Publishing, Internet-Related and Overseas Business. The Recruiting segment provides advertising agency services for recruitment advertising, organizational consultancy, education and training and development services. The Human Resources Services handles recruitment, staffing, placement dispatching services, and business contracting. The Information Publishing segment deals with the publication of local information magazines, and planning, development and operation of online products. The Internet -Related segment operates Nihon no Jinjibu website, which helps companies to solve personnel issues. The Overseas Business segment provides personnel placement, temporary staffing and personnel and labor consulting services to local Japanese companies. The company was founded by Tsutomu Wan on September 19, 1980 and is headquartered in Osaka, Japan.', '2019-09-27 07:25:39', '2019-09-27 07:25:39', 1, 1),
