(1383, 1, 'Ray Corp. (4317)', 4, 26, 114, '-', 'http://www.ray.co.jp/', 'Ray Corp. engages in the management of its group companies that provide advertising and technical solutions for television (TV) commercial messages and sales promotions. It operates through the following segments: Advertising Solutions and Technical Solutions. The Advertising Solutions segment deals with the planning and production of campaigns, events, exhibitions, and TV commercials. The Technical Solutions segment offers production and video processing technology services that made use of digital video equipment. The company was founded in June 1980 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:40', '2019-09-27 07:25:40', 1, 1),
