(1387, 1, 'Realord Group Holdings Ltd. (1196)', 4, 26, 102, '-', 'http://www.realord.com/', 'Realord Group Holdings Ltd. is an investment company, which engages in the provision of printing and packaging services. It operates through the following segments: Commercial Printing, Hangtag, Motor Vehicle Parts, Financial Services, Trading and Property Investment. The Commercial Printing segment includes digital and financial printing activities. The Hangtag segment manufactures and trades labels, shirt paper boards, hangtags, and plastic bags. The Motor Vehicle Parts segment markets and sells motor parts and accessories. The Financial Services segment deals with margin financing and securities brokerage services. The Trading segment distributes and sells electronic products and computer components. The Property Investment segment includes investments in properties. The company was founded in 1962 and is headquartered in Hong Kong.', '2019-09-27 07:25:40', '2019-09-27 07:25:40', 1, 1),
(1388, 1, 'Recruit Holdings Co. Ltd. (6098)', 4, 26, 114, '-', 'https://recruit-holdings.co.jp/', 'Recruit Holdings Co., Ltd. provides integrated human resource services. It operates through the following business segments: Human Resources (HR) Technology Services, Media and Solutions, and Staffing. The HR Technology Services segment deals with overseas HR recruitment through the job search engine site "Indeed.com". The Media and Solutions segment offers HR and marketing solutions. The Staffing segment provides domestic and overseas staffing services. The company was founded on March 31, 1960 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:40', '2019-09-27 07:25:40', 1, 1),
