(1395, 1, 'Refinverse Inc. (6531)', 4, 26, 114, '-', 'http://www.r-inverse.com/', 'Refinverse, Inc. engages in waste recycling business. It operates through the Recycled Resin Manufacturing and Sales Business and Industrial Waste Treatment Business segments. The Recycled Resin Manufacturing and Sales Business segment offers disposal of used carpet tiles, which are the raw materials for recycled resin. The Industrial Waste Treatment Business segment provides recycling, collection, and transportation of industrial wastes. The company was founded by Akira Ochi on December 25, 2003 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:41', '2019-09-27 07:25:41', 1, 1),
