(1400, 1, 'Relia Inc. (4708)', 4, 26, 114, '-', 'http://www.relia-group.com/', 'Relia, Inc. provides business process outsourcing services. It operates through the following segments: Consultation and Analytics Services, Contact Center Services, Back Office Services, Field Operation Services, Digital Marketing Services and Overseas Services. The Consultation and Analytics Services segment provides comprehensive consultation that covers from designing strategy to operation for direct communication enterprises and customers. The Contact Center Services segment provides wide range of solutions through installation of new technologies and enhancement of global structure. The Back Office Services segment provides one-stop back office operation services from documents sorting, error checks, data entry, to shipping, delivery of materials to customers. The Field Operation Services segment offers field operations and store-front and in-store customer services. The Digital Marketing Services segment provides customer support, optimizing and integrating various channels as websites, emails, chats, calls, and direct mails. The Overseas Services segment provides CRM (Customer Relationship Management)services to client companies for each country including Japan. The company was founded in June 1987 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:41', '2019-09-27 07:25:41', 1, 1),
