(1503, 1, 'Shenzhen Selen Science & Technology Co. Ltd. (002341)', 4, 26, 47, '-', 'http://www.szselen.com/', 'Shenzhen Selen Science & Technology Co., Ltd. engages in the research, development, and manufacture of clean-room consumables and adhesive tapes. Its business scope includes electronic functional materials, new composite materials, clean-room engineering, and clean-room consumables industries. The electronic functional materials business offers high purification protective films, double-sided tapes, functional adhesive tapes and thin films, optical adhesive tapes, and cooling graphite sheets. The new composite materials business provides new energy material products such as lithium battery package materials and aramid fiber materials. The clean-room engineering business involves in the provision of electronic industry clean-room solutions, medical or food industry clean-room solutions, and laboratory system solutions. The company was founded by Yi Hou on December 25, 2002 and is headquartered in Shenzhen, China.', '2019-09-27 07:25:54', '2019-09-27 07:25:54', 1, 1),
(1504, 1, 'Shifang Holding Ltd. (1831)', 4, 26, 102, '-', 'http://www.shifangholding.com/', 'ShiFang Holding Ltd. is an investment holding company, which engages in the business of publishing and advertising. It also offers barter transaction; online services; and marketing, consulting, and printing services. The company was founded on December 9, 2009 and is headquartered in Fuzhou, China.', '2019-09-27 07:25:54', '2019-09-27 07:25:54', 1, 1),
(1505, 1, 'Shin Pro Maint Inc. (6086)', 4, 26, 114, '-', 'http://www.shin-pro.com/', 'Shin Maint Holdings Co., Ltd. engages in the provision of kitchen facilities and equipment maintenance services. It operates through the following business divisions: Emergency Maintenance Services, Preventive Maintenance Services, and Maintenance Outsourcing. The Emergency Maintenance Services division offers support for problems with kitchen, electrical, lighting, water and drainage sanitation, and air-conditioning equipment. The Preventive Maintenance Services division provides air conditionings, exhaust fans, drainage pipes, grease trap cleaning; water tank and pump inspection and maintenance; and periodic inspection services. The Maintenance Outsourcing division offers after service support from kitchen equipment manufacturers; and maintenance service support from service providing companies. It also provides the import, export and sale of furniture. The company was founded by Hideo Naito on August 23, 1985 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:54', '2019-09-27 07:25:54', 1, 1),
(1506, 1, 'Shivkrupa Machineries & Engineering Services Ltd. (539359)', 4, 26, 105, '-', '-', '-', '2019-09-27 07:25:54', '2019-09-27 07:25:54', 1, 1),
(1507, 1, 'SHL-Japan Ltd. (4327)', 4, 26, 114, '-', 'http://www.shl.co.jp/', 'SHL-Japan Ltd. engages in the provision of personnel assessment services. It sells sustainability tests that measure individual differences and organizational climate; provides methods for measuring personnel competency; and conducts trainings and skill evaluations. The company was founded by Yuzo Shimizu on December 22, 1987 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:54', '2019-09-27 07:25:54', 1, 1),
(1508, 1, 'Showcase-TV Inc. (3909)', 4, 26, 114, '-', 'https://www.showcase-tv.com/', 'Showcase-TV, Inc. engages in the web marketing services. Its operations are carried out through the following business segments: E-Marketing, Data-Marketing and Web Solutions. The E-Marketing segment provides eight internally developed web-based software products which are supported by global patents. The Data-Marketing segment provides advertising products business-2-business in connection with website optimization techniques and a data management platform (DMP). The Web Solutions segment provides research and development for smart phone applications, which helps to solve problems with website and apps in an integrated manner using website optimization techniques. It also includes store coupon delivery application development, real estate website creation and e-commerce website management. The company was founded by Masahiro Mori and Toyoshi Nagata on February 1, 1996 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:55', '2019-09-27 07:25:55', 1, 1),
(1509, 1, 'Shreejal Info Hubs Ltd. (506874)', 4, 26, 105, '-', '-', 'Shreejal Info Hubs Ltd. engages in information vending publicity business. The company was founded on September 17, 1962 and is headquartered in Mumbai, India.', '2019-09-27 07:25:55', '2019-09-27 07:25:55', 1, 1),
(1510, 1, 'SIGMAXYZ Inc. (6088)', 4, 26, 114, '-', 'https://www.sigmaxyz.com/', 'SIGMAXYZ Inc. engages in the provision of project management and consulting services such as business consulting, system consulting, digital transformation consulting and organization innovation consulting. It offers strategic planning, new business development, business reform, mergers and acquisitions advisory services, security, and systems development. The company was founded on May 9, 2008 and is headquartered in Tokyo, Japan.', '2019-09-27 07:25:55', '2019-09-27 07:25:55', 1, 1),
(1511, 1, 'Sigong Tech Co. Ltd. (020710)', 4, 26, 217, '-', 'http://www.sigongtech.co.kr/', 'Sigong Tech Co., Ltd. engages in the exhibition business. It operates through the following business segments: Exhibition and Service. The Exhibition segment provides exhibitions and cultural facilities such as museum, memorial, science museum, public relations center and cultural heritage preservation systems. The Service segment provides exhibitions planning services. The company was founded on February 19, 1988 and is headquartered in Seongnam, South Korea.', '2019-09-27 07:25:55', '2019-09-27 07:25:55', 1, 1),
(1512, 1, 'Sika Interplant Systems Ltd. (523606)', 4, 26, 105, '-', 'http://www.sikaglobal.com/', 'Sika Interplant Systems Ltd. is an engineering company. The company engages in the business of manufacturing and rendering of services in engineering products, projects and designs for aerospace, space, marine and automotive industries. It also offers customers design, development, precision manufacturing, assembly, certification, supply and integration of systems and implementation of projects. The company was founded in 1965 and is headquartered in Bangalore, India.', '2019-09-27 07:25:56', '2019-09-27 07:25:56', 1, 1),
(1513, 1, 'SILC Sejours Internationaux Linguistiques et Culturels (MLSIL)', 4, 26, 78, '-', '-', '-', '2019-09-27 07:25:56', '2019-09-27 07:25:56', 1, 1),
(1514, 1, 'Silver Chef Ltd. (SIV)', 4, 26, 13, '-', 'https://www.silverchef.com.au/', 'Silver Chef Ltd. engages in the provision of rental and financing of commercial equipment to small and medium sized businesses. It operates through the Hospitality and GoGetta segments. The Hospitality segment offers equipment rental finance predominantly to the hospitality industry including, coffee shops, takeaway stores, independently owned restaurants, and franchises. The GoGetta provides equipment rental finance to other industries such as transport, light commercial vehicle, and light construction sectors. The company was founded by Allan John English in 1986 and is headquartered in West End, Australia.', '2019-09-27 07:25:56', '2019-09-27 07:25:56', 1, 1),
(1515, 1, 'Simei Media Co. Ltd. (002712)', 4, 26, 47, '-', 'http://www.simei.cc/', 'Simei Media Co., Ltd. engages in the provision of media services. It offers services such as media planning & agency, brand management, outdoor advertising, digital marketing, content marketing, and strategy research, through the following brands: ProVision Media Network, BC&T Boundless Creations & Talents, EYoung Outdoors, Simei Digital and E-Action. The company was founded on August 9, 2000 and is headquartered in Hangzhou, China.', '2019-09-27 07:25:56', '2019-09-27 07:25:56', 1, 1),
