(1518, 1, 'Sims Metal Management Ltd. (SGM)', 4, 26, 13, '-', 'https://www.simsmm.com/', 'Sims Metal Management Ltd. engages in the recycling of metal and electronics. It operates though the following segments: North America Metals (NAM), ANZ Metals (ANZ), Europe Metals (Europe), Global E-Recycling (SRS), and Unallocated. The NAM segment comprises of subsidiaries and joint ventures in the U.S. and Canada which perform ferrous and non-ferrous secondary recycling functions. The ANZ segment includes subsidiaries and joint arrangements in Australia, New Zealand and Papua New Guinea which perform ferrous and non-ferrous secondary recycling functions. The Europe segment consists of subsidiaries in the United Kingdom which perform ferrous and non-ferrous secondary recycling functions. The SRS segment composes of subsidiaries which provide electronic recycling solutions in the following countries: Australia, Austria, Belgium, Canada, Czech Republic, Dubai, Germany, India, Ireland, Netherlands, New Zealand, Norway, Poland, Republic of South Africa, Singapore, Sweden, the United Kingdom and the U.S. The Unallocated segment contains unallocated corporate costs, interests in an associate and joint venture in Hong Kong and Australia, and the group''s non-ferrous central marketing entity. The company was founded by Albert George Sims in 1917 and is headquartered in Rye, NY.', '2019-09-27 07:25:57', '2019-09-27 07:25:57', 1, 1),
(1519, 1, 'Sims Metal Management Ltd. ADR (SMSMY)', 4, 26, 250, '-', '-', '-', '2019-09-27 07:25:57', '2019-09-27 07:25:57', 1, 1),
(1520, 1, 'SingAsia Holdings Ltd. (8293)', 4, 26, 102, '-', 'http://www.singasia.com.sg/', 'SingAsia Holdings Ltd., engages in the provision of manpower services. It operates through the following segments: Manpower Outsourcing Services, Manpower Recruitment Services and Manpower Training Services. Its clients include the hotel and resort, retail, and food and beverage sectors. The company was founded by Sim Hak Chor on November 12, 2015 and is headquartered in Singapore.', '2019-09-27 07:25:57', '2019-09-27 07:25:57', 1, 1),
