(1523, 1, 'SinoMedia Holding Ltd. (0623)', 4, 26, 102, '-', 'http://www.sinomedia.com.hk/', 'SinoMedia Holding Ltd. is an investment company, which engages in investment in the field of advertisement. It provides television advertisement (TV), creative content production, and digital marketing services for advertisers and advertising agents. The company operates through the TV Advertising & Content Operations; and Digital Marketing and Internet Media segments. SinoMedia Holding was founded by Jin Lan Liu in 1999 and is headquartered in Shanghai, China.', '2019-09-27 07:25:57', '2019-09-27 07:25:57', 1, 1),
(1524, 1, 'SINOPEC Engineering (Group) Co. Ltd. (2386)', 4, 26, 102, '-', 'http://www.segroup.cn/segroup/', 'SINOPEC Engineering (Group) Co., Ltd. is a holding company, which engages in the oil refining and chemical industries. It operates through the following segments: Engineering, Consulting and Licensing; EPC Contracting; Construction; and Equipment Manufacturing. The Engineering, Consulting and Licensing segment includes research and development, feasibility studies, and compliance services. The EPC Contracting segment offers engineering, construction, and project management services. The Construction segment provides infrastructure services such as oil and gas storage, pipelines transportation, expansion, repair and maintenance, and large equipment lifting. The Equipment Manufacturing segment designs and develops oil refining equipment and provides spare parts for chemical facilities. The company was founded July 24, 2007 and is headquartered in Beijing, China.', '2019-09-27 07:25:57', '2019-09-27 07:25:57', 1, 1),
