(1526, 1, 'Site Group International Ltd. (SIT)', 4, 26, 13, '-', 'https://www.site.edu.au/home/', 'Site Group International Ltd. is an Australia based vocational training company. The company operates through following business segments: Site Skills Training-Domestic, Site Skills Training-International, Energy Services and Tertiary Education. The Site Skills Training-Domestic segment delivers vocational training and assessment services through five training facilities. The Site Skills Training-International segment operates at Clark Freeport Zone in the Philippines and also incorporates site workready being the recruitment and assessment division for international clients. The Energy Services segment refers to the establishment of energy training and services delivered to the Oil and Gas industry. The Tertiary Education segment delivers diploma level courses. Site Group International was founded by Michael David Bonello in 1976 and is headquartered in Brisbane, Australia.', '2019-09-27 07:25:58', '2019-09-27 07:25:58', 1, 1),
