(1532, 1, 'Smartgroup Corp. Ltd. (SIQ)', 4, 26, 13, '-', 'https://www.smartgroup.com.au/', 'Smartgroup Corp. Ltd. engages in the provision of employee benefits and workforce optimization services. It operates through the following segments: Outsourced Administration; Vehicle Services; and Software, Distribution and Group Services (SDGS). The Outsourced Administration segment includes salary packaging administration, novated leasing, and share plan administration. The Vehicle Services segment provides end-to-end fleet management services. The SDGS segment offers salary packaging software solutions, distribution of vehicle insurances, and information technology services. The company was founded in 1999 and is headquartered in Sydney, Australia.', '2019-09-27 07:25:59', '2019-09-27 07:25:59', 1, 1),
