(1548, 1, 'Solution Engineering Holdings Bhd (SOLUTN)', 4, 26, 136, '-', 'http://www.solution.com.my/', 'Solution Engineering Holdings Bhd. manufactures equipment''s for engineering education, research and technical and vocational training. It engages in the designing and development of equipment for bio lubricant project and for engineering education and research and provision of training and curriculum content development. The company operates through the following segments: Engineering Education and Research, Provision of Industrial Automation Services, Investment and Others. The Engineering Education and Research segment designs and develops equipment for engineering education and research and provision of training and curriculum content development. The Provision of industrial Automation Services segment engages in providing integration solutions for telemetry, Supervisory Control and Data Acquisition (SCADA), instrumentation and control systems. The Investment segment invests unit trust and money market funds. The Others segment provides provision for industrial automation services, and production and supply of industrial bio-lubricants. Solution Engineering Holdings was founded on June 1, 2004 and is headquartered in Puchong, Malaysia.', '2019-09-27 07:26:02', '2019-09-27 07:26:02', 1, 1),
