(1550, 1, 'So-Net Media Networks Corp. (6185)', 4, 26, 114, '-', 'https://www.so-netmedia.jp/', 'So-net Media Networks Corp. engages in the marketing technology business that offers data and system solutions. Its main services include Ad Technology,Demand Side Platform (DSP), Affiliates, and Media Planning. The Ad Technology offers marketing solutions through its following products: VALIS-Engine, Logicad and VALIS-cockpit. The Affiliates offers SCAN service that limits advertising to a carefully selected media thus maximizing advertiser return on investment. The Media Planning offers PubMatic service, a supply side platform that manages and operates impressions or placements. The company was founded on March 21, 2000 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:02', '2019-09-27 07:26:02', 1, 1),
