(1557, 1, 'Spearhead Integrated Marketing Communication Group (300071)', 4, 26, 47, '-', 'http://www.spearhead.com.cn/', 'Spearhead Integrated Marketing Communication Group engages in the provision of digital integrated marketing. It operates through the following business integration segments: Experiential Marketing, Public Relations Advertising, Digital Marketing, Content Marketing, and Big Data Marketing. The Experiential Marketing provides services through the collection of consumer behavior data for consumer insight and consumer portraits, to achieve more accurate experience in marketing services. The Public Relations Advertising provides brand creativity, brand marketing management consulting services, traditional and digital public relations services, and media communication services. The Digital Marketing provides network marketing and e-business services. The Content Marketing provides movie star broker, performing, intellectual property rights management, media communication, and social media marketing. The Big Data Marketing provides precision marketing, effect marketing, and programmatic purchase services. The company was founded in 2003 and is headquartered in Beijing, China.', '2019-09-27 07:26:03', '2019-09-27 07:26:03', 1, 1),
