(1564, 1, 'S-Pool Inc. (2471)', 4, 26, 114, '-', 'https://www.spool.co.jp/', 'S-Pool, Inc. engages in the provision of business outsourcing services and human resource solutions. It operates through the Business Solutions and Human Resources Solutions segments. The Business Solutions segment offers logistics, sales promotion outsourcing services and farm management business associated with the service and employment of people with disabilities support services. The Human Resources Solutions segment provides staffing and dispatching services for sales and office support operations. The company was founded on December 1, 1999 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:03', '2019-09-27 07:26:03', 1, 1),
(1565, 1, 'Spotless Group Holdings Ltd. (SPO)', 4, 26, 13, '-', 'https://www.spotless.com/', 'Spotless Group Holdings Ltd. operates as a holding company, which provides outsourced facility services, laundry and linen services in Australia and New Zealand. The company serves in customer sectors including health, education and government, commercial and leisure. It operates through the following segments; Facility Services and Laundries Services. The Facility Services segment provides multi-faceted facilities management, cleaning, and catering and food services to a range of industries across Australia and New Zealand. The Laundry Services segment provides linen and uniform laundry services to a broad range of customers across Australia and New Zealand. The company was founded by Ian Godfrey McMullin in 1946 and is headquartered in Melbourne, Australia.', '2019-09-27 07:26:03', '2019-09-27 07:26:03', 1, 1),
