(1574, 1, 'StarGroup Ltd. (STL)', 4, 26, 13, '-', 'http://www.starpaymentsystems.com.au/', 'StarGroup Ltd. engages in the integrated banking technology business. It specializes in designing, manufacturing, sale and operating of automatic teller machines (ATMs) and other banking equipment. The company offers back office settlement, intelligence cash handling, and coin deposit solutions, recycling automated teller machines (ATMs), and cash redemption solutions. The company was founded on December 23, 1993 and is headquartered in Perth, Australia.', '2019-09-27 07:26:04', '2019-09-27 07:26:04', 1, 1),
