(1591, 1, 'Sugimura Warehouse Co. Ltd. (9307)', 4, 26, 114, '-', 'http://www.sugimura-wh.co.jp/', 'Sugimura Warehouse Co., Ltd. engages in the logistics and warehousing businesses. It operates through the following segments: Logistics, Real Estate, and Others. The Logistics segment provides warehouse storage, cargo handling and car transportation. The Real Estate segment leases and rents out land, residential buildings, and parking lots. The Others segment includes management of golf course and selling of electricity. The company was founded by Shotaro Sugimura in October 1895 and is headquartered in Osaka, Japan.', '2019-09-27 07:26:05', '2019-09-27 07:26:05', 1, 1),
(1592, 1, 'Sunny Friend Environmental Technology Co. Ltd. (8341)', 4, 26, 228, '-', 'http://www.sunnyfriend.com.tw/', 'Sunny Friend Environmental Technology Co., Ltd. engages in the clearing, processing, and landfill of industrial waste. It also involves in construction and operation of government incineration plant. Its business includes incineration of bio-medical waste; sterilization of bio-medical waste treatment; resources recycling; writing and consultation of institution environmental pollution prevention and control plan; generation operating of waste incineration facility; operation of industrial district sewage treatment plant; design, planning, and construction of small incinerator; contract to build the buried plant or incineration plant; engineering consultancy or technical services on government plans; and consultancy on relevant environmental laws. The company was founded on November 29, 1994 and is headquartered in Yunlin, Taiwan.', '2019-09-27 07:26:05', '2019-09-27 07:26:05', 1, 1),
(1593, 1, 'Sunny Side Up Inc. (2180)', 4, 26, 114, '-', 'http://www.ssu.co.jp/', 'SUNNY SIDE UP, Inc. engages in the provision of corporate marketing services. Its operations are carried out through the following segments: Marketing Communications, Sales Promotions (SP) and Merchandising (MD), Sports, Bills Restaurant, and Development. The Marketing Communications segment provides total marketing communication support including promotion, digital marketing, and creation of casting based advertisements. The SP and MD segment offers shop-front promotions and planning and manufacturing of products. The Sports segment handles sports promotions. The Bills Restaurant segment manages restaurants that offer all-day dining. The Development segment includes development initiatives in Do Sports and human resources. The company was founded on July 1, 1985 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:06', '2019-09-27 07:26:06', 1, 1),
