(1601, 1, 'Synergis Holdings Ltd. (2340)', 4, 26, 102, '-', 'http://www.synergis.com.hk/html/en/', 'Synergis Holdings Ltd. engages in the provision of property and facility management services. It operates through the following segments: Property and Facility Management Services in Hong Kong, Property and Facility Management Services in Mainland China, Ancillary Business, and Interiors and Special Projects. The Ancillary Business segment comprises security, cleaning, laundry, procurement, and maintenance contracting. The company was founded in 1978 and is headquartered in Hong Kong.', '2019-09-27 07:26:06', '2019-09-27 07:26:06', 1, 1),
(1602, 1, 'Syngene International Ltd. (EQSYNGENE)', 4, 26, 105, '-', 'https://www.syngeneintl.com/', 'Syngene International Ltd. operates as a contract research organization, which provides discovery and development services for novel molecular entities. Its services include discovery chemistry, discovery biology, safety assessment, large molecule development, chemical development, formulation development, stability studies, polymer research, integrated discovery and development, and clinical development. The company was founded on November 18, 1993 and is headquartered in Bangalore, India.', '2019-09-27 07:26:06', '2019-09-27 07:26:06', 1, 1),
(1603, 1, 'System Location Co. Ltd. (2480)', 4, 26, 114, '-', 'http://www.slc.jp/', 'System Location Co., Ltd. engages in the provision of financial and information technology (IT) services. It offers a platform that utilizes finance technology and IT for automobile-related businesses. The platform deals with car auction, auto financial engineering, and auto lease business support services. The company was founded on April 1, 1968 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:06', '2019-09-27 07:26:06', 1, 1),
(1604, 1, 'T.K.S. Technologies PCL (TKS)', 4, 26, 231, '-', 'http://www.tks.co.th/homepage.asp', 'T.K.S. Technologies Public Co. Ltd. engages in manufacturing of continuous paper forms, securities printing, other printing and continuous labels. The company carries out stationery and office supply. It operates through the following segments: Printing, and Design and Software Development. The company was founded in 1954 and is headquartered in Samut Sakhon, Thailand.', '2019-09-27 07:26:06', '2019-09-27 07:26:06', 1, 1),
