(1606, 1, 'Tac Co. Ltd. (4319)', 4, 26, 114, '-', 'https://www.tac-school.co.jp/', 'TAC Co., Ltd. engages in the provision of individual education and corporate training to university students and corporate employees. It operates through the following segments: Personal Education, Corporate Training, Publishing, and Manpower Business. The Personal Education segment deals with operating preparatory courses for individuals challenging various license exams. The Corporate Training segment provides training programs for acquisition of qualifications, work training for acquisition of specialized knowledge and skills, as well as, various educational materials to corporations, universities, colleges, accountancy firms and other organizations. The Publishing segment segment promotes publishing of textbooks for license qualifications under a dual framework of ''TAC Publishing'' and Waseda Keiei Publishing''s ''W Seminar''. The Manpower Business segment which covers manpower dispatching, manpower placement and job advertisement is assumed by TAC Profession Bank, TAC Medical Office Staffing Co., Ltd., Medical Office Staffing Kansai Co., Ltd. and Kubo Medical Office Support Co., Ltd. The company was founded by Hiroaki Saito on December 10, 1980 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:07', '2019-09-27 07:26:07', 1, 1),
(1607, 1, 'Taisei Co. Ltd. (Fukuoka) (3359)', 4, 26, 114, '-', 'https://www.taisei-wellnet.co.jp/', 'Taisei Co., Ltd. engages in the sale of ingredients and food packaging materials related to confectionery and lunch boxes. It offers business-to-business (BtoB) service for deliveries and manages the site cotta, for making sweets and bread. The company by Seiichi Sato was founded on December 25, 1998 and is headquartered in Tsukumi, Japan.', '2019-09-27 07:26:07', '2019-09-27 07:26:07', 1, 1),
(1608, 1, 'Taiwan Shin Kong Security Co. Ltd. (9925)', 4, 26, 228, '-', 'http://www.sks.com.tw/', 'Taiwan Shin Kong Security Co., Ltd. provides safety and maintenance services for security, fire prevention, and disaster prevention. It operates through the following business segments: Electronic services, Cash delivery, Permanent, and Others. The Electronic services segment provides maintenance services for electronics. The Cash delivery segment provides secure cash transport services. The Permanent segment provides resident security services. The company was founded on January 21, 1980 and is headquartered in Taipei, Taiwan.', '2019-09-27 07:26:07', '2019-09-27 07:26:07', 1, 1),
(1609, 1, 'Takara Printing Co. Ltd. (7921)', 4, 26, 114, '-', 'https://www.takara-print.co.jp/', 'Takara Printing Co., Ltd. engages in the production and sale of printed matterial related to the financial instruments & exchange act, the company law, and investor relations related information. It also operates in the production and handling of legal and IR-related advertisements. The company was founded by Masamichi Nomura on June 15, 1952 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:07', '2019-09-27 07:26:07', 1, 1),
(1610, 1, 'Takeei Corp. (2151)', 4, 26, 114, '-', 'http://www.takeei.co.jp/', 'Takeei Corp. engages in the environmental solutions business. It operates through the following segments: Takeei Corp., Recycle Peer Co., Ltd., Hokuriku Kankyou Service Co., Ltd., Gypro Co., Ltd., Fujicar Manufacturing Co., Ltd., and Others. The Takeei Corp. segment operates treatment processing and recycling of construction wastes; collection, transportation, and the sanitary landfill site. The Recycle Peer Co., Ltd. segment handles processing and recycling of dismantled mixed construction wastes. The Hokuriku Kankyou Service Co., Ltd. segment manages controlled landfill site and recycles waste plastic materials. Gypro Co., Ltd. segment deals with recycling business of waste plaster boards. The Fujicar Manufacturing Co., Ltd. segment manufactures forging machineries. The Others segment covers the businesses of its other group companies. The company was founded on March 7, 1977 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:07', '2019-09-27 07:26:07', 1, 1),
