(1659, 1, 'TKC Corp. (9746)', 4, 26, 114, '-', 'https://www.tkc.jp/', 'TKC Corp. engages in the provision of information processing, software, and consulting services. It operates through the following segments: Accounting Firms, Local Government Units, and Printing. The Accounting Firms segment offers information processing, software and consulting services, and office equipment sales to accounting offices. The Local Government Units segment deals with information processing, software and consulting services, and office equipment sales to government offices. The Printing segment includes printing of computer and general business vouchers, data print-outs, and pamphlets. It also provides the Internet services by the name called TISC (TKC Internet Service Center) which includes Intranet, Internet, cloud computing, database, data storage, data backup, data security and downloaded services. The company was founded by Takeshi Iizuka on October 22, 1966 and is headquartered in Utsunomiya, Japan.', '2019-09-27 07:26:11', '2019-09-27 07:26:11', 1, 1),
(1660, 1, 'Toppan Forms Co. Ltd. (7862)', 4, 26, 114, '-', 'https://www.toppan-f.co.jp/', 'Toppan Forms Co., Ltd. engages in the printing and information solutions businesses. It operates through the following segments: DigitalHybrid Business, Information Technology (IT) Innovation Business, Business Products Business, and Global Business. The DigitalHybrid Business segment offers business forms and digital print services through its EFMS platform, a hybrid business forms operating platform. The IT Innovation Business segment offers payment services, system operation outsourcing, Internet of Things (IoT) and card solutions. The Business Products Business segment includes information processing equipment, proprietary developed products, and office supplies and purchase management systems. The Global Business segment manages global manufacturing and sales. The company was founded in May 1955 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:11', '2019-09-27 07:26:11', 1, 1),
(1661, 1, 'Tosnet Corp. (4754)', 4, 26, 114, '-', 'http://www.tosnet.co.jp/', 'TOSNET Corp. engages in the provision of security services. It operates through the following segments: Security Business, Building Maintenance Business, Mailing Service Business, and Power Supply Business. The Security Business segment includes transportation, facility, and train guard security services. The Building Maintenance Business segment handles the building maintenance and cleaning services. The Mailing Service Business segment manages the mail shipping agency; and sample and promotional item packing and shipping agency business. The Power Supply Business segment provides power supply by demand. The company was founded on March 30, 1977 and is headquartered in Sendai, Japan.', '2019-09-27 07:26:12', '2019-09-27 07:26:12', 1, 1),
