(1664, 1, 'TOW Co. Ltd. (4767)', 4, 26, 114, '-', 'http://www.tow.co.jp/', 'TOW Co., Ltd. engages in the planning, production, development, management, and sales promotion of events. It offers WEB, premium, and printing tool services for government, cultural, sports, inner, public relations, and special events. The company was founded by Osamu Kawamura on July 6,1976 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:12', '2019-09-27 07:26:12', 1, 1),
