(1666, 1, 'Toyo Logistics Co. Ltd. (9306)', 4, 26, 114, '-', 'http://www.toyo-logistics.co.jp/', 'Toyo Logistics Co., Ltd. engages in the provision of distribution services. It operates through the following segments: Domestic Logistics, International Logistics, and Real Estate. The Domestic Logistics segment handles cargo services in Japan which includes storage, transportation, and other auxiliary businesses. The International Logistics segment deals with import, export, international multi-modal transport, customs clearance, and storage. The Real Estate segment provides land and building leasing services. The company was founded on March 13, 1926 and is headquartered in Nagoya, Japan.', '2019-09-27 07:26:12', '2019-09-27 07:26:12', 1, 1),
(1667, 1, 'Toyo Tec Co. Ltd. (9686)', 4, 26, 114, '-', 'https://www.toyo-tec.co.jp/', 'Toyo Tec Co., Ltd. engages in the provision of security and building administration services. It operates through the following segments: Security, Building Management and Real Estate. The Security segment includes security business, contract management, electronic, transport, and facility security. It also includes handling call centers and crime prevention equipment. The Building Management segment provides comprehensive building management services. The Real Estate segment manages real estate for rental property and real estate brokerage. The company was founded on January 5, 1966 and is headquartered in Osaka, Japan.', '2019-09-27 07:26:12', '2019-09-27 07:26:12', 1, 1),
