(1669, 1, 'Tradelink Electronic Commerce Ltd. (0536)', 4, 26, 102, '-', 'https://www.tradelink.com.hk/eng/index.html', 'Tradelink Electronic Commerce Ltd. operates as a provider of e-commerce services. It operates through the following segments: E-commerce, Security Solutions, and Other Services. The E-commerce segments generates income from processing trade-related government documents and business-related documents. The Security Solutions segment provides security products, digital certificates, security solutions and mobile security solutions. The Other Services segment comprises handling fees for the conversion of paper form to electronic messages, income from the provision of technical support and other project services. The company was founded on September 23, 1988 and is headquartered in Hong Kong.', '2019-09-27 07:26:12', '2019-09-27 07:26:12', 1, 1),
