(1671, 1, 'Traffic Technologies Ltd. (TTI)', 4, 26, 13, '-', 'http://www.trafficltd.com.au/', 'Traffic Technologies Ltd. is a traffic solutions company, which provides solutions to the traffic industry. It operates through the following divisions: Technical Products and Signage Division. The Technical Products division engages in the design, manufacture and installation of traffic signals, traffic controllers, portable roadside technology, variable message signs emergency telephones and road lighting. The Signage division manufactures and supplies a complete range of directional and regulatory traffic signs and traffic control products to road traffic authorities, municipal councils and the construction industry. The company was founded in January 2004 and is headquartered in Eltham, Australia.', '2019-09-27 07:26:12', '2019-09-27 07:26:12', 1, 1),
