(1719, 1, 'ValueCommerce Co. Ltd. (2491)', 4, 26, 114, '-', 'https://www.valuecommerce.co.jp/', 'ValueCommerce Co., Ltd. engages in the provision of internet advertising distribution services. It operates through the Affiliate Marketing and E-Commerce (EC) Solution segments. The Affiliate Marketing segment offers advertising services. The EC Solution segment handles StoreMatch pay-per-click advertising on Yahoo! Shopping and proposal-based sales and consulting support to stores for CRM tool, STORE''s R8. The company was founded in March 1996 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:16', '2019-09-27 07:26:16', 1, 1),
(1720, 1, 'Vector Inc. (6058) (6058)', 4, 26, 114, '-', 'https://vectorinc.co.jp/', 'Vector Inc. engages in the public relations (PR) business. It provides the following services: PR planning and implementation, risk management, PR business agency and consulting, marketing research, branding, events planning and implementation, investor relations (IR) communication, social networking site (SNS) communication, casting, and marketing. It operates through the following segments: Press release (PR), News Release Distribution, Video Release Distribution, Direct Marketing, and Others. The PR segment deals with PR consulting services. The News Release Distribution segment provides press release service catering to public listed corporations through PR Times. The Video Release Distribution segment distributes news and earning announcement videos directly to desired audience through an advertising network. The Direct Marketing segment handles the online sale of goods. The Others segment covers the investment businesses. The company was founded by Keiji Nishie on March 30, 1993 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:16', '2019-09-27 07:26:16', 1, 1),
(1721, 1, 'Veerhealth Care Ltd. (511523)', 4, 26, 105, '-', 'http://veerhealthcare.net/', 'Veerhealth Care Ltd. engages in the manufacturing, development and sale of ayurvedic medicines. Its products include tablets, syrups, ointment, powder, oil, and toothpaste. The company was founded on July 10, 1992 and is headquartered in Mumbai, India.', '2019-09-27 07:26:16', '2019-09-27 07:26:16', 1, 1),
