(1739, 1, 'Virinchi Ltd. (532372)', 4, 26, 105, '-', 'http://www.virinchi.com/', 'Virinchi Ltd. engages in the provision of consulting and technology services. The company operates through following segments: Development of Computer Software and Services, Healthcare Services, IT Enabled Services and Infrastructure & Real Estate Services. Its products includes Qfund, enterprise enabler, FairShare, vendor relations enabler, Virinchi TPIA, eTendering, eLogistics, iAcquisto, online auction, eSales, community collaborator, workflow engine, security provider, data mapping and conversion tool, language processor, enterprise messenger, FAME, HMS, Active, Case Trail and TrakPORT. The company was founded by Viswanath Kompella on March 13, 1990 and is headquartered in Hyderabad, India.', '2019-09-27 07:26:18', '2019-09-27 07:26:18', 1, 1),
(1740, 1, 'Virtualex Consulting Inc. (6193)', 4, 26, 114, '-', 'https://www.vx-holdings.com/', 'Virtualex Holdings, Inc. provides the corporate strategy and manages its subsidiaries which engage in information technology (IT), consulting and outsourcing businesses. Its operations are carried out through IT & Consulting Business and Outsourcing Business segments. The IT & Consulting Business segment offers consulting services, Customer Relationship Management (CRM) products and CRM IT services. The Outsourcing Business segment deals with the CRM process services which operates contact centers handling new customer acquisition, advertising, campaign management, marketing data management and reporting, and marketing platform operations. The company was founded by Eiki Maruyama on June 15, 1999 and in headquartered in Tokyo, Japan.', '2019-09-27 07:26:18', '2019-09-27 07:26:18', 1, 1),
