(1763, 1, 'WDB Holdings Co. Ltd. (2475)', 4, 26, 114, '-', 'https://www.wdbhd.co.jp/', 'WDB Holdings Co., Ltd. operates as a holding company which provides the management of its group companies. It operates through the following business divisions: Human Resource Services, CRO (Contract Research Organization) Business, Contract Research and Manufacturing Business, Interaction Business and Group Strategy Support Business. The Human Resource Services business division provide services in the field of physical science and engineering. The CRO business division provides support from basic research to clinical trials in the pharmaceutical, medical, cosmetics, and other industries. The Contract Research and Manufacturing Business division provides custom manufacturing and development services for new materials, such as electronic materials, medical products and cosmetics. The Interaction Business division provides appearance servicers for smartphones and information services through the Internet. The Group Strategy Support Business division supports increased competitiveness of human resource services, CRO business, contract research and manufacturing and Interaction Business by dividing companies among a variety of businesses, encouraging the pursuit of efficiency throughout the organization. The company was founded on July 6, 1985 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:19', '2019-09-27 07:26:19', 1, 1),
(1764, 1, 'Weathernews Inc. (4825)', 4, 26, 114, '-', 'https://global.weathernews.com/', 'Weathernews, Inc. engages in the provision of weather information content services. It offers services for logistics, transportation, distribution and theme parks. It also offers instruments such as WNISAT, tsunami radar, storm radar with sensor, pollen robo, seaman''s eye, and live camera. The company was founded on June 11, 1986 and is headquartered in Chiba, Japan.', '2019-09-27 07:26:20', '2019-09-27 07:26:20', 1, 1),
