(1766, 1, 'Wellco Holdings Corp. (7831)', 4, 26, 114, '-', 'http://www.wellco-corp.com/', 'Wellco Holdings Corp. handles the strategy planning and overall management of its group companies that engages in the provision of printing and marketing services. It operates through the following business segments: Information Printing, Media and Education. The Information Printing segment manufactures and sells commercial printing materials that include advertising materials, direct mail, sales promotional posters, and business forms; and handles planning and production of digital contents. The Media business segment covers publication of community based free information magazine and shipping agency business. The Education business segment handles the sale of picture books with sound, educational toys and plans promotional prizes. The company was founded in April 1974 and is headquartered in Hakusan, Japan.', '2019-09-27 07:26:20', '2019-09-27 07:26:20', 1, 1),
(1767, 1, 'Wellcom Group Ltd. (WLL)', 4, 26, 13, '-', 'https://www.wellcomww.com/', 'Wellcom Group Ltd. provides advertising, marketing content production and management services. The company operates through following segments: Australasia, the United Kingdom and the United States of America. Its services include advertising and marketing content production, design, artwork and retouching; content management, digital photography, television production, digital print and computer to plate production. The company was founded by Wayne William Sidwell in 2000 and is headquartered in Port Melbourne, Australia.', '2019-09-27 07:26:20', '2019-09-27 07:26:20', 1, 1),
(1768, 1, 'Wellnet Corp. (2428)', 4, 26, 114, '-', 'http://www.well-net.jp/', 'Wellnet Corp. engages in the business of settlement authentication services. Its operations are carried out through the following business divisions: Multi-payment Services, Online Business, Electronic Authentication Services, and IT (Information Technology) Solutions. The Multi-payment Services division includes billing issuance and collection, e-billing, and other services. The Online Business division provides pin online sale services and various application services. The Electronic Authentication Service division covers electronic ticket or two-dimensional code in mobile and smart phones. The IT Solutions division offers smart phone applications that enable user to search bus routes and purchase bus tickets. The company was founded in April 1983 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:20', '2019-09-27 07:26:20', 1, 1),
