(1773, 1, 'Will Group Inc. (6089)', 4, 26, 114, '-', 'https://willgroup.co.jp/', 'Will Group, Inc. engages in the human resources business through temporary staffing, outsourcing, and permanent placement. It operates through the following segments: Sales Outsourcing, Call Center Outsourcing, Factory Outsourcing, Care Business Support, and Others. The Sales Outsourcing segment manages staffing and recommendation of sales workforce for consumer electronics stores. The Call Center segment handles professional staffing and recommendation for call centers as well as other contract services. The Factory Outsourcing segment undertakes business contract services; and staffing and recommendation of operating workforce in factories. The Care Business Support segment dispatches and refers caregivers primarily in care facilities. The Others segment offers staffing services focusing on offices, assistant language teachers (ALT), overseas, and recruitment via the Internet. The company was founded on April 3, 2006 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:20', '2019-09-27 07:26:20', 1, 1),
