(1785, 1, 'Wong Fong Industries Ltd. (1A1)', 4, 26, 210, '-', 'http://www.wongfong.com/', 'Wong Fong Industries Ltd. is an investment holding company specializes in business and management consultancy services. It operates through the following segments: Equipment Sales, Repairs and Servicing, Projects, and Training. The Equipment Sales segment offers sales and installation of load handling systems and waste management systems as well as assistive technology and mobility aids, and offers truck-mounted cranes, tailgates, tippers, self-loaders, hookloaders, and portable compactors. The Projects segment provides design, customization, fabrication, and integration services, and manages projects such as customization of special purpose vehicles, defense solutions, and the provision of add-on armour solutions for homeland security and defense use. The Repairs and Servicing segment is the operation of service centres for truck-mounted cranes, hookloaders and tailgates in Singapore. The Training segment offers training courses on the operation of industrial equipment, risk management implementation and supervision of safe lifting operations. The company was founded by Foo Lew and Ah Kuie Liew on January 2, 2015 and is headquartered in Singapore.', '2019-09-27 07:26:21', '2019-09-27 07:26:21', 1, 1),
