(1819, 1, 'YAMADA Consulting Group Co. Ltd. (4792)', 4, 26, 114, '-', 'https://www.yamada-cg.co.jp/', 'YAMADA Consulting Group Co., Ltd. engages in the provision of financial consulting services. It operates through the following business segments: Business Consulting, Real Estate Consulting, Financial Planner (FP) related, and Investment and Fund. The Business Consulting segment includes business revival, operations, and financial consulting. The FP related segment includes marketing course, corporate training, and insurance consulting for financial planners. The Investment and Fund segment includes composition and management of investment partnership and investment business. The company was founded on July 10, 1989 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:24', '2019-09-27 07:26:24', 1, 1),
(1820, 1, 'Yamada Servicer Synthetic Office Co. Ltd. (4351)', 4, 26, 114, '-', 'https://www.yamada-servicer.co.jp/', 'Yamada Servicer Synthetic Office Co., Ltd. engages in disposal of non-performing claims, corporate restructuring, dispatching, and surveying services. Its operations are carried out through the following business segments: Servicer, Dispatch, Real Estate Solution, Surveying, and Others. The Servicer segment offers debt management and collection services. The Dispatch segment handles staffing services of specified workers for judicial scrivener companies and real estate surveyors. The Real Estate Solution segment buys and sells real estate properties. The Surveying segment provides surveying services. The Others segment includes investment business services. The company was founded on October 26, 1981 and is headquartered in Yokohama, Japan.', '2019-09-27 07:26:24', '2019-09-27 07:26:24', 1, 1),
(1821, 1, 'Yamatane Corp. (9305)', 4, 26, 114, '-', 'https://www.yamatane.co.jp/', 'Yamatane Corp. engages in the logistics and food products businesses. It operates through the following segments: Logistics-Related, Food Products-Related, Information-Related, and Real Estate-Related. The Logistics-Related segment includes warehousing, freight forwarding, customs clearance, harbor transportation and freight transport businesses. The Food Products-Related segment sells brown rice and handles its wholesale of staple foods under the law for stabilization of supply, demand and prices of staple food; Import, export and sale of staple foods and foodstuffs. The Information-Related segment offers development, sale and lease of computers and other information equipment. The Real Estate-Related segment engages in the purchase, sale, intermediation, lease and management of real estate. The company was founded by Taneji Yamazaki in July 1924 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:24', '2019-09-27 07:26:24', 1, 1),
(1822, 1, 'Yasuda Logistics Corp. (9324)', 4, 26, 114, '-', 'http://www.yasuda-soko.co.jp/', 'Yasuda Logistics Corp. engages in the business of transportation, logistics, warehousing, customs clearance, and logistics information system services. It operates through the following segments: Logistics and Real Estate. The Logistics segment offers expert logistics services to medical and pharmaceutical companies (drugs, medical equipment, quasi drugs, reagent products, diagnostic drugs, cosmetics, etc.); IT(Information Technology ) equipment logistics, archiving and relocation; and international transportation services. The Real Estate segment provides redevelop communities based on their needs and create comfortable spaces for office buildings as well as houses. The company was founded on December 20, 1919 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:24', '2019-09-27 07:26:24', 1, 1),
(1823, 1, 'Yechiu Metal Recycling (China) Ltd. (601388)', 4, 26, 47, '-', 'http://www.yechiu.com.cn/', 'Yechiu Metal Recycling (China) Ltd. engages in aluminum and scrap recycling business. It operates through the following business divisions: Secondary Aluminum Products and Scrap Metal. The Secondary Aluminum Products division manufactures and sells recycled aluminum ingot. The Scrap Metal division offers recycled materials from discarded copper, zinc, and cheap aluminum. The company was founded by Huang Chong Sheng on March 15, 2001 and is headquartered in Taicang, China.', '2019-09-27 07:26:24', '2019-09-27 07:26:24', 1, 1),
(1824, 1, 'Yellow Brick Road Holdings Ltd. (YBR)', 4, 26, 13, '-', 'https://www.ybr.com.au/', 'Yellow Brick Road Holdings Ltd. engages in the provision of investment and wealth management, general insurance, accounting, and mortgage broking services. It operates through the following segments: Branch Network, Professional Services, and Other. The company was founded in 2007 and is headquartered in Sydney, Australia.', '2019-09-27 07:26:24', '2019-09-27 07:26:24', 1, 1),
(1825, 1, 'Y-Entec Co. Ltd. (067900)', 4, 26, 217, '-', 'http://www.y-entec.co.kr/', 'Y-Entec Co., Ltd. engages in the provision of waste treatment services. It operates through the following business areas: Environment and Construction, Remicon, and Golf Course. The Environment and Construction business engages in the incineration and reclamation of commercial and industrial wastes. It also engages in construction works. The Remicon business manufactures ready-mixed concrete. The Golf Course business focuses on the operation of golf clubs. The company was founded on August 31, 1990 and is headquartered in Yeosu-si, South Korea.', '2019-09-27 07:26:24', '2019-09-27 07:26:24', 1, 1),
(1826, 1, 'YG PLUS Inc. (037270)', 4, 26, 217, '-', 'http://www.ygplus.com/?ckattempt=1', 'YG PLUS, INC. provides publication and advertising services. It operates through the following business: Advertisement Production and Media Agency. The Advertisement Production business provides advertisements services. The Media Agency business offers publication and broadcasts advertisements through television, radio, newspapers, magazines, billboards and others. The company was founded on November 15, 1996 and is headquartered in Seoul, South Korea.', '2019-09-27 07:26:24', '2019-09-27 07:26:24', 1, 1),
(1827, 1, 'Yin He Holdings Ltd. (8260)', 4, 26, 102, '-', 'TIDAK ADA DATA', '-', '2019-09-27 07:26:24', '2019-09-27 07:26:24', 1, 1),
(1828, 1, 'YOC AG (YOC)', 4, 26, 250, '-', '-', '-', '2019-09-27 07:26:24', '2019-09-27 07:26:24', 1, 1),
(1829, 1, 'Yonker Environmental Protection Co. Ltd. A (300187)', 4, 26, 47, '-', 'http://www.yonker.com.cn/', 'Yonker Environmental Protection Co., Ltd. engages in the providing of emission control systems for industrial enterprises. It provides various technologies in the field of energy saving, including industrial boiler and industrial furnace flue gas desulfurization, denitrification, and waste heat utilization for environmental protection industry. The company was founded on January 19, 2004 and is headquartered in Liuyang, China.', '2019-09-27 07:26:25', '2019-09-27 07:26:25', 1, 1),
(1830, 1, 'YouGov PLC (YOU)', 4, 26, 249, '-', '-', '-', '2019-09-27 07:26:25', '2019-09-27 07:26:25', 1, 1),
(1831, 1, 'Youji Corp. (2152)', 4, 26, 114, '-', 'http://www.youji.co.jp/', 'Youji Corp. engages in the supervision and management of physical education in kindergarten and nursery schools. It operates thorough the following segments: Children''s Physical Education and Consulting. The Children''s Physical Education segment provides regular physical education, extracurricular physical education, event planning, and nursery school management. The Consulting segment offers kindergarten and nursery management consulting services; and seminar planning and hosting services. The company was founded on September 14, 1972 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:25', '2019-09-27 07:26:25', 1, 1),
(1832, 1, 'Yueshou Environmental Holdings Ltd. (1191)', 4, 26, 102, '-', '-', '-', '2019-09-27 07:26:25', '2019-09-27 07:26:25', 1, 1),
(1833, 1, 'Yume Technology Co. Ltd. (2458)', 4, 26, 114, '-', '-', '-', '2019-09-27 07:26:25', '2019-09-27 07:26:25', 1, 1),
(1834, 1, 'Yumeshin Holdings Co. Ltd. (2362)', 4, 26, 114, '-', 'http://www.yumeshin.co.jp/', 'Yumeshin Holdings Co., Ltd. engages in the manpower dispatch business. Its operations are carried out through the following segments: Construction Engineer Dispatch, Engineer Dispatch, and Others. The Construction Engineer Dispatch segment dispatches construction managers and construction work-related engineers, as well as creates and sells drawings for construction-related companies. The Engineer Dispatch segment is engaged in the dispatch of engineers, and the customized development of software. The Others segment includes the recruitment, education, and information technology-related businesses. The company was founded by Shingo Sato in May 1970 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:25', '2019-09-27 07:26:25', 1, 1),
