(1839, 1, 'Zhejiang Weiming Environment Protection Co. Ltd. (603568)', 4, 26, 47, '-', 'http://www.cnweiming.com/', 'Zhejiang Weiming Environment Protection Co., Ltd. engages in the incineration of city garbage and generation of power. It operates through the following business segments: Household waste treatment, Agricultural and forestry waste treatment, Sewage leachate treatment, Sludge drying treatment, and Kitchen waste collection and treatment. Its services include project operation, leachate treatment, and food waste disposal. The company was founded on December 29, 2001 and is headquartered in Wenzhou, China.', '2019-09-27 07:26:25', '2019-09-27 07:26:25', 1, 1),
(1840, 1, 'ZhongDe Waste Technology AG (ZEF)', 4, 26, 250, '-', '-', '-', '2019-09-27 07:26:25', '2019-09-27 07:26:25', 1, 1),
(1841, 1, 'Zhongyuan Environment-Protection Co. Ltd. (000544)', 4, 26, 47, '-', '-', 'Central Plains Environment Protection Co., Ltd. is engaged in urban sewage treatment and urban central heat supply. It operates through three business segments: urban sewage treatment, urban central heat supply and pipe network engineering business. The company was founded on December 1, 1993 and is headquartered in Zhengzhou, China.', '2019-09-27 07:26:26', '2019-09-27 07:26:26', 1, 1),
