(1843, 1, 'Zico Holdings Inc. (40W)', 4, 26, 210, '-', 'http://www.zicoholdings.com/', 'ZICO Holdings, Inc. is a investment company engages in the provision multidisciplinary professional service. It operates through the following segments: Advisory and Transactional Services, Management and Support Services, and Licensing Services. The Advisory and Transactional Services segment offers legal services, Shariah advisory services, trust services, corporate services, and consulting and investor services. The Management and Support Services segment refers to regional management services and business support services. The Licensing Services segment engages in providing trademarks to members of the ZICOlaw Network and certain entities of the group. The company was founded on December 9, 2010 and is headquartered in Singapore.', '2019-09-27 07:26:26', '2019-09-27 07:26:26', 1, 1),
(1844, 1, 'ZIGExN Co. Ltd. (3679)', 4, 26, 114, '-', 'https://zigexn.co.jp/', 'ZIGExN Co., Ltd. engages in the management and operation of a specialized online site, EX for jobs, dwellings, marriage and car booking. It integrates information from multiple Internet media information and enterprise for search, application and inquiry. The company operates through Life Media Platform and Others segments. The Life Media Platform segment handles the job or work, dwellings or home, used car, match making and travel aspect of the online site EX. The Others segment deals with deployment of new development services and new business projects. The company was founded on June 1, 2006 and is headquartered in Tokyo, Japan.', '2019-09-27 07:26:26', '2019-09-27 07:26:26', 1, 1),
