(4371, 1, 'Bumi Resources (BUMI)', 3, 24, 106, '-', '-', 'PT Bumi Resources Tbk is a holding company, which engages in mining activities. It operates through the following segments: Holding Company, Coal, Services, Oil & Gas, and Gold. The Holding Company segment refers to the company and other holding companies within the group. The Coal segment explores, exploits, mines, and sells coal. The Services segment offers marketing and management services. The Oil and Gas segment explores oil and gas resources. The Gold segment explores gold resources. The company was founded on June 26, 1973 and is headquartered in Jakarta, Indonesia. ', '2019-09-27 08:27:31', '2019-09-27 08:27:31', 1, 1),
(4372, 1, 'Bumi Resources Minerals (BRMS)', 3, 24, 106, '-', '-', 'PT Bumi Resources Minerals Tbk is an investment holding company, which engages in the operations of various non-coal mineral projects. It operates through the following segments: Mining and Services, Investments, and Holding Company. The Mining and Services segment is the marketing services and mining activities of lead, zinc, gold, copper and iron ore and under the exploration and development stages. The Investment segment is comprised of investments in shares of stock, funding, and financing. The Holding Company segment is a setup of joint capital for the purpose of development of mines. The company was founded on August 6, 2003 and is headquartered in Jakarta, Indonesia. ', '2019-09-27 08:27:31', '2019-09-27 08:27:31', 1, 1),
