(5789, 1, 'HG Metal Manufacturing Ltd. (BTG)', 3, 24, 210, '-', '-', 'HG Metal Manufacturing Ltd. operates as an investment holding company, which engages in manufacturing and trading customized flat steel bars and mild steel lip channels. It operates through two segments: Trading and Manufacturing. The Trading segment involves in supplying steel products and includes the holding of investments in subsidiaries. The Manufacturing segment includes producing steel products and provides related engineering services. HG Metal Manufacturing was founded by Tan Chan Too, Tian Chye Heng, Tan Ah Bee, Kuah Kian Leng, and Tan Teng Hian in 1971 and is headquartered in Singapore. ', '2019-09-27 08:29:56', '2019-09-27 08:29:56', 1, 1),
(5790, 1, 'Hi Ho Silver Resources Inc. (H9T1)', 3, 24, 86, '-', '-', '-', '2019-09-27 08:29:56', '2019-09-27 08:29:56', 1, 1),
(5791, 1, 'Hiap Teck Venture Bhd (HIAPTEK)', 3, 24, 136, '-', '-', 'Hiap Teck Venture Bhd. is an investment and property holding company, which engages in the provision of management services. It operates through the following segments: Trading, Manufacturing, Property & Investment, Transportation, and Mining Exploration. The Trading segment imports, exports, and distributes steel products, hardware, and building materials. The Manufacturing segment manufactures, leases, and distributes steel pipes, hollow sections, scaffolding equipment, accessories, and other steel products. The Property & Investment segment focuses on investment in and renting out property, and investment holding. The Transportation segment provides transportation of goods by lorries. The Mining Exploration segment involves in exploring, contracting, and activities related to the mining, processing, and sale of iron ore. The company was founded in 1993 and is headquartered in Klang, Malaysia. ', '2019-09-27 08:29:56', '2019-09-27 08:29:56', 1, 1),
