(5916, 1, 'Indal Aluminium Industry (INAI)', 3, 24, 106, '-', '-', 'PT Indal Aluminium Industry Tbk engages in the manufacture of aluminium sheets, rolling mills, and plant extrusion. It operates through the following segments: Manufacturing of Aluminium, Construction Services, Software Services, General Trading and Investments, and Software Services. The Manufacturing of Aluminium segment produces and distributes aluminium products. The Construction Services segment provides construction works and services for façade design, supply, and installation. The Software Services segment sells enterprise resource planning software including maintenance and repair services. The General Trading and Investments segment trades aluminium products such as ladders, water tanks, and aluminium profiles; and invests in companies related to aluminium and coating industries. The Software Services segment retails enterprise resource planning software and offers maintenance and repair services. The company was founded by Alim Markus on July 16, 1971 and is headquartered in Surabaya, Indonesia. ', '2019-09-27 08:30:12', '2019-09-27 08:30:12', 1, 1),
