(6217, 1, 'Krakatau Steel (KRAS)', 3, 24, 106, '-', '-', 'PT Krakatau Steel (Persero) Tbk engages in the production and distribution of integrated steel. It operates through the following segments: Steel Products; Real Estate and Hotels; Engineering and Construction; Port Services Provider; and Other Services. The Steel Products segment produces and sells steel products such as sponge iron, slabs, billets, hot rolled coils, cold rolled coils, wire rods, various steel pipes, reinforcing bars, steel wires, steel coating and tolling services. The Real Estate and Hotels segment develops and sells industrial estate along with the infrastructure, hotels and sport facilities. The Engineering and Construction segment refers to the construction, engineering, planning of various types of buildings; export and import of goods; provision related services and software. The Port Services Provider segment provides pier services for berthing, loading and unloading of goods and container, sea port support services, transport services and warehousing. The Other services segment provides services such as information technology, medical, electricity, and distributes water for industrial and residence needs. The company was founded on August 31, 1970 and is headquartered in Cilegon, Indonesia. ', '2019-09-27 08:30:39', '2019-09-27 08:30:39', 1, 1),
