(6316, 1, 'Lion Industries Corp. Bhd (LIONIND)', 3, 24, 136, '-', '-', 'Lion Industries Corp. Bhd. is an investment holding company, which engages in the property development, and steel products manufacturing businesses. It operates through the following business segments: Steel, Property Development, Building Materials, and Others. The Steel segment manufactures and markets steel bars, wire rods, hot briquetted iron, steel related products, and provision of chartering services. The Property Development segment develops and manages properties. The Building Materials segment trades and distributes building materials and other steel products. The Others segment includes investment holding, treasury business, manufacturing and trading of lubricants and spark plugs; provision of transportation services; agriculture; and distribution and retail of customer products. The company was founded on May 17, 1924 and is headquartered in Kuala Lumpur, Malaysia. ', '2019-09-27 08:30:48', '2019-09-27 08:30:48', 1, 1),
