(7040, 1, 'Novo Group Ltd. (MR8)', 3, 24, 210, '-', '-', 'Yorkshine Holdings Ltd. engages in investment activities with interests in the business of coal, steel, and other related products. It operates through the Trading and Tinplate Manufacturing segments. The Trading segment refers to the trading and distribution of iron ore, coal, and steel products which include semi-finished steel products such as billets and slabs used for producing deformed steel bars; finished steel products such as deformed bars, wire rods, tube, section, and angle channels; flat products such as hot rolled coils and cold-rolled coils; and others including galvanized steel coils and pre-painted galvanizes steel coils. The Tinplate Manufacturing segment is the manufacture and trade of tinning line products such as tinplate, tin-free steel, and scraps. The company was founded by Kin Wa Chow and Wing Keung Yu on June 29, 1989 and is headquartered in Hong Kong. ', '2019-09-27 08:32:08', '2019-09-27 08:32:08', 1, 1),
