(7049, 1, 'NSL Ltd. (N02)', 3, 24, 210, '-', '-', 'NSL Ltd. operates as an investment holding company, which engages in the manufacture and trade of building materials, lime, and refractory products design and sale of container handling spreaders. It also provides environmental services and sale of related products. It operates through the following business segments: Precast & Prefabricated Bathroom Unit (PBU), Environmental Services, and Investment Holding & Others. The Precast & PBU segment manufactures precast concrete components in Singapore, Malaysia, and Dubai while the PBU business is a dominant producer in Scandinavia. The Environmental Services segment refers to the treatment and logistics services of oily and toxic waste for both land and marine sectors. The Investment Holding & Others segment comprises of molding investments and includes the operation of marina club, and the manufacturing and sale of refractory materials and road stone products. The company was founded on August 12, 1961 and is headquartered in Singapore. ', '2019-09-27 08:32:09', '2019-09-27 08:32:09', 1, 1),
