(7172, 1, 'P.A. Resources Bhd (PA)', 3, 24, 136, '-', '-', 'P.A. Resources Bhd. is an investment holding company, which engages in the manufacture, fabrication, distribution, and sale of aluminum billets and aluminum extrusion products. It operates through the following segments: Extrusion and Fabrication; Aluminium Billet and Tolling; Construction Contract; Solar Industry; and Money Lending. The Extrusion and Fabrication segment covers the aluminium profiles for a variety of applications, ranging from simple architectural needs to high precision electronics applications and mainly used in the product manufacturing industry which include, electrical and electronics, furniture and consumer durables. The Aluminium Billet Casting and Tolling segment casts the standard aluminium billet for general or miscellaneous use where moderate bending and forming is permissible. The Construction Contract segment involves the design, supply, fabricating and installation of aluminium products. The Solar Industry segment relates to the supply, installation and commissioning of solar panels and provision of after installation services. The Money Lending segment provides funding needs to the individual customers who purchase solar power generation devices from solar segment. The company was founded in 1996 and is headquartered in Kuala Selangor, Malaysia. ', '2019-09-27 08:32:19', '2019-09-27 08:32:19', 1, 1),
