(7232, 1, 'Pantech Group Holdings Bhd (PANTECH)', 3, 24, 136, '-', '-', 'Pantech Group Holdings Bhd. is an investment company, which engages in the manufacture of pipes, fittings, flanges, valves, and other components. It operates through the following segments: Trading, Manufacturing, and Investment Holding. The Trading segment markets and supplies high pressure seamless and specialized steel pipes, fittings, flanges, valves and other related products for use in the oil and gas, gas reticulation, marine, onshore and offshore heavy engineering, power generation, petrochemicals, palm oil refining, and other related industries. The Manufacturing segment produces butt-welded carbon steel fittings such as elbows, tees, reducers, end-caps, and high frequency induction long bends; and manufacturing and supply of stainless steel and alloy pipes, fittings, and related products. The Investment Holding segment consists of investment holding, property investment, and management services. The company was founded on May 15, 2006 and is headquartered in Kuala Lumpur, Malaysia. ', '2019-09-27 08:32:25', '2019-09-27 08:32:25', 1, 1),
