(7266, 1, 'Pelat Timah Nusantara (NIKL)', 3, 24, 106, '-', '-', 'PT Pelat Timah Nusantara Tbk engages in the production of tinplate. It operates through the Coil and Sheet segments. The Coil segment sells tinplate coil to customers with cutting machineries for processing their raw material into cans. The Sheet segment sells and cuts sheet tinplate to customers based on the request. The company was founded on August 19, 1982 and is headquartered in Jakarta, Indonesia. ', '2019-09-27 08:32:29', '2019-09-27 08:32:29', 1, 1),
