(7279, 1, 'Perdana Karya Perkasa (PKPK)', 3, 24, 106, '-', '-', 'PT Perdana Karya Perkasa Tbk engages in the coal mining, heavy equipment rental, and contracting businesses. It operates through the following segments: Coal Mining; Construction and Land Clearing Services; and Heavy Equipment Rental. The Coal Mining segment explores and exploits coal to supply both the local and foreign markets. The Construction and Land Clearing Services segment provides civil construction work assignments such as planning, installation, fabrication, commissioning, labor supply, material support and maintenance services. The Heavy Equipment Rental segment offers equipment lease including operational support and maintenance and spare parts procurement for the mining, plantation and oil and gas production activities. The company was founded on December 7, 1983 and is headquartered in Samarinda, Indonesia. ', '2019-09-27 08:32:30', '2019-09-27 08:32:30', 1, 1),
