(8905, 1, 'Australian Pharmaceutical Industries Ltd. (API)', 13, 67, 13, 'USD', 'http://www.api.net.au/', 'Australian Pharmaceutical Industries Ltd. engages in the wholesale, product delivery, retail services, marketing programs, and business advisory services. It operates through the Australia and New Zealand segments. The Australia segment involves in the distribution of pharmaceutical, medical, health, beauty, and lifestyle products to pharmacies. The New Zealand segment engaged in the manufacturing and owner of rights of pharmaceutical medicines and consumer toiletries. The company was founded in 1910 and is headquartered in Camberwell, Australia.', '2019-09-27 08:40:51', '2019-09-27 08:40:51', 1, 1),
(8906, 1, 'Autowave Co. Ltd. (2666)', 13, 67, 114, '-', 'https://auto-wave.co.jp/', 'Autowave Co., Ltd. engages in the sale and maintenance of automobiles. Its services include tire maintenance, driving support, oil and battery replacement, interior and exterior upgrade, and security items. The company was founded by Hitoshi Hirooka in September 1990 and is headquartered in Chiba, Japan.', '2019-09-27 08:40:51', '2019-09-27 08:40:51', 1, 1),
(8907, 1, 'AVT Natural Products Ltd. (519105)', 13, 67, 105, '-', 'http://www.avtnatural.com/', 'AVT Natural Products Ltd. engages in the manufacture of solvent extracted products. Its products include marigold extract food and feed grade, spice oils and oleo resins, and tea. The company was founded on March 12, 1986 and is headquartered in Aluva, India.', '2019-09-27 08:40:51', '2019-09-27 08:40:51', 1, 1),
(8908, 1, 'CEC International Holdings Ltd. (0759)', 13, 67, 102, '-', 'http://www.ceccoils.com/cecweb/index.aspx?lang=en', 'CEC International Holdings Ltd. engages in the design and manufacture of electronic coils and local retail business. It operates through the following business segments: Retail Business, Electronic Components Manufacturing, and Investment Property Holdings. The Retail Business segment engages in the retailing of food and beverages, household, and personal care products. The Electronic Components Manufacturing segment engages in the design, development, manufacture and sale of coils, ferrite powder and other electronic components. The Investment Property Holdings segment offers residential and office buildings. The company was founded in 1979 and is headquartered in Hong Kong.', '2019-09-27 08:40:51', '2019-09-27 08:40:51', 1, 1),
(8909, 1, 'China Oil & Gas Group Ltd. (0603)', 13, 67, 102, '-', 'http://www.hk603.com/', 'China Oil & Gas Group Ltd. is a holding company, which engages in the investment in natural gas and energy related businesses. It operates through the following segments: Sales and Distribution of Natural Gas and Other Related Products; Gas Pipeline Construction and Connection; and Exploitation and Production of Crude Oil and Natural Gas. The company was founded on June 17, 1905 and is headquartered in Hong Kong.', '2019-09-27 08:40:51', '2019-09-27 08:40:51', 1, 1),
(8910, 1, 'China ZhengTong Auto Services Holdings Ltd. (1728)', 13, 67, 102, '-', 'http://www.zhengtongauto.com/', 'China Zhengtong Auto Services Holdings Ltd. is an investment company, which engages in the distribution of vehicles and sale of spare parts. It operates through the following segments: 4S Dealership Business, Supply Chain Business, and Financial Services Business. The 4S Dealership business segment includes sales of motor vehicles and after-sales services through the network of 4S dealerships of the group in the PRC. The Supply Chain business segment provides motor-related logistics services and trading of lubricant oil. The Financial Services provides financial services to auto customers and dealers. The company was founded by Mu Qing Wang in 1999 and is headquartered in Beijing, China.', '2019-09-27 08:40:51', '2019-09-27 08:40:51', 1, 1),
(8911, 1, 'COSMOS Pharmaceutical Corp. (3349)', 13, 67, 114, '-', 'http://www.cosmospc.co.jp/', 'COSMOS Pharmaceutical Corp. engages in the operation of drugstores. It operates through the following business divisions: Pharmaceutical, Cosmetics, Miscellaneous Goods, General Food, and Others. The Pharmaceutical division markets general drugs, health drinks, oral and nursing care products, vitamins, health food, and dietary food and supplements. The Cosmetics division offers skin care for men and women, hair products, and makeup. The Miscellaneous Goods division sells detergents, insecticides, toiletries, kitchenware, garden supplies, clothing, and baby, bath, and car products. The General Food division includes processed food, seasonings, bread, pastries, dairy products, beverages, and liquor. The Others division distributes tobacco and cigarettes. The company was founded by Masateru Uno and Noriko Uno in February 1973 and is headquartered in Fukuoka, Japan.', '2019-09-27 08:40:52', '2019-09-27 08:40:52', 1, 1),
(8912, 1, 'Daesung Industrial Co. Ltd. (128820)', 13, 67, 217, '-', 'http://www.daesung.co.kr/', 'Daesung Industrial Co., Ltd. is a holding company that engages in the sale and distribution of petroleum and gas products. It operates through the following business divisions: Petroleum and Gas, Construction, Machinery, Cogeneration, Gas Boiler, Computer System, Industrial Gas, Food and Overseas. The Petroleum and Gas division operates petroleum and liquefied petroleum gas filling stations. The Construction division offers construction services for apartment houses. The Machinery division produces industrial machines and various oil and pneumatic pressure tools and appliances. The Cogeneration division produces and supplies steam and electricity, operates combined heat and power plants. The Gas Boiler division distributes and sells gas boilers. The Computer System division sells engineering workstations and personal computers. The Industrial Gas division produces and sells industrial and medical gases. The Food division imports and distributes organic farming food and health supplement food. The Overseas division develops oil and gas fields. The company was founded on July 4, 1968 and is headquartered in Seoul, South Korea.', '2019-09-27 08:40:52', '2019-09-27 08:40:52', 1, 1),
(8913, 1, 'Handsman Co. Ltd. (7636)', 13, 67, 114, '-', 'http://www.handsman.co.jp/', 'Handsman Co., Ltd. engages in the operation of home center business. The company offers do-it-yourself, home, car and leisure products. It operates through the following product divisions: Do-It-Yourself (DIY), Home Product, and Car and Leisure. The Do-It-Yourself (DIY) product division involves in the purchase and sale of hobby items, wooden products, building materials, hand tools, electrical tools, hardware, paints, adhesives, gardening materials, chemical fertilizers, soil, plants, exterior products, and stone materials. The Home Product product division provides household articles, daily essentials, interior products, electrical materials, storage products, and housing facility equipment. The Car and Leisure product division offers car products, outdoor products, pet items, biological products, and stationery. The company was founded in 1914 and is headquartered in Miyakonojo, Japan.', '2019-09-27 08:40:52', '2019-09-27 08:40:52', 1, 1),
(8914, 1, 'Heungu Oil Co. Ltd. (024060)', 13, 67, 217, '-', 'http://hunggu.kr/', 'Heunguoil Co., Ltd. engages in the production of petroleum. Its products include gasoline, kerosene, direct, banka C oil and liquefied petroleum gas. The company was founded on December 16, 1966 and is headquartered in Daegu, South Korea.', '2019-09-27 08:40:52', '2019-09-27 08:40:52', 1, 1),
(8915, 1, 'Joyful Honda Co. Ltd. (3191)', 13, 67, 114, '-', 'http://www.joyfulhonda.com/', 'Joyful Honda Co. Ltd. engages in the home center retail business. It operates through the following divisions: Home Center, Garden Center, Pet Center, Internet Sales and Gasoline Station. The Home Center division offers gardening and plumbing supplies, agricultural materials, engine machinery, wallpapers, carpet and curtains, lighting fixtures, electrical appliances, daily living essentials, daily consumables, fresh cut flowers, storage goods, stationery and office supplies, outdoor goods, automotive accessories, bicycles, medicines, alcoholic and non-alcoholic drinks, building materials, timbers, paint, tools, hardware, worker essentials, electrical fittings and other materials for home renovation projects. The Garden Center division provides flower seedlings, vegetable seedlings, plants, mulch and other soil for horticulture, fertilizers, plant pots and other gardening supplies. The Pet Center division engages in the purchasing and sale of live animals such as dogs, cats, small animals, birds and fish, as well as pet supplies. The Internet Sales division provides the sale of lifestyle-related products through online. The Gasoline Station division operates self-service gasoline stations. The company was founded on December 15, 1975 and is headquartered in Tsuchiura, Japan.', '2019-09-27 08:40:52', '2019-09-27 08:40:52', 1, 1),
(8916, 1, 'Kamei Corp. (8037)', 13, 67, 114, '-', 'https://www.kamei.co.jp/', 'Kamei Corp. engages in the general trading business. It operates through the following segments: Energy, Food, Housing, Automotive, Overseas and Trading, Pet, Pharmacy, and Others. The Energy segment sells gasoline, kerosene, light oil, heavy oil, liquefied petroleum gas, solar power generation, and light emitting diode. The Food segment provides agricultural and fishery products, livestock products, beer, wine, and sake. The Housing segment offers housing fixtures and appliances; sells construction materials, and also involved in the house renovation business. The Automobile segment deals with the sale of domestic and imported cars; and car leasing services. The Overseas and Trading segment handles the export of tires, bearings and tanker planes. The Pet segment sells pet supplies, gardening materials, and agricultural materials. The Pharmacy segment operates dispensing pharmacy, sells general pharmaceutical products, and offers home medical care. The Others segment includes the sale of information equipment; transportation business, and real estate leasing. It also operates supermarkets and franchise stores. The company was founded by Bunpei Kamei in July 1903 and is headquartered in Sendai, Japan.', '2019-09-27 08:40:53', '2019-09-27 08:40:53', 1, 1),
(8917, 1, 'Mitra Pinasthika Mustika (MPMX)', 13, 67, 106, '-', 'http://mpmgroup.co.id/en', 'PT Mitra Pinasthika Mustika Tbk engages in the distribution and sale of motorcycles and automobiles. It operates through the following business segments: Distribution and Retail; After Market; Transportation; and Others. The Distribution and Retail segment includes the purchasing, sale, and services of two- and four-wheel motor vehicles. The After Market segment manufacutres and sells lubricant oil as well as after market parts and services. The Transportation segment provides transportation solutions. The Other segment handles the consumer, automotive, and capital goods financing as well as non-life insurance products. The company was founded by William Soeryadjaya on November 2, 1987 and is headquartered in Jakarta, Indonesia.', '2019-09-27 08:40:53', '2019-09-27 08:40:53', 1, 1),
(8918, 1, 'Nanjing Xinjiekou Department Store Co. Ltd. A (600682)', 13, 67, 47, '-', '-', 'Nanjing Xinjiekou Department Store Co. Ltd. is engaged in the retail and wholesale of apparel goods and accessories, sporting and recreational goods, electrical appliances and equipment, electronic products, communication equipment, car and motorcycle spare parts, motorcycle, construction materials, pharmaceutical products, rubber, wine and cooking oil. Its other activities include operation, construction, development, sale and lease of real estate, interior design, operation and research of biological medicine, medical raw materials and machinery and operation of mineral and pig iron. The company was founded on August 15, 1952 and is headquartered in Nanjing, China.', '2019-09-27 08:40:53', '2019-09-27 08:40:53', 1, 1),
(8919, 1, 'NewOcean Energy Holdings Ltd. (0342)', 13, 67, 102, '-', 'http://www.newoceanhk.com/eng/ir/profile.php', 'NewOcean Energy Holdings Ltd. is an investment holding company, which engages in the sale and distribution of liquefied petroleum gas (LPG), oil products business, and sale of electronic products. It operates through the following segments: Sales and Distribution of LPG, Oil Products Business, and Sales of Electronic Products. The Sales and Distribution of LPG segment refers to the distribution of LPG to industrial customers, auto-gas operators, overseas wholesaler customers, bottled LPG end users, auto-gas end-users. The Oil Products Business segment refers to the sale of oil products to both wholesaler and retailer customers and leasing of oil vessels. The Sales of Electronic Products segment is the trading of electronic products such as integrated circuit and mobile phones. The company is headquartered in Hong Kong.', '2019-09-27 08:40:53', '2019-09-27 08:40:53', 1, 1),
(8920, 1, 'Nissin Shoji Co. Ltd. (7490)', 13, 67, 114, '-', 'https://www.nissin-shoji.co.jp/tabid/36/Default.aspx', 'Nissin Shoji Co., Ltd. engages in the energy business. It operates through the following segments: Petroleum, Restaurant, Real Estate, and Renewable Energy. The Petroleum segment offers petrochemicals, liquefied petroleum gas, start to start operations, and automotive-related products as well as lubricants and fuel oils such as gasoline, kerosene, light oil, and crude petroleum. The Restaurant segment manages Kentucky Fried Chicken and Tully''s Coffee franchise stores. The Real Estate segment leases properties. The Renewable Energy segment sells electric power. The company was founded on August 7, 1947 and is headquartered in Tokyo, Japan.', '2019-09-27 08:40:53', '2019-09-27 08:40:53', 1, 1),
(8921, 1, 'Nitori Holdings Co. Ltd. (9843)', 13, 67, 114, '-', 'https://www.nitorihd.co.jp/', 'Nitori Holdings Co., Ltd. engages in the sales of furniture and interior goods through its group companies. It offers beddings, curtains, carpets, rugs, mats, interior items, daily living items, kitchenware, cookware, tableware, bath ware, toilet, laundry, beds, sofas, cushions, television stands, living room storage, tables, chairs, cupboards, storage racks, office furniture, bookshelves, stationeries, relaxation, massage, health items, everyday life support items, children''s room items, study desks, small home appliances, lighting products and kitchen units. The company was founded in December 1967 and is headquartered in Tokyo, Japan.', '2019-09-27 08:40:54', '2019-09-27 08:40:54', 1, 1),
(8922, 1, 'Phoenix Petroleum Philippines Inc. (PNX)', 13, 67, 185, '-', 'https://www.phoenixfuels.ph/', 'Phoenix Petroleum Philippines, Inc. engages in trading of petroleum products and operating of gas stations, oil depots, storage facilities, and allied services. It operates through the following segments: Trading, Depot and Logistics Services, Shipping and Cargo Services, and Real Estate. The Trading segment is involved in marketing, merchandising, purchasing, selling, dealing, acquiring, disposing, and distribution of goods and wares. The Depot and Logistics Services segment operates oil depots, storage facilities, and provides logistics services to entities. The Shipping and Cargo Services segment offers hauling of petroleum products; operation of inter-island going vessels for domestic trade; chartering in and out any vessels, and providing complete marine services. The Real Estate segment comprises of real estate development, management, and operations. The company was founded by Domingo T. Uy and Dennis A. Uy on May 8, 2002 and is headquartered in Davao City, Philippines.', '2019-09-27 08:40:54', '2019-09-27 08:40:54', 1, 1),
(8923, 1, 'PTG Energy PCL (PTG)', 13, 67, 231, '-', 'http://www.ptgenergy.co.th/', 'PTG Energy Public Co. Ltd. engages in the retail and wholesale of fuel and provides logistic services. It operates through the Trade of petroleum products, gas supplies, and equipment for oil services station, and Consumable Products segments. It operates convenience stores, under PT Max Mrt brand, and coffee shops. under Punthai Coffee brand, at PT petrol stations. It also involves in renewable energy business, manufacturing, and distribution of biodiesel and cooking oil. The company was founded on March 21, 1988 and is headquartered in Bangkok, Thailand.', '2019-09-27 08:40:54', '2019-09-27 08:40:54', 1, 1),
(8924, 1, 'PTG Energy PCL NVDR (PTG-R)', 13, 67, 231, '-', 'http://www.ptgenergy.co.th/', 'PTG Energy Public Co. Ltd. engages in the retail and wholesale of fuel and provides logistic services. It operates through the Trade of petroleum products, gas supplies, and equipment for oil services station, and Consumable Products segments. It operates convenience stores, under PT Max Mrt brand, and coffee shops. under Punthai Coffee brand, at PT petrol stations. It also involves in renewable energy business, manufacturing, and distribution of biodiesel and cooking oil. The company was founded on March 21, 1988 and is headquartered in Bangkok, Thailand.', '2019-09-27 08:40:54', '2019-09-27 08:40:54', 1, 1),
(8925, 1, 'Reject Shop Ltd. (TRS)', 13, 67, 13, '-', 'https://www.rejectshop.com.au/', 'The Reject Shop Ltd. engages in retailing of discount variety merchandise. It offers general consumer merchandise such as toiletries, cosmetics, homewares, personal care products, hardware, basic furniture, household cleaning products, kitchenware, confectionery, snack food, lifestyle and seasonal merchandise, such as seasonal gifts, cards and wrapping, toys, leisure items, and home decorations. The company was founded by Ron Hall and John Shuster in 1981 and is headquartered in Kensington, Australia.', '2019-09-27 08:40:54', '2019-09-27 08:40:54', 1, 1),
(8926, 1, 'RPCG PCL (RPC)', 13, 67, 231, '-', 'http://www.rpcthai.com/', 'RPCG Public Co., Ltd. engages in the manufacture and trading of fuel oil and petrochemical products. It operates through the Energy and Real Estate segments. The Energy segment involves in fuel and gas retailing through a network of gas stations; manufacture and distribution of biodiesel; distribution and maintenance of gas station equipment, and rental of oil depot and port business. The Real Estate segment offers real estate development for sale and for rent. The company was founded on January 27, 1995 and is headquartered in Bangkok, Thailand.', '2019-09-27 08:40:55', '2019-09-27 08:40:55', 1, 1),
(8927, 1, 'RPCG PCL NVDR (RPC-R)', 13, 67, 231, '-', 'http://www.rpcthai.com/', 'RPCG Public Co., Ltd. engages in the manufacture and trading of fuel oil and petrochemical products. It operates through the Energy and Real Estate segments. The Energy segment involves in fuel and gas retailing through a network of gas stations; manufacture and distribution of biodiesel; distribution and maintenance of gas station equipment, and rental of oil depot and port business. The Real Estate segment offers real estate development for sale and for rent. The company was founded on January 27, 1995 and is headquartered in Bangkok, Thailand.', '2019-09-27 08:40:55', '2019-09-27 08:40:55', 1, 1),
(8928, 1, 'Sanwa Co. Ltd. (3187)', 13, 67, 114, '-', 'https://www.sanwacompany.co.jp/shop/', 'Sanwa Co., Ltd. engages in the planning, development, and sale of building materials and housing facilities. Its products include bath and toilet systems, door fittings, furniture, kitchen equipment, storage items, flooring, tiles, lighting, interior and exterior finishes, glass, and wall materials. The company was founded on August 22, 1979 and is headquartered in Osaka, Japan.', '2019-09-27 08:40:55', '2019-09-27 08:40:55', 1, 1),
(8929, 1, 'Savezone I&C Corp. (067830)', 13, 67, 217, '-', 'http://www.savezone.co.kr/', 'Savezone I&C Corp. operates department stores. It operates in five divisions: Clothes, Foods, Home Appliances, Cultural and Sports Center. The Clothes division offers discounted prices on merchandise inventories and planning products of different brands. The Food division provides food islands include restaurants and savezone food sector include grocery. The Home Appliances offers furniture, such as adults furniture, student furniture, antique furniture, kitchen furniture and sofas; appliances, such as video appliances, music appliances, living appliances, kitchen appliances, computers, mobiles, healthy appliances, season appliances and business communications; kitchen supplies, such as ceramics and kitchen supplies; home fashion, such as handicraft, bedding and curtains and bathroom supplies, such as bath supplies, toiletries, gift and interior props. The Cultural Center provides lectures or lessons of singing, dancing, musical instruments, arts, yoga, massage, writing, origami, gift wrapping, flower arrangements, quilts, making baby''s supplies and so on. The Sports Center operates golf programs, swimming program, fitness program, group exercise program, cozy spa and green tea spa for physically and psychologically stressed out. The company was founded on May 7, 2002 and is headquartered in Seoul, South Korea.', '2019-09-27 08:40:55', '2019-09-27 08:40:55', 1, 1),
(8930, 1, 'Scan Inter PCL (SCN)', 13, 67, 231, '-', 'http://www.scan-inter.com/en.html', 'Scan-Inter Public Co. Ltd. engages in the development of natural gas and alternative energy. It operates through the following segments: Gas Related Business; Car Dealer; Export of Goods, and Others. The Gas Related Business segment offers supply, installation and repair; and maintenance of the natural gad dispenser equipment; transportation of natural gas, and trading of vehicle gas relates spare parts. The Car Dealer segment involves in trading of cars and related spare parts. The Export of Goods segment includes export of battery and glass. The Others segment comprises of trading of liquid carbon dioxide, engine oil and lubricants, and convenient store. The company was founded in 1988 and is headquartered in Nonthaburi, Thailand.', '2019-09-27 08:40:55', '2019-09-27 08:40:55', 1, 1),
(8931, 1, 'Scan Inter PCL NVDR (SCN-R)', 13, 67, 231, '-', 'http://www.scan-inter.com/en.html', 'Scan-Inter Public Co. Ltd. engages in the development of natural gas and alternative energy. It operates through the following segments: Gas Related Business; Car Dealer; Export of Goods, and Others. The Gas Related Business segment offers supply, installation and repair; and maintenance of the natural gad dispenser equipment; transportation of natural gas, and trading of vehicle gas relates spare parts. The Car Dealer segment involves in trading of cars and related spare parts. The Export of Goods segment includes export of battery and glass. The Others segment comprises of trading of liquid carbon dioxide, engine oil and lubricants, and convenient store. The company was founded in 1988 and is headquartered in Nonthaburi, Thailand.', '2019-09-27 08:40:55', '2019-09-27 08:40:55', 1, 1),
(8932, 1, 'Seobu T&D Co. Ltd. (006730)', 13, 67, 217, '-', 'http://www.seobutnd.com/main/main.php', 'Seobu T&D Co., Ltd. engages in leasing of real estates properties. Its other major activities include sales commissions, movie showing theaters and oil distribution. The company was founded on July 12, 1979 and is headquartered in Seoul, South Korea.', '2019-09-27 08:40:55', '2019-09-27 08:40:55', 1, 1),
(8933, 1, 'Shenzhen Guangju Energy Co. Ltd. A (000096)', 13, 67, 47, '-', 'http://www.gj000096.com/', 'Shenzhen Guangju Energy Co., Ltd. is engaged in the selling petroleum products. Its other activities include the sale of liquefied petroleum gas and refined oil; provision of storage; investment in electric power industries; generation of electric power; domestic trades, import, purchase and sale of diesel oil, gasoline & lubricating oil; and freight transportation and lease of ships. The company was founded on February 18, 1999 and is headquartered in Shenzhen, China.', '2019-09-27 08:40:56', '2019-09-27 08:40:56', 1, 1),
(8934, 1, 'Siam Pan Group PCL (SPG)', 13, 67, 231, '-', 'http://www.siampangroup.com/en', 'The Siam Pan Group Public Co. Ltd. engages in the manufacture and distribution of lubricating oil, batteries, and lubricating grease. It operates through the following segments: Grease, Lubricating Oil, and Batteries. Its product brands include Boliden, Trane, Crown, S4 Turbo Plus, Super HD Hydraulic Oil, Marina Super Lube, ATF, Super LXT, Super LT3, Super HT, BTX Bentone Grease, SG-406, SG-306, and SG-304. The company was founded in 1959 and is headquartered in Bangkok, Thailand.', '2019-09-27 08:40:56', '2019-09-27 08:40:56', 1, 1),
(8935, 1, 'Siam Pan Group PCL NVDR (SPG-R)', 13, 67, 231, '-', 'http://www.siampangroup.com/en', 'The Siam Pan Group Public Co. Ltd. engages in the manufacture and distribution of lubricating oil, batteries, and lubricating grease. It operates through the following segments: Grease, Lubricating Oil, and Batteries. Its product brands include Boliden, Trane, Crown, S4 Turbo Plus, Super HD Hydraulic Oil, Marina Super Lube, ATF, Super LXT, Super LT3, Super HT, BTX Bentone Grease, SG-406, SG-306, and SG-304. The company was founded in 1959 and is headquartered in Bangkok, Thailand.', '2019-09-27 08:40:56', '2019-09-27 08:40:56', 1, 1),
(8936, 1, 'Sinanen Holdings Co. Ltd. (8132)', 13, 67, 114, '-', 'http://www.sinanengroup.co.jp/', 'SINANEN Holdings Co., Ltd. engages in the distribution of petroleum products and gas. It operates through the following segments: Wholesale and Retail Energy Peripheral Business (BtoC Business), Energy Solutions Business (BtoB Business), and Non-Energy and Overseas Business. The Wholesale and Retail Energy Peripheral (BtoC Business) segment offers services for house, living or lifestyle, and energy businesses. The Energy Solutions Business (BtoB Business) segment includes oil, solutions, electricity, and fabheat businesses. The Non-Energy and Overseas Business segment includes bicycle, antibacterial, recycling, system, and overseas businesses. The company was founded on April 11, 1927 and is headquartered in Tokyo, Japan.', '2019-09-27 08:40:56', '2019-09-27 08:40:56', 1, 1),
(8937, 1, 'SINOPEC Shandong Taishan Petroleum Co. Ltd. A (000554)', 13, 67, 47, '-', '-', 'SINOPEC Shandong Taishan Petroleum Co., Ltd. engages in the sale of petroleum products. Its products include gasoline, diesel fuel, lubricating oil and natural gas. It also provides other services such as operation of convenient stores, repairing and maintenance of vehicles, and outdoor advertisement. The company was founded on March 17, 1993 and is headquartered in Tai''an, China.', '2019-09-27 08:40:56', '2019-09-27 08:40:56', 1, 1),
(8938, 1, 'Sunautas Co. Ltd. (7623)', 13, 67, 114, '-', 'http://www.sunautas.co.jp/', 'Sunautas Co., Ltd. engages in the provision of automotive products and car services. Its operations are carried out through the following segments: Energy, Car Business, Life Support, and Real Estate. The Energy segment sells gasoline, diesel, kerosene, heavy oil, and oil-related products. It also offers car maintenance and retail of car supplies, tires audio, and battery. The Car Business segment handles the sales, maintenance and inspection of BMW, Ford, Peugeot cars. It also deals with car leases and rents. The Life Support includes life insurance recruitments, casualty insurance agencies, home care support, and visiting nurse services. The Real Estate segment deals with building maintenance and real estate leasing businesses. The company was founded by Maijiro Ota in 1926 and is headquartered in Yokohama, Japan.', '2019-09-27 08:40:57', '2019-09-27 08:40:57', 1, 1),
(8939, 1, 'SUSCO PCL (SUSCO)', 13, 67, 231, '-', 'http://www.susco.co.th/index.php', 'SUSCO Public Co. Ltd. engages in the purchase and sale of fuel oils, liquefied petroleum gas, and . The firm provides retail distribution of gasoline, diesel oil, gasohol national gas vehicle and lubricant products through its own service stations and wholesale distribution to industrial sector including other traders. The company was founded on September 21, 1977 and is headquartered in Bangkok, Thailand.', '2019-09-27 08:40:57', '2019-09-27 08:40:57', 1, 1),
(8940, 1, 'SUSCO PCL NVDR (SUSCO-R)', 13, 67, 231, '-', 'http://www.susco.co.th/', 'SUSCO Public Co. Ltd. engages in the purchase and sale of fuel oils, liquefied petroleum gas, and . The firm provides retail distribution of gasoline, diesel oil, gasohol national gas vehicle and lubricant products through its own service stations and wholesale distribution to industrial sector including other traders. The company was founded on September 21, 1977 and is headquartered in Bangkok, Thailand.', '2019-09-27 08:40:57', '2019-09-27 08:40:57', 1, 1),
(8941, 1, 'Takuni Group PCL (TAKUNI)', 13, 67, 231, '-', 'http://www.takunigroup.com/', 'Takuni Group Public Co. Ltd. engages in oil and gas provisions. It operates through the following segments: Petroleum Gas Trading, Gas installation equipment trading, Transportation services, Construction services, Safety-Checking Services, and Others. The Petroleum Gas Trading segment refers to petroleum gas trading for household cooking, as well as industry and transportation consumption. The Gas installation equipment trading segment refers to car gas installation and industrial equipment. The Transportation Services segment refers to the gas services among land vehicles. The Construction services segment provides industrial and construction services. The Safety-Checking Services segment provides industrial and car gas system safety-checking services. The Others segment is the investment holding activities in the field of construction and renewable energy. The company was founded on March 26, 2007 and is headquartered in Bangkok, Thailand', '2019-09-27 08:40:57', '2019-09-27 08:40:57', 1, 1),
(8942, 1, 'Takuni Group PCL NVDR (TAKUNI-R)', 13, 67, 231, '-', 'http://www.takunigroup.com/', 'Takuni Group Public Co. Ltd. engages in oil and gas provisions. It operates through the following segments: Petroleum Gas Trading, Gas installation equipment trading, Transportation services, Construction services, Safety-Checking Services, and Others. The Petroleum Gas Trading segment refers to petroleum gas trading for household cooking, as well as industry and transportation consumption. The Gas installation equipment trading segment refers to car gas installation and industrial equipment. The Transportation Services segment refers to the gas services among land vehicles. The Construction services segment provides industrial and construction services. The Safety-Checking Services segment provides industrial and car gas system safety-checking services. The Others segment is the investment holding activities in the field of construction and renewable energy. The company was founded on March 26, 2007 and is headquartered in Bangkok, Thailand', '2019-09-27 08:40:57', '2019-09-27 08:40:57', 1, 1),
(8943, 1, 'Thanapiriya PCL (TNP)', 13, 67, 231, '-', 'http://www.thanapiriya.co.th/', 'Thanapiriya PCL engages in the operation of supermarket. It involves in the retail and wholesale of consumer goods through its brand name Thanapiriya. Its products are divided into five categories: household, personal care, drinks & dried food, cosmetics & supplements, and baby care. The household products include detergent, dish washing liquid, fabric conditioner, tableware, automotive cleaning products. The personal care product include shampoo, conditioner, soap, toothpaste, powder, sanitary napkin, paper towel, etc. The drinks & dried food product covers tea, coffee, milk, seasoning, vegetable oil. The cosmetics & supplements product refers to skin care, foundation, lipstick, medicines and supplements. The baby care products include milk bottles, baby food, nappy, supersorber, toy and others. The company was founded by Thawatchai Phuttahiphiriya and Amorn Phutthiphiriya in 1965 and is headquartered in Chiang Rai, Thailand.', '2019-09-27 08:40:58', '2019-09-27 08:40:58', 1, 1),
(8944, 1, 'Thanapiriya PCL NVDR (TNP-R)', 13, 67, 231, '-', 'http://www.thanapiriya.co.th/', 'Thanapiriya PCL engages in the operation of supermarket. It involves in the retail and wholesale of consumer goods through its brand name Thanapiriya. Its products are divided into five categories: household, personal care, drinks & dried food, cosmetics & supplements, and baby care. The household products include detergent, dish washing liquid, fabric conditioner, tableware, automotive cleaning products. The personal care product include shampoo, conditioner, soap, toothpaste, powder, sanitary napkin, paper towel, etc. The drinks & dried food product covers tea, coffee, milk, seasoning, vegetable oil. The cosmetics & supplements product refers to skin care, foundation, lipstick, medicines and supplements. The baby care products include milk bottles, baby food, nappy, supersorber, toy and others. The company was founded by Thawatchai Phuttahiphiriya and Amorn Phutthiphiriya in 1965 and is headquartered in Chiang Rai, Thailand.', '2019-09-27 08:40:58', '2019-09-27 08:40:58', 1, 1),
(8945, 1, 'Yakuodo Co. Ltd. (3385)', 13, 67, 114, '-', 'https://www.yakuodo.co.jp/', 'YAKUODO Co., Ltd. engages in the management of dispensing pharmacy and drugstore chain. It operates through the following divisions: Healthcare, Beauty Care, Home Care, and Convenience Store. The Healthcare division offers medical supplies, health food, nursing care products, and baby items. The Beauty Care division sells cosmetics and toiletries. The Home Care division retails clothing, footwear, fashion accessories, detergents, and kitchenware. The Convenience Store division provides food and beverage, stationery, pet supplies, electrical accessories, books, and variety products. The company was founded by Tatsuhiro Saigo and Kiyoko Saigo in April 1978 and is headquartered in Shiwa-gun, Japan.', '2019-09-27 08:40:58', '2019-09-27 08:40:58', 1, 1),
(8946, 1, 'Yellow Hat Ltd. (9882) (9882)', 13, 67, 114, '-', 'http://www.yellowhat.jp/', 'Yellow Hat Ltd. engages in the wholesale and retail sale of car parts and accessories. It operates through the Car and Motorcycle Parts Sales and Leased Property segments. The Car and Motorcycle Parts Sales segment is involved in the sale of tires, wheel products, audio and visual products, car wash, oil, chemical products, and others. The Leased Property segment manages the leasing of real estate. The company was founded in October 1961 and is headquartered in Tokyo, Japan.', '2019-09-27 08:40:58', '2019-09-27 08:40:58', 1, 1),
(8947, 1, 'Z Energy Ltd. (ZEL)', 13, 67, 13, '-', 'http://z.co.nz/', 'Z Energy Ltd. engages in the distribution and trade of oil and gas products. Its operations include bulk fuel deliveries and mini-tankers for vehicle fleet operators and road projects; provision of Z card for retail customers; and supply of bitumen for road infrastructure. The company was founded on June 18, 1959 and is headquartered in Wellington, New Zealand.', '2019-09-27 08:40:58', '2019-09-27 08:40:58', 1, 1),
