(9372, 1, 'AllCargo Logistics Ltd. (532749)', 16, 77, 231, '-', 'https://www.asimar.com/', 'Asian Marine Services Public Co., Ltd. engages in the provision of ship building and ship repair services. It operates through the Ship Repairing and Ship Building segments. It also provides ship conversion services; support vessels for offshore businesses; and other engineering works such as fabricating and repairing afloat and offshore constructions, and steel work structures for bridges, heavy industries, oil rigs, and factory components. The company was founded in 1981 and is headquartered in Samut Prakan, Thailand.', '2019-09-27 08:55:24', '2019-09-27 08:55:24', 1, 1),
