(9375, 1, 'Anhui Expressway Co. Ltd. (600012)', 16, 77, 210, '-', 'http://www.aslmarine.com/', 'ASL Marine Holdings Ltd. engages in the provision of ship management services. It operates through the following business segments: Shipbuilding, Ship Repair and Conversion, Ship Chartering and Rental, Engineering, and Investment Holding. The Shipbuilding segment includes construction of vessels. The Ship Repair and Conversion segment provides repair and related services. The Ship Chartering and Rental segment deals with chartering of vessels and transportation services. The Engineering segment offers dredging engineering products and services. The Investment Holding segment provides corporate and treasury services to the group. The company was founded by Ang Sin Liu on October 4, 2000 and is headquartered in Singapore.', '2019-09-27 08:55:24', '2019-09-27 08:55:24', 1, 1),
(9376, 1, 'Anhui Wanjiang Logistics (Group) Co. Ltd. (600575)', 16, 77, 210, '-', 'https://www.atlanticnavigation.com/', 'Atlantic Navigation Holdings (Singapore) Ltd. operates as an investment holding company, which is engaged in the provision of marine logistics services, ship repair, fabrication and other marine services. It operates through the following business segments: Marine logistics services; and Ship repair, fabrication and other marine services. The Ship repair, fabrication and other marine services segment provides repairs and maintenance of marine equipment, engines, heavy machines and related marine services. The Marine logistics services segment provides vessel chartering and chandlery services to external customers. The company was founded on August 31, 2004 and is headquartered in Singapore.', '2019-09-27 08:55:24', '2019-09-27 08:55:24', 1, 1),
(9377, 1, 'Ansaldo STS S.p.A. (W9X)', 16, 77, 13, '-', 'https://www.austal.com/', 'Austal Ltd. engages in the designing and construction of customized aluminum commercial and defense vessels. The company operates through the following segments: Australia, USA, and Philippines. The Australia segment manufactures defense vessels for markets worldwide, excluding the USA and provides training and on-going support and maintenance for vessels. The USA segment engages in the manufacturing of aluminum defense vessels for the US Navy and provides training and on-going support and maintenance of these performance vessels for the US Navy. The Philippines segment provides aluminum commercial vessels for global markets excluding the USA. It also offers support to other segments not just manufacturing for external buyers. The company was founded by John Rothwell in 1988 and is headquartered in Henderson, Australia.', '2019-09-27 08:55:24', '2019-09-27 08:55:24', 1, 1),
