(9419, 1, 'CCR S.A. (CCRO3)', 16, 77, 47, '-', 'http://csscholdings.cssc.net.cn/', 'China CSSC Holdings Ltd. engages in the shipbuilding and ship maintenance industry. It operates through the following business: shipbuilding, ship maintenance, and ship equipment. Its business scopes are: investment on shipbuilding and diesel production; sale of civilian ship; manufacture, installation, and sale of the shipping mechanical and electrical equipment; and providing technical service and advise in the field of marine technology. The company was founded on May 12, 1998 and is headquartered in Shanghai, China.', '2019-09-27 08:55:27', '2019-09-27 08:55:27', 1, 1),
(9420, 1, 'Celebi Hava Servisi A.S. (CLEBI)', 16, 77, 102, '-', 'http://www.huarongenergy.com.hk/en/index.php', 'China Huarong Energy Co. Ltd. is an investment holding company, which engages in shipbuilding, marine engine building, offshore engineering and engineering machinery focusing on oil and gas related customers and markets. The company operates through the following segments: Shipbuilding, Offshore Engineering, Engineering Machinery, Marine Engine Building, and Energy Exploration and Production. The Shipbuilding segment engages in the construction of vessels. The Offshore Engineering segment engages in the construction of vessels for marine projects. The Engineering Machinery segment engages in the manufacturing of excavators and crawler cranes. The Marine Engine Building segment includes building marine engines. The Energy Exploration and Production segment includes in the sales of crude oil. China Huarong Energy was founded by Zhi Rong Zhang on February 3, 2010 and is headquartered in Hong Kong.', '2019-09-27 08:55:28', '2019-09-27 08:55:28', 1, 1),
(9421, 1, 'Center for Cargo Container Traffic (TRCN)', 16, 77, 47, '-', 'http://www.cmenergyshipping.com/', 'China Merchants Energy Shipping Co., Ltd. principally engages in international crude oil transportation, international dry bulk shipping, and international liquefied natural gas transportation. It provides these energy transportation services with vessels, including crude oil tankers, dry bulk carriers, and liquefied natural gas carriers. The company was founded on December 31, 2004 and is headquartered in Shanghai, China.', '2019-09-27 08:55:28', '2019-09-27 08:55:28', 1, 1),
(9422, 1, 'Center for Cargo Container Traffic PJSC GDR Reg S (TRCN)', 16, 77, 250, '-', 'http://www.cmport.com.hk/en/', 'China Merchants Port Holdings Co., Ltd. engages in ports operation, bonded logistics and cold chain operations, property development and investment. The company operates through the following business segments: Ports Operation, Bonded Logistics Operations, Port-related Manufacturing Operations, and Other Operations. The Ports Operation segment includes container terminal operation, bulk and general cargo terminal operations. The Bonded Logistics Operations segments include logistic park operation, ports transportation, cold storage and logistics operation and airport cargo handling. The Port-related Manufacturing Operations segment includes construction of modular housing and container manufacturing. Its port network expands across the Bohai Economic Zone, the Yangtze River Delta, the Xiamen Bay Economic Zone, the Pearl River Delta, and the Southwest region includes the coastal hub ports in Hong Kong, Shenzhen, Ningbo, Shanghai, Qingdao, Tianjin, Xiamen Bay and Zhanjiang. China Merchants Holdings is also developing marine logistics services relating to the port industry, which include the Bonded Logistics Park in Shenzhen, Qingdao and the Tianjin Haitian Bonded Logistics Zone, apart from the fast and safe information platforms serving for its terminals, logistics parks and customers, and the South China Shuttle Barge Services to Shenzhen western terminals. The company was founded in May 28, 1991 and is headquartered in Hong Kong.', '2019-09-27 08:55:28', '2019-09-27 08:55:28', 1, 1),
(9423, 1, 'Century Logistics Holdings Bhd (CENTURY)', 16, 77, 102, '-', 'http://www.cmport.com.hk/en/', 'China Merchants Port Holdings Co., Ltd. engages in ports operation, bonded logistics and cold chain operations, property development and investment. The company operates through the following business segments: Ports Operation, Bonded Logistics Operations, Port-related Manufacturing Operations, and Other Operations. The Ports Operation segment includes container terminal operation, bulk and general cargo terminal operations. The Bonded Logistics Operations segments include logistic park operation, ports transportation, cold storage and logistics operation and airport cargo handling. The Port-related Manufacturing Operations segment includes construction of modular housing and container manufacturing. Its port network expands across the Bohai Economic Zone, the Yangtze River Delta, the Xiamen Bay Economic Zone, the Pearl River Delta, and the Southwest region includes the coastal hub ports in Hong Kong, Shenzhen, Ningbo, Shanghai, Qingdao, Tianjin, Xiamen Bay and Zhanjiang. China Merchants Holdings is also developing marine logistics services relating to the port industry, which include the Bonded Logistics Park in Shenzhen, Qingdao and the Tianjin Haitian Bonded Logistics Zone, apart from the fast and safe information platforms serving for its terminals, logistics parks and customers, and the South China Shuttle Barge Services to Shenzhen western terminals. The company was founded in May 28, 1991 and is headquartered in Hong Kong.', '2019-09-27 08:55:28', '2019-09-27 08:55:28', 1, 1),
