(9425, 1, 'Chasen Holdings Ltd. (5NV)', 16, 77, 102, '-', '-', 'China Ocean Industry Group Ltd. engages in the production and operation of shipbuilding, securities trading, and provision of financial services. It operates through three segments: Shipbuilding, Trading business, Finance leasing business, Intelligent car parking & automotive device business and Steel Structure Engineering & Installation. The Shipbuilding segment focuses on shipbuilding services under shipbuilding construction contracts China. The Trading business segment provides trading and is operated in Hong Kong. The Finance leasing business offers direct finance leasing, sale and leaseback, and advisory services in China. The Intelligent car parking and automotive device business manufactures and sells car parking equipment, investment, operation and management of car parks and electronic automotive devices. The Steel Structure Engineering & Installation segment engages in manufacturing and selling of steel structures and fittings for ship, marine equipment, mining equipment, ro-ro equipment, ship, bridge and building steel structure in the PRC. China Ocean Industry Group was founded on May 22, 1998 and is headquartered in Hong Kong.', '2019-09-27 08:55:28', '2019-09-27 08:55:28', 1, 1),
(9426, 1, 'China Aircraft Leasing Group Holdings Ltd. (1848)', 16, 77, 47, '-', 'http://www.csicl.com.cn/', 'China Shipbuilding Industry Co., Ltd. engages in the design, manufacture, and distribution of ships. It operates through the following business divisions: Shipbuilding and Support, Ship Remodeling and Repair, Naval Equipment, Offshore Engineering, and Others. The Shipbuilding and Support division designs, constructs, and upgrades various ships such as bulk carriers, chemical and oil tankers, and container vessels. The Ship Remodeling and Repair division modifies ship designs and restores ships. The Naval Equipment division provides warship diesel engine, shipboard weapons and launchers, communications and navigation equipment, and rugged computers. The Offshore Engineering division engages in the construction of offshore platforms and floating production structure. The Others division offers non-ship products and services such as wind turbine accessories, nuclear power plant emergency generators, and railway equipment and vehicles. The company was founded on March 18, 2008 and is headquartered in Beijing, China.', '2019-09-27 08:55:28', '2019-09-27 08:55:28', 1, 1),
