(9435, 1, 'CJ Korea Express Corp. (000120)', 16, 77, 105, '-', 'http://www.chowgulesteamships.co.in/', 'Chowgule Steamships Ltd. engages in the seaborne transportation of bulk cargoes. It owns and operates vessels for moving bulk cargoes such as iron ore, grain, coal, and fertilizers. The company was founded on April 9, 1963 and is headquartered in Mumbai, India.', '2019-09-27 08:55:29', '2019-09-27 08:55:29', 1, 1),
(9436, 1, 'Clarke Inc. (CKI)', 16, 77, 102, '-', 'https://www.cksd.com/zh-HK', 'Chu Kong Shipping Enterprises (Group) Co. Ltd. is an investment holding company, which engages in the provision of terminal and shipping logistics services. It operates through the following segments: Cargo Transportation; Cargo Handling and Storage; Passenger Transportation; Fuel Supply; and Corporate and Other Businesses. The Cargo Transportation segment consists of shipping agency, river trade cargo direct shipment, transshipment, container handling, and trucking. The Cargo Handling and Storage segment offers wharf cargo handling and consolidation. The Passenger Transportation segment includes travel agency operations and passenger carrier services. The Fuel Supply segment deals with oil trading and marine bunkering solutions. The Corporate and Other Businesses segment pertains to the firm''s administrative activities. The company was founded on September 5, 1996 and is headquartered in Hong Kong.', '2019-09-27 08:55:29', '2019-09-27 08:55:29', 1, 1),
(9437, 1, 'Clarkson PLC (CKNHF)', 16, 77, 102, '-', 'Company Not Found', '-', '2019-09-27 08:55:29', '2019-09-27 08:55:29', 1, 1),
(9438, 1, 'Clarkson PLC (CKN)', 16, 77, 136, '-', 'http://www.coastalcontracts.com/', 'Coastal Contracts Bhd. is an investment holding company, which engages in the provision of marine products and services to the shipping, oil and gas, and commodities industries. It operates through Vessels Manufacturing and Repairing Services; and Vessels Chartering and Equipment Hire segments. The Vessels Manufacturing and Repairing Services segment fabricates and sell offshore support and marine transportation vessels, and provides ship repairs and maintenance services. The Vessels Chartering and Equipment Hire segment provides vessels transportation and equipment hiring services. The company was founded in 1976 and is headquartered in Sandakan, Malaysia.', '2019-09-27 08:55:29', '2019-09-27 08:55:29', 1, 1),
(9439, 1, 'Clipper Logistics PLC (CLG)', 16, 77, 219, '-', 'http://www.cdl.lk/', 'Colombo Dockyard Plc engages in the provision of shipping repair and engineering solutions. It operates through the following segments: Ship Repairs; Shipbuilding; Heavy Engineering; and Material and Other Sales. The Ship Repairs segment is responsible for all routine, damage, and retrofit repairs such as machinery, hull, propeller, electrical, electronic and automation, cargo gear repairs, internal tank, and installation of ballast water treatment systems. The Ship Building segment is the construction of small tug boats, patrol boats, and barges. The Heavy Engineering segment provides petrochemical installations such as fuel storage systems, liquefied petroleum gas storage systems, cement silos, piping systems, as well as supplying ancillary services, fabrication and installation. The company was founded by Ambalavanar Ragunathan in 1974 and is headquartered in Colombo, Sri Lanka.', '2019-09-27 08:55:29', '2019-09-27 08:55:29', 1, 1),
