(9443, 1, 'Compania de Distribucion Integral Logista S.A. (5CI)', 16, 77, 136, '-', 'http://www.complete-group.com/', 'Complete Logistics Services Bhd. is an investment holding company, which engages in the provision of marine transportation, general trading, freight trading, container haulage, custom brokerage, forwarding, warehousing, and total logistics services. It operates through the following segments: Logistics, Marine, and Others. The Logistics segment offers container haulage, lorry transportation, warehousing, custom brokerage and forwarding services, and trading of freight. The Marine segment has motorized vessels that provide marine transportation for general break-bulk or conventional cargoes and project cargoes that require total logistics or door-to-door handling. The Others segment comprises of trading of goods, insurance agents, and investment holding. The company was founded by Hee Ling Law on November 29, 2005 and is headquartered in Port Klang, Malaysia.', '2019-09-27 08:55:29', '2019-09-27 08:55:29', 1, 1),
