(9446, 1, 'Corporate Courier & Cargo Ltd. (526737)', 16, 77, 210, '-', 'http://www.cosco.com.sg/', 'COSCO Shipping International (Singapore) Co., Ltd. is an investment holding company, which engages in shipping and other logistics services. It operates through the following segments: Shipping; Ship Repair and Marine Engineering Activities; Logistics: Property Management; and All Other Segments. The company was founded on October 25, 1961 and is headquartered in Singapore.', '2019-09-27 08:55:29', '2019-09-27 08:55:29', 1, 1),
