(9450, 1, 'CWT Ltd. (C14)', 16, 77, 102, '-', 'https://ports.coscoshipping.com/en/', 'COSCO SHIPPING Ports Ltd. is a holding company, which engages in the operation and management of terminal businesses. It operates through the Terminal and Related businesses; and Others segments The Terminals and Related businesses segment engages in the terminal operations, container handling, transportation, and storage. The Others segment includes corporate level activities. The company was founded on July 26, 1994 and is headquartered in Hong Kong.', '2019-09-27 08:55:30', '2019-09-27 08:55:30', 1, 1),
