(9459, 1, 'Dongguan Development (Holdings) Co. Ltd. A (000828)', 16, 77, 228, '-', 'http://www.csbcnet.com.tw/', 'CSBC Corp. Taiwan engages in the design, manufacture, sale, installation, and repair of ships. It specializes in the design, manufacture, installation, repair, and sale of marine machinery and transport machinery; and design and manufacture of waste treatment equipment and air pollution prevention and control equipment. Its business covers merchant ships, naval ships, ship repair, industrial business, and offshore engineering services. The company was founded in June 1937 and is headquartered in Kaohsiung, Taiwan.', '2019-09-27 08:55:30', '2019-09-27 08:55:30', 1, 1),
