(9466, 1, 'ENAV S.p.A. (ENV)', 16, 77, 102, '-', 'http://www.dlport.cn/', 'Dalian Port (PDA) Co., Ltd. engages in the provision of oil chemicals terminal and related logistics services. The company operates its business through the following segments: Oil, Container, Automobile Terminal, Ore, General Cargo, Bulk Grains, Passenger and Ro-Ro, Value-Added Services. The Oil segment provides loading and discharging, storage, and transshipment of oil products and liquefied chemicals, and port management services. The Container segment engages in the loading and discharging, storage, and transshipment of containers; leasing of terminals and related facilities; various container logistics services; and sale of properties. The Automobile Terminal segment involves in the loading and discharging, storage, transshipment, exhibition, trade, and maintenance of import and export automobiles. The Ore segment includes loading and unloading of ore and provides related logistics services. The General Cargo segment provides loading, discharging, and logistics services for steel, coal, dry bulk cargoes, heavy lifts, and timber. The Bulk Grains segment engages in the discharging, storage, and transshipment of corn, soybean, barley, and wheat. The Passenger and Ro-Ro segment includes passenger transportation and general cargo roll-on and roll-off. The Value-Added segment involves tallying, tugging, transportation, power supply, information technology, and construction services. The company was founded on November 16, 2005 and is headquartered in Dalian, China.', '2019-09-27 08:55:31', '2019-09-27 08:55:31', 1, 1),
(9467, 1, 'Engenco Ltd. (EGN)', 16, 77, 47, '-', 'http://www.dlport.cn/', 'Dalian Port (PDA) Co., Ltd. engages in the provision of oil chemicals terminal and related logistics services. The company operates its business through the following segments: Oil, Container, Automobile Terminal, Ore, General Cargo, Bulk Grains, Passenger and Ro-Ro, Value-Added Services. The Oil segment provides loading and discharging, storage, and transshipment of oil products and liquefied chemicals, and port management services. The Container segment engages in the loading and discharging, storage, and transshipment of containers; leasing of terminals and related facilities; various container logistics services; and sale of properties. The Automobile Terminal segment involves in the loading and discharging, storage, transshipment, exhibition, trade, and maintenance of import and export automobiles. The Ore segment includes loading and unloading of ore and provides related logistics services. The General Cargo segment provides loading, discharging, and logistics services for steel, coal, dry bulk cargoes, heavy lifts, and timber. The Bulk Grains segment engages in the discharging, storage, and transshipment of corn, soybean, barley, and wheat. The Passenger and Ro-Ro segment includes passenger transportation and general cargo roll-on and roll-off. The Value-Added segment involves tallying, tugging, transportation, power supply, information technology, and construction services. The company was founded on November 16, 2005 and is headquartered in Dalian, China.', '2019-09-27 08:55:31', '2019-09-27 08:55:31', 1, 1),
