(9570, 1, 'Kapsch Trafficcom AG (BZ6)', 16, 77, 114, '-', 'http://www.hyoki.co.jp/', 'Hyoki Kaiun Kaisha, Ltd. engages in the shipping, port transportation, warehousing and real estate leasing businesses. It operates through the following segments: Shipping, Harbor Transport and Warehousing, and Others. The Shipping segment covers domestic and international shipping businesses. The Harbor Transport and Warehousing segment deals with port transportation business, including warehouse operations. The Others segment engages in the real estate leasing and trade businesses. The company was founded on December 30, 1942 and is headquartered in Kobe, Japan.', '2019-09-27 08:55:38', '2019-09-27 08:55:38', 1, 1),
(9571, 1, 'Kapsch Trafficcom AG (KTCG)', 16, 77, 217, '-', 'http://www.hhi.co.kr/', 'Hyundai Heavy Industries Co., Ltd. engages in the manufacture and sale of steel ships. Its operations are carried out through the following divisions: Shipbuilding, Offshore and Engineering, Industrial Plant and Engineering, Engine and Machinery, Electro Electric Systems, Green Energy and Construction Equipment. The Shipbuilding division main products involve VLCCs, tankers, product carriers, chemical tankers, containerships, bulk carriers, OBO carriers, ro-pax ships, ro-ro ships, pure car carriers, LNG carriers, LPG carriers, submarines, destroyers and frigates. The Offshore and Engineering division has floating units, mixed platforms, pipelines and subsea facilities, offshore installations. The Industrial Plant and Engineering division offers combined cycle power plant, thermal power plant, oil and gas processing plant, LNG plant, refinery plant, petrochecmical plant, process equipment, nuclear component, boiler and HRSG. The Engine and Machinery division provides machine engine equipment, industrial machinery, power plant and robot system. The Electro Electric System offers transformers, GIS, switchgear, low and medium voltage circuit breakers, power electronics, rotating machinery, integrated control and monitoring systems. The company Green Energy division has solar power system and wind turbine system. The Construction Equipment division offers excavators, wheel loaders, backhoe loaders, forklift trucks and skid steer loaders. The company was founded by Chung Ju-Yung on December 28, 1973 and is headquartered in Ulsan, South Korea.', '2019-09-27 08:55:38', '2019-09-27 08:55:38', 1, 1),
(9572, 1, 'KCTC (009070)', 16, 77, 217, '-', 'http://www.hmm21.com/cms/company/engn/index.jsp', 'Hyundai Merchant Marine Co., Ltd. engages in providing logistics services. It operates through the following business divisions: Container Services and Bulk Services. The Container Services division provides vessel fleet, North America Intermodal, dangerous cargo, over-sized cargo and reefer cargo services, and equipment such as container management service, refrigerated and specialized containers. The Bulk Services division offers crude tanker, trampers, bulk liner, heavy lift and project services. The company was founded on March 25, 1976 and is headquartered in Seoul, South Korea.', '2019-09-27 08:55:38', '2019-09-27 08:55:38', 1, 1),
