(9589, 1, 'Logwin AG (TGH)', 16, 77, 47, '-', 'http://www.jinzhouport.com/', 'Jinzhou Port Co. Ltd. engages in the provision of port services. Its activities include loading and unloading of oil and cargo, goods warehousing, and port management. It also provides freight transportation agency service, as well as logistical service. It also engages in the coal wholesale business, sale of mineral products, and development and management of land and real estate. The company was founded in October 1986 and is headquartered in Jinzhou, China.', '2019-09-27 08:55:40', '2019-09-27 08:55:40', 1, 1),
(9590, 1, 'Macquarie Atlas Roads Group (M82)', 16, 77, 47, '-', 'http://www.jinzhouport.com/', 'Jinzhou Port Co. Ltd. engages in the provision of port services. Its activities include loading and unloading of oil and cargo, goods warehousing, and port management. It also provides freight transportation agency service, as well as logistical service. It also engages in the coal wholesale business, sale of mineral products, and development and management of land and real estate. The company was founded in October 1986 and is headquartered in Jinzhou, China.', '2019-09-27 08:55:40', '2019-09-27 08:55:40', 1, 1),
