(9613, 1, 'Nissin Corp. (9066)', 16, 77, 114, '-', 'https://www.kuribayashishosen.com/', 'Kuribayashi Steamship Co., Ltd. engages in the provision of marine freight transportation and shipping agency services. It operates through the following segments: Marine Transportation, Hotel, and Real Estate. The Marine Transportation segment includes domestic and overseas shipping, port transportation, marine-related services, and passenger ferry operations. The Hotel segment operates resort hotels in Hokkaido region. The Real Estate segment engages in the management, rental and leasing of real estate properties. The company was founded in July 1894 and is headquartered in Tokyo, Japan.', '2019-09-27 08:55:41', '2019-09-27 08:55:41', 1, 1),
(9614, 1, 'Noida Toll Bridge Co. Ltd. (532481)', 16, 77, 114, '-', 'http://www.kyoeitanker.co.jp/', 'Kyoei Tanker Co., Ltd. engages in the marine transport business. Its main businesses include shipping service and vessel lending. The company was founded on March 19, 1937 and is headquartered in Tokyo, Japan.', '2019-09-27 08:55:42', '2019-09-27 08:55:42', 1, 1),
(9615, 1, 'Noida Toll Bridge Co. Ltd. GDR (NTBC)', 16, 77, 124, '-', '-', '-', '2019-09-27 08:55:42', '2019-09-27 08:55:42', 1, 1),
(9616, 1, 'Nurminen Logistics Oyj (NLG1V)', 16, 77, 106, '-', 'http://www.logindo.co.id/neo7/en/', 'PT Logindo Samudramakmur Tbk engages in the provision of domestic sea transportation services of passengers and goods. It also involves in the offshore support vessel chartering services for oil and gas industries. It offers anchor handling tugs, anchor handling supply vessels, platform supply vessels, diving support and utility vessels, crew boats, patrol boats, tug boats, and accommodation work barges. The company was founded by Eddy Kurniawan Logam and Rudy Kurniawan Logam on August 23, 1995 and is headquartered in Jakarta, Indonesia.', '2019-09-27 08:55:42', '2019-09-27 08:55:42', 1, 1),
(9617, 1, 'Nusantara Infrastructure (META)', 16, 77, 185, '-', 'http://www.lorenzoshipping.com/en/index.php', 'Lorenzo Shipping Corp. is a liner shipping company, which engages in the containerized cargo transport. The firm owns and operates vessels with which it provides domestic inter-island cargo liner services to the general public. It also owns equipment and facilities including land based equipment such as forklifts, top lifts and trucks and container yards and warehouses in its branches and agencies. It markets its services through a network of branches and agencies nationwide. The company was founded on October 17, 1972 and is headquartered in Manila, Philippines.', '2019-09-27 08:55:42', '2019-09-27 08:55:42', 1, 1),
(9618, 1, 'Orian Sh.M. Ltd. (ORIN)', 16, 77, 212, '-', '-', '-', '2019-09-27 08:55:42', '2019-09-27 08:55:42', 1, 1),
(9619, 1, 'Pacific CMA Inc. (PACC)', 16, 77, 136, '-', 'http://www.maybulk.com.my/', 'Malaysian Bulk Carriers Bhd. is an investment holding company, which engages in the provision of dry bulk and tanker shipping services internationally. The company also commenced ship owning and ship operating activities. It operates through the following segments: Bulkers, Tankers, Ship Brokerage and Management, and Investment Holding and Others. The company was founded on November 19, 1988 and is headquartered in Petaling Jaya, Malaysia.', '2019-09-27 08:55:42', '2019-09-27 08:55:42', 1, 1),
(9620, 1, 'PCC Intermodal S.A. (PCI)', 16, 77, 210, '-', 'http://www.manhattan.sg/', 'Manhattan Resources Ltd. operates as an investment holding company, which provides provision of management services. The company engages in barging activities as well as the provision of logistics, marine transportation and support services to the coal mining and resources industries. It operates through the following segments: Power Plant, Shipping, Property Development, Mineral Resources, and Corporate & Others. The Power Plant segment relates to the construction, acquisition, operations and maintenance of power plants and the production and sale of electric power in Indonesia. The Shipping segment includes ship chartering and provision of freight services in Indonesia for coal carrying activities. The Property Development segment relates to property development activities in China. The Mineral Resources segment operates mineral resources and mining activities in China. The Corporate & Others segment includes group-level corporate services, treasury functions, investments in properties and others, including overburden removal services and equipment leasing services. Manhattan Resources was founded on December 28, 1990 and is headquartered in Singapore.', '2019-09-27 08:55:42', '2019-09-27 08:55:42', 1, 1),
(9621, 1, 'Pekaes S.A. (PEK)', 16, 77, 210, '-', 'http://www.marcopolomarine.com.sg/', 'Marco Polo Marine Ltd. is an investment holding company, which engages in marine logistics. It operates through the Ship Catering Services and Ship Building and Repair Services segments. The Ship Catering Services segment is involved in charter hire activities which includes offshore supply vessels, tugboats, and barges. The Ship Building and Repair Services segment covers ship building; and ship maintenance, repair, outfitting, and conversion services. The company was founded by Yun Feng Lee in 1991 and is headquartered in Singapore.', '2019-09-27 08:55:42', '2019-09-27 08:55:42', 1, 1),
(9622, 1, 'Pelayaran Nasional Bina Buana Raya (BBRM)', 16, 77, 86, '-', '-', '-', '2019-09-27 08:55:42', '2019-09-27 08:55:42', 1, 1),
(9623, 1, 'Perak Corp. Bhd (PRKCORP)', 16, 77, 164, '-', '-', '-', '2019-09-27 08:55:42', '2019-09-27 08:55:42', 1, 1),
(9624, 1, 'Perak Transit Bhd (PTRANS)', 16, 77, 250, '-', '-', '-', '2019-09-27 08:55:42', '2019-09-27 08:55:42', 1, 1),
(9625, 1, 'Perfect Holding S.A. (PRFN)', 16, 77, 114, '-', 'https://www.meiji-shipping.com/', 'Meiji Shipping Co., Ltd. engages in the international shipping business. It operates through the following segments: Overseas Shipping, Hotel-related, and Real Estate Leasing. The Overseas Shipping segment manages ship chartering and ship management businesses. The Hotel-related segment provides hotel and golf course services. The Real Estate Leasing segment deals with office space leasing, real estate brokerage and building operations management. The company was founded by Nobuya Uchida on May 1, 1911 and is headquartered in Kobe, Japan.', '2019-09-27 08:55:42', '2019-09-27 08:55:42', 1, 1),
(9626, 1, 'PKP Cargo S.A. (PKP)', 16, 77, 219, '-', '-', 'Mercantile Shipping Co. Plc in carrying out investment activities and management services to its subsidiaries in the shipping industry. It also hires vessels for international sea cargo operations. The company was founded by Ainsley Nimal Ubesinghe Jayawardena and Klaus Kriwat on March 17, 1981 and is headquartered in Colombo, Sri Lanka.', '2019-09-27 08:55:42', '2019-09-27 08:55:42', 1, 1),
(9627, 1, 'Poh Tiong Choon Logistics Ltd. (P01)', 16, 77, 105, '-', 'http://mercator.in/', 'Mercator Ltd. engages in the marine transportation and shipping operations. It operates through the following business segments: Shipping; Offshore; Coal Mining, Trading and Logistics; and Others. The company was founded on November 24, 1983 and is headquartered in Mumbai, India.', '2019-09-27 08:55:42', '2019-09-27 08:55:42', 1, 1),
(9628, 1, 'Prime Oil Chemical Service Corp. (2904)', 16, 77, 105, '-', 'https://www.mindteck.com/', 'Mindteck (India) Ltd. is a holding company, which engages in the provision of information technology services. It includes products engineering, reengineering, and sustenance; data center transformation and information technology infrastructure management; application development and system integration; smart city solutions; information technology talent; and transition care. It operates through the following geographical segments: United States of America, India, and Rest of the World. The company was founded on July 25, 1991 and is headquartered in Bangalore, India.', '2019-09-27 08:55:43', '2019-09-27 08:55:43', 1, 1),
(9629, 1, 'PTA Holdings Inc. (PTAH)', 16, 77, 136, '-', 'https://www.misc.com.my/', 'MISC Bhd. engages in the provision of energy shipping and maritime solutions. It operates through the following segments: Liquefied Natural Gas (LNG), Petroleum, Offshore, Heavy Engineering, and Others. The LNG segment provides carrier services. The Petroleum segment offers petroleum tanker and chemical tanker services. The Offshore segment involves in owning, leasing, operation, and maintenance of offshore, floating, production, and offloading terminals. The Heavy Engineering segment includes marine repair, marine conversion and engineering, and construction work. The Others segment covers the management of operation of ports and marine terminals, provision of marine support services and consulting services relating to marine matters, provision of ship management services, marine education and training, and other diversified businesses. The company was founded on November 6, 1968 and is headquartered in Kuala Lumpur, Malaysia.', '2019-09-27 08:55:43', '2019-09-27 08:55:43', 1, 1);
INSERT INTO `companies` (`id`, `sic_code`, `name`, `sector`, `sub_sector`, `country`, `exchange`, `website`, `profile`, `created_at`, `updated_at`, `created_by`, `updated_by`) VALUES
(9630, 1, 'Qube Holdings Ltd. (QUB)', 16, 77, 114, '-', 'https://www.mes.co.jp/', 'Mitsui E&S Holdings Co., Ltd. provides investment holdings in engineering, construction, and shipbuilding services. It operates through the following segments: Ship, Marine Development, Machinery, Engineering, and Others. The Ship segment builds and repairs various types of ships and offshore development equipment including bulk carriers, crude oil tankers, reefers, high-speed passenger ships, container ships, underwater equipment and iron steel structures. The Marine Development segment constructs floating oil and gas production facilities. The Machinery segment manufactures marine and stationary diesel engines, marine equipment, blowers, process compressors, industrial boilers, process equipment, induction heaters, container cranes, industrial cranes, container terminal management systems. The Engineering segment handles chemical plants, oil refinery plants, overseas civil works, renewable energy power generation business, power plant, water treatment plants, waste treatment plants, resources recycling plants and PCB waste treatment facilities. The Others segment includes diesel power plant construction, transport equipment, system development, real estate rental businesses. The company was founded on November 14, 1917 and is headquartered in Tokyo, Japan.', '2019-09-27 08:55:43', '2019-09-27 08:55:43', 1, 1),
(9631, 1, 'Radiant Logistics Inc. (RLGT)', 16, 77, 114, '-', 'http://mol.co.jp/', 'Mitsui O.S.K. Lines Ltd. engages in the provision of marine transport services. It operates through the following segments: Dry Bulk, Energy Transport, Product Transport, Associated Businesses and Others. The Dry Bulk segment includes dry bulkers, oil tankers, LNG carriers, and car carriers. The Energy Transport segment covers the tankers, steaming coal carriers, LNG carriers and offshore business. The Product Transport segment comprises of containerships, ferries and coastal RoRo ships. The Associated Businesses segment includes real estate, cruise ship, tug boats and trading. The Others segment handles the ship maneuvering, management, shipping, finance and shipbuilding. The company was founded in April 1964 and is headquartered in Tokyo, Japan.', '2019-09-27 08:55:43', '2019-09-27 08:55:43', 1, 1),
(9632, 1, 'Radiant Logistics Inc. 9.75% Cum. Redeem. Perp. Pfd. Series A (RLGT.PA)', 16, 77, 250, '-', '-', '-', '2019-09-27 08:55:43', '2019-09-27 08:55:43', 1, 1),
(9633, 1, 'Ramba Energy Ltd. (R14)', 16, 77, 13, '-', 'https://www.mmaoffshore.com/', 'MMA Offshore Ltd. engages in the provision of marine services to the offshore oil and gas industry. It owns and operates fleet of vessels which operates in Australia, New Zealand, South East Asia, the Middle East, and Africa. It provides floating production storage and offloading offtake support; supply operations; construction support; dive and remotely operated vehicle support; subsea installation support; subsea inspection, maintenance, and repair; and tug and barge operations. The company was founded by James Henry Carver in 1982 and is headquartered in Fremantle, Australia.', '2019-09-27 08:55:43', '2019-09-27 08:55:43', 1, 1),
(9634, 1, 'Refrigeration Industries Co. S.A.K. (REFRI)', 16, 77, 114, '-', 'http://www.ntl-naigai.co.jp/index.html', 'Naigai Trans Line Ltd. engages in the business of international freight forwarding. It operates through the Japan and Overseas segments. Its services include trilateral, consolidated marine and international air cargo transportation, export and import services, and international multimodal transport. The company was founded on May 1, 1980 and is headquartered in Osaka, Japan.', '2019-09-27 08:55:43', '2019-09-27 08:55:43', 1, 1),
(9635, 1, 'Reysas Tasimacilik ve Lojistik Ticaret A.S. (RYSAS)', 16, 77, 114, '-', 'http://www.naikaizosen.co.jp/', 'Naikai Zosen Corp. engages in the manufacture and repair of ships, construction works, and operation of hotels and food service business. It operates through the following business divisions: Ships, Service Business and Others. The Ships division deals with the renovation and repair of commercial ships and various crafts such as cargo freights, automobile transport ships, container ships, and passenger ferries. The Service Business division manages hotels and restaurants, client contracts, and gift shops. The Others division includes onshore service business which handles the civil engineering construction and the installation of solar power generation systems. The company was founded on October 1, 1972 and is headquartered in Onomichi, Japan.', '2019-09-27 08:55:43', '2019-09-27 08:55:43', 1, 1),
(9636, 1, 'Rinko Corp. (9355)', 16, 77, 114, '-', 'https://www.namura.co.jp/ja/index.html', 'Namura Shipbuilding Co., Ltd. engages in the business of ship building, ship repair, and design, production and installation of bridges, floodgates and steel structures. Its operations are carried out through the following business segments: New Ship Business, Ship Repair Business, Machinery Business, Steel Structure and Land Machine Business, and Others. The New Ship Business segment provides the manufacture and sale of various types of vessels. The Ship Repair Business segment handles the repair and demolition of various vessels in the business being operated by the companies Hakodate Dock Co., Ltd. and Sasebo Heavy Industries Co., Ltd. The Machinery Business segment covers the manufacture and sale of marine equipment such as automated equipment and precision spring molding machine and crankshaft for the press in the business being operated by the companies Sasebo Heavy Industries Co., Ltd. and Orii & Mec Corp. The Steel Structure and Land Machine segment includes the manufacture and sale of steel structures. The Others segment provides the software development, shipping, wholesale and facility construction. The company was founded by Gennosuke Namura in February 1911 and is headquartered in Osaka, Japan.', '2019-09-27 08:55:43', '2019-09-27 08:55:43', 1, 1),
(9637, 1, 'Roadrunner Transportation Systems Inc. (RRTS)', 16, 77, 250, '-', '-', '-', '2019-09-27 08:55:43', '2019-09-27 08:55:43', 1, 1),
(9638, 1, 'Royal Wolf Holdings Ltd. (RWH)', 16, 77, 47, '-', 'http://www.nj-port.com/', 'Nanjing Port Co., Ltd. engages in the operation of port. Its business includes crude oil, refined oil, and liquid chemical transit storage; petrochemical warehousing, and integrated logistics services. The company was founded on September 21, 2001 and is headquartered in Nanjing, China.', '2019-09-27 08:55:43', '2019-09-27 08:55:43', 1, 1),
