(9651, 1, 'Sebang Co. Ltd. Pfd. Series 1 (004365)', 16, 77, 47, '-', 'http://www.nbmc.com.cn/', 'Ningbo Marine Co., Ltd. engages in the provision of logistics, cargo, and marine transportation services. Its business segments include Shipping transportation and Highway toll operations segments. It focuses on domestic and international cargo transportation, transportation infrastructure, transportation attached service facilities, and expressway. The company was founded on December 31, 1996 and is headquartered in Ningbo, China.', '2019-09-27 08:55:44', '2019-09-27 08:55:44', 1, 1),
(9652, 1, 'Senko Co. Ltd. (9069)', 16, 77, 47, '-', 'http://www.nbport.com.cn/', 'Ningbo Zhoushan Port Co., Ltd. engages in the operation of terminals focusing on port logistics, and capital operation development activities. Its business scopes include containers handling, iron core handling, crude oil handling, coal and liquefied chemicals handling, integrated logistics, and trade and sale services. The company was founded in 1979 and is headquartered in Ningbo, China.', '2019-09-27 08:55:44', '2019-09-27 08:55:44', 1, 1),
(9653, 1, 'SG Fleet Group Ltd. (SGF)', 16, 77, 114, '-', 'https://www.nyk.com/', 'Nippon Yusen KK operates as a global logistics enterprise offering ocean, land, and air transport services. It operates in six business sectors: Liner Trade, Bulk Shipping, Logistics, Air Cargo Transport, Real Estate, and Others. The company was founded on September 29, 1885 and is headquartered in Tokyo, Japan.', '2019-09-27 08:55:44', '2019-09-27 08:55:44', 1, 1),
