(9730, 1, 'World-Link Logistics (Asia) Holding Ltd. (8012)', 16, 77, 217, '-', 'http://www.samsungshi.com/kor/default.aspx', 'Samsung Heavy Industries Co., Ltd. engages in the production and sale of vessels, plant, and power systems. It operates through the following business areas: Shipbuilding, Engineering and Construction, Power and Control Systems, and Wind Energy. The Shipbuilding business provides tanker, container, passenger and drill ships, crude oil production and storage facility, fixed platform, and other shipbuilding products. The Engineering and Construction business offers architecture and development works, housing, civil works, and plants. The Power and Control Systems business include digital vessel, and home and building systems. The Wind Energy business provides wind power generators. The company was founded on August 5, 1974 and is headquartered in Seongnam, South Korea.', '2019-09-27 08:55:50', '2019-09-27 08:55:50', 1, 1),
(9731, 1, 'Xiamen International Airport Co. Ltd. (600897)', 16, 77, 106, '-', 'http://www.samudera.id/', 'PT Samudera Indonesia Tbk engages in providing cargo transportation and logistics services. It operates through the following segments: Shipping and Agency, Logistics and Terminal, and Others. It services include storage and warehouse, distribution center, packaging, labeling, customs clearance, formalities, door to door distribution, multimodal transportation, terminal, project logistics, and offshore support. The company was founded by Soedarpo Sastrosatomo in 1964 and is headquartered in Jakarta, Indonesia.', '2019-09-27 08:55:50', '2019-09-27 08:55:50', 1, 1),
(9732, 1, 'Xiamen Port Development Co. Ltd. A (000905)', 16, 77, 210, '-', 'http://ssl.samudera.id/ssl/', 'Samudera Shipping Line Ltd. engages in the transportation of containerized cargo, gas, liquid, and bulk cargo. It operates through the following segments: Container Shipping, Bulk and Tanker, and Logistics and Others. The Container Shipping segment provides feeder services for the transportation of containerized cargo between Singapore as a hub port and other outgoing spoke ports in Asia; as well as inter-region and intra-region container shipping services to end users. The Bulk andTanker segment offers the transportation of special dry bulk, liquid and gas cargo in the international and Indonesian domestic market. The Logistics and Others segment provides agency services in Bangkok, Port Klang, Penang, Mumbai, Kolkata, Chennai, and Dubai. The company was founded on December 22, 1993 and is headquartered in Singapore.', '2019-09-27 08:55:50', '2019-09-27 08:55:50', 1, 1),
