(9756, 1, 'ABC India Ltd. (520123)', 16, 78, 105, '-', 'http://www.abcindia.com/', 'ABC India Ltd. engages in the provision of logistics services. It operates through the following segments: Freight and Services; Petrol Pump; and Construction. It offers barge and road transportation solutions, freight forwarding, warehousing solutions, and record management services. The company was founded by P. D. Agarwal in 1963 and is headquartered in Kolkata, India.', '2019-09-27 08:58:52', '2019-09-27 08:58:52', 1, 1),
(9757, 1, 'ABG Shipyard Ltd. (532682)', 16, 78, 105, '-', 'http://www.abgindia.com/', 'ABG Shipyard Ltd. provides ship building and repair services. It specializes in the manufacture of vessels like Interceptor boats, Battle Practice Target, Cadet Training Ship, Self-Loading and Discharging Bulk Cement Carriers, Floating Cranes, Articouple Tugs and Flotilla, Split Barges, Bulk Carriers, Newsprint Carriers, Offshore Supply Vessels, Dynamic Positioning Ships, Anchor Handling Tug Supply Vessels, Multi-purpose Support Vessel, Diving Support Vessels, and Pollution Control Vessel. The company was founded on March 15, 1985 and is headquartered in Mumbai, India.', '2019-09-27 08:58:52', '2019-09-27 08:58:52', 1, 1),
(9758, 1, 'Adani Ports & Special Economic Zone Ltd. (532921)', 16, 78, 105, '-', 'https://www.adaniports.com/', 'Adani Ports & Special Economic Zone Ltd. engages in the development, operation, and maintenance of port and port based related infrastructure facilities. It operates through the Port and Special Economic Zone (SEZ) Activities; and Others business segments. The Port and SEZ Activities segment involves infrastructure development activities. The Others segment comprises of aircraft operating income, ulitilities services, and contaner trains services. The company was founded on May 26, 1998 and is headquartered in Ahmedabad, India.', '2019-09-27 08:58:52', '2019-09-27 08:58:52', 1, 1),
