(9761, 1, 'Alam Maritim Resources Bhd (ALAM)', 16, 78, 136, '-', 'http://www.alam-maritim.com.my/', 'Alam Maritim Resources Bhd. is an investment holding company, which engages in the provision of transportation support services, offshore facilities construction and installation, and underwater services to the upstream activities in the oil and gas industry. It operates through the following segments: Offshore Support Vessels and Services, Sub-sea Services, and Other. The Offshore Support Vessels and Services segment includes the provision of vessels for charter hire; assisting seismic operators in seismic survey related activities, transportation of crew and supplies, towing and mooring of rigs offshore, anchor-handling services and other support, repair and maintenance services for the oil and gas industry. The Sub-sea Services segment provides offshore facilities construction and installation services such as marine construction related services, sub-sea engineering services and offshore pipeline construction related services and designing, manufacturing and operating of remotely operated vehicles. The Other segment includes investment holding and provision of transportation, ship forwarding and agent and ship chandelling to the subsidiaries. The company was founded in 1998 and is headquartered in Kuala Lumpur, Malaysia.', '2019-09-27 08:58:53', '2019-09-27 08:58:53', 1, 1),
