(9768, 1, 'Asian Marine Services PCL (ASIMAR)', 16, 78, 231, '-', 'https://www.asimar.com/', 'Asian Marine Services Public Co., Ltd. engages in the provision of ship building and ship repair services. It operates through the Ship Repairing and Ship Building segments. It also provides ship conversion services; support vessels for offshore businesses; and other engineering works such as fabricating and repairing afloat and offshore constructions, and steel work structures for bridges, heavy industries, oil rigs, and factory components. The company was founded in 1981 and is headquartered in Samut Prakan, Thailand.', '2019-09-27 08:58:54', '2019-09-27 08:58:54', 1, 1),
(9769, 1, 'Asian Marine Services PCL NVDR (ASIMAR-R)', 16, 78, 231, '-', 'https://www.asimar.com/', 'Asian Marine Services Public Co., Ltd. engages in the provision of ship building and ship repair services. It operates through the Ship Repairing and Ship Building segments. It also provides ship conversion services; support vessels for offshore businesses; and other engineering works such as fabricating and repairing afloat and offshore constructions, and steel work structures for bridges, heavy industries, oil rigs, and factory components. The company was founded in 1981 and is headquartered in Samut Prakan, Thailand.', '2019-09-27 08:58:55', '2019-09-27 08:58:55', 1, 1),
(9770, 1, 'Asian Terminals Inc. (ATI)', 16, 78, 185, '-', 'https://www.asianterminals.com.ph/', 'Asian Terminals, Inc. engages in developing, investing, and managing port terminals. It operates through the General Cargo Division, Container Terminal Division, Batangas Container Terminal, Batangas Port, Off-dock Yards and South Cotabato Integrated Port . The company was founded on July 9, 1986 and is headquartered in Manila, Philippines.', '2019-09-27 08:58:55', '2019-09-27 08:58:55', 1, 1),
(9771, 1, 'ASL Marine Holdings Ltd. (A04)', 16, 78, 210, '-', 'http://www.aslmarine.com/', 'ASL Marine Holdings Ltd. engages in the provision of ship management services. It operates through the following business segments: Shipbuilding, Ship Repair and Conversion, Ship Chartering and Rental, Engineering, and Investment Holding. The Shipbuilding segment includes construction of vessels. The Ship Repair and Conversion segment provides repair and related services. The Ship Chartering and Rental segment deals with chartering of vessels and transportation services. The Engineering segment offers dredging engineering products and services. The Investment Holding segment provides corporate and treasury services to the group. The company was founded by Ang Sin Liu on October 4, 2000 and is headquartered in Singapore.', '2019-09-27 08:58:55', '2019-09-27 08:58:55', 1, 1),
(9772, 1, 'Atlantic Navigation Holdings (Singapore) Ltd. (5UL)', 16, 78, 210, '-', 'https://www.atlanticnavigation.com/', 'Atlantic Navigation Holdings (Singapore) Ltd. operates as an investment holding company, which is engaged in the provision of marine logistics services, ship repair, fabrication and other marine services. It operates through the following business segments: Marine logistics services; and Ship repair, fabrication and other marine services. The Ship repair, fabrication and other marine services segment provides repairs and maintenance of marine equipment, engines, heavy machines and related marine services. The Marine logistics services segment provides vessel chartering and chandlery services to external customers. The company was founded on August 31, 2004 and is headquartered in Singapore.', '2019-09-27 08:58:55', '2019-09-27 08:58:55', 1, 1),
(9773, 1, 'Austal Ltd. (ASB)', 16, 78, 13, '-', 'https://www.austal.com/', 'Austal Ltd. engages in the designing and construction of customized aluminum commercial and defense vessels. The company operates through the following segments: Australia, USA, and Philippines. The Australia segment manufactures defense vessels for markets worldwide, excluding the USA and provides training and on-going support and maintenance for vessels. The USA segment engages in the manufacturing of aluminum defense vessels for the US Navy and provides training and on-going support and maintenance of these performance vessels for the US Navy. The Philippines segment provides aluminum commercial vessels for global markets excluding the USA. It also offers support to other segments not just manufacturing for external buyers. The company was founded by John Rothwell in 1988 and is headquartered in Henderson, Australia.', '2019-09-27 08:58:55', '2019-09-27 08:58:55', 1, 1),
