(9790, 1, 'Boustead Heavy Industries Corp. Bhd (BHIC)', 16, 78, 136, '-', 'https://www.bhic.com.my/', 'Boustead Heavy Industries Corp. Bhd. is an investment holding company, which engages in shipbuilding and maintenance, repair, and overhaul (MRO) of naval vessels. It operates through the following segments: Defense and Security, Energy, and Commercial. The Defense and Security segment involves in shipbuilding, MRO of navy''s patrol vessels, and manufacture, supply, and maintenance of defense related electronic products. The Energy segment focuses on the fabrication of steel structures and platforms, marine engineering, oil and gas, hook up and commissioning and other related services. The Commercial segment includes heavy engineering, shipbuilding, MRO of non-navy''s vessels, providing trainings, trading of goods, and MRO of aircraft wheels and brakes. The company was founded on September 9, 1971 and is headquartered in Kuala Lumpur, Malaysia.', '2019-09-27 08:58:58', '2019-09-27 08:58:58', 1, 1),
