(9808, 1, 'Chang Jiang Shipping Group Phoenix Co. Ltd. (000520)', 16, 78, 47, '-', 'http://www.csc-hy.com.cn/', 'Chang Jiang Shipping Group Phoenix Co., Ltd. engages in the provision of dry bulk shipping and coastal and ocean integrated transport and logistics services. Its business Includes dry bulk transport, shipping agents, freight forwarders, integrated logistics and special large transport, ship leasing, crew services, and property management. The company uses the self-operated and term lease business model. The company was founded on June 15, 1992 and is headquartered in Wuhan, China.', '2019-09-27 08:59:01', '2019-09-27 08:59:01', 1, 1),
