(9821, 1, 'China Ocean Industry Group Ltd. (0651)', 16, 78, 102, '-', '-', 'China Ocean Industry Group Ltd. engages in the production and operation of shipbuilding, securities trading, and provision of financial services. It operates through three segments: Shipbuilding, Trading business, Finance leasing business, Intelligent car parking & automotive device business and Steel Structure Engineering & Installation. The Shipbuilding segment focuses on shipbuilding services under shipbuilding construction contracts China. The Trading business segment provides trading and is operated in Hong Kong. The Finance leasing business offers direct finance leasing, sale and leaseback, and advisory services in China. The Intelligent car parking and automotive device business manufactures and sells car parking equipment, investment, operation and management of car parks and electronic automotive devices. The Steel Structure Engineering & Installation segment engages in manufacturing and selling of steel structures and fittings for ship, marine equipment, mining equipment, ro-ro equipment, ship, bridge and building steel structure in the PRC. China Ocean Industry Group was founded on May 22, 1998 and is headquartered in Hong Kong.', '2019-09-27 08:59:02', '2019-09-27 08:59:02', 1, 1),
(9822, 1, 'China Shipbuilding Industry Co. Ltd. (601989)', 16, 78, 47, '-', 'http://www.csicl.com.cn/', 'China Shipbuilding Industry Co., Ltd. engages in the design, manufacture, and distribution of ships. It operates through the following business divisions: Shipbuilding and Support, Ship Remodeling and Repair, Naval Equipment, Offshore Engineering, and Others. The Shipbuilding and Support division designs, constructs, and upgrades various ships such as bulk carriers, chemical and oil tankers, and container vessels. The Ship Remodeling and Repair division modifies ship designs and restores ships. The Naval Equipment division provides warship diesel engine, shipboard weapons and launchers, communications and navigation equipment, and rugged computers. The Offshore Engineering division engages in the construction of offshore platforms and floating production structure. The Others division offers non-ship products and services such as wind turbine accessories, nuclear power plant emergency generators, and railway equipment and vehicles. The company was founded on March 18, 2008 and is headquartered in Beijing, China.', '2019-09-27 08:59:02', '2019-09-27 08:59:02', 1, 1),
(9823, 1, 'China Shipping Container Lines Co. Ltd. (2866)', 16, 78, 102, '-', 'http://www.en.cscl.com.cn/', 'COSCO SHIPPING Development Co., Ltd. engages in the ownership, chartering, and operation of container vessels for the provision of international and domestic container marine transportation services; and the operation of container terminals. It operates through the following segments: Container Shipping; Vessel Chartering and Container Leasing; Non-Shipping Related Leasing; Container; Financial Services; Equity Investment; and Others. The Container Shipping segment renders container marine transportation services and related businesses. The Container segment manufactures and sells containers. The Financial Services segment provides corporate banking and insurance brokerage services. The Equity Investment segment focuses on equity investments, including investments in associates, investments in joint ventures, and available-for-sale equity investments. The Others segment consists of cargo and liner agency services. The company was founded in 1997 and is headquartered in Shanghai, China.', '2019-09-27 08:59:02', '2019-09-27 08:59:02', 1, 1),
(9824, 1, 'China Shipping Container Lines Co. Ltd. (601866)', 16, 78, 47, '-', 'http://www.en.cscl.com.cn/', 'COSCO SHIPPING Development Co., Ltd. engages in the ownership, chartering, and operation of container vessels for the provision of international and domestic container marine transportation services; and the operation of container terminals. It operates through the following segments: Container Shipping; Vessel Chartering and Container Leasing; Non-Shipping Related Leasing; Container; Financial Services; Equity Investment; and Others. The Container Shipping segment renders container marine transportation services and related businesses. The Container segment manufactures and sells containers. The Financial Services segment provides corporate banking and insurance brokerage services. The Equity Investment segment focuses on equity investments, including investments in associates, investments in joint ventures, and available-for-sale equity investments. The Others segment consists of cargo and liner agency services. The company was founded in 1997 and is headquartered in Shanghai, China.', '2019-09-27 08:59:02', '2019-09-27 08:59:02', 1, 1),
