(9830, 1, 'Chinese Maritime Transport Ltd. (2612)', 16, 78, 228, '-', 'http://www.cmt.tw/', 'Chinese Maritime Transport Ltd. engages in the operation of bulk carriers; and inland container transportation and terminals. It owns and operates bulk vessels, bulk chartering, inland trucking, logistics, terminal, and air agency and tourism. The company was founded by Yin Kang Peng on January 31, 1978 and is headquartered in Taipei, Taiwan.', '2019-09-27 08:59:02', '2019-09-27 08:59:02', 1, 1),
(9831, 1, 'Chowgule Steamships Ltd. (501833)', 16, 78, 105, '-', 'http://www.chowgulesteamships.co.in/', 'Chowgule Steamships Ltd. engages in the seaborne transportation of bulk cargoes. It owns and operates vessels for moving bulk cargoes such as iron ore, grain, coal, and fertilizers. The company was founded on April 9, 1963 and is headquartered in Mumbai, India.', '2019-09-27 08:59:02', '2019-09-27 08:59:02', 1, 1),
(9832, 1, 'Chu Kong Shipping Enterprises (Group) Co. Ltd. (0560)', 16, 78, 102, '-', 'https://www.cksd.com/zh-HK', 'Chu Kong Shipping Enterprises (Group) Co. Ltd. is an investment holding company, which engages in the provision of terminal and shipping logistics services. It operates through the following segments: Cargo Transportation; Cargo Handling and Storage; Passenger Transportation; Fuel Supply; and Corporate and Other Businesses. The Cargo Transportation segment consists of shipping agency, river trade cargo direct shipment, transshipment, container handling, and trucking. The Cargo Handling and Storage segment offers wharf cargo handling and consolidation. The Passenger Transportation segment includes travel agency operations and passenger carrier services. The Fuel Supply segment deals with oil trading and marine bunkering solutions. The Corporate and Other Businesses segment pertains to the firm''s administrative activities. The company was founded on September 5, 1996 and is headquartered in Hong Kong.', '2019-09-27 08:59:02', '2019-09-27 08:59:02', 1, 1),
