(9834, 1, 'Coastal Contracts Bhd (COASTAL)', 16, 78, 136, '-', 'http://www.coastalcontracts.com/', 'Coastal Contracts Bhd. is an investment holding company, which engages in the provision of marine products and services to the shipping, oil and gas, and commodities industries. It operates through Vessels Manufacturing and Repairing Services; and Vessels Chartering and Equipment Hire segments. The Vessels Manufacturing and Repairing Services segment fabricates and sell offshore support and marine transportation vessels, and provides ship repairs and maintenance services. The Vessels Chartering and Equipment Hire segment provides vessels transportation and equipment hiring services. The company was founded in 1976 and is headquartered in Sandakan, Malaysia.', '2019-09-27 08:59:03', '2019-09-27 08:59:03', 1, 1),
(9835, 1, 'Colombo Dockyard PLC (DOCKN)', 16, 78, 219, '-', 'http://www.cdl.lk/', 'Colombo Dockyard Plc engages in the provision of shipping repair and engineering solutions. It operates through the following segments: Ship Repairs; Shipbuilding; Heavy Engineering; and Material and Other Sales. The Ship Repairs segment is responsible for all routine, damage, and retrofit repairs such as machinery, hull, propeller, electrical, electronic and automation, cargo gear repairs, internal tank, and installation of ballast water treatment systems. The Ship Building segment is the construction of small tug boats, patrol boats, and barges. The Heavy Engineering segment provides petrochemical installations such as fuel storage systems, liquefied petroleum gas storage systems, cement silos, piping systems, as well as supplying ancillary services, fabrication and installation. The company was founded by Ambalavanar Ragunathan in 1974 and is headquartered in Colombo, Sri Lanka.', '2019-09-27 08:59:03', '2019-09-27 08:59:03', 1, 1),
