(9844, 1, 'COSCO Shipping Co. Ltd. A (600428)', 16, 78, 47, '-', 'http://spe.coscoshipping.com/', 'COSCO Shipping Specialized Carriers Co., Ltd. engages in the provision of water freight transportation and logistics services. Its business covers the transportation of overlength, oversize, and overweight cargoes, including RIGs, engineering vessels, port machinery, locomotives, windmills, bridge cranes, and complete equipment. Its operates and manages multi-purpose and heavy lift vessels, semi-submersible vessels, pure car carriers, logs carriers as well as asphalt carriers. Its service includes liner service, vessel specifications, transport of offshore, shipping for heavy cargo, pure car carriers transport, log carrier transport, and asphalt carriers transport. The company was founded on December 8, 1999 and is headquartered in Guangzhou, China.', '2019-09-27 08:59:04', '2019-09-27 08:59:04', 1, 1),
