(9883, 1, 'DTXS Silk Road Investment Holdings Co. Ltd. (0620)', 16, 78, 102, '-', 'http://www.dtxs.com/en/', 'DTXS Silk Road Investment Holdings Co. Ltd. is an investment holding company, which provides marine engineering services. It operates through the following segments: Arts & Cultural Division, Fintech Division, Winery Division, e-Commerce Division, Jewellery Division and Engineering Services Division. The Arts and Cultural Division segment mainly represents auction business and sales of antique, art financing business and ACBD business. The Fintech Division segment mainly represents financial e-commerce business and provision of financial trading platform and solutions. The Winery Division segment mainly represents operation of vineyard, production and sales of wine and related business. The e-Commerce Division segment mainly represents trading of merchandise. The Jewellery Division segment represents sales of jewellery. The Engineering Services Division segment mainly represents sales of vessels, provision of marine engineering and construction and structural steel engineering services. DTXS Silk Road Investment Holdings was founded by Leung Man Kwong in 1940 and is headquartered in Hong Kong.', '2019-09-27 08:59:07', '2019-09-27 08:59:07', 1, 1),
