(9887, 1, 'E.A. Technique (M) Bhd (EATECH)', 16, 78, 136, '-', 'http://www.eatechnique.com.my/', 'E.A. Technique (M) Bhd. engages in the provision of logistics and ship management services. It operates through the following segments: Vessel Charter Hire & Other Income; and EPCIC. The Vessel charter hire & other income segment Vessel charter hire income is recognized on a straight-line basis over the lease term determined at the inception of the lease. The EPCIC segment refers to contract revenue arising from the provision of engineering, procurement, construction, installation and commissioning (EPCIC) of a floating, storage and offloading facility. The company was founded on January 18, 1993 and is headquartered in Kuala Lumpur, Malaysia.', '2019-09-27 08:59:08', '2019-09-27 08:59:08', 1, 1),
