(9899, 1, 'Ever Harvest Group Holdings Ltd. (1549)', 16, 78, 102, '-', 'http://www.xhsl.com.hk/en/', 'Ever Harvest Group Holdings Ltd. engages in rendering of sea freight transportation and freight forwarding services. It operates through the following segments: Sea Freight Forwarding Agency Services, Fujian Routes, Guangxi Routes, Guangdong Routes, and Hainan Routes. The company was founded by Yu Leung Lau on October 15, 2015 and is headquartered in Hong Kong.', '2019-09-27 08:59:09', '2019-09-27 08:59:09', 1, 1),
(9900, 1, 'Evergreen Marine Corp. (Taiwan) Ltd. (2603)', 16, 78, 228, '-', 'http://www.evergreen-marine.com/', 'Evergreen Marine Corp. (Taiwan) Ltd. provides marine shipping services. The firm offers container services, micro computer-controlled reefer containers, slot charters, slot exchanges and joint services, container terminals, and e-business services. Evergreen Marine was founded by Chang Yung-Fa on September 1, 1968 and is headquartered in Taipei, Taiwan.', '2019-09-27 08:59:09', '2019-09-27 08:59:09', 1, 1),
