(9903, 1, 'Ezion Holdings Ltd. (5ME)', 16, 78, 210, '-', 'http://www.ezionholdings.com/', 'Ezion Holdings Ltd. develops, owns and charters strategic offshore assets to support the offshore energy markets. It operates through the following business segments: Liftboats, Jack-Up Rigs, Offshore Support Logistics Services and Others. The Liftboats segment deals in the owning, chartering and management of self-propelled rigs involved in the production and maintenance phase of the oil and gas industry as well as the offshore windfarm industry. The Jack-Up Rigs segment consists of non self-propelled rigs involved in the production, maintenance and exploration phase of the oil and gas industry as well as offshore windfarm accommodation market. The Offshore Support Logistics Services segment comprises of oil and gas related offshore logistics support vessels. The Others segment involves assets or investments involved in renewable energy and other oil and gas related industries. The company was founded on July 28, 1999 and is headquartered in Singapore.', '2019-09-27 08:59:09', '2019-09-27 08:59:09', 1, 1),
