(9906, 1, 'Far Eastern Shipping Co. (FESH)', 16, 78, 192, '-', 'https://www.fesco.ru/', 'Far Eastern Shipping Co. OJSC is engaged in the shipping services. Its activities include ship owning, ship management, chartering out, and line operating. The company operates within the following segments: Shipping, Liner and Logistics, Railway Services, Ports and Bunkering. The Shipping segment involves in ship ownership, ship management, chartering out, and provision of agency cervices. The Liner and Logistics segment operates liner services, and provides freight forwarding services both for containers and bulk carriers. The Railway Services segment provides services both as an operator and an agent. The Ports segment owns and operates facilities and container terminals, and provides cargo handling, stevedoring, container storage and rental, and related port services and facilities. The bunkering segment provides services of ship bunkering which involves transferring oil and fuel from a vessel and other supporting activity. The company was founded in 1880 and is headquartered in Moscow, Russia.', '2019-09-27 08:59:10', '2019-09-27 08:59:10', 1, 1),
