(9911, 1, 'First Ship Lease Trust (D8DU)', 16, 78, 210, '-', 'http://www.firstshipleasetrust.com/', 'First Ship Lease Trust engages in leasing and chartering of vessels which is carried out in international waters. It vessels are diversified across four shipping sub-sectors, namely crude oil tankers, product tankers, chemical tankers and containerships. The company was founded on March 19, 2007 and is headquartered in Singapore.', '2019-09-27 08:59:10', '2019-09-27 08:59:10', 1, 1),
(9912, 1, 'First Steamship Co. Ltd. (2601)', 16, 78, 228, '-', 'http://www.firsteam.com.tw/', 'First Steamship Co., Ltd. engages in department store retail. It operates through the following business segments: Shipping, Investment, Department store, and Leasing. The Shipping segment engages in domestic and international shipping and provides related services. The Investment segment includes domestic and foreign investment businesses. The Department store segment includes the operation of retailers and department store chains. The Leasing segment provides automobile finance leasing services. The company was founded on October 8, 1963 and is headquartered in Taipei, Taiwan.', '2019-09-27 08:59:10', '2019-09-27 08:59:10', 1, 1);
