(9962, 1, 'Humpuss Intermoda Transportasi (HITS)', 16, 78, 106, '-', 'http://www.hits.co.id/', 'PT Humpuss Intermoda Transportasi Tbk engages in the provision of sea transportation services and other activities related to sea transportation. It operates through the following business segments: Chartered Vessel Services, and Crews and Vessel Management Services. The company was founded on December 21, 1992 and is headquartered in Jakarta, Indonesia.', '2019-09-27 08:59:15', '2019-09-27 08:59:15', 1, 1),
