(9971, 1, 'Icon Offshore Bhd (ICON)', 16, 78, 136, '-', 'http://www.iconoffshore.com.my/', 'Icon Offshore Bhd. operates as an investment holding company, which engages in the provision of offshore support vessel services. It offers vessel owning and leasing, and provides provision of vessel chartering and ship management services to oil and gas related industries. The company was founded on March 30, 2012 and is headquartered in Kuala Lumpur, Malaysia.', '2019-09-27 08:59:16', '2019-09-27 08:59:16', 1, 1),
(9972, 1, 'Iino Kaiun Kaisha Ltd. (9119)', 16, 78, 114, '-', 'http://www.iino.co.jp/', 'Iino Kaiun Kaisha, Ltd. engages in the business of shipping and real estate services. It operates through the following segments: Oceangoing Shipping, Regional Shipping, and Real Estate. The Oceangoing Shipping segment operates oil and chemical tankers, large gas carriers, and dry bulkers. The Regional Shipping segment manages pressurized gas carriers and transports fuel gases such as LNG and LPG, and petrochemical gases such as propylene and vinyl chloride monomers (VCM) in Japanese coastal waters and adjacent waters including East Asia and Southeast Asia. The Real Estate segment provides real estate-related activities such as warehousing, building development, operation, management, and maintenance. The company was founded by Torakichi Iino in July 1899 and is headquartered in Tokyo, Japan.', '2019-09-27 08:59:16', '2019-09-27 08:59:16', 1, 1),
