(9974, 1, 'International Container Terminal Services Inc. (ICT)', 16, 78, 185, '-', 'https://www.ictsi.com/', 'International Container Terminal Services, Inc. engages in developing, acquiring, owning, and operating common-user container terminals for cargo handling and services. It operates through the following geographical segments: Asia; Europe, Middle East and Africa (EMEA); and Americas. The Asia segment includes Manila International Container Terminal, Bauan Terminal, Bauan, Philippines, Sasa Wharf, Port of Davao and Makar Wharf, Port of General Santos, Philippines. The EMEA segment comprises of Baltic Container Terminal, Gdynia, Poland, Port of Batumi, Batumi, Georgia, Brajdica Container Terminal, Rijeka, Croatia, and Port of Toamasina, Toamasina, Madagascar. The Americas segment consists of Suape Container Terminal, Suape, Brazil, Port of Guayaquil, Guayaquil, Ecuador, Port of La Plata, Buenos Aires Province, Argentina, and Port of Manzanillo, Manzanillo, Mexico (CMSA) and Port of Tuxpan, Mexico. The company was founded on December 24, 1987 and is headquartered in Manila, Philippines.', '2019-09-27 08:59:17', '2019-09-27 08:59:17', 1, 1),
