(9990, 1, 'Kawasaki Kinkai Kisen Kaisha Ltd. (9179)', 16, 78, 114, '-', 'https://www.kawakin.co.jp/', 'Kawasaki Kinkai Kisen Kaisha, Ltd. engages in the sea freight transportation. Its operations are carried out through the following segments: Coastal, Domestic, and Others. The Coastal segment includes international transport services through trampers and liners. The Domestic segment handles local transport services through trampers, liners and ferries. The Others segment deals with real estate leasing and offshore support vessels. The company was founded on May 1, 1966 and is headquartered in Tokyo, Japan.', '2019-09-27 08:59:19', '2019-09-27 08:59:19', 1, 1),
(9991, 1, 'Kawasaki Kisen Kaisha Ltd. (9107)', 16, 78, 114, '-', 'https://www.kline.co.jp/ja/index.html', 'Kawasaki Kisen Kaisha, Ltd. engages in the provision of marine transportation services. It operates through the following segments: Containership, Bulk Shipping, Offshore Energy Exploration and Production (E&P) Support and Heavy Lifter, and Others. The Containership segment offers container and cargo shipping, port, and logistics services. The Bulk Shipping segment includes dry bulk, car carrier, liquefied natural gas tanker, ferry, and coastal businesses. The Offshore Energy E&P Support and Heavy Lifter segment deals with large-scale cargo, energy resource development, and offshore support services. The Others segment consists of ship management, travel agency, and real estate businesses. The company was founded on April 5, 1919 and is headquartered in Tokyo, Japan.', '2019-09-27 08:59:19', '2019-09-27 08:59:19', 1, 1),
