(10003, 1, 'Korea Line Corp. (005880)', 16, 78, 217, '-', 'http://www.korealines.co.kr/', 'Korea Line Corp. engages in the provision of shipping and carrier services of raw materials and mineral resources. It operates through the Carrier and Tramper Carrier Business segments. The Carrier business provides transport service for liquefied natural gas, iron, ore, and coal. The Tramper Carrier Service includes dry bulk transportation and carrier services for steel, raw sugar, grain, mineral resources and iron. The company was founded on December 12, 1968 and is headquartered in Seoul, South Korea.', '2019-09-27 08:59:20', '2019-09-27 08:59:20', 1, 1),
(10004, 1, 'KSS Line Ltd. (044450)', 16, 78, 217, '-', 'https://www.kssline.com/', 'KSS LINE Ltd. engages in the marine transportation industry. It operates through the following business divisions: Gas and Chemical. The Gas business transports and handles cargoes such as anhydrous ammonia, butadiene, butane, butane1, C4 raffinate, ethylene, propane, propylene, and vinyl chloride monomer. The Chemical business transports and handles cargoes such as acetic acid, acetone, acrylonitrile monomer, aniline, benzene, toluene, xylene, base oil, cumene, cyclohexane, dioctyl phthalate, ethanol, kerosene, methanol, methyl ethyl ketone, mono ethylene glycol, nitric acid, octanol, phenol, pyrolysis gasoline, styrene monomer, and vinyl acetate monomer. The company was founded on June 27, 1984 and is headquartered in Seoul, South Korea.', '2019-09-27 08:59:20', '2019-09-27 08:59:20', 1, 1),
