(10009, 1, 'Kuribayashi Steamship Co. Ltd. (9171)', 16, 78, 114, '-', 'https://www.kuribayashishosen.com/', 'Kuribayashi Steamship Co., Ltd. engages in the provision of marine freight transportation and shipping agency services. It operates through the following segments: Marine Transportation, Hotel, and Real Estate. The Marine Transportation segment includes domestic and overseas shipping, port transportation, marine-related services, and passenger ferry operations. The Hotel segment operates resort hotels in Hokkaido region. The Real Estate segment engages in the management, rental and leasing of real estate properties. The company was founded in July 1894 and is headquartered in Tokyo, Japan.', '2019-09-27 08:59:21', '2019-09-27 08:59:21', 1, 1),
(10010, 1, 'Kyoei Tanker Co. Ltd. (9130)', 16, 78, 114, '-', 'http://www.kyoeitanker.co.jp/', 'Kyoei Tanker Co., Ltd. engages in the marine transport business. Its main businesses include shipping service and vessel lending. The company was founded on March 19, 1937 and is headquartered in Tokyo, Japan.', '2019-09-27 08:59:21', '2019-09-27 08:59:21', 1, 1),
