(10012, 1, 'Logindo Samudramakmur (LEAD)', 16, 78, 106, '-', 'http://www.logindo.co.id/neo7/en/', 'PT Logindo Samudramakmur Tbk engages in the provision of domestic sea transportation services of passengers and goods. It also involves in the offshore support vessel chartering services for oil and gas industries. It offers anchor handling tugs, anchor handling supply vessels, platform supply vessels, diving support and utility vessels, crew boats, patrol boats, tug boats, and accommodation work barges. The company was founded by Eddy Kurniawan Logam and Rudy Kurniawan Logam on August 23, 1995 and is headquartered in Jakarta, Indonesia.', '2019-09-27 08:59:21', '2019-09-27 08:59:21', 1, 1),
(10013, 1, 'Lorenzo Shipping Corp. (LSC)', 16, 78, 185, '-', 'http://www.lorenzoshipping.com/en/index.php', 'Lorenzo Shipping Corp. is a liner shipping company, which engages in the containerized cargo transport. The firm owns and operates vessels with which it provides domestic inter-island cargo liner services to the general public. It also owns equipment and facilities including land based equipment such as forklifts, top lifts and trucks and container yards and warehouses in its branches and agencies. It markets its services through a network of branches and agencies nationwide. The company was founded on October 17, 1972 and is headquartered in Manila, Philippines.', '2019-09-27 08:59:21', '2019-09-27 08:59:21', 1, 1),
