(10015, 1, 'Malaysian Bulk Carriers Bhd (MAYBULK)', 16, 78, 136, '-', 'http://www.maybulk.com.my/', 'Malaysian Bulk Carriers Bhd. is an investment holding company, which engages in the provision of dry bulk and tanker shipping services internationally. The company also commenced ship owning and ship operating activities. It operates through the following segments: Bulkers, Tankers, Ship Brokerage and Management, and Investment Holding and Others. The company was founded on November 19, 1988 and is headquartered in Petaling Jaya, Malaysia.', '2019-09-27 08:59:21', '2019-09-27 08:59:21', 1, 1),
(10016, 1, 'Manhattan Resources Ltd. (L02)', 16, 78, 210, '-', 'http://www.manhattan.sg/', 'Manhattan Resources Ltd. operates as an investment holding company, which provides provision of management services. The company engages in barging activities as well as the provision of logistics, marine transportation and support services to the coal mining and resources industries. It operates through the following segments: Power Plant, Shipping, Property Development, Mineral Resources, and Corporate & Others. The Power Plant segment relates to the construction, acquisition, operations and maintenance of power plants and the production and sale of electric power in Indonesia. The Shipping segment includes ship chartering and provision of freight services in Indonesia for coal carrying activities. The Property Development segment relates to property development activities in China. The Mineral Resources segment operates mineral resources and mining activities in China. The Corporate & Others segment includes group-level corporate services, treasury functions, investments in properties and others, including overburden removal services and equipment leasing services. Manhattan Resources was founded on December 28, 1990 and is headquartered in Singapore.', '2019-09-27 08:59:21', '2019-09-27 08:59:21', 1, 1),
(10017, 1, 'Marco Polo Marine Ltd. (5LY)', 16, 78, 210, '-', 'http://www.marcopolomarine.com.sg/', 'Marco Polo Marine Ltd. is an investment holding company, which engages in marine logistics. It operates through the Ship Catering Services and Ship Building and Repair Services segments. The Ship Catering Services segment is involved in charter hire activities which includes offshore supply vessels, tugboats, and barges. The Ship Building and Repair Services segment covers ship building; and ship maintenance, repair, outfitting, and conversion services. The company was founded by Yun Feng Lee in 1991 and is headquartered in Singapore.', '2019-09-27 08:59:22', '2019-09-27 08:59:22', 1, 1),
