(10021, 1, 'Meiji Shipping Co. Ltd. (9115)', 16, 78, 114, '-', 'https://www.meiji-shipping.com/', 'Meiji Shipping Co., Ltd. engages in the international shipping business. It operates through the following segments: Overseas Shipping, Hotel-related, and Real Estate Leasing. The Overseas Shipping segment manages ship chartering and ship management businesses. The Hotel-related segment provides hotel and golf course services. The Real Estate Leasing segment deals with office space leasing, real estate brokerage and building operations management. The company was founded by Nobuya Uchida on May 1, 1911 and is headquartered in Kobe, Japan.', '2019-09-27 08:59:22', '2019-09-27 08:59:22', 1, 1),
(10022, 1, 'Mercantile Shipping Co. PLC (MSLN)', 16, 78, 219, '-', '-', 'Mercantile Shipping Co. Plc in carrying out investment activities and management services to its subsidiaries in the shipping industry. It also hires vessels for international sea cargo operations. The company was founded by Ainsley Nimal Ubesinghe Jayawardena and Klaus Kriwat on March 17, 1981 and is headquartered in Colombo, Sri Lanka.', '2019-09-27 08:59:22', '2019-09-27 08:59:22', 1, 1),
(10023, 1, 'Mercator Ltd. (526235)', 16, 78, 105, '-', 'http://mercator.in/', 'Mercator Ltd. engages in the marine transportation and shipping operations. It operates through the following business segments: Shipping; Offshore; Coal Mining, Trading and Logistics; and Others. The company was founded on November 24, 1983 and is headquartered in Mumbai, India.', '2019-09-27 08:59:22', '2019-09-27 08:59:22', 1, 1),
(10024, 1, 'Mindteck (India) Ltd. (517344)', 16, 78, 105, '-', 'https://www.mindteck.com/', 'Mindteck (India) Ltd. is a holding company, which engages in the provision of information technology services. It includes products engineering, reengineering, and sustenance; data center transformation and information technology infrastructure management; application development and system integration; smart city solutions; information technology talent; and transition care. It operates through the following geographical segments: United States of America, India, and Rest of the World. The company was founded on July 25, 1991 and is headquartered in Bangalore, India.', '2019-09-27 08:59:22', '2019-09-27 08:59:22', 1, 1),
(10025, 1, 'MISC Bhd (MISC)', 16, 78, 136, '-', 'https://www.misc.com.my/', 'MISC Bhd. engages in the provision of energy shipping and maritime solutions. It operates through the following segments: Liquefied Natural Gas (LNG), Petroleum, Offshore, Heavy Engineering, and Others. The LNG segment provides carrier services. The Petroleum segment offers petroleum tanker and chemical tanker services. The Offshore segment involves in owning, leasing, operation, and maintenance of offshore, floating, production, and offloading terminals. The Heavy Engineering segment includes marine repair, marine conversion and engineering, and construction work. The Others segment covers the management of operation of ports and marine terminals, provision of marine support services and consulting services relating to marine matters, provision of ship management services, marine education and training, and other diversified businesses. The company was founded on November 6, 1968 and is headquartered in Kuala Lumpur, Malaysia.', '2019-09-27 08:59:22', '2019-09-27 08:59:22', 1, 1),
(10026, 1, 'Mitsui Engineering & Shipbuilding Co. Ltd. (7003)', 16, 78, 114, '-', 'https://www.mes.co.jp/', 'Mitsui E&S Holdings Co., Ltd. provides investment holdings in engineering, construction, and shipbuilding services. It operates through the following segments: Ship, Marine Development, Machinery, Engineering, and Others. The Ship segment builds and repairs various types of ships and offshore development equipment including bulk carriers, crude oil tankers, reefers, high-speed passenger ships, container ships, underwater equipment and iron steel structures. The Marine Development segment constructs floating oil and gas production facilities. The Machinery segment manufactures marine and stationary diesel engines, marine equipment, blowers, process compressors, industrial boilers, process equipment, induction heaters, container cranes, industrial cranes, container terminal management systems. The Engineering segment handles chemical plants, oil refinery plants, overseas civil works, renewable energy power generation business, power plant, water treatment plants, waste treatment plants, resources recycling plants and PCB waste treatment facilities. The Others segment includes diesel power plant construction, transport equipment, system development, real estate rental businesses. The company was founded on November 14, 1917 and is headquartered in Tokyo, Japan.', '2019-09-27 08:59:22', '2019-09-27 08:59:22', 1, 1),
(10027, 1, 'Mitsui O.S.K. Lines Ltd. (9104)', 16, 78, 114, '-', 'http://mol.co.jp/', 'Mitsui O.S.K. Lines Ltd. engages in the provision of marine transport services. It operates through the following segments: Dry Bulk, Energy Transport, Product Transport, Associated Businesses and Others. The Dry Bulk segment includes dry bulkers, oil tankers, LNG carriers, and car carriers. The Energy Transport segment covers the tankers, steaming coal carriers, LNG carriers and offshore business. The Product Transport segment comprises of containerships, ferries and coastal RoRo ships. The Associated Businesses segment includes real estate, cruise ship, tug boats and trading. The Others segment handles the ship maneuvering, management, shipping, finance and shipbuilding. The company was founded in April 1964 and is headquartered in Tokyo, Japan.', '2019-09-27 08:59:22', '2019-09-27 08:59:22', 1, 1),
(10028, 1, 'Mitsui O.S.K. Lines Ltd. ADR (MSLOY)', 16, 78, 250, '-', '-', '-', '2019-09-27 08:59:22', '2019-09-27 08:59:22', 1, 1),
(10029, 1, 'MMA Offshore Ltd. (MRM)', 16, 78, 13, '-', 'https://www.mmaoffshore.com/', 'MMA Offshore Ltd. engages in the provision of marine services to the offshore oil and gas industry. It owns and operates fleet of vessels which operates in Australia, New Zealand, South East Asia, the Middle East, and Africa. It provides floating production storage and offloading offtake support; supply operations; construction support; dive and remotely operated vehicle support; subsea installation support; subsea inspection, maintenance, and repair; and tug and barge operations. The company was founded by James Henry Carver in 1982 and is headquartered in Fremantle, Australia.', '2019-09-27 08:59:23', '2019-09-27 08:59:23', 1, 1),
(10030, 1, 'Naigai Trans Line Ltd. (9384)', 16, 78, 114, '-', 'http://www.ntl-naigai.co.jp/index.html', 'Naigai Trans Line Ltd. engages in the business of international freight forwarding. It operates through the Japan and Overseas segments. Its services include trilateral, consolidated marine and international air cargo transportation, export and import services, and international multimodal transport. The company was founded on May 1, 1980 and is headquartered in Osaka, Japan.', '2019-09-27 08:59:23', '2019-09-27 08:59:23', 1, 1),
(10031, 1, 'Naikai Zosen Corp. (7018)', 16, 78, 114, '-', 'http://www.naikaizosen.co.jp/', 'Naikai Zosen Corp. engages in the manufacture and repair of ships, construction works, and operation of hotels and food service business. It operates through the following business divisions: Ships, Service Business and Others. The Ships division deals with the renovation and repair of commercial ships and various crafts such as cargo freights, automobile transport ships, container ships, and passenger ferries. The Service Business division manages hotels and restaurants, client contracts, and gift shops. The Others division includes onshore service business which handles the civil engineering construction and the installation of solar power generation systems. The company was founded on October 1, 1972 and is headquartered in Onomichi, Japan.', '2019-09-27 08:59:23', '2019-09-27 08:59:23', 1, 1),
(10032, 1, 'Namura Shipbuilding Co. Ltd. (7014)', 16, 78, 114, '-', 'https://www.namura.co.jp/ja/index.html', 'Namura Shipbuilding Co., Ltd. engages in the business of ship building, ship repair, and design, production and installation of bridges, floodgates and steel structures. Its operations are carried out through the following business segments: New Ship Business, Ship Repair Business, Machinery Business, Steel Structure and Land Machine Business, and Others. The New Ship Business segment provides the manufacture and sale of various types of vessels. The Ship Repair Business segment handles the repair and demolition of various vessels in the business being operated by the companies Hakodate Dock Co., Ltd. and Sasebo Heavy Industries Co., Ltd. The Machinery Business segment covers the manufacture and sale of marine equipment such as automated equipment and precision spring molding machine and crankshaft for the press in the business being operated by the companies Sasebo Heavy Industries Co., Ltd. and Orii & Mec Corp. The Steel Structure and Land Machine segment includes the manufacture and sale of steel structures. The Others segment provides the software development, shipping, wholesale and facility construction. The company was founded by Gennosuke Namura in February 1911 and is headquartered in Osaka, Japan.', '2019-09-27 08:59:23', '2019-09-27 08:59:23', 1, 1),
(10033, 1, 'Namura Shipbuilding Co. Ltd. (NMRSF)', 16, 78, 250, '-', '-', '-', '2019-09-27 08:59:23', '2019-09-27 08:59:23', 1, 1),
(10034, 1, 'Nanjing Port Co. Ltd. (002040)', 16, 78, 47, '-', 'http://www.nj-port.com/', 'Nanjing Port Co., Ltd. engages in the operation of port. Its business includes crude oil, refined oil, and liquid chemical transit storage; petrochemical warehousing, and integrated logistics services. The company was founded on September 21, 2001 and is headquartered in Nanjing, China.', '2019-09-27 08:59:23', '2019-09-27 08:59:23', 1, 1),
(10035, 1, 'National Shipping Co. of Saudi Arabia (4030)', 16, 78, 204, '-', 'https://www.bahri.sa/', 'The National Shipping Co. of Saudi Arabia engages in the purchasing, chartering, and operating vessels for cargo and passengers transportation. It operates through the following business units: Crude Oil Transportation; General Cargo Transportation; Chemical Transportation; and Dry Bulk Transportation. The Crude Oil Transportation segment provides crude carriers such as tankers. The General Cargo Transportation segment operates on commercial lines between North America, and Europe, the Middle East and the Indian subcontinent. The Chemical Transportation segment refers to the operation of vessels for liquid chemical and clean petroleum products such as fuel, gasoline, and vegetables oils. The Dry Bulk Transportation segment refers to the roll-on-roll-off transportation of heavy lift and container cargo. The company was founded on January 21, 1978 and is headquartered in Riyadh, Saudi Arabia. ', '2019-09-27 08:59:23', '2019-09-27 08:59:23', 1, 1),
