(10051, 1, 'Noble Century Investment Holdings Ltd. (2322)', 16, 78, 102, '-', 'http://www.noblecentury.hk/', 'Noble Century Investment Holdings Ltd. engages in identifying and exploring investment businesses. It operates through the following segments: Vessel Chartering, Trading, Money Lending, and Finance Leasing. The Vessel chartering segment offers voyage chartering. The Trading segment involves in marketing and distribution of products. The Money Lending segment includes loan financing services. The Finance Leasing segment offers sale-leaseback and financing services. The company founded on June 26, 2002 and is headquartered in Hong Kong.', '2019-09-27 08:59:25', '2019-09-27 08:59:25', 1, 1),
