(10056, 1, 'North-Western Shipping Co. (SZPR)', 16, 78, 192, '-', 'https://www.nwship.com/', 'North-Western Shipping Co. PJSC provides transport services. It engages in the export-import shipping of bulk, general and project cargoes, and towages of oversized cargo and craft. The company provides transport services on the inland waterways of Russia and international sea traffic. North-Western Shipping was founded on January 30, 1923 and is headquartered in Saint-Petersburg, Russia.', '2019-09-27 08:59:25', '2019-09-27 08:59:25', 1, 1),
(10057, 1, 'Novorossiysk Commercial Sea Port (NMTP)', 16, 78, 192, '-', 'http://www.nmtp.info/', 'Novorossiysk Commercial Sea Port PJSC engages in the stevedoring, additional port services, and sea vessel services. It offers stevedoring services and additional port services; fleet services; and other services mainly comprising rent, resale of energy and utilities to external customers. The company was founded in 1845 and is headquartered in Novorossiysk, Russia.', '2019-09-27 08:59:25', '2019-09-27 08:59:25', 1, 1),
