(10060, 1, 'NS United Kaiun Kaisha Ltd. (9110)', 16, 78, 114, '-', 'http://www.nsuship.co.jp/', 'NS United Kaiun Kaisha, Ltd. provides marine transportation services for raw materials and fuel for the iron production industry, raw materials for other industries, various energy resources, industrial products, and feed grains. It operates through the following business segments: Ocean Shipping, Domestic Shipping, and Others. The Ocean Shipping segment manages and operates ocean-going vessels, cargo ships, and freight transportation. The Domestic Shipping segment offers domestic marine transportation services. The Others segment deals with general affairs and accounting operational contracting services. It also engages in the manufacturing, sale, repair and maintenance of vessels and shipping equipment; personnel placement agency operations; property and life insurance agency operations; real estate operations; data-processing and business information services. The company was founded on April 1, 1950 and is headquartered in Tokyo, Japan.', '2019-09-27 08:59:26', '2019-09-27 08:59:26', 1, 1),
