(10071, 1, 'Orient Overseas (International) Ltd. (0316)', 16, 78, 102, '-', 'https://www.ooilgroup.com/Pages/default.aspx', 'Orient Overseas (International) Ltd. is an investment holding company, which engages in the business of container transport and logistics services. It operates through the following segments: Container Transport and Logistics, and Others. The Container Transport and Logistics segment includes containerised shipping services in major trade lanes, covering Trans-Pacific, Trans-Atlantic, Asia/Europe, Asia/Australia and Intra-Asia trades, and integrated services. The company was founded on July 29, 1986 and is headquartered in Hong Kong.', '2019-09-27 08:59:27', '2019-09-27 08:59:27', 1, 1),
(10072, 1, 'Oriental Precision & Engineering Co. Ltd. (014940)', 16, 78, 217, '-', 'http://www.opco.co.kr/main/main.htm', 'Oriental Precision & Engineering Co., Ltd. engages in the manufacture machineries and equipment for ships. It products include lifting appliances, engine room crane, life saving appliances, deck machinery, deck house, engine room casing, funnel, and living quarter. The company was founded on July 19, 1980 and is headquartered in Busan, South Korea.', '2019-09-27 08:59:27', '2019-09-27 08:59:27', 1, 1),
