(10075, 1, 'Pacific Basin Shipping Ltd. (2343)', 16, 78, 102, '-', 'https://www.pacificbasin.com/en/global/home.php', 'Pacific Basin Shipping Ltd. is an investment holding company, which engages in the ownership and international operation of dry bulk ships Handysize and Supramax dry bulk ships. It caters industrial users, traders, and produces of dry bulk commodities under spot and long-term contracts. The company was founded in 1987 and is headquartered in Hong Kong.', '2019-09-27 08:59:27', '2019-09-27 08:59:27', 1, 1),
