(10078, 1, 'Pan Ocean Co. Ltd. (AZY)', 16, 78, 210, '-', 'https://www.panocean.com/ko', 'Pan Ocean Co., Ltd. engages in the provision of marine transportation services. It operates through following businesses: includes Break Bulk Liner, Tramper, Large Bulker, Container, Tanker, Gas Carrier and Heavy Lifter. The company was founded on May 28, 1966 and is headquartered in Seoul, South Korea.', '2019-09-27 08:59:28', '2019-09-27 08:59:28', 1, 1),
(10079, 1, 'Pan Ocean Co. Ltd. (028670)', 16, 78, 217, '-', 'https://www.panocean.com/ko', 'Pan Ocean Co., Ltd. engages in the provision of marine transportation services. It operates through following businesses: includes Break Bulk Liner, Tramper, Large Bulker, Container, Tanker, Gas Carrier and Heavy Lifter. The company was founded on May 28, 1966 and is headquartered in Seoul, South Korea.', '2019-09-27 08:59:28', '2019-09-27 08:59:28', 1, 1),
(10080, 1, 'Pan-United Corp. Ltd. (P52)', 16, 78, 210, '-', 'https://www.panunited.com.sg/', 'Pan-United Corp. Ltd. is an investment holding, which engages in the production of cement products and provision of logistics services. It operates through the following segments: Concrete and Cement; Trading and Shipping; and Others. The Concrete and Cement segment supplies mainly cement, granite, ready-mix concrete and refined petroleum products to the construction and marine industries of Singapore, Vietnam, Malaysia and Indonesia. The Trading and Shipping segment consists of coal trading, bulk shipping and agency operations. The Others segment relates to companies which are of investment holding nature. The company was founded by Ng Kar Cheong in 1958 and is headquartered in Singapore.', '2019-09-27 08:59:28', '2019-09-27 08:59:28', 1, 1),
