(10082, 1, 'PDZ Holdings Bhd (PDZ)', 16, 78, 136, '-', 'http://www.pdzlines.com/', 'PDZ Holdings Bhd. is an investment holding company, which engages in the shipping and provision of related services. The company actively involved in the ownership and operation of sea-going vessels, shipping agency and ship management activities, shipping and provision of related services. PDZ Holdings was founded in 1996 and is headquartered in Port Klang, Malaysia.', '2019-09-27 08:59:28', '2019-09-27 08:59:28', 1, 1),
(10083, 1, 'Pelayaran Nelly Dwi Putri (NELY)', 16, 78, 106, '-', 'http://www.nellydwiputri.co.id/', 'PT Pelayaran Nelly Dwi Putri Tbk engages in shipping and consulting services. It operates through the following segments: Shipping Services, and Ship Maintenance & Repair Services. The Shipping Services segment provides ship rental services with freight charter and time charter rental systems. The Ship Maintenance & Repair Services segment engages in serving shipbuilding, maintenance and ship repair services. The company was founded on February 5, 1977 and is headquartered in Jakarta, Indonesia.', '2019-09-27 08:59:28', '2019-09-27 08:59:28', 1, 1),
(10084, 1, 'Pelayaran Tempuran Emas (TMAS)', 16, 78, 106, '-', 'https://www.temasline.com/', 'PT Pelayaran Tempuran Emas Tbk engages in the provision of maritime solutions. The firm transport passengers, cargoes, and animals by vessels. It operates through the Shipping and Stevedoring segments. The company was founded by Koentojo, Harto Khusumo, and Chau Lin Wong on September 17, 1987 and is headquartered in Jakarta, Indonesia.', '2019-09-27 08:59:28', '2019-09-27 08:59:28', 1, 1),
(10085, 1, 'Penguin International Ltd. (BTM)', 16, 78, 210, '-', 'http://www.penguin.com.sg/', 'Penguin International Ltd. is an investment holding company, which engages in the operation and trading of passenger ferries and launches. It operates through the Chartering and Shipbuilding and Repair segments. The Chartering segment offers ferry services and chartering of motor launches. The Shipbuilding and Repair segment acts as a builder of high speed aluminum commercial vessels and supplier of related repairs and maintenance services. The company was founded by Kheng Seng Heng in 1972 and is headquartered in Singapore.', '2019-09-27 08:59:28', '2019-09-27 08:59:28', 1, 1),
