(10093, 1, 'Precious Shipping PCL (PSL)', 16, 78, 231, '-', 'http://www.preciousshipping.com/index.php?lang=en', 'Precious Shipping Public Co. Ltd. is a holding company, which invests in marine transportation business. The company owns and manages dry bulk ships on a tramp shipping basis. It operates through the following business areas: Ship Owning, Ship Chartering, Ship Management, Holding Companies, and Port Development. Precious Shipping Public was founded in December 1989 and is headquartered in Bangkok, Thailand', '2019-09-27 08:59:29', '2019-09-27 08:59:29', 1, 1),
