(10103, 1, 'Qingdao Port International Co. Ltd. (6198)', 16, 78, 102, '-', 'https://www.qingdao-port.com/zh/index.jsp', 'Qingdao Port International Co. Ltd. engages in the operation of ports. It operates through the following segments: Container Handling and Ancillary Services; Metal Ore, Coal and Other Cargo Handling and Ancillary Services; Liquid Bulk Handling and Ancillary Services; Logistics and Port Value-Added Services; Port Ancillary Services; and Financial Services. The Container Handling and Ancillary Services segment includes loading and releasing of containers, storage, and port management. The Metal Ore, Coal and Other Cargo Handling and Ancillary Services segment provides of loading and discharging of metal ore, coal, grains, break bulk cargo and other cargo, storage, and port management. The Liquid Bulk Handling and Ancillary Services segment stores and transports liquid contents. The Logistics and Port Value-Added Services segment includes tallying, barging, towing, container processing. The Port Ancillary Services segment involves in the provision of facilities construction services, manufacturing of port related equipment, supplying electricity power, fuel and others. The Financial Services segment offers deposit taking activities, corporate loans, financial leasing, guarantee, and agency insurance. The company was founded in 1892 and is headquartered in Qingdao, China.', '2019-09-27 08:59:30', '2019-09-27 08:59:30', 1, 1),
(10104, 1, 'Qinhuangdao Port Co. Ltd. (3369)', 16, 78, 102, '-', 'http://www.portqhd.com/html/index.php', 'Beijing Bohui Innovation Technology Co., Ltd. engages in the research and development, production, sale, and service of clinical laboratory analysis products. Its products include virus detection, diluting, and calibration solutions, atomic absorption spectromers, cervical cell samplers, and vitamin detection kits. The company was founded in June 26, 2001 and is headquartered in Beijing, China.', '2019-09-27 08:59:30', '2019-09-27 08:59:30', 1, 1),
