(10107, 1, 'Regional Container Lines PCL (RCL)', 16, 78, 231, '-', 'http://www.rclgroup.com/', 'Regional Container Lines Public Co. Ltd. engages in feeder services and container liner business. It operates through the following business lines: Shipper-Owned-Container (SOC), Carrier-Owned-Container (COC), and Value-Added Logistic Services. The SOC business offers space on vessels to container owning customers. The COC business involves container box fleet management. The Value-Added Logistic Services include basics in custom house brokerage and domestic haulage; contract logistics arrangements such as inventory management; cross country haulage; and multi country supply chain management. The company was founded on June 25, 1980 and is headquartered in Bangkok, Thailand.', '2019-09-27 08:59:31', '2019-09-27 08:59:31', 1, 1),
