(10113, 1, 'Rig Tenders Indonesia (RIGS)', 16, 78, 106, '-', 'http://rigtenders.co.id/', 'PT Rig Tenders Indonesia Tbk engages in the provision of marine transportation services. It operates through the Coal and Offshore segments. The Coal segment comprises of the following: PT Adaro Indonesia; PT Maritim Barito Persada; PT Arutmin Indonesia; and Sport Charters. The Offshore segment focuses on the chartering of supply vessels and accommodation work barges to upstream oil and gas companies to support their offshore operations. The company was founded by Boedihardjo Sastrohadiwirjo on January 22, 1974 and is headquartered in Jakarta, Indonesia.', '2019-09-27 08:59:31', '2019-09-27 08:59:31', 1, 1),
