(10115, 1, 'Rizhao Port Co. Ltd. A (600017)', 16, 78, 47, '-', 'http://en.rzport.com/', 'Rizhao Port Co., Ltd. engages in the management of port terminals and facilities. It deals with port loading and unloading, cargo warehousing, and transshipping services for bulk cargos such as coal, ore, and cement. It also sells mechanical equipment and related spare parts. The company was founded on July 15, 2002 and is headquartered in Rizhao, China.', '2019-09-27 08:59:31', '2019-09-27 08:59:31', 1, 1),
(10116, 1, 'Sado Steam Ship Co. Ltd. (9176)', 16, 78, 114, '-', 'https://www.sadokisen.co.jp/', 'Sado Steam Ship Co., Ltd. engages in marine transportation and tourism. Its operations are carried out through the following segments: Marine Transportation, General Cargo Trucking, Shop and Restaurant, Tourism, and Other. The Marine Transportation segment provides marine transportation services for passengers, automobiles, and cargo. The General Cargo Trucking segment provides cargo trucking services to companies and individuals and offers automobile maintenance services. The Shop and Restaurant segment includes dining services and selling of local commodities aimed at tourists. The Tourism segment is engaged in the selling of travel goods and provision of tourism services, such as travel information, facilities, and accommodation services. The company was founded on February 3, 1913 and is headquartered in Sado, Japan.', '2019-09-27 08:59:31', '2019-09-27 08:59:31', 1, 1),
