(10121, 1, 'Sakurajima Futo Kaisha Ltd. (9353)', 16, 78, 114, '-', 'http://www.sakurajima-futo.co.jp/', 'Sakurajima Futo Kaisha, Ltd. engages in the harbor transportation and warehousing businesses. It operates through the following business segments: Bulk Cargo, Liquid Cargo, Logistics & Warehousing, and Others. The Bulk Cargo segment offers freight distribution services for coal, salt, and coke. The Liquid Cargo segment provides intermediary services from storage to transport of fuel, oil and petrochemicals. The Logistics & Warehousing segment handles the storage and customs clearance of dangerous materials and frozen food. The Others segment includes solar power-generated electricity sales and insurance agency business. The company was founded on February 12, 1948 and is headquartered in Osaka, Japan.', '2019-09-27 08:59:32', '2019-09-27 08:59:32', 1, 1),
