(10124, 1, 'Samsung Heavy Industries Co. Ltd. (010140)', 16, 78, 217, '-', 'http://www.samsungshi.com/kor/default.aspx', 'Samsung Heavy Industries Co., Ltd. engages in the production and sale of vessels, plant, and power systems. It operates through the following business areas: Shipbuilding, Engineering and Construction, Power and Control Systems, and Wind Energy. The Shipbuilding business provides tanker, container, passenger and drill ships, crude oil production and storage facility, fixed platform, and other shipbuilding products. The Engineering and Construction business offers architecture and development works, housing, civil works, and plants. The Power and Control Systems business include digital vessel, and home and building systems. The Wind Energy business provides wind power generators. The company was founded on August 5, 1974 and is headquartered in Seongnam, South Korea.', '2019-09-27 08:59:32', '2019-09-27 08:59:32', 1, 1),
