(10126, 1, 'Samudera Indonesia (SMDR)', 16, 78, 106, '-', 'http://www.samudera.id/', 'PT Samudera Indonesia Tbk engages in providing cargo transportation and logistics services. It operates through the following segments: Shipping and Agency, Logistics and Terminal, and Others. It services include storage and warehouse, distribution center, packaging, labeling, customs clearance, formalities, door to door distribution, multimodal transportation, terminal, project logistics, and offshore support. The company was founded by Soedarpo Sastrosatomo in 1964 and is headquartered in Jakarta, Indonesia.', '2019-09-27 08:59:32', '2019-09-27 08:59:32', 1, 1),
(10127, 1, 'Samudera Shipping Line Ltd. (S56)', 16, 78, 210, '-', 'http://ssl.samudera.id/ssl/', 'Samudera Shipping Line Ltd. engages in the transportation of containerized cargo, gas, liquid, and bulk cargo. It operates through the following segments: Container Shipping, Bulk and Tanker, and Logistics and Others. The Container Shipping segment provides feeder services for the transportation of containerized cargo between Singapore as a hub port and other outgoing spoke ports in Asia; as well as inter-region and intra-region container shipping services to end users. The Bulk andTanker segment offers the transportation of special dry bulk, liquid and gas cargo in the international and Indonesian domestic market. The Logistics and Others segment provides agency services in Bangkok, Port Klang, Penang, Mumbai, Kolkata, Chennai, and Dubai. The company was founded on December 22, 1993 and is headquartered in Singapore.', '2019-09-27 08:59:32', '2019-09-27 08:59:32', 1, 1),
