(10149, 1, 'Seroja Investments Ltd. (IW5)', 16, 78, 210, '-', 'http://seroja.com.sg/', 'Seroja Investments Ltd. is a holding company, which engages in the provision f vessel chartering services to transport dry bulk freight. It operates through the Freight Charter and Time Charter segments. The Freight Charter segment involves domestic routes in Indonesia from Kalimantan to various ports in Java and Sulawesi. The Time Charter segment focuses on domestic routes around the Sumatra Island. The company was founded on February 23, 1983 and is headquartered in Singapore.', '2019-09-27 08:59:35', '2019-09-27 08:59:35', 1, 1),
(10150, 1, 'Shanghai International Port (Group) Co. Ltd. A (600018)', 16, 78, 47, '-', 'http://www.portshanghai.com.cn/jtwbs/webpages/index.jsp', 'Shanghai International Port (Group) Co., Ltd. engages in the operation of all public terminals in the port of Shanghai. Its operations are carried through the following businesses: container terminals, non-container terminals, port-related logistics and port services. The company was founded on January 27, 2003 and is headquartered in Shanghai, China.', '2019-09-27 08:59:35', '2019-09-27 08:59:35', 1, 1),
(10151, 1, 'Shanghai Lonyer Fuels Co. Ltd. (603003)', 16, 78, 47, '-', 'http://www.lyrysh.com/', 'Shanghai Lonyer Fuels Co., Ltd. engages in the supply of fuel oil, and trading of metal products. Its business activities include commercial sales, and marine transportation supporting services. The company offers nonferrous metals, blended and non-blended oils, and chemical products. Shanghai Lonyer Fuels was founded by Zeng Zeng Xu on December 17, 1997 and is headquartered in Shanghai, China.', '2019-09-27 08:59:35', '2019-09-27 08:59:35', 1, 1),
(10152, 1, 'Shanghai Yatong Co. Ltd. A (600692)', 16, 78, 47, '-', 'http://www.shanghaiyatong.com/', 'Shanghai Yatong Co., Ltd. is engaged in the provision of passenger and freight water transportation services. It is also involved in the cultural broadcasting, real estate and ecological agriculture business. The company was founded on October 14, 1993 and is headquartered in Shanghai, China.', '2019-09-27 08:59:35', '2019-09-27 08:59:35', 1, 1),
