(10155, 1, 'Shenzhen Yan Tian Port Holdings Co. Ltd. (000088)', 16, 78, 47, '-', 'http://www.yantian-port.com/', 'Shenzhen Yan Tian Port Holdings Co., Ltd. provides port development and management services. It operates through the following business segments: Transportation, Warehousing and other services, and Other. Its services include port investment, port development, port management, cargo handling and transportation, wharf construction project management, and toll expressway and bridge operations management. The company was founded on May 8, 1997 and is headquartered in Shenzhen, China.', '2019-09-27 08:59:35', '2019-09-27 08:59:35', 1, 1),
(10156, 1, 'Shih Wei Navigation Co. Ltd. (5608)', 16, 78, 228, '-', 'http://www.swnav.com.tw/', 'Shih Wei Navigation Co., Ltd. engages in the provision of shipping agency. Its business includes vessel for trading global lines; vessel for trading in global lines with bulk cargo; vessel for standard worldwide trading; vessel for trading in world wide with equipment, wooden cargos, steel products, woodpulp, dry bulk cargo and general cargo; and vessel for trading in Asian lines with logs and bulk general cargo. The company was founded on March 11, 1985 and is headquartered in Taipei, Taiwan.', '2019-09-27 08:59:35', '2019-09-27 08:59:35', 1, 1),
(10157, 1, 'Shin Yang Shipping Corp. Bhd (SYSCORP)', 16, 78, 136, '-', 'https://www.syshippingcorp.com.my/', 'Shin Yang Shipping Corp. Bhd. is an investment and property holding company, which engages in the provision of shipping and shipyard services. It operates through the following segments: Shipbuilding, Ship Repair and Fabrication of Metal Structures; Domestic and Regional Shipping; International Shipping; and Others. The Domestic and Regional Shipping segment carries out business in coastal and regional routes within Malaysia and Association of South East Asian Nations (ASEAN) region. The International Shipping segment focuses on shipping business in United Arab Emirates and international routes to Japan, Korea, China, Philippines, and ASEAN region. The Others segment consists of shipping agency business. The company was founded on September 15, 2004 and is headquartered in Miri, Malaysia.', '2019-09-27 08:59:35', '2019-09-27 08:59:35', 1, 1),
