(10160, 1, 'Shipping Corp. of India Ltd. (523598)', 16, 78, 105, '-', 'http://www.shipindia.com/', 'The Shipping Corp. of India Ltd. is a holding company, which engages in the provision of sea and coastal freight water transport services. It operates through the following segments: Liner, Bulk, Tankers Technical and Offshore, and Others. The Liner segment includes break-bulk, container transport, passenger vessels, and research vessels managed on behalf of other organizations. The Bilk segment offers dry bulk carriers. The Technical and Offshore segment focuses on company owned offshore vessels, offshore vessels managed on behalf of other organizations and income from technical consultancy. The Other segment represents income earned from maritime training institute. The company was founded October 2, 1961 and is headquartered in Mumbai, India.', '2019-09-27 08:59:36', '2019-09-27 08:59:36', 1, 1),
(10161, 1, 'Shreyas Shipping & Logistics Ltd. (520151)', 16, 78, 105, '-', 'https://www.transworld.com/', 'Shreyas Shipping & Logistics Ltd. engages in the provision of shipping and logistics services. It owns and operates container feeder between Indian ports and container transshipment ports. It offers domestic, exim liner, and feeder transshipment; project cargo and ODC transportation; break bulk cargo; and multimodal coastal logistics services. The company was founded by R. Sivaswamy on August 16, 1988 and is headquartered in Mumbai, India.', '2019-09-27 08:59:36', '2019-09-27 08:59:36', 1, 1),
(10162, 1, 'Sillo Maritime (SHIP)', 16, 78, 106, '-', 'https://sillomaritime.com/', 'PT Sillo Maritime Perdana Tbk engages in the provision of a fleet of offshore vessels to support business activities of the oil and gas industry. It operates through the Shipping Services and Agent Services segments. The company was founded on June 1, 1989 and is headquartered in Jakarta, Indonesia.', '2019-09-27 08:59:36', '2019-09-27 08:59:36', 1, 1),
(10163, 1, 'Sincere Navigation Corp. (2605)', 16, 78, 228, '-', 'https://www.snc.com.tw/', 'Sincere Navigation Corp. provides bulk shipping transportation services. Its business scope includes marine shipping, port operator of barge industry, ship agents, and sea transport of bulk goods such as ore, coal and wood chips. The company was founded on February 27, 1968 and is headquartered in Taipei, Taiwan.', '2019-09-27 08:59:36', '2019-09-27 08:59:36', 1, 1),
(10164, 1, 'Singapore Shipping Corp. Ltd. (S19)', 16, 78, 210, '-', 'http://www.singaporeshipping.com.sg/', 'Singapore Shipping Corp. Ltd. is an investment holding company, which engages in the provision of shipping and logistics services. It operates through the Ship Owning and Agency and Logistics segments. The Ship Owning segment includes ship acquisition and ship management. The Agency and Logistics segment comprises of agency, terminal operations, warehousing, and logistics services. The company was founded on April 28, 1988 and is headquartered in Singapore.', '2019-09-27 08:59:36', '2019-09-27 08:59:36', 1, 1),
