(10167, 1, 'Sinwa Ltd. (5CN)', 16, 78, 210, '-', 'http://www.sinwaglobal.com/SinwaGlobal/', 'Sinwa Ltd. is an investment holding company, which engages in the provision of management services. It operates through the following segments: Supply; Agency and Logistics; Charter; and Property Holding. The Supply segment supplies deck stores; engine stores; electrical stores; safety equipment; general consumables and tools; and provisions and bonded stores. The Agency and Logistics segment provides port and customs clearances and documentation; deslopping and sludge removal; temporary and medium to long-term storage of goods and equipment to ship and rig owners; trans-shipment; and other logistics support. The Charter segment owns a seismic vessels and another joint venture owns a launch vessel. The Property Holding segment encompasses the warehoue cum office facilities in Henderson and Karratha in Australia. The Property Holding segment monitors property holding revenue. The company was founded byYoon Kay Sim in 1965 and headquartered in Singapore.', '2019-09-27 08:59:36', '2019-09-27 08:59:36', 1, 1),
(10168, 1, 'SITC International Holdings Co. Ltd. (1308)', 16, 78, 102, '-', 'http://www.sitc.com/', 'SITC International Holdings Co., Ltd. engages in the provision of integrated transportation and logistics solutions. It operates through the Container Shipping and Logistics, and Dry Bulk and Others segments. The Container Shipping and Logistics segment provides integrated logistics services such as container transport, freight forwarding, shipping agency, depot, and warehousing. The Dry Bulk and Others segment comprises of dry bulk vessel leasing, air-freight forwarding, and land leasing. The company was founded in May 1991 and is headquartered in Hong Kong.', '2019-09-27 08:59:36', '2019-09-27 08:59:36', 1, 1),
