(10183, 1, 'SUTL Enterprise Ltd. (BHU)', 16, 78, 210, '-', 'http://www.sutlenterprise.com/', 'SUTL Enterprise Ltd. is an investment holding company, which engages in the development, operation and consultation of integrated marinas and consultancy services. Its businesses include ONE°15 marina, ONE15 management and technical services, and ONE15 luxury yachting. The company was founded on November 3, 1993 and is headquartered in Singapore.', '2019-09-27 08:59:38', '2019-09-27 08:59:38', 1, 1),
