(10185, 1, 'Swissco Holdings Ltd. (ADP)', 16, 78, 210, '-', 'http://www.swissco.net/', 'Swissco Holdings Ltd. operates as an investment holding company, which provides marine services for the shipping and offshore oil and gas industries. It operates through the following segments: Drilling rig chartering, Vessel Chartering, Ship Repair and Maintenance Services, and Maritime Related Services. The company was founded by Peng Ehe Chu in 1979 and is headquartered in Singapore.', '2019-09-27 08:59:38', '2019-09-27 08:59:38', 1, 1),
(10186, 1, 'Taiwan Navigation Co. Ltd. (2617)', 16, 78, 228, '-', 'http://www.taiwanline.com.tw/', 'Taiwan Navigation Co., Ltd. is engaged in the shipping services and real estate industry. Its business scope includes domestic and international sea passenger and freight business; domestic and international wharf operation; vessel and wharf warehouse''s auxiliary services; shipping agency business operations; waterway dredging and towing; as well as leasing and sales of residential and commercial building. The company''s business is carried out in Taiwan, China, Australia, South America, North America, Europe, Southeast Asia and Middle East. Taiwan Navigation was founded on July 1, 1946 and is headquartered in Taipei, Taiwan.', '2019-09-27 08:59:38', '2019-09-27 08:59:38', 1, 1),
