(10190, 1, 'Tamai Steamship Co. Ltd. (9127)', 16, 78, 114, '-', 'http://www.tamaiship.co.jp/', 'Tamai Steamship Co., Ltd. engages in the shipping business. It operates through the following segments: International Shipping Industry, Coastal Shipping Industry, and Real Estate Leasing. The International Shipping Industry segment manages the transport of bauxite, aluminum hydroxide, and grains. The Coastal Shipping Industry segment handles the transport of aluminum hydroxide and heavy fuel. It also deals with the maritime disposal of bauxite residues. The Real Estate Leasing segment leases out owned real estate. The company was founded by Shukichi Tamai on May 31, 1929 and is headquartered in Tokyo, Japan.', '2019-09-27 08:59:39', '2019-09-27 08:59:39', 1, 1),
(10191, 1, 'Tangshan Port Group Co. Ltd. (601000)', 16, 78, 47, '-', 'http://www.jtport.com.cn/', 'Tangshan Port Group Co., Ltd. engages in the provision of marine port services. Its services include cargo collection, shipping and cost, settlement services, logistics business, loading and unloading, transport and storage and warehousing. The company was founded on January 3, 2003 and is headquartered in Tangshan, China.', '2019-09-27 08:59:39', '2019-09-27 08:59:39', 1, 1),
