(10193, 1, 'TAS Offshore Bhd (TAS)', 16, 78, 136, '-', 'http://www.tasoffshore.com/', 'TAS Offshore Bhd. is an investment holding company, which engages in the provision of shipbuilding and ship repairing services. Its shipbuilding activities include hull and superstructure construction; propulsion and power system installation; communication, navigation, and surveillance systems installation; machinery and equipment installation; interior fit-out; painting; and vessel testing and commissioning. The firm also offers ship repairing services which include routine marine engine, machinery and equipment inspection and maintenance; routine piping and wiring inspection and maintenance; repainting; repairing damage from collision and other accidents; and equipment installation. The company was founded by Nai Hoh Lau on March 18, 2008 and is headquartered in Sibu, Malaysia.', '2019-09-27 08:59:39', '2019-09-27 08:59:39', 1, 1),
