(10204, 1, 'Thoresen Thai Agencies PCL (TTA)', 16, 78, 231, '-', 'http://www.thoresen.com/', 'Thoresen Thai Agencies Public Co. Ltd. is a strategic investment holding company. It engages in the sea shipping and freight services industry. The company operates through the following segments: Transport, Energy, Infrastructure and Holding. The Transport segment includes dry bulk shipping business, petroleum tankering business, as well as shipping services businesses which include ship agency and ship brokerage. The Energy segment provides offshore services to the oil and gas industry. The Infrastructure segment provides such fertilizer production, and coal logistics. Thoresen Thai Agencies was founded on August 16, 1983 and is headquartered in Bangkok, Thailand.', '2019-09-27 08:59:40', '2019-09-27 08:59:40', 1, 1),
