(10209, 1, 'Tianjin Port Development Holdings Ltd. (3382)', 16, 78, 102, '-', 'http://www.tianjinportdev.com/html/index.php', 'Tianjin Port Development Holdings Ltd. engages in managing a container handling business within the port. It operates through the following segments: Cargo Handling, Sales, and Other Port Ancillary Services. The Cargo Handling segment involves in the non-containerized cargo handling and container handling business. The Sales segment offers supplying fuel and also sells materials. The Other Port Ancillary Services segment includes tugboat, agency, and tallying services. The company was founded on August 26, 2005 and is headquartered in Hong Kong.', '2019-09-27 08:59:40', '2019-09-27 08:59:40', 1, 1),
(10210, 1, 'Tianjin Port Holdings Co. Ltd. (600717)', 16, 78, 47, '-', 'http://www.tianjin-port.com/', 'Tianjin Port Co., Ltd. engages in port management, cargo loading and freight management services. It also offers warehousing, intermodal transit, bulk cargo handling, and freight forwarding, port logistics, bonded logistics, port finance and other related port services. The company was founded on December 21, 1992 and is headquartered in Tianjin, China.', '2019-09-27 08:59:40', '2019-09-27 08:59:40', 1, 1),
