(10214, 1, 'Tokai Kisen Co. Ltd. (9173)', 16, 78, 114, '-', 'https://www.tokaikisen.co.jp/', 'Tokai Kisen Co., Ltd. engages in the marine transportation business. It operates through the following business segments: Fleet Service-related, Trade Food and Beverage, Restaurant, Hotel, and General Passenger Automobile Carrier. The Fleet Service-related business segment operates passenger and freight lines, and shipping agencies. The Trade Food and Beverage business segment involves food and beverage sales, and cafeteria management. It also supplies daily necessities and construction materials to Izu islands. The Restaurant business segment manages restaurants. The Hotel business segment deals with hotel operations in Oshima. The General Passenger Automobile carrier business segment handles bus service and car maintenance services in Oshima. The company was founded on November 15, 1889 and is headquartered in Tokyo, Japan.', '2019-09-27 08:59:40', '2019-09-27 08:59:40', 1, 1),
(10215, 1, 'Tokyo Kisen Co. Ltd. (9193)', 16, 78, 114, '-', 'http://www.tokyokisen.co.jp/', 'Tokyo Kisen Co., Ltd. engages in the operation of tugboats, passenger ships, and restaurant services. It operates through the following segments: Tugboats, Passenger Ships, and Restaurants. The Tugboats segment provides tugboat services, boat rentals, and maritime disaster-related services. The Passenger Ships segment deals with sightseeing boats, car ferries, and crew boats. The Restaurants segment manages shops and food services accompanying the car ferry business. The company was founded on May 5, 1947 and is headquartered in Yokohama, Japan.', '2019-09-27 08:59:41', '2019-09-27 08:59:41', 1, 1),
