(10220, 1, 'Trada Maritime (TRAM)', 16, 78, 106, '-', 'http://www.tram.co.id/', 'PT Trada Alam Minera Tbk engages in the provision of shipping and marine transportation services. Its main activities include operating and chartering vessels, ship management, licensing, logistic services, and agency services. The company operates through the following segments: Floating Storage & Offloading, Cargo Transportation, Coal Sales, and Mining Services. The Floating Storage and Offloading segment provides floating storage for oil. The Cargo Transportation Services segment charters and operates liquid cargo tankers. The company was founded on August 26, 1998 and is headquartered in Jakarta, Indonesia.', '2019-09-27 08:59:41', '2019-09-27 08:59:41', 1, 1),
(10221, 1, 'Trans Power Marine (TPMA)', 16, 78, 106, '-', 'http://www.transpowermarine.com/', 'PT Trans Power Marine Tbk engages in provision of shipping services and marine logistics solutions. The company operates in the shipping industry by also providing services of coal and other cargo transportation using tag and barges. Its services includes tug and barge and crane barge. The company was founded on January 24, 2005 and is headquartered in Jakarta, Indonesia.', '2019-09-27 08:59:41', '2019-09-27 08:59:41', 1, 1),
