(10231, 1, 'U-Ming Marine Transport Corp. (2606)', 16, 78, 228, '-', 'http://www.uming.com.tw/', 'U-Ming Marine Transport Corp. provides marine transport services. The company operates through two segments: Marine transportation and Investment. It owns and manages ships that transport dry bulk cargoes, principally cement, industrial raw materials, oil, coal, iron ore an grain and also engages in the investment business. The company was founded on August 29, 1968 and headquartered in Taipei, Taiwan.', '2019-09-27 08:59:42', '2019-09-27 08:59:42', 1, 1),
