(10237, 1, 'Vyborg Shipyard (VSYD)', 16, 78, 192, '-', 'http://vyborgshipyard.ru/ru', 'Vyborg Shipyard operates as a shipbuilding company. It engages in the construction of small and medium tonnage vessels and offshore drilling rigs. The company activities include construction of deep sea semi-submersible floating drilling and production platforms for exploration of oil and gas offshore fields; as well as construction of stationary production platforms, and deep sea jack-ups. It produces steel, stainless steel and aluminium for shipbuilding, construction and oil processing industries. The company was founded in 1948 and is headquartered in Vyborg, Russia.', '2019-09-27 08:59:42', '2019-09-27 08:59:42', 1, 1),
(10238, 1, 'Vyborg Shipyard Pfd. (VSYDP)', 16, 78, 192, '-', 'http://vyborgshipyard.ru/ru', 'Vyborg Shipyard operates as a shipbuilding company. It engages in the construction of small and medium tonnage vessels and offshore drilling rigs. The company activities include construction of deep sea semi-submersible floating drilling and production platforms for exploration of oil and gas offshore fields; as well as construction of stationary production platforms, and deep sea jack-ups. It produces steel, stainless steel and aluminium for shipbuilding, construction and oil processing industries. The company was founded in 1948 and is headquartered in Vyborg, Russia.', '2019-09-27 08:59:43', '2019-09-27 08:59:43', 1, 1),
(10239, 1, 'Wan Hai Lines Ltd. (2615)', 16, 78, 228, '-', 'https://tw.wanhai.com/views/Main.xhtml', 'Wan Hai Lines Ltd. engages in the provision of full container vessel shipping services. Its business activities include ship transportation, shipping agency, ship and container trading, port container terminal operation, and ship and container leasing businesses. The company was founded on February 24, 1965 and is headquartered in Taipei, Taiwan.', '2019-09-27 08:59:43', '2019-09-27 08:59:43', 1, 1),
