(10247, 1, 'Wintermar Offshore Marine (WINS)', 16, 78, 106, '-', 'http://www.wintermar.com/wintermar/', 'PT Wintermar Offshore Marine Tbk engages in the provision of shipping support services for the offshore transportation for oil and gas industry. The firm operates through the following segments: Charter of Own Vessels, Charter of Third Party Vessels, and Other Services. It offers marine logistic solutions and services such as drilling rig support, towing, oil storage, rig moves, anchor handling, emergency rescue, vessel inspection, vessel maintenance, and diving support. The company was founded on December 18, 1995 and is headquartered in Jakarta, Indonesia.', '2019-09-27 08:59:44', '2019-09-27 08:59:44', 1, 1),
(10248, 1, 'Wisdom Marine Lines Co. Ltd. (2637)', 16, 78, 228, '-', 'http://www.wisdomlines.com.tw/wisdom/php/home.php', 'Wisdom Marine Lines Co. Ltd. engages in the acquisition, management, and operation of dry bulk vessels. Its business includes international maritime transport operations; ship-related management, maintenance, and service; ship leasing; and shipping agency business. The company was founded by James Lan on October 21, 2008 and is headquartered in Taipei, Taiwan.', '2019-09-27 08:59:44', '2019-09-27 08:59:44', 1, 1),
(10249, 1, 'Xiamen International Port Co. Ltd. (3378)', 16, 78, 102, '-', '-', 'Xiamen International Port Co. Ltd. is an investment holding company, which engages in the provision of logistics services. It operates through the following business segments: Container Loading and Unloading and Storage Business, Bulk and General Cargo Loading and Unloading Business, Comprehensive Port Logistics Services, Manufacturing and Selling of Building Materials, and Trading Business of Merchandise. The company was founded on May 25, 1998 and is headquartered in Xiamen, China.', '2019-09-27 08:59:44', '2019-09-27 08:59:44', 1, 1),
(10250, 1, 'XMH Holdings Ltd. (BQF)', 16, 78, 210, '-', 'http://www.xmh.com.sg/XMHH/', 'XMH Holdings Ltd. is an investment company, which engages in the provision of machine repair and maintenance services. It operates through the following segments: Distribution, After-Sales, and Projects. The Distribution segment sells propulsion engines. The After-Sales segment includes services and jobs, sales of spare parts, and other trading. The Projects segment relates to manufacturing, sales, and commission of power generator sets and the manufacturing of marine equipment and related repair services. The company was founded by Tum Beng Tan in 1955 and is headquartered in Singapore.', '2019-09-27 08:59:44', '2019-09-27 08:59:44', 1, 1),
(10251, 1, 'Yang Ming Marine Transport Corp. (2609)', 16, 78, 228, '-', 'http://www.yangming.com.tw/', 'Yang Ming Marine Transport Corp. engages in the marine cargo transportation services. It provide services related to the maintenance of old vessels, lease and sale of old vessels, containers and chassis of vessels. It also offers transporting perishables, prioe loading checklists, packaging loading patterns, compatibility for commodities, handling guidance and gensets services. The company was founded on December 28, 1972 and is headquartered in Keelung, Taiwan.', '2019-09-27 08:59:44', '2019-09-27 08:59:44', 1, 1),
(10252, 1, 'Yangzijiang Shipbuilding Holdings Ltd. (BS6)', 16, 78, 210, '-', 'http://www.yzjship.com/', 'Yangzijiang Shipbuilding (Holdings) Ltd. engages in the provision of agency services for shipbuilding and related activities. It operates through the following segments: Shipbuilding, Investments, Trading and Others. The Shipbuilding segment handles offshore marine equipment construction and ship design. The Investment segment consists of micro-financing and investments in financial assets. The Trading segment consists of trading of goods. The Others segment includes ship demolition and vessel owning companies. The company was founded in 1956 and is headquartered in Jingjiang, China.', '2019-09-27 08:59:44', '2019-09-27 08:59:44', 1, 1),
(10253, 1, 'Yingkou Port Liability Co. Ltd. A (600317)', 16, 78, 47, '-', 'http://www.ykplc.com/', 'Yingkou Port Liability Co., Ltd. principally engages in the provision of cargo loading and unloading, stockpiling, as well as transportation services. The company was founded on March 22, 2000 and is headquartered in Yingkou, China.', '2019-09-27 08:59:44', '2019-09-27 08:59:44', 1, 1),
(10254, 1, 'Zhuhai Holdings Investment Group Ltd. (0908)', 16, 78, 102, '-', '-', 'Zhuhai Holdings Investment Group Ltd. operates as an investment holding company. It engages in the provision of port facilities and ferry services, and management of holiday resort, theme park, amusement park, property development, and golf club. It operates through the following segments: Jiuzhou Blue Sea Jet and Blue Marine Tourism, Composite Real Estate and Green Leisure Tourism, and Public Utilities. The Jiuzhou Blue Sea Jet and Blue Marine Tourism segment provides maritime transportation. The Public Utilities segment offers port facilities; and trades and distributes fuel. The company was founded on January 28, 1998 and is headquartered in Hong Kong.', '2019-09-27 08:59:44', '2019-09-27 08:59:44', 1, 1),
