(10256, 1, 'ABans Enterprises Ltd. (512165)', 13, 68, 105, '-', 'http://www.abansenterprises.com/', 'ABans Enterprises Limited (Formerly known as Matru-Smriti Traders Limited) (“AEL”) was incorporated on 2nd February, 1985. Presently, AEL is listed on BSE Limited and Metropolitan Stock Exchange of India Limited (MSEI). Matru-Smriti Traders Limited was taken over by Mr. Abhishek Bansal on February 25, 2015. Following takeover of the Company and in order to reflect the group name, the name of the Company was changed to “ABans Enterprises Limited”. AEL is involved in the business of trading in Commodities, Agri - Commodities, Precious Metals, Shares, Currencies and all kind of Derivatives over all the leading Exchanges and also in the Spot Market.', '2019-09-27 09:02:54', '2019-09-27 09:02:54', 1, 1),
