(10261, 1, 'Advan Co. Ltd. (7463)', 13, 68, 114, '-', 'http://www.advan.co.jp/', 'ADVAN CO., LTD. engages in the import and sale of building materials. It operates through the following segments: Construction Materials, Real Estate Leasing, and Others. The Construction Materials segment deals with the import, sale, and construction of building materials such as stones, tiles, and housing-related products. The Real Estate Leasing segment handles property leasing management. The Others segment includes the wholesale of products to home centers. The company was founded by Masaji Yamagata on March 1, 1975 and is headquartered in Tokyo, Japan.', '2019-09-27 09:02:54', '2019-09-27 09:02:54', 1, 1),
