(10263, 1, 'AKR Corporindo (AKRA)', 13, 68, 106, '-', 'http://www.akr.co.id/', 'PT AKR Corporindo Tbk engages in the general trading and distribution of chemical and petroleum products. It operates through the following segments: Trading and Distribution; Logistics Services; Manufacturing; Coal Mining and Trading; and Industrial Estate. The Trading and Distribution segment distributes petroleum products and various kinds of chemicals such as caustic soda, sodium sulphate, polyvinyl chloride resin, and soda ash. The Logistics Services segment provides rental of storage tanks and warehouses; bagging; port handling and transportation services for liquid and solid chemicals and petroleum products in Indonesia; and operation of ports in Guijang, China. The Manufacturing segment produces sorbitol liquid and powder in China and adhesive materials by PT Arjuna Utama Kimia. The Coal Mining and Trading segment mines, produces, and trades coal through PT Anugrah Karya Raya. The Industrial Estate segment operates and manages industrial estate activities through PT Berkah Kawasan Manyar Sejahtera. The company was founded on November 28, 1977 and is headquartered in Jakarta, Indonesia.', '2019-09-27 09:02:55', '2019-09-27 09:02:55', 1, 1),
