(10270, 1, 'Aseem Global Ltd. (534564)', 13, 68, 105, '-', 'http://www.aseemglobal.com/', 'Aseem Global Limited being a public listed company at Bombay Stock Exchange and Delhi Stock Exchange, was incorporated in 1983. It is a rapidly growing company in sourcing and distribution of Non-Ferrous and Ferrous metals. We are major importers of LME graded non-ferrous metals and operate in India on distribution basis. With an annual turnover of approximately Rs.2250 million, the company provides high quality services and support to a wide variety of business organizations throughout India and abroad. Our head office is situated in Sadar Bazar, Delhi, which is the hub of metal trading in Delhi. Our wide network includes various branches across India including Maharashtra, Rajasthan, Punjab etc. From the time of incorporation, Aseem Global Limited has been known for its reputation for meeting its customers'' needs effectively and professionally.', '2019-09-27 09:02:56', '2019-09-27 09:02:56', 1, 1),
(10271, 1, 'Askul Corp. (2678)', 13, 68, 114, '-', 'https://www.askul.co.jp/', 'ASKUL Corp. engages in the provision of office equipment, supplies, and support services. It operates through following segments: e-Commerce, Logistics and Others. The e-Commerce segment offers office automation products, personal computers, office furniture, business supplies, food items, alcoholic beverages, medical products, and cosmetics. The Logistics segment handles the small cargo freight transportation service for enterprises. The Others segment covers the production and sale of Tsumagoi natural water, Oku Karuizawa natural water and NANO bubble oxygen water. The company was founded on November 2, 1963 and is headquartered in Tokyo, Japan.', '2019-09-27 09:02:56', '2019-09-27 09:02:56', 1, 1),
(10272, 1, 'Atlantic China Welding Consumables Inc. (600558)', 13, 68, 47, '-', 'http://www.weldatlantic.com/', 'Atlantic China Welding Consumables, Inc. engages in the research and development, manufacture, and sale of welding materials. Its products include welding rods, welding wires, and fluxes. It also steel welding materials for pressure equipment, marine welding materials, pipeline welding materials, nuclear grade welding materials, and non ferrous metal welding wires. The company was founded in 1949 and is headquartered in Zigong, China.', '2019-09-27 09:02:57', '2019-09-27 09:02:57', 1, 1),
