(10281, 1, 'Boustead Holdings Bhd (BSTEAD)', 13, 68, 136, '-', 'http://www.boustead.com.my/', 'Boustead Holdings Bhd. engages in the provision of management services and property investment to its subsidiaries. It operates through the following segments: Plantation, Heavy Industries, Property, Finance and Investment, Pharmaceutical, and Trading and Industrial. The Plantation segment involves in the planting of oil palm, processing of crude palm oil, and research in oil palm tissue culture and genetics. The Heavy Industries segment comprises shipbuilding, fabrication of offshore structures, restoration and maintenance of vessels and defense related products, and offers air transportation and flight services. The Property segment includes property development, constructs and leases out commercial and retail properties, and owning and managing hotels. The Finance and Investment segment consists of commercial, Islamic and investment banking, stock broking, and life and general insurance businesses. The Pharmaceutical segment focuses on researching, developing, manufacturing, trading, marketing, and supplying pharmaceutical products, and medical and hospital equipment. The Trading and Industrial segment owns and operates BHPetrol brand of retail petrol station network, and manufactures and trades building materials. The company was founded in 1828 and is headquartered in Kuala Lumpur, Malaysia.', '2019-09-27 09:02:58', '2019-09-27 09:02:58', 1, 1),
