(10290, 1, 'China Hi-Tech Group Co. Ltd. A (600730)', 13, 68, 47, '-', 'http://www.chinahitech.com.cn/', 'China Hi-tech Group Co., Ltd. engages in the provision of vocational education services. Its business activities include education operations management, smart education, and global education and development. It offers degree-granting, and non-degree granting education programs. The company was founded on June 20, 1992 and is headquartered in Beijing, China.', '2019-09-27 09:03:00', '2019-09-27 09:03:00', 1, 1),
(10291, 1, 'China National Complete Plant Import & Export Corp. Ltd. A (000151)', 13, 68, 47, '-', 'http://www.complant-ltd.com/zcgf/index.htm', 'China National Complete Plant Import & Export Corp. Ltd. engages in the provision of engineering contracting services. Its business activities include export of equipment and construction contracting, general trading, and overseas industrial operations. Its Export of Equipment and Construction Contracting division provides foreign aid engineering contracting services. Its General Trading division exports textiles, electronic machineries, solar energy systems, and agricultural machinery parts. Its Overseas Industrial Operations offers sucrose and alcohol products. The company was founded on March 1, 1999 and is headquartered in Beijing, China.', '2019-09-27 09:03:00', '2019-09-27 09:03:00', 1, 1),
(10292, 1, 'Chinese Energy Holdings Ltd. (8009)', 13, 68, 102, '-', 'http://www.chinese-energy.com/', 'Chinese Energy Holdings Ltd. operates as an investment company which engages in the provision of management services, investment in financial and investment products. It operates through the following segments: General Trading, Trading of LNG Products, Investment in Financial Assets, Money Lending, Provision of Factoring Services, and Provision of Management Services. The General Trading segment includes the market sourcing of technical and electronic products. The company was founded on October 25, 1999 and is headquartered in Hong Kong.', '2019-09-27 09:03:00', '2019-09-27 09:03:00', 1, 1),
