(10294, 1, 'CITIC Resources Holdings Ltd. (1205)', 13, 68, 102, '-', 'http://resources.citic/eng/global/home.htm', 'CITIC Resources Holdings Ltd. engages in the exploration, development and production of oil and coal; import and export of bulk commodities; as well as investments in aluminum smelting and manganese businesses. It operates through the following segments: Aluminum Smelting, Coal, Import and Export of Commodities, and Crude Oil. The Aluminum Smelting segment operates the Portland Aluminum Smelter, which sources alumina and produces aluminum ingots in Australia. The Coal segment comprises the operation of coal mines and the sale of coal in Australia. The Import and Export of Commodities segment engages in the export of various commodity products, such as aluminum ingots, iron ore, alumina and coal; and the import of other commodities and manufactured goods, such as vehicle and industrial batteries, tires, alloy wheels and various metals, such as steel and aluminum extrusion products in Australia. The Crude Oil segment comprises the operation of oilfields and the sale of oil in Indonesia and China. The company was founded in 1997 and is headquartered in Hong Kong.', '2019-09-27 09:03:00', '2019-09-27 09:03:00', 1, 1),
