(10296, 1, 'Collins Co. Ltd. (2906)', 13, 68, 228, '-', 'http://www.collins.com.tw/web/index/index.jsp', 'Collins Co., Ltd. engages in the exporting of sundry goods and garment to over worldwide corporate customers, Its customers include department stores, warehouse clubs, supermarkets, discounted stores, home centers, drug stores, and importers. Its product lines include tool set and box and auto accessories, garden tools and accessories, BBQ grills and firepits, houseware and kitchenware, Christmas decorations and lightings, sporting equipment and travel goods, small appliances and lightings, digital products and computer accessories, indoor and outdoor furniture, and garment. The company was founded on May 5, 1969 and is headquartered in Taipei, Taiwan.', '2019-09-27 09:03:00', '2019-09-27 09:03:00', 1, 1),
(10297, 1, 'Compugates Holdings Bhd (COMPUGT)', 13, 68, 136, '-', 'http://www.compugates.com/', 'Compugates Holdings Bhd. is an investment company, which engages in the provision of management services. It operates through the Trading and Service; and Agriculture segments. The Trading and Service segment includes trading, marketing, distributing of imaging, technology, and communication-based product. The Agriculture segment involves in trading and cultivating of agricultural products. The company was founded in 1997 and is headquartered in Petaling Jaya, Malaysia.', '2019-09-27 09:03:00', '2019-09-27 09:03:00', 1, 1),
