(10300, 1, 'Create Corp. (3024)', 13, 68, 114, '-', 'https://www.cr-net.co.jp/', 'Create Corp. engages in the manufacture and sale of plumbing materials. It operates through the following segments: Pipe Work Equipment and Construction-related. The Pipe Work Equipment segment sells pipe machineries and equipment products such as pipe fittings and valves. The Construction-related segment provides interior decoration construction services. The company was founded by Seiichi Fukui in January 1916 and is headquartered in Osaka, Japan.\n\nCreate Corp. engages in the manufacture and sale of plumbing materials. It operates through the following segments: Pipe Work Equipment and Construction-related. The Pipe Work Equipment segment sells pipe machineries and equipment products such as pipe fittings and valves. The Construction-related segment provides interior decoration construction services. The company was founded by Seiichi Fukui in January 1916 and is headquartered in Osaka, Japan.\n\n', '2019-09-27 09:03:00', '2019-09-27 09:03:00', 1, 1),
(10301, 1, 'CW Group Holdings Ltd. (1322)', 13, 68, 102, '-', 'http://www.cwgroup-int.com/', 'CW Group Holdings Ltd. engages in the provision of precision engineering solutions. The firm also engages in the manufacturing and distribution machine tool and components. It operates through the following segments: Precision Engineering Solutions Projects, Sales of Computer Numeric Control (CNC) Machining Centres, Sales of Components and Parts, After-Sales Technical Support Services, and Renewable Energy Solutions. The Precision Engineering Solutions Projects segment relates to the provision of industrial solutions specific to machine tools and industrial machinery and equipment encompassing conceptualization and design to production set-up, commissioning and maintenance of production lines. The Sales of CNC Machining Centers segment sells precision engineering manufacturing equipment operable under CNC automation. The Sales of Components and Parts segment covers the sale of self-manufactured and trading of components and parts. The After-Sales Technical Support Services segment offers repairs and maintenance services for the above segments. The Renewable Energy Solutions segment involves the selling of self-manufactured and trading of solar photovoltaic modules and panels. The company was founded by Koon Lup Wong in 1996 and is headquartered in Singapore.', '2019-09-27 09:03:01', '2019-09-27 09:03:01', 1, 1),
