(10312, 1, 'Doshisha Co. Ltd. (7483)', 13, 68, 114, '-', 'https://www.doshisha.co.jp/', 'Doshisha Co., Ltd. engages in the manufacture and sale of lifestyle and household products. It operates through the following segments: Product Development Business, Wholesale Model Business, and Others. The Product Development Business segment handles the product planning, development, and sales of consumer electronics, household goods, clothing, food, and alcoholic beverages. The Wholesale Model Business segment focuses on the sourcing and marketing of domestic and overseas brands using the National Brand (NB) processing. The Others segment includes real estate, logistics, nursing care, and overseas subsidiary operations. The company was founded by Masaharu Nomura in October 1974 and is headquartered in Osaka, Japan.', '2019-09-27 09:03:01', '2019-09-27 09:03:01', 1, 1),
(10313, 1, 'Ducon Infratechnologies Ltd. (EQDUCON)', 13, 68, 105, '-', 'http://duconinfra.co.in/', 'Ducon Infratechnologies Ltd. is a technology company, which engages in the provision of solutions to digital and infrastructure business sectors. It provides network and hardware solutions, marketing initiatives, distribution, volume procurement, and technical support in the digital sector. The firm also executes FGD systems for power and industrial boilers, bulk material handling systems, and electrification projects in the infrastructure sector. The company was founded on April 2, 2009 and is headquartered in Mumbai, India.', '2019-09-27 09:03:01', '2019-09-27 09:03:01', 1, 1),
