(10320, 1, 'Emmsons International Ltd. (532038)', 13, 68, 105, '-', 'http://www.emmsons.com/', 'Emmsons International Ltd. engages in the trading of agricultural commodities. It operates through the following businesses: Trading, Farming, and Mining. The Trading business involves trading of agricultural and soft commodities. The Farming business offers oilseeds, sorgham, wheat, yellow peas, and barley. The Mining business trades in and acquires coal mining assets. The company was founded by Anil Kumar Monga and Rajesh Kumar Monga on April 15, 1993 and is headquartered in New Delhi, India.', '2019-09-27 09:03:02', '2019-09-27 09:03:02', 1, 1),
