(10322, 1, 'eSang Networks Co. Ltd. (080010)', 13, 68, 217, '-', 'http://www.e-sang.net/', 'eSang Networks Co., Ltd. engages in the provision of electronic commerce services. It operates through the following Business Divisions: Electronic Commerce, Exhibition, and Information Technology. The Electronic Commerce Division provides purchase brokerage and group purchase services. The Exhibition Division offers conventions for exhibitions. The company was founded on February 28, 2000 and is headquartered in Seoul, South Korea.', '2019-09-27 09:03:02', '2019-09-27 09:03:02', 1, 1),
