(10325, 1, 'Euro Asia Exports Ltd. (530929)', 13, 68, 105, '-', 'http://www.euroasiaexportsltd.com/aboutus.html', 'The company is planning to revive its export business in European markets where, it was dominant player once. The trade enquiries have also started pouring in and the business will take jump in 1-2 years.', '2019-09-27 09:03:02', '2019-09-27 09:03:02', 1, 1),
