(10331, 1, 'Fujian Furi Electronics Co. Ltd. A (600203)', 13, 68, 47, '-', 'http://www.furielec.com/', 'Fujian Furi Electronics Co., Ltd. engages in the manufacture and sale of light-emitting diode epitaxial chip and package products, applications, and engineering. It offers industrial and integrated energy-saving technology services; smart phones and color television, air purifiers, and other home appliances; and integrated circuit devices and substrate processing. The company was founded on May 7, 1999 and is headquartered at Fuzhou, China.', '2019-09-27 09:03:03', '2019-09-27 09:03:03', 1, 1),
(10332, 1, 'Fujian Sanmu Group Co. Ltd. A (000632)', 13, 68, 47, '-', 'http://www.san-mu.com/', 'Fujian Sanmu Group Co., Ltd. engages in the real estate development and management, and import and export trade. It focuses on real estate development, commercial tourism asset operation, and import and export trade. The company business segment covers real estate development, commercial tourism assets, import and export trade, and investment mergers and acquisitions. Fujian Sanmu Group was founded on October 12, 1984 and is headquartered in Fuzhou, China.', '2019-09-27 09:03:03', '2019-09-27 09:03:03', 1, 1),
