(10335, 1, 'Grandma Trading & Agencies Ltd. (504369)', 13, 68, 105, '-', '-', 'Grandma Trading & Agencies Ltd. engages in the business of wholesale trading, credit granting and wholesale of agricultural raw materials. Its products include yarns, fabrics, suitings, and readymade-garments. The company was founded by Krishna Kumar Mansingka on January 28, 1981 and is headquartered in Secunderabad, India.', '2019-09-27 09:03:03', '2019-09-27 09:03:03', 1, 1),
(10336, 1, 'Green Cross Co. Ltd. (7533)', 13, 68, 114, '-', 'http://green-cross.co.jp/', 'Green Cross Co., Ltd. engages in the manufacture, sale, and rental of safety items. Its products include road safety materials, disaster prevention necessities, safety equipment, protection gear, and signboards and tags. The company was founded in January 1969 and is headquartered in Fukuoka, Japan.', '2019-09-27 09:03:03', '2019-09-27 09:03:03', 1, 1),
