(10340, 1, 'GS Global Corp. (001250)', 13, 68, 217, '-', 'http://www.gsgcorp.com/', 'GS Global Corp. is a holding company which engages in the export, logistics, import and trade of steel and natural resources. It operates through the Industrial Materials and Import Distribution Business divisions. The Industrial Materials divison provides steel, petroleum, and chemical products, cement, coal, machine plants, and other materials import and export. The Import Distribution division offers engine and biomass imports, imported automobiles pre-delivery inspection service, and general logistics services. The company was founded on July 31, 1954 and is headquartered in Seoul, South Korea.', '2019-09-27 09:03:04', '2019-09-27 09:03:04', 1, 1),
(10341, 1, 'Guangdong Mingzhu Group Co. Ltd. A (600382)', 13, 68, 47, '-', 'http://www.gdmzh.com/', 'Guangdong Mingzhu Group Co., Ltd. engages in trading, cooperative investment in property development projects, development of land and construction of public facilities through public-private partnership, equity investment, as well as leasing of the Company''s current properties. The company was founded in 1971 and is headquartered in Xingning, China.', '2019-09-27 09:03:04', '2019-09-27 09:03:04', 1, 1),
(10342, 1, 'Hanwa Co. Ltd. (8078)', 13, 68, 114, '-', 'https://www.hanwa.co.jp/', 'Hanwa Co., Ltd. engages in the sale of iron and steel products. It operates through the following segment: Steel, Metal and Alloy, Non-Ferrous Metal, Food Products, Petroleum and Chemical, Overseas Subsidiary Sales, and Others. The Steel segment engages in the sale of steel bars, building materials, sheets, pipes, wires, and other steel products. The Metal and Alloy segment includes nickel, chromium, manganese, silicon, and ferroalloys. The Non-Ferrous Metal segment offers copper, aluminum, zinc, lead, nickel, and chromium. The Food Products segment includes shrimp, crab, salmon, herring roe, mackerel, horse mackerel, capelin, and various processed foods. The Petroleum and Chemical segment provides petroleum products, industrial chemicals, and other chemicals. The Overseas Subsidiary Sales segment deals with the overseas sale business. The Others segment handles lumber, plywood, and machineries businesses. The company was founded on April 1, 1947 and is headquartered in Tokyo, Japan.', '2019-09-27 09:03:04', '2019-09-27 09:03:04', 1, 1);
