(10344, 1, 'Hanwha Corp. Pfd. Series 1 (000885)', 13, 68, 217, '-', 'http://www.hanwhacorp.co.kr/', 'Hanwha Corp. engages in the trading and manufacturing business. The company operates its businesses through two business divisions: explosive and trading division. The Explosive division manufactures and sells commercial explosives, explosive demolitions, fireworks, chemicals and others. The Trading division involves in the export and import, domestic sale of oil products, minerals, photovoltaic packages and others. The company was founded on October 28,1952 and is headquartered in Seoul, South Korea.', '2019-09-27 09:03:04', '2019-09-27 09:03:04', 1, 1),
