(10346, 1, 'Harrisons Holdings (Malaysia) Bhd (HARISON)', 13, 68, 136, '-', 'http://www.harrisons.com.my/', 'Harrisons Holdings Malaysia Bhd. is an investment holding company. It engages in the marketing, sales and distribution of building materials, industrial and agricultural chemical products, liquor products, consumer goods, engineering and the operation of shipping, insurance and travel agencies. The company operates through the following segments: Trading & Distribution; and Others. The Trading & Distribution segment deals in marketing, sales and distribution of fast-moving consumer goods, building materials, industrial and agricultural chemical products, liquor products, and engineering products. The Others segment comprises of shipping agency commissions, insurance agency commissions, travel agency commissions, income from investment in marketable securities and property rental income. Harrisons Holdings Malaysia was founded on March 9, 1990 and is headquartered in Kuala Lumpur, Malaysia.', '2019-09-27 09:03:04', '2019-09-27 09:03:04', 1, 1),
(10347, 1, 'Hashimoto Sogyo Holdings Co. Ltd. (7570)', 13, 68, 114, '-', 'https://www.hat-hd.co.jp/', 'HASHIMOTO SOGYO HOLDINGS Co., Ltd. operates as a holding company which provides the sale of tubing materials and housing equipment. It operates through the following segments: Tubing Compounds, Sanitary Ware and Metal Fittings, Housing Equipment, Air Conditioning and Pumps, and Others. The Tubing Compounds segment includes tubes, fittings, valves, chemical products, and tools. The Sanitary Ware and Metal Fittings segment consists of wash basins, washing toilet seats, sensor systems, bath, vanity, and shower fittings. The Housing Equipment segment deals with hot water supply and kitchen-related equipment. The Air Conditioning and Pumps segment offers room air conditioners, package air conditioning systems, general purpose pumps, line pumps, and water pumps. The Others segment engages in logistics contract and information systems. It also provides the leasing and management of real estate properties; information, money lending, guarantee, leasing, and property insurance agency services. The company was founded by Kyujiro Hashimoto in October 1890 and is headquartered in Tokyo, Japan.', '2019-09-27 09:03:04', '2019-09-27 09:03:04', 1, 1),
