(10351, 1, 'HGL Ltd. (HNG)', 13, 68, 13, '-', 'http://www.hgl.com.au/site/content/', 'HGL Ltd. engages in product marketing and supply chain business, selling brands in diversified markets. It operates through the following segments: Retail Marketing, Homewares, Collectables, Building Product, and Health and Beauty. The Retail Marketing segment provides standard and customized shelving product solutions to brand owners and retailers. The Homewares segment distributes homewares and traditional sewing and crafts supplies. The Collectables segment produces collectable model cars. The Building Product segment offers architectural lighting for the commercial market. The Health and Beauty segment deals with cosmetics and skincare products through salon, spa, and retail markets. The company was founded on October 29, 1904 and is headquartered in Sydney, Australia.', '2019-09-27 09:03:05', '2019-09-27 09:03:05', 1, 1),
