(10355, 1, 'HupSteel Ltd. (BMH)', 13, 68, 210, '-', 'https://www.hupsteel.com/', 'HupSteel Ltd. is an investment holding company, which engages in the provision of industrial hardware for the oil and gas, chemical and petrochemical, energy, infrastructure, marine, and other industries. It operates through the Hardware Trading, Steel Product Trading, and Property Investment segments. The Hardware Trading focuses on the sale of industrial hardware products. The Steel Product Trading offers industrial steel products. The Property Investment segment provides rental of properties. The company was founded by Boon Wan Lim, Boon Kee Lim, and Boon Hong Lim in 1941 and is headquartered in Singapore.', '2019-09-27 09:03:05', '2019-09-27 09:03:05', 1, 1),
(10356, 1, 'Hydoo International Holding Ltd. (1396)', 13, 68, 102, '-', 'http://www.hydoo.com.cn/EnglishBin/', 'Hydoo International Holdings Ltd. engages in the development and operation of large-scale trade centers. It includes commercial trade and logistics centres, and residential properties. It also offers hardware, electric tools, building materials, furniture and home furnishings, home electronics, apparel, and small goods. The company was founded on October 19, 2010 and is headquartered in Shenzhen, China.\n\nHydoo International Holdings Ltd. engages in the development and operation of large-scale trade centers. It includes commercial trade and logistics centres, and residential properties. It also offers hardware, electric tools, building materials, furniture and home furnishings, home electronics, apparel, and small goods. The company was founded on October 19, 2010 and is headquartered in Shenzhen, China.\n\n', '2019-09-27 09:03:05', '2019-09-27 09:03:05', 1, 1),
(10357, 1, 'ICC International PCL (ICC)', 13, 68, 231, '-', 'http://www.icc.co.th/icc/index.php', 'I.C.C. International Public Co., Ltd. engages in manufacturing, marketing, and trading of clothes and accessories. The company operates through the following segments: Cosmetics, Toiletries & Perfumeries; Women''s Apparel; and Men''s Apparel. It distributes under the following brands: Wacoal, Arrow, Lacoste, BSC Cosmetology, Daks, Elle, Guy Laroche, Mizuno, Naturalizer, BSC, St. Andrews, Rain Flower, Sheene, BSC Pure Care, and Arty Professional. The company was founded on January 1, 1964 and is headquartered in Bangkok, Thailand.', '2019-09-27 09:03:05', '2019-09-27 09:03:05', 1, 1),
(10358, 1, 'ICC International PCL NVDR (ICC-R)', 13, 68, 231, '-', 'http://www.icc.co.th/icc/index.php', 'I.C.C. International Public Co., Ltd. engages in manufacturing, marketing, and trading of clothes and accessories. The company operates through the following segments: Cosmetics, Toiletries & Perfumeries; Women''s Apparel; and Men''s Apparel. It distributes under the following brands: Wacoal, Arrow, Lacoste, BSC Cosmetology, Daks, Elle, Guy Laroche, Mizuno, Naturalizer, BSC, St. Andrews, Rain Flower, Sheene, BSC Pure Care, and Arty Professional. The company was founded on January 1, 1964 and is headquartered in Bangkok, Thailand.', '2019-09-27 09:03:05', '2019-09-27 09:03:05', 1, 1),
