(10361, 1, 'Inscobee Inc. (006490)', 13, 68, 217, '-', 'http://eng.inscobee.com/', 'Inscobee, Inc. engages in the design, manufacture, and sale of wristwatches. It operates through the following business divisions: telecommunication, Smart Grid, and Retail. It also distributes personal computer (PC) related-products and offers energy-related services. The company operates the following business segments: Wristwatch, PC, and Energy. The Wristwatch segment carries Odin and Dolphin brands. The PC segment sells computer parts which include installation services. The Energy segment provides oil products and logistics services through operating of filling stations. The company was founded on February 28, 1970 and is headquartered in Seoul, South Korea.', '2019-09-27 09:03:06', '2019-09-27 09:03:06', 1, 1),
(10362, 1, 'Ipmuda Bhd (IPMUDA)', 13, 68, 136, '-', 'http://www.ipmuda.com.my/', 'Ipmuda Bhd. engages in the businesses of trading and distribution of building materials. It operates through the following segments: Trading, Contracting, Property Development, Property and Investment Holding, Manufacturing, and Others. The Trading segment distributes and supplies construction and finishing building materials, heavy steel products, architectural hardware, home improvement materials, cabinet systems, and fuel and lubricants. The Contracting segment covers the fluid engineering systems and maintenance works; contracting and assembling of industrial control instruments and engineering equipment; as well as civil engineering works and construction. This segment also engages in roofing works, such as metal roofing, prefabricated roof trusses and ceiling works, as well as provision of interior fit-out works and services. The Property Development segment develops residential and commercial properties. The Property and Investment Holding segment leases out for rental income or held for long term capital appreciation. The Manufacturing segment manufactures and supplies building materials, kitchen cabinet, and wardrobe systems. This segment also offers complete cabinet systems and component parts, such as doors, furniture components, and wooden moldings. The company was founded on April 19, 1975 and is headquartered in Kuala Lumpur, Malaysia.', '2019-09-27 09:03:06', '2019-09-27 09:03:06', 1, 1),
(10363, 1, 'Itochu Corp. (IOC)', 13, 68, 86, '-', '-', '-', '2019-09-27 09:03:06', '2019-09-27 09:03:06', 1, 1),
(10364, 1, 'Itochu Corp. (ITOCF)', 13, 68, 250, '-', '-', '-', '2019-09-27 09:03:06', '2019-09-27 09:03:06', 1, 1),
(10365, 1, 'Itochu Corp. (8001)', 13, 68, 114, '-', 'https://www.itochu.co.jp/ja/', 'ITOCHU Corp. engages in business of product trading and business investment activities. It operates through the following segments: Textile; Machinery; Metals and Minerals; Energy and Chemicals; Food; ICT and Realty; and Others. The Textile segment covers fiber, raw materials, textile fabrics, clothing apparel, and brand marketing business. The Machinery segment includes plant projects, marine, aerospace, automobile, construction machinery, industrial systems, and life and healthcare business. The Metals and Minerals segment offers metals and mineral resources, steel and non-ferrous products, and coal, nuclear, and solar business. The Energy and Chemicals segment pertains to oil and gas trading, energy resources development, and chemicals business. The Food segment focuses on food resources, product processing, midstream distribution, and retail business. The ICT and Realty segment deals with forest products, general merchandise, ICT, insurance, logistics, construction, realty, and financial business. The Others segment includes the overseas legal corporations in the United States, United Kingdom, Australia, China and Hong Kong. The company was founded by Chubei Itoh in 1858 and is headquartered in Osaka, Japan.', '2019-09-27 09:03:06', '2019-09-27 09:03:06', 1, 1),
(10366, 1, 'Itochu Corp. ADR (ITOCY)', 13, 68, 250, '-', '-', '-', '2019-09-27 09:03:06', '2019-09-27 09:03:06', 1, 1),
