(10368, 1, 'J-Holdings Corp. (2721)', 13, 68, 114, '-', 'http://jholdings.co.jp/', 'J-Holdings Corp. engages in the sale of residential properties. It operates through the following segments: Sports, Real Estate, and Web Business. The Sports segment manages futsal facilities and school. The Real Estate segment involves in the real estate trading business, real estate sales brokerage business and Consulting business. The Web business segment deals with the system solution, security management, web marketing and web creation business. The company was founded on January 25, 1993 and is headquartered in Tokyo, Japan.', '2019-09-27 09:03:06', '2019-09-27 09:03:06', 1, 1),
(10369, 1, 'Jiangsu Aucksun Co. Ltd. (002245)', 13, 68, 47, '-', 'http://www.aucksun.com/', 'Jiangsu Aucksun Co. Ltd. engages in the provision of warehousing, sorting, nesting, packaging, distribution, and processing of metal materials. It operates through metal distribution, new energy, and financial segments. The company was founded on September 30, 2002 and is headquartered in Zhangjiagang, China.', '2019-09-27 09:03:06', '2019-09-27 09:03:06', 1, 1),
(10370, 1, 'Jimei International Entertainment Group Ltd. (1159)', 13, 68, 102, '-', '-', '-', '2019-09-27 09:03:06', '2019-09-27 09:03:06', 1, 1),
(10371, 1, 'JK Holdings Co. Ltd. (9896)', 13, 68, 114, '-', 'https://www.jkhd.co.jp/', 'JK Holdings Co., Ltd. manages its group companies which are in the building materials industry. It operates through the following segments: General Building Material Wholesale, Plywood Manufacturing and Wood Processing, General Building Material Retail, and Others. The General Building Material Wholesale deals with the wholesale of timber, lumber, plywood, housing equipment, fixtures, and various building materials. The Plywood Manufacturing and Wood Processing segment manufactures and sells ordinary plywood, structural laminated veneer lumber, glued laminated timber, and wood panels. The General Building Material Retail segment offers plywood, secondary plywood products, building materials, and housing equipment to consumers. The Others segment includes franchise, real estate leasing, warehousing and transportation, construction, travel, and insurance agency businesses. The company was founded by Takeshi Yoshida in October 1937 and is headquartered in Tokyo, Japan.', '2019-09-27 09:03:06', '2019-09-27 09:03:06', 1, 1),
(10372, 1, 'Joban Kosan Co. Ltd. (9675)', 13, 68, 114, '-', 'http://www.joban-kosan.com/', 'Joban Kosan Co., Ltd. engages in the tourism, wholesale trading, real estate, and manufacturing-related businesses. It operates through the following segments: Tourism, Wholesale, Manufacturing related, and Transportation. The Tourism segment operates leisure facilities and hotels. The Wholesale segment sells petroleum and other coal products. The Manufacturing related segment offers machinery and casting. The Transportation segment handles transportation and its related businesses. It also offers online information services. The company was founded on March 31, 1944 and is headquartered in Iwaki, Japan.', '2019-09-27 09:03:07', '2019-09-27 09:03:07', 1, 1),
