(10375, 1, 'Khemani Distributors & Marketing Ltd. (539788)', 13, 68, 105, '-', 'http://www.khemanigroup.net/', 'Khemani Distributors & Marketing Ltd. engages in the business of trading of fast moving consumer goods of Hindustan Unilever Limited. Its product portfolio includes personal care products, home care products, and food and drinks products. It operates through the FMCG Product and Dealing in Securities segments. The company was founded on January 6, 2011 and is headquartered in Surat, India.', '2019-09-27 09:03:07', '2019-09-27 09:03:07', 1, 1),
(10376, 1, 'Kim Teck Cheong Consolidated Bhd (KTC)', 13, 68, 136, '-', 'http://kimteckcheong.com/', 'Kim Teck Cheong Consolidated Bhd. is an investment holding company, which engages in the provision of consumer package goods. It operates through the following segments: Distribution, Manufacturing, and Others. Distribution segment offers distribution of third party, and own brands of consumer packaged goods. The Manufacturing segment involves in the manufacture of bakery products. The Others segment covers investment holding. The company was founded by Yeong Ching Lau in 1938 and is headquartered in Kota Kinabalu, Malaysia.', '2019-09-27 09:03:07', '2019-09-27 09:03:07', 1, 1),
