(10380, 1, 'Kobayashi Metals Ltd. (8077)', 13, 68, 114, '-', 'http://www.kobayashi-metals.co.jp/', 'Kobayashi Metals Ltd. engages in the import, export and domestic sale of rivet screws, fastening products and others. Its products include anchor birds, new lock anchors, new lock nuts, zinc hat series, return buckle, multi eye bolts, round lock bolts, line caps, nord-lock washers, zenneji markers, PC nuts, anchor plates, stick inserts, connecting plates, lifting jigs, material handling and transportation equipment, civil engineering and construction equipment, welding and fusing instruments, measuring tools, safety and disaster prevention goods, hydraulic equipment, air and electric tools, electrical installation and plumbing fixtures, cutting tools and others. The company was founded by Shoji Kobayashi in August 1926 and is headquartered in Osaka, Japan.', '2019-09-27 09:03:08', '2019-09-27 09:03:08', 1, 1),
(10381, 1, 'Kobexindo Tractors (KOBX)', 13, 68, 106, '-', 'http://www.kobexindo.com/', 'PT Kobexindo Tractors Tbk engages in the provision of industrial equipment. It operates through the following segments: Heavy Equipment, Spare Parts, Repair and Maintenance, and Other. The Other segment covers building leases, and heavy equipment rentals. The company was founded by Freddy Limawan, Yudi Budiman, and Humas Soputro on September 28, 2002 and is headquartered in Jakarta, Indonesia.', '2019-09-27 09:03:08', '2019-09-27 09:03:08', 1, 1),
(10382, 1, 'Kumpulan Perangsang Selangor Bhd (KPS)', 13, 68, 136, '-', 'http://www.perangsangselangor.com/', 'Kumpulan Perangsan Selangor Bhd. is an investment holding company, which engages in the provision of management services. It operates through the following business segments: Investment Holding, Infrastructure and Utilities, Manufacturing, Licensing, Trading, Hospitality, Oil & Gas and Telecommunication. The company was founded on August 11, 1975 and is headquartered in Shah Alam, Malaysia.', '2019-09-27 09:03:08', '2019-09-27 09:03:08', 1, 1),
(10383, 1, 'Kuriyama Holdings Corp. (3355)', 13, 68, 114, '-', 'http://www.kuriyama-holdings.com/', 'Kuriyama Holdings Corp. operates as a holding company which provides the strategic management and oversight of the Kuriyama Group. Its operations are carried out through the following segments: North America Business, Europe Business, Industrial Materials, Construction Materials, Sports Facility Materials and Others. The North America Business segment deals with the manufacture, sale, inventory management, distribution, research and development of industrial hoses, sheet rubber, couplings, and accessories. The Europe Business segment engages in the manufacture and sale of rubber lay-flat hoses. The Industrial Materials segment supplies a large variety of materials including rubber, metal, and plastic parts to be built in by mass production machineries such as agricultural equipment, construction machineries, off-road vehicles, etc. The Construction Materials segment handles the delivery and application of various kinds of equipment and materials including quake absorbing products used for roads, bridges and other related-infrastructure. The Sports Facility Materials segment involves in the delivery and application of various kinds of elastic floor covering for school gymnasiums, indoor sports facilities, and welfare institutions. The Others segment includes sale of outdoor sport goods and dust control related items. The company was founded on April 5, 1939 and is headquartered in Osaka, Japan.', '2019-09-27 09:03:08', '2019-09-27 09:03:08', 1, 1),
(10384, 1, 'Kuwazawa Trading Co. Ltd. (8104)', 13, 68, 114, '-', 'https://www.kuwazawa.co.jp/', 'KUWAZAWA Trading Co., Ltd. engages in the sale and installation of construction materials. It operates through the following segments: Construction Materials, Construction Work, Materials Transportation, and Others. The Construction Materials segment handles the manufacture and sale of construction materials such as cement, concrete, plywood, glasses, sash, residence materials including home facility equipment, hot-water supply equipment, heating equipment, kitchen sets, bathroom supplies, and prefabricated baths. The Construction Work segment deals with the contract construction of exterior walls, renovation of stores, buildings, and residential houses, and civil engineering work. The Materials Transportation segment manages the cargo transportation business. The Others segment includes automobile maintenance, non-life insurance agency and real estate leasing businesses. The company was founded by Saya Kuwazawa in 1933 and is headquartered in Sapporo, Japan.', '2019-09-27 09:03:08', '2019-09-27 09:03:08', 1, 1),
(10385, 1, 'Lahoti Overseas Ltd. (531842)', 13, 68, 105, '-', 'http://www.lahotioverseas.com/', 'Lahoti Overseas Ltd. engages in the export trading of cotton textiles. It operates through the Trading and Power segment. Its offers yarns, fabrics, organic products, and raw cotton. The company was founded in 1990 and is headquartered in Mumbai, India.', '2019-09-27 09:03:08', '2019-09-27 09:03:08', 1, 1),
