(10389, 1, 'LG International Corp. (001120)', 13, 68, 217, '-', 'http://www.lgicorp.com/', 'LG International Corp. engages in the development of energy, raw materials and trading industrial materials. Its products include oil, coal, nonferrous metals, and steel products. The company was founded on November 26, 1953 and is headquartered in Seoul, South Korea.', '2019-09-27 09:03:08', '2019-09-27 09:03:08', 1, 1),
(10390, 1, 'LianYunGang Ideal Group Co. Ltd. (000626)', 13, 68, 47, '-', 'http://www.grand-holding.cn/cn/', 'Grand Industrial Holding Co., Ltd. engages in the bulk commodity trade. It focuses on commodity trade, and warehouse logistics. The commodity trade covers petrochemical, energy and chemical industry, metal, agricultural products, and rubber. The company was founded on June 28, 1994 and is headquartered in Lianyungang, China.', '2019-09-27 09:03:08', '2019-09-27 09:03:08', 1, 1),
(10391, 1, 'Liaoning Cheng Da Co. Ltd. A (600739)', 13, 68, 47, '-', 'https://www.chengda.com.cn/index.php?_d=site&_f=index', 'Liaoning Cheng Da Co., Ltd. engages in the commodities distribution, import and export trading as well as biological drug manufacturing. It also engages in the trade of textile products, bulk steel raw materials, vaccines, development of energy and management of pharmacy retail stores. It provides the agricultural production materials, financial and investment services. The company was founded in June 1993 and is headquartered in Dalian, China.', '2019-09-27 09:03:08', '2019-09-27 09:03:08', 1, 1),
(10392, 1, 'Loco Hong Kong Holdings Ltd. (8162)', 13, 68, 102, '-', 'http://www.locohongkong.com/', 'Loco Hong Kong Holdings Ltd. engages in the trade of metals, commodity forward contracts, and processing of silver products. It offers silver kilo and catty bars, silver granules, and silver bars. The company was founded on January 14, 2014 and is headquartered in Hong Kong.', '2019-09-27 09:03:09', '2019-09-27 09:03:09', 1, 1),
