(10398, 1, 'Marubeni Construction Material Lease Co. Ltd. (9763)', 13, 68, 114, '-', 'http://www.mcml-maruken.com/', 'Marubeni Construction Material Lease Co., Ltd. engages in the sale, lease, and maintenance of temporary steel construction materials. It operates through the following segments: Heavy Scaffolding Equipment; Heavy Scaffolding Equipment Construction; and Public Works and Water and Sewer Facilities Construction. The Heavy Scaffolding Equipment segment deals with the rental, sale, repair, processing, and transportation of scaffolding equipment for foundation works. The Heavy Scaffolding Equipment Construction segment engages in the construction of piles, erections, and underground serial walls. The Public Works and Water and Sewer Facilities Construction segment offers civil engineering works and construction of building equipment, plant, and sewage facilities. The company was founded on November 1, 1968 and is headquartered in Tokyo, Japan.', '2019-09-27 09:03:09', '2019-09-27 09:03:09', 1, 1),
