(10400, 1, 'Marubeni Corp. (8002)', 13, 68, 114, '-', 'https://www.marubeni.com/jp/', 'Marubeni Corp. engages in handling of products and provision of services in the areas of import and export. It also conducts business investment, development and management. It operates through the following segments: Food & Consumer Products; Chemical & Forest Products; Energy & Metals; Transportation & Industrial Machinery; Power Projects & Plant; and Others. The Food & Consumer Products segment handles the domestic and overseas manufacture and trade of all food products including feed grains, soybeans, wheat, sugar, processed foods, beverages, and their raw materials, foodstuffs for professional use, and agricultural, seafood & livestock products. It also handles clothes, footwear, tire, sporting goods, living essentials, and other consumer products. This segment also engages in system integration, data communication network, and mobile terminal sales businesses; as well as in forwarding and distribution services, insurance brokerage, reinsurance, asset and property management, fund investment, condominium development, and property redevelopment. The Chemical & Forest Products segment merchandises petrochemicals, electronic materials, and functional chemicals. It also handles agricultural materials including pesticides and fertilizers. The Energy & Metals segment covers the trade of petroleum and gas, raw materials development and gas station retail. It also handles steel, non-iron light metals, and their raw materials; as well as steel products such as steel sheets and tubes, and special steel products. The Transportation & Industrial Machinery comprises of export, import, wholesale and retail of transport equipment; as well as the navigation of cargo boats, tankers, and LNG ships. The Power Projects & Plant segment engages in the development, investment, operation, and maintenance of electricity and energy infrastructure-related businesses, seawater conversion, water and sewerage businesses, traffic infrastructure systems, and various industrial plants. The Others segment provides the group''s financing services. The company was founded by Chubei Itoh in May 1858 and is headquartered in Tokyo, Japan.', '2019-09-27 09:03:09', '2019-09-27 09:03:09', 1, 1),
(10401, 1, 'Marubeni Corp. ADR (MARUY)', 13, 68, 250, '-', '-', '-', '2019-09-27 09:03:09', '2019-09-27 09:03:09', 1, 1),
(10402, 1, 'Marufuji Sheet Piling Co. Ltd. (8046)', 13, 68, 114, '-', 'http://www.mrfj.co.jp/', 'Marufuji Sheet Piling Co., Ltd. engages in the manufacture and sale of steel sheet piles, steel plates, and other steel products that include H-shaped steel, architectural steel processed products and reinforced soil wall products. It operates through the following divisions: Sales, Factory, and Transportation. The Sales division engages in the procurement and sale of steel and construction materials. The Factory division manages the production, processing, and maintenance of construction-related products. The Transportation division provides product transportation services. The company was founded by Ryozo Fujimori in March 1926 and is headquartered in Tokyo, Japan.', '2019-09-27 09:03:09', '2019-09-27 09:03:09', 1, 1),
(10403, 1, 'Mclean Technologies Bhd (MCLEAN)', 13, 68, 136, '-', 'http://www.mclean.com.sg/', 'MClean Technologies Bhd. is an investment holding company, which engages in the provision of precision cleaning and washing solutions for components of hard disk drives, and media cassettes. It operates through the Surface Treatment and Precision Cleaning segment. The Surface Treatment and Precision Cleaning segment includes clean bulk pack and related services mainly in the hard disk drive and consumer electronics industries. The company was founded on March 17, 2010 and is headquartered in Singapore.', '2019-09-27 09:03:09', '2019-09-27 09:03:09', 1, 1),
(10404, 1, 'Merdeka Financial Services Group Ltd. (8163)', 13, 68, 102, '-', 'http://www.merdeka.com.hk/en/', 'Merdeka Financial Services Group Ltd. is an investment holding company, which engages in the provision of financial services. It operates through the following segments: Trading Business, Financial Services Business, Information Technology Business, and Other Business. The Trading Business segment involves trading of goods, components and accessories. The Financial Services Business segment offers finance lease, money lending, and securities services. The Information Technology segment covers the distributorship of information technology products and provision of relevant technical support services. The Other Business segment includes servicing business, such as training course provision. The company was founded on September 20, 2001 and is headquartered in Hong Kong.\n\nMerdeka Financial Services Group Ltd. is an investment holding company, which engages in the provision of financial services. It operates through the following segments: Trading Business, Financial Services Business, Information Technology Business, and Other Business. The Trading Business segment involves trading of goods, components and accessories. The Financial Services Business segment offers finance lease, money lending, and securities services. The Information Technology segment covers the distributorship of information technology products and provision of relevant technical support services. The Other Business segment includes servicing business, such as training course provision. The company was founded on September 20, 2001 and is headquartered in Hong Kong.\n\n', '2019-09-27 09:03:09', '2019-09-27 09:03:09', 1, 1),
(10405, 1, 'Minmetals Development Co. Ltd. (600058)', 13, 68, 47, '-', 'http://www.minlist.com.cn/', 'Minmetals Development Co., Ltd. engages in the integrated steel trading and logistics services provider. Its business covers ferrous industrial chain such as metallurgical raw materials trade; steel circulation and product trade, processing and distribution; tender business; industrial investment; e-commerce; and logistics service. The company was founded on May 21, 1997 and is headquartered in Beijing, China.', '2019-09-27 09:03:10', '2019-09-27 09:03:10', 1, 1),
(10406, 1, 'Mishka Exim Ltd. (539220)', 13, 68, 105, '-', 'http://www.mishkaexim.com/about-us', 'Our company is engaged in the business of trading and distribution of Jewellery, Ornaments and textiles products.\nWe are a multi-product trading company with a diverse product portfolio. We are in the trading business since our inception. We predominentaly deal in lifestyle products such as Jewellery, Ornaments and Fabrics. We supply products, which are made with most advanced technology and graded raw materials.\n\nOur Company is an entrepreneur driven and well managed organization focused on meeting our consumer requirements for meeting their fashion and lifestyle requirements by offering products and services with the finest quality. We also aim at achieving greater and long-term growth.\n\nWe sell gold and diamond jewellery on a wholesale basis to other jewellery retailers in India. Our product profile includes traditional, contemporary and combination designs across jewellery lines, usages and price points.We are also engaged in fabric trading our range includes fabrics for Silk, Polyester, Sarees, Lace Fabrics, Netting\n\nFabrics, Coarse Cotton Fabric, suiting, shirting, linen, jute and other fabrics. We primarily cater to retailers in Delhi and NCR Regions, wherein we supply mid range of unstitched fabrics.\n\nWe supply products in accordance with the industry set norms and standards, which widely appreciated, by clients and end users.To expand operations, we intend to rope in more professionals. We also intend to open showrooms and outlets in metropolitan cities in India.We also plan to commence export of Jewellery in Middle East Countries and intend to import high quality fabrics from various multinational brands and to supply in India.', '2019-09-27 09:03:10', '2019-09-27 09:03:10', 1, 1),
(10407, 1, 'Misumi Co. Ltd. (7441)', 13, 68, 114, '-', '-', 'Misumi Co., Ltd. engages in the provision of products and services for everyday living. It operates through the following segments: Energy, Lifestyle, and Food and Beverage. The Energy segment deals with the retail and wholesale of petroleum oil and gas related products such as gasoline, diesel, kerosene, fuel oil, lubricating oil; liquefied petroleum gas and its equipment. The Lifestyle segment sells books, automobiles, and tires. It also manages complex commercial facilities. The Food and Beverage segment sells Kentucky Fried Chicken products, and manufactures and sells mineral water. The company was founded by Minohachi Misumi in 1907 and is headquartered in Kagoshima, Japan.', '2019-09-27 09:03:10', '2019-09-27 09:03:10', 1, 1),
(10408, 1, 'Mitani Sangyo Co. Ltd. (8285)', 13, 68, 114, '-', 'http://www.mitani.co.jp/JP/index.html', 'Mitani Sangyo Co., Ltd. engages in the chemical-related business. It operates through the following business segments: Chemicals, Air Conditioning Systems, Resin and Electronics, Information Systems, Energy and Housing Equipment. The Chemicals segment handles chemicals, resin materials, functional materials, and pharmaceutical ingredients. The Air Conditioning Systems segment offers air conditioning equipment, plumbing and sanitary equipment, cleanrooms, fire fighting equipment, and refrigeration facilities. The Resin and Electronics segment manages the production and sale of molds, composite unit products, resin mold products, and electronic parts. The Information Systems segment provides system integration services, software packages, information infrastructure, hardware maintenance, outsourcing services, and other system services. The Energy segment involves petroleum products, liquefied petroleum gas, household fuel cells, solar power generation systems, and wind power generation equipment. The Housing Equipment segment involves housing equipment, air-conditioning equipment, systems storage, kitchen units, storage units and washstands. The company was founded by Shinzo Mitani on February 11, 1928 and is headquartered in Kanazawa, Japan.', '2019-09-27 09:03:10', '2019-09-27 09:03:10', 1, 1),
(10409, 1, 'Mitsubishi Corp. (MBI)', 13, 68, 86, '-', '-', '-', '2019-09-27 09:03:10', '2019-09-27 09:03:10', 1, 1),
(10410, 1, 'Mitsubishi Corp. (8058)', 13, 68, 114, '-', 'https://www.mitsubishicorp.com/jp/en/index.html', 'Mitsubishi Corp. engages in the provision of services utilizing the function of general trading. It operates through the following segments: Global Environmental and Infrastructure, Industrial Finance, Logistics and Development, Energy Business, Metals, Machinery, Chemicals, Living Essentials, and Others. The Global Environmental and Infrastructure handles trade and related business operations in power generation, water, transportation, and other necessary infrastructure. It also manufactures lithium-ion batteries for vehicles and electricity storage. The Industrial Finance, Logistics and Development segment deals with asset management, infrastructure financing, corporate financing, and leasing. It also provides solutions in construction and real estate development focusing on commercial facilities and urban development, condominium development, and logistics. The Energy Business explores, develops and produces natural gas, crude oil, petroleum products, petroleum coke, coal coke, carbon products, and liquefied petroleum gas. It also develop and invests in oil and gas projects. The Metals segment supplies steel products, non-ferrous metals, and ferrous raw materials. It also undertakes ventures in precious metals like platinum and palladium. The Machinery segment handles industrial machinery, shipping, defense and aerospace, motor vehicles and Isuzu business. It also includes machine tools, agricultural machinery, construction and mining equipment, elevators and escalators, ships, space-related equipment, and automobiles. The Chemicals segment supplies chemical products that includes raw materials for synthetic resins and fibers, chemical fertilizers, inorganic raw materials, industrial salts, plastics, electronic materials, and life science products. The Living Essentials segment provides consumer necessities connected with clothing, food and housing. This includes food, textile, daily necessities, healthcare, distribution and retail. The Others segment represents services and operational support of corporate staff departments to the company and its affiliates; income and expenses from financial and personnel-related activities; and cash and securities for financial and investment activities. The company was founded by Yataro Iwasaki on July 1, 1954 and is headquartered in Tokyo, Japan.', '2019-09-27 09:03:10', '2019-09-27 09:03:10', 1, 1),
