(10419, 1, 'Muraki Corp. (7477)', 13, 68, 114, '-', 'https://muraki.co.jp/hp/', 'Muraki Corp. engages in the sale of automobile replacement parts. It operates through the Car Care-related Merchandise Sales and Others segments. The Car Care-related Merchandise Sales segment offers automobile spare parts, automobile chemicals, service station equipment, promotional goods, and car accessories. The Others segment provides automobile body maintenance parts, promotional materials such as signboards and leaflets, insurance and travel agency services, automobile leasing, gift certificate and ticket sales, employee training, and financing services. The company was founded on February 1, 1946 and is headquartered in Tokyo, Japan.', '2019-09-27 09:03:11', '2019-09-27 09:03:11', 1, 1),
(10420, 1, 'N.R. International Ltd. (532623)', 13, 68, 105, '-', 'http://www.nrinternationalltd.in/', 'N.R. International Ltd. engages in the production and trade of coal and coke. It operates through Handling Transportation and Coal & Coke segments. The firm also manufactures low ash metallurgical coke. The company was founded on May 14, 1991 and is headquartered in Kolkata, India.', '2019-09-27 09:03:11', '2019-09-27 09:03:11', 1, 1),
(10421, 1, 'Navketan Merchants Ltd. (539525)', 13, 68, 105, '-', 'http://www.navketanmerchants.com/', 'Navketan Merchants Limited was incorporated in the year 1994 as a private limited company in the State of West Bengal. Thereafter it converted into a Public Limited Company on 15th February 1996. Presently it is listed on the Bombay Stock Exchange and the Calcutta Stock Exchange. The Company is engaged mainly in trading of yarn and sarees.', '2019-09-27 09:03:11', '2019-09-27 09:03:11', 1, 1),
