(10424, 1, 'Nice Holdings Inc. (8089)', 13, 68, 114, '-', 'https://www.suteki-nice.jp/', 'Nice Holdings, Inc. engages in the domestic distribution, import and sale of building materials for housing, sale of housing and real estate business. It operates through the following segments: Building Materials Business, Housing Business, and Others. The Building Materials Business segment offers wood products, building materials, and house appliances. The Housing Business segment sells condominium unit and single detached houses; management and maintenance of condominiums; and provides real estate brokerage services. The Others segment includes building construction, development and sale of software, and general broadcasting businesses. The company was founded on June 23, 1950 and is headquartered in Yokohama, Japan.', '2019-09-27 09:03:11', '2019-09-27 09:03:11', 1, 1),
(10425, 1, 'Ningbo United Group Co. Ltd. A (600051)', 13, 68, 47, '-', 'http://www.nug.com.cn/', 'Ningbo United Group Co., Ltd. engages in the development of real estate; production and supply of electricity and heat energy; wholesaling; and cultural activities. The company was founded on May 1988 and it is headquartered in Ningbo, China.', '2019-09-27 09:03:11', '2019-09-27 09:03:11', 1, 1),
(10426, 1, 'Ningbo Yunsheng Co. Ltd. A (600366)', 13, 68, 47, '-', '-', 'Ningbo Yunsheng Co., Ltd. engages in the research and development, manufacture, and sale of rare earth permanent magnet materials. Its products include sintered neodymium, magnetic assemblies, bonded neodymium, and servo motor. The company was founded on June 30, 1994 and is headquartered in Ningbo, China.', '2019-09-27 09:03:11', '2019-09-27 09:03:11', 1, 1),
(10427, 1, 'Nippo Ltd. (9913)', 13, 68, 114, '-', 'http://www.nip.co.jp/', 'Nippo Ltd. engages in the manufacture and sale of industrial components and materials. It operates though the following business segments: Mobility, Electronics, Precision Device, Household Equipment, and Others. The Mobility segment handles the manufacture and sale of parts for automobile market. The Electronics segment covers the procurement and sale of products for electrical, electronic component, semiconductor, and liquid crystal displays (LCD) . The Precision Device segment manages the manufacture and sale of shaft for precision machinery market. The Household Equipment procures and sells window shade control, resin pipe parts and highly functional materials. The Others segment deals with radio frequency identification devices (RFID) that includes IC cards, IC tags and affiliated system devices. The company was founded in March 1940 and is headquartered in Inazawa, Japan.', '2019-09-27 09:03:11', '2019-09-27 09:03:11', 1, 1),
