(10431, 1, 'Ochi Holdings Co. Ltd. (3166)', 13, 68, 114, '-', 'http://www.ochiholdings.co.jp/', 'Ochi Holdings Co., Ltd. engages in the control and management of its subsidiaries. It operates through the following segments: Construction Materials, Lifestyle, Processing and Others. The Construction Materials segment merchandises building materials to contractors, lumber dealers, house builders, construction firms, and home centers. The Lifestyle segment sells heaters to supermarkets, home centers, and drugstores. The Processing segment deals with the structural framework for wooden houses. The Others segment includes construction, nursing care and industrial materials sales. The company was founded on October 1, 2010 and is headquartered in Fukuoka, Japan.', '2019-09-27 09:03:12', '2019-09-27 09:03:12', 1, 1),
(10432, 1, 'Ohashi Technica Inc. (7628)', 13, 68, 114, '-', 'https://www.ohashi.co.jp/ja/index.html', 'Ohashi Technica Inc. engages in the design, development, manufacture and sale of various products in the automobile and information technology sectors. Its products include automotive fasteners, engine and mission, differential, brake, and body and chasse components. It also sells mobile phone hinges and other communication parts. It operates through the following geographical segments: Japan, North America, China, ASEAN, Europe, and Taiwan. The company was founded by Yoshio Ohashi on March 12, 1953 and is headquartered in Tokyo, Japan.', '2019-09-27 09:03:12', '2019-09-27 09:03:12', 1, 1),
(10433, 1, 'Oman International Marketing SAOG (OIMS)', 13, 68, 174, '-', '-', '-', '2019-09-27 09:03:12', '2019-09-27 09:03:12', 1, 1),
(10434, 1, 'Orient International Enterprise Ltd. A (600278)', 13, 68, 47, '-', '-', 'Orient International Enterprise Ltd. engages in trading of textile products. Its business activities include international freight forwarding; development, production, and marketing of chemical and pharmaceutical products; and wholesale of pre-packaged food. It also engages in industrial and high-tech industry investment, as well as counter, entrepot trade, and the provision of other trade services. The company was founded on October 15, 1998 and it is headquartered in Shanghai, China.', '2019-09-27 09:03:12', '2019-09-27 09:03:12', 1, 1),
