(10437, 1, 'POSCO Daewoo Corp. (047050)', 13, 68, 217, '-', 'http://www.daewoo.com/', 'POSCO DAEWOO Corp. engages in trade internationally and development of resources. It operates through the following Business divisions: Trade, Resource Development, and the Other. The Trade division provides steel products, chemicals, automotive parts, and electronic products, and others. The Other division operates department stores. The company was founded on December 27, 2000 and is headquartered in Seoul, South Korea.', '2019-09-27 09:03:12', '2019-09-27 09:03:12', 1, 1),
