(10443, 1, 'Rasa Corp. (3023)', 13, 68, 114, '-', 'http://www.rasaco.co.jp/', 'Rasa Corp. engages in the provision of resources, metallic materials, industrial machinery, construction equipment and other products to firms in different industries. It operates through the following segments: Resources and Metallic Materials, Industrial and Construction Machineries, Environmental Equipment, Plant and Equipment Work, Chemical, and Corporate Real Estate. The Resources and Metallic Materials Business segment imports natural resources as zircon sand and exports a variety of products including ferro-nickel and mini crawler crane. The Industrial and Construction Machineries Business segment handles various machineries including pumps, valves, and automatic pipe cutters. The Environmental Equipment Business segment supplies industrial waste disposal equipment and recycling systems. The Plant and Equipment Work segment covers the design, construction and maintenance work related to plants and related works in various fields such as oil refining, petrochemical, gas related, clean room related, various construction related, urban large air conditioning related. The Chemical Business segment supplies various kinds of plastic resins and chemical products, and manufactures various plastic compounds. The Corporate Real Estate Business segment deals with the rent of corporate real estate. The company was founded on January 10, 1939 and is headquartered in Tokyo, Japan.', '2019-09-27 09:03:13', '2019-09-27 09:03:13', 1, 1),
(10444, 1, 'Raunaq EPC International Ltd. (537840)', 13, 68, 105, '-', '-', '-', '2019-09-27 09:03:13', '2019-09-27 09:03:13', 1, 1),
