(10447, 1, 'Risa International Ltd. (530251)', 13, 68, 105, '-', 'http://www.risainternational.com/', 'Risa International Ltd. engages in the wholesale of textiles and fabrics. It operates through the Trading and Realty segments. The company was founded on March 9, 1993 and is headquartered in Mumbai, India.', '2019-09-27 09:03:13', '2019-09-27 09:03:13', 1, 1),
(10448, 1, 'Ruralco Holdings Ltd. (RHL)', 13, 68, 13, '-', 'https://www.ruralco.com.au/', 'Ruralco Holdings Ltd. provides merchandising services. It operates through the following segments: Rural Services, Water Services, Live Export, Financial Services and Corporate. The Rural Services segment offers livestock agency, wool broking, real estate services and sells rural supplies. The Water Services segment supplies and installs water related products and also provides irrigation and planning services. The Live Export segment supplies feeder and slaughter cattle. The Financial Services segment comprises of finance broking and agricultural advisory services. The Corporate segment comprises the Group''s back office Corporate, Supply Chain and Procurement cost centres. The company was founded in 1865 and is headquartered in Macquarie Park, Australia.', '2019-09-27 09:03:13', '2019-09-27 09:03:13', 1, 1),
(10449, 1, 'Rykadan Capital Ltd. (2288)', 13, 68, 102, '-', 'http://www.rykadan.com/html/index.php', 'Rykadan Capital Ltd. is an investment holding company, which engages in the provision of corporate management services. It operates through the following segments: Property Development, Property Investment, and Distribution of Construction and Interior Decorative Materials. The Property Development segment derives its revenue from repositioning and value enhancement of property with a focus on the development projects. The Property Investment segment handles the leasing of premises within its investment portfolios. The Distribution of Construction and Interior Decorative Materials segment distributes stone composite surfaces products. The company was founded in 1986 and is headquartered in Hong Kong.', '2019-09-27 09:03:13', '2019-09-27 09:03:13', 1, 1),
(10450, 1, 'Sabrimala Leasing & Holdings Ltd. (540132)', 13, 68, 105, '-', 'http://sabrimala.co.in/', 'We are in the business of manufacturing of household plastic goods which includes lunch boxes, food containers and various other items. Our product range contains fusion of stainless steel items with plastic. Apart from that, we are also having a wide range of products that are made for Household Purposes using tetron fabric for manufacturing of outer of food containers to keep the food insulated from outside temperature.', '2019-09-27 09:03:13', '2019-09-27 09:03:13', 1, 1),
(10451, 1, 'Safwan Trading & Contracting Co. K.S.C. (SAFWAN)', 13, 68, 121, '-', '-', '-', '2019-09-27 09:03:13', '2019-09-27 09:03:13', 1, 1),
(10452, 1, 'Sanyo Trading Co. Ltd. (3176)', 13, 68, 114, '-', 'https://www.sanyo-trading.co.jp/', 'Sanyo Trading Co., Ltd. engages in the import, export, and domestic sale of rubber, chemicals, machinery and environmental equipment, industrial products and scientific instruments. It operates through the following segments: Chemicals, Machinery Materials, Overseas Subsidiaries, Domestic Subsidiaries, and Others. The Chemicals segment handles the sale of synthetic rubber and various chemicals. The Machinery Materials segment manages the sale of car parts, granulating machine for animal feeds, and other related machines. The Overseas Subsidiaries segment includes the sale of synthetic rubber, chemicals, and car parts. The Domestic Subsidiaries segment provides various chemicals, drilling equipment, surfactants, pigment dispersants, and synthetic resin additives. The Others segment provides the real estate leasing services. The company was founded on May 28, 1947 and is headquartered in Tokyo, Japan.', '2019-09-27 09:03:13', '2019-09-27 09:03:13', 1, 1),
(10453, 1, 'Sato Shoji Corp. (8065)', 13, 68, 114, '-', 'http://www.satoshoji.co.jp/', 'SATO SHO-JI CORP. engages in the sale, import and export of metal products, electronic materials, machines, industrial tools, lifestyle goods, metal and jewelry, and material of construction and environment-related goods. It operates through the following business divisions: Iron and Steel, Non-ferrous Metals, Electronic Materials, Life Sales, and Machinery and Tools. The Iron and Steel division sells normal steel, specialty steel, construction materials and machinery parts mainly for the industries including the automobiles, construction machinery, bridge building, construction, electrical machinery, ship building and molds. The Non-ferrous Metals division sells and imports processed goods and materials including aluminum, copper, zinc, tin, nickel, silicon, manganese and resins. The Electronic Materials division provides laminate board materials of printed circuit boards used in mobile phones and household appliances such as personal computers and digital cameras, sub-materials, equipment and machines related to manufacturing. The Life Sales division offers novelty goods, tableware, kitchen equipment, precious metals, accessories, and designer items. The Machinery and Tools division covers work tools, grinding wheels, grinding tools and machine tools including lathes, milling machinery, grinding machinery and machining centers; as well as provides factory automation services. The company was founded by Shoji Sato in February 1930 and is headquartered in Tokyo, Japan.', '2019-09-27 09:03:13', '2019-09-27 09:03:13', 1, 1),
(10454, 1, 'Saudi Industrial Export Co. (4140)', 13, 68, 204, '-', '-', '-', '2019-09-27 09:03:14', '2019-09-27 09:03:14', 1, 1),
