(10456, 1, 'SCC Holdings Bhd (SCC)', 13, 68, 136, '-', 'http://www.sccholdings.com.my/', 'SCC Holdings Bhd. is an investment holding company, which engages in the sale, market, and distribution of non-antibiotic animal health products and food service equipment. It operates through three segments: Food Service Equipment, Feed Additives and Other. The Food Service Equipment segment includes all industrial-grade equipment used to aid the final preparation and delivery of meals to customers. The Feed Additives segment is comprised of substances added in small or micro quantities to macronutrient of animal feed to provide specific health or nutrition effects in a concentrated manner and can be categorized into antibiotic feed additives and non-antibiotic feed additives. The Other segment includes all other activities of the company. SCC Holdings was founded by Long Sing Lee, Sew Seng Cher and Ah Heng Goh in 1972 and is headquartered in Kuala Lumpur, Malaysia.', '2019-09-27 09:03:14', '2019-09-27 09:03:14', 1, 1),
(10457, 1, 'School Specialty Inc. (SCOO)', 13, 68, 250, '-', '-', '-', '2019-09-27 09:03:14', '2019-09-27 09:03:14', 1, 1),
