(10459, 1, 'Shandong Shengli Co. Ltd. A (000407)', 13, 68, 47, '-', '-', 'Shandong Shengli Co., Ltd. principally engages in the investment in and operation of services of natural gas and plastic pipelines, etc. Focusing on the development and utilization of clean energy, it invests in, constructs, and operates natural gas business, which involves transmission pipelines of natural gas, urban pipe networks of natural gas, liquefied natural gas, compressed natural gas, and distributed energy of natural gas. The company was founded on May 11, 1994 and is headquartered in Jinan, China.', '2019-09-27 09:03:14', '2019-09-27 09:03:14', 1, 1),
(10460, 1, 'Shanghai Lansheng Corp. A (600826)', 13, 68, 47, '-', '-', 'Shanghai Lansheng Corp. engages in manufacturing, import and export of commodities. Its main business areas include trade and industry, finance, and biopharmaceutical. Its major exporting commodities include footwear, textile materials and textile products, plastics, paper products, electric equipment, and accessories. The company was founded on January 1, 1983 and is headquartered in Shanghai, China.', '2019-09-27 09:03:14', '2019-09-27 09:03:14', 1, 1),
(10461, 1, 'Shanghai Wai Gaoqiao Free-Trade Zone Development Co. Ltd. (600648)', 13, 68, 47, '-', 'http://www.china-ftz.com/', 'Shanghai Waigaoqiao Free Trade Zone Group Co., Ltd. engages in the investment, operation, and management of state-owned assets in Shanghai Free-Trade Zone (FTZ), including Waigaoqiao FTZ and its surrounding land. Its business segment includes park development, commercial real estate, logistics and trade, and cultural investment. The company was founded on May 19, 1992 and is headquartered in Shanghai, China.', '2019-09-27 09:03:14', '2019-09-27 09:03:14', 1, 1),
(10462, 1, 'Shanghai Wai Gaoqiao Free-Trade Zone Development Co. Ltd. B (900912)', 13, 68, 47, '-', 'http://www.china-ftz.com/', 'Shanghai Waigaoqiao Free Trade Zone Group Co., Ltd. engages in the investment, operation, and management of state-owned assets in Shanghai Free-Trade Zone (FTZ), including Waigaoqiao FTZ and its surrounding land. Its business segment includes park development, commercial real estate, logistics and trade, and cultural investment. The company was founded on May 19, 1992 and is headquartered in Shanghai, China.', '2019-09-27 09:03:14', '2019-09-27 09:03:14', 1, 1),
(10463, 1, 'Shenzhen Agricultural Products Co. Ltd. A (000061)', 13, 68, 47, '-', 'http://www.szap.com/', 'Shenzhen Agricultural Products Group Co., Ltd. engages in distribution of agricultural products. It also engages in investing and managing of food wholesale markets and operates food markets and online markets. The company was founded on January 14, 1989 and is headquartered in Shenzhen, China.', '2019-09-27 09:03:14', '2019-09-27 09:03:14', 1, 1),
