(10465, 1, 'Sicagen India Ltd. (533014)', 13, 68, 105, '-', 'http://sicagen.com/', 'Sicagen India Ltd. engages in the provision of infrastructure solutions, industrial packaging, and specialty chemicals for water treatment. It operates through the Trading and Manufacturing segments. The company was founded on June 11, 2004 and is headquartered in Chennai, India.', '2019-09-27 09:03:14', '2019-09-27 09:03:14', 1, 1),
