(10468, 1, 'Sinomach General Machinery Science & Technology Co. Ltd. A (600444)', 13, 68, 47, '-', '-', 'Sinomach General Machinery Science & Technology Co., Ltd. engages in the research and development, manufacture, and sale of pipes and pipe fittings. It focuses on the fluid machinery related business and plastic pipe business. The firm''s products include drainage series, water supply series, gas series, trenchless pipes, cable sheathing, pipeline used inside the building, ground source heat pump system piping, PE-RT floor heating pipe, and fittings series. The company was founded on December 30, 1993 and is headquartered in Hefei, China.', '2019-09-27 09:03:15', '2019-09-27 09:03:15', 1, 1),
(10469, 1, 'SK Networks Co. Ltd. (001740)', 13, 68, 217, '-', 'https://www.sknetworks.co.kr/', 'SK Networks Co., Ltd. engages in the distribution of energy, communication, trading, car life, and appliances rental services, and walkerhill hotels services. It operates through the following business divisions: Communication, Energy Marketing, Car Life, Trading, SK Magic, and Walkerhill. The communication division involves in mobile device distribution such as cellphone, tablet, and wearable devices. The energy marketing division provides petroleum products, asphalt, and bunkering. The car life division offers car renting services and automotive parts distribution. The trading division provides provides import and export services with global suppliers. The SK magic division rents appliances such as water purifier, air fresher, and others. The walkerhill division provides hotel services and customer facilitating services. The company was founded on March 24, 1956 and is headquartered in Suwon, South Korea.', '2019-09-27 09:03:15', '2019-09-27 09:03:15', 1, 1),
