(10472, 1, 'Smart-Core Holdings Ltd. (2166)', 13, 68, 102, '-', 'http://www.smart-core.com.hk/', 'Smart-Core Holdings Ltd. is an investment company, which engages in the distribution and trade of integrated circuit and other electronic components. Through its subsidiaries, it operates through the Hong Kong; and the People''s Republic of China geographical segments. The firm''s products include various integrated circuits and other electronic components, which can be used in smart media for display; smart radio terminals; mobile terminals; automotive electronics; and memory. It also provides engineering solutions and field application engineering support. The company was founded by Wei Dong Tian on October 22, 2015 and is headquartered in Hong Kong.', '2019-09-27 09:03:15', '2019-09-27 09:03:15', 1, 1),
(10473, 1, 'SP Corp. Ltd. (AWE)', 13, 68, 210, '-', 'http://www.spcorp.com.sg/', 'SP Corp. Ltd. is an investment holding company, which engages in the provision of management services. It operates through the following Commodities Trading, and Corporate and Others business segment. The Commodities Trading segment trades and markets products including coal, rubber and metals used by manufacturers in the energy, tyre, metal and automotive industries. The Corporate and Others segment includes general corporate activities and others. The company was founded on November 27, 1952 and is headquartered in Singapore.', '2019-09-27 09:03:15', '2019-09-27 09:03:15', 1, 1),
(10474, 1, 'SPK Corp. (7466)', 13, 68, 114, '-', 'http://www.spk.co.jp/', 'SPK Corp. engages in the sale, import and export of components for automobiles and industrial machinery vehicles. It operates through the following segments: Domestic Sales, Overseas Sales and Industrial Machinery Sales. The Domestic Sales segment engages in the sale of automobile parts and car items to regional automobile part wholesalers, car item shops and others. The Overseas Sales segment engages in the provision of automobile components and other products to more than 80 overseas countries through importers. The Industrial Machinery Sales segment is engaged in the sale of assembly components to construction, agricultural and forklift machinery makers. The company was founded on December 25, 1917 and is headquartered in Osaka, Japan.', '2019-09-27 09:03:15', '2019-09-27 09:03:15', 1, 1),
(10475, 1, 'State Trading Corp. of India Ltd. (512531)', 13, 68, 105, '-', 'http://www.stclimited.co.in/', 'State Trading Corp. of India Ltd. is engaged in the import, export and domestic trading of spices and other agricultural products. Its business is classified into three categories: import of items like edible oils, pulses and fertilizers on behalf of the Government of India; business carried out on behalf of business associates on back to back basis; and direct buying and selling in items like tea, soyabean seed, chana. The company''s export basket includes wheat, rice, tea, coffee, cashew, extractions, castor oil/seed, sugar, spices, jute goods, iron ore, chemicals, pharmaceuticals, light engineering goods, construction materials, consumer goods, processed foods, textiles, garments, jewelry and leather ware. State Trading Corp. of India was founded on May 18, 1956 and is headquartered in New Delhi, India.', '2019-09-27 09:03:15', '2019-09-27 09:03:15', 1, 1),
