(10479, 1, 'STX Corp. (011810)', 13, 68, 217, '-', 'http://www.stx.co.kr/Kor/Main/index.aspx', 'STX Corp. engages in the provision of trading services. It operates through the following businesses areas: Energy Trading, Commodity Trading, Machinery and Engine Trading, Shipping and Logistics, and Industrial and Consumer Goods. The company was founded on December 24, 1976 and is headquartered in Changwon, South Korea.', '2019-09-27 09:03:16', '2019-09-27 09:03:16', 1, 1),
(10480, 1, 'Sugita Ace Co. Ltd. (7635)', 13, 68, 114, '-', 'https://www.sugita-ace.co.jp/', 'Sugita Ace Co., Ltd. engages in the sale of architectural hardware and construction related materials. It operates through the following segments: Root, Engineering and Direct Demand. The Root segment deals with the secondary wholesale of building materials to hardware and construction stores. The Engineering segment covers the sale of residential and building materials to construction shops and building material stores. The Direct Demand segment handles the sale of DIY products and original equipment manufacturing (OEM) related products to discount stores and home centers. It also wholesales Do-It-Yourself (DIY) supplies. The company was founded on September 11, 1948 and is headquartered in Tokyo, Japan.', '2019-09-27 09:03:16', '2019-09-27 09:03:16', 1, 1),
(10481, 1, 'Sumitomo Corp. (8053)', 13, 68, 114, '-', 'https://www.sumitomocorp.com/region-selector/', 'Sumitomo Corp. engages in the provision of trade services. It operates through the following segments: Metal Products, Transportation and Construction Systems, Infrastructure, Media and Digital, Living Related and Real Estate, and Mineral Resources, Energy, Chemical and Electronics. The Metal Products segment handles the trade of metal products, including steel sheets, tubular products, and other products, as well as non-ferrous metals such as aluminum and titanium. The Transportation and Construction Systems segment deals with the automobile, ship, aircraft, rail, other transportation equipment, and construction equipment businesses. The Infrastructure segment includes social infrastructure, global power infrastructure, and logistics infrastructure businesses. The Media and Digital segment handles the digital, media, and smart communications platform businesses. The Living Related and Real Estate segment manages the lifestyle and retail, food and agriculture, and materials, supplies, and real estate divisions. The Mineral Resources, Energy, Chemical and Electronics segment develops businesses in mineral resources, energy, basic chemicals and electronics, and life sciences. The company was founded on December 24, 1919 and is headquartered in Tokyo, Japan.', '2019-09-27 09:03:16', '2019-09-27 09:03:16', 1, 1),
(10482, 1, 'Sumitomo Corp. (SSUMF)', 13, 68, 250, '-', '-', '-', '2019-09-27 09:03:16', '2019-09-27 09:03:16', 1, 1),
