(10484, 1, 'Summit Ascent Holdings Ltd. (0102)', 13, 68, 102, '-', 'http://www.saholdings.com.hk/eng/', 'Summit Ascent Holdings Ltd. engages in the investment and management of tile trading and engineering business. It operates through the Gaming & Hotel Operations segment. The company was founded on October 26, 1993 and is headquartered in Hong Kong.', '2019-09-27 09:03:16', '2019-09-27 09:03:16', 1, 1),
