(10487, 1, 'SVP Global Ventures Ltd. (505590)', 13, 68, 105, '-', 'https://www.pittie.com/', 'SVP Global Ventures Ltd. is a yarn manufacturing company, which engages in the textiles business. Its products include single ring yarn, double ring yarn, single open end yarn, and double open end yarn. The company was founded on February 17, 1982 and is headquartered in Mumbai, India.', '2019-09-27 09:03:16', '2019-09-27 09:03:16', 1, 1),
