(10490, 1, 'Tai United Holdings Ltd. (0718)', 13, 68, 102, '-', 'http://www.irasia.com/listco/hk/taiunited/index.htm', 'Tai United Holdings Ltd. is an investment holding company. It operates though following segments: Financial Services, Securities Investment, Commodity Trading, Distressed Debt Asset Management, Mining & Exploitation of natural resources, & Other, Financial services and Property investment. The Financial Services segment includes fund investment, provision of securities and margin financing, trading and brokerage of futures contracts, asset management, money lending business and insurance brokerage service to customers in Hong Kong. The Securities Investment segment engages in trading equity securities and derivatives in the PRC, Hong Kong and Singapore. The Commodity trading segment engages in trading of petrochemical products and metal-related products in Singapore. The Distressed debt asset management segment manages assets arising from acquisition of distressed debts assets in the PRC. The Mining and exploitation of natural resources segment engages in the mining and production of tungsten resources activities in the Republic of Mongolia. The Sales of medical equipment and other general goods segment engages in the trading of medical equipment and other general goods in the PRC. The Financial services segment engages in the provision of securities and margin financing, trading and brokerage of futures contracts, asset management and money lending business to customers in Hong Kong. The Property investment segment includes property investment and leasing of properties in the PRC and UK. The company was founded on August 18, 1995 and is headquartered in Hong Kong.', '2019-09-27 09:03:16', '2019-09-27 09:03:16', 1, 1),
