(10493, 1, 'Takashima & Co. Ltd. (8007)', 13, 68, 114, '-', 'http://www.tak.co.jp/', 'Takashima & Co., Ltd. engages in the provision of construction and industrial materials. It operates through the following segments: Construction Supply, Industrial Materials, and Real Estate Leasing. The Construction Supply segment sells materials for systems which uses renewable energy and also provides environment-friendly construction materials and housing equipment. The Industrial Materials segment provides textiles, plastic, railway train materials, and electronic products. The Real Estate Leasing segment leases condominium and other properties. The company was founded by Kotakichi Takashima on October 1, 1915 and is headquartered in Tokyo, Japan.', '2019-09-27 09:03:17', '2019-09-27 09:03:17', 1, 1),
(10494, 1, 'Tempo Australia Ltd. (TPP)', 13, 68, 13, '-', 'https://www.tempoaust.com/', 'Tempo Australia Ltd. engages in the provision of structural mechanical piping services to mining, oil and gas sectors specializing in construction, maintenance, sustaining capital works, and shutdown services. The company was founded in 1969 and is headquartered in Sydney, Australia.', '2019-09-27 09:03:17', '2019-09-27 09:03:17', 1, 1),
