(10496, 1, 'Thakral Corp. Ltd. (AWI)', 13, 68, 210, '-', 'http://www.thakralcorp.com/', 'Thakral Corp. Ltd. operates as an investment holding company, which engages in the distribution of consumer electronics products, strategic property and equity investments. It operates through the following segments: Lifestyle, Investments and Others. The Lifestyle segment engages in the distribution of lifestyle products and accessories. The Investments segment includes real estate the property investments in China and Hong Kong, Australia and Japan. The Others segment involves other activities of the company which do not fall into the above categories. The company was founded on October 7, 1993 and is headquartered in Singapore.', '2019-09-27 09:03:17', '2019-09-27 09:03:17', 1, 1),
