(10501, 1, 'Tou Rong Chang Fu Group Ltd. (0850)', 13, 68, 102, '-', 'http://trcf.com.hk/zh-hant/', 'Tou Rong Chang Fu Group Ltd. is an investment holding company, which engages in the provision of exploration drilling services and insurance broker services. It operates through the following segments: Commodity Trading, Crude Oil, Property Investment, Financial Services, and Others. The Commodity Trading segment is comprised of commodities and chemical trading. The Crude Oil segment exploits and sell crude oil. The Property Investment segment leases investment properties. The Finance Services segment is consist of money lending, securities brokerage, and asset management business. The company was founded by Sum Poon in March 1987 and is headquartered in Hong Kong.', '2019-09-27 09:03:17', '2019-09-27 09:03:17', 1, 1),
