(10506, 1, 'Trinity Tradelink Ltd. (512417)', 13, 68, 105, '-', 'http://trinitytrade.in/', 'Trinity Tradelink Ltd. is engaged in international trading. Its export products includes jute, tea, potato, consumer electronics, agricultural products, iron and steal, metals, and minerals. The company was founded on March 30, 1985 and is headquartered in Mumbai, India.', '2019-09-27 09:03:18', '2019-09-27 09:03:18', 1, 1),
(10507, 1, 'Triwira Insanlestari (TRIL)', 13, 68, 106, '-', 'http://www.triwirainsanlestari.com/', 'PT Triwira Insanlestari Tbk engages in the distribution and supply of safety equipment, technical automotive equipment, machinery, and technical hardware. It operates through the following segments: Safety and Equipment, Machinery and Automation, and Hoist and Lever. It also involves in the mining and energy businesses. The company was founded by Tommy Lybianto on October 26, 1992 and is headquartered in Jakarta, Indonesia.', '2019-09-27 09:03:18', '2019-09-27 09:03:18', 1, 1),
(10508, 1, 'Tye Soon Ltd. (BFU)', 13, 68, 210, '-', 'http://www.tyesoon.com/', 'Tye Soon Ltd. engages in the distribution of automotive parts. It operates through the following geographical segments: Singapore, Malaysia, Australia, Thailand, North Asia, and Others. It also imports, exports, and distributes automotive parts and property investment. The company was founded by Ban Guan Ong in 1933 and is headquartered in Singapore.', '2019-09-27 09:03:18', '2019-09-27 09:03:18', 1, 1),
(10509, 1, 'UIM Entertainment Co. Ltd. (043220)', 13, 68, 217, '-', '-', '-', '2019-09-27 09:03:18', '2019-09-27 09:03:18', 1, 1),
(10510, 1, 'Union Asia Enterprise Holdings Ltd. (8173)', 13, 68, 102, '-', 'http://www.unionasiahk.com/en-us/index', 'Union Asia Enterprise Holdings Ltd. engages in the trading business. It operates through the following segments: Beverages, Metals, Household Products, Nephrite, Charter, and Securities. The Beverages segment offers bottled mineral water and tea products. The Metals segment includes stainless steel and scrap metals such as aluminum and copper. The Household Products segment involves trading in of daily essentials such as skincare and baby products. The Nephrite segment involves in trading of nephrite. The Charter segment refers to rental income on rent of vessels. The Securities segment invests in and trades of listed securities. The company was founded in 2008 and is headquartered in Hong Kong.', '2019-09-27 09:03:18', '2019-09-27 09:03:18', 1, 1),
