(10515, 1, 'Uniphos Enterprises Ltd. (EQUNIENTER)', 13, 68, 105, '-', 'http://www.uelonline.com/', 'Uniphos Enterprises, Ltd. operates as a chemicals trading company in India. It trades chemicals and other products; and imports and exports engineering goods, agricultural products, and other items. The company was founded on May 29, 1969 and is headquartered in Mumbai, India.', '2019-09-27 09:03:18', '2019-09-27 09:03:18', 1, 1),
