(10526, 1, 'Wah Lee Industrial Corp. (3010)', 13, 68, 228, '-', 'https://www.wahlee.com/ZH', 'Wah Lee Industrial Corp. engages in the development and provision of industrial materials. Its products include semiconductor process materials; information and communication materials; flat panel display materials and equipment; printed circuit board materials, equipment, and components; photoelectric materials and equipment. The company was founded on October 1, 1968 and is headquartered in Kaohsiung, Taiwan.', '2019-09-27 09:03:19', '2019-09-27 09:03:19', 1, 1),
