(10534, 1, 'Won IK Corp. (032940)', 13, 68, 217, '-', '-', 'Wonik Corp. engages in the manufacture and sale of electronic medical equipment. It operates through the Healthcare and Trade Business divisions. The Healthcare division provides surgery, skin care, and laser equipment. The Trade division offers industrial materials, lighting instrument, semiconductor measuring equipment, and semiconductors gas pressure checking sensors. The company was founded on October 31, 1983 and is headquartered in Seongnam-si, South Korea.', '2019-09-27 09:03:20', '2019-09-27 09:03:20', 1, 1),
(10535, 1, 'Wulff-Yhtiot Oyj (WUF1V)', 13, 68, 77, '-', '-', '-', '2019-09-27 09:03:20', '2019-09-27 09:03:20', 1, 1),
(10536, 1, 'Xiamen C&D Inc. A (600153)', 13, 68, 47, '-', 'http://www.chinacnd.com/', 'Xiamen C&D Inc. is engaged in the operation of supply chains and the development of real estate properties. It operates its businesses primarily through the operation of supply chains for pulp and paper, iron and steel, minerals, chemical products, electrical and mechanical products, textile products, agricultural products, cars and alcohol products as well as engages in the provision of integrated logistics services. The company was founded in May 1998 and is headquartered in Xiamen, China.', '2019-09-27 09:03:20', '2019-09-27 09:03:20', 1, 1),
(10537, 1, 'Xiamen ITG Group Corp. Ltd. (600755)', 13, 68, 47, '-', '-', 'Xiamen International Trade Group Corp. Ltd. engages in supply chain management, real estate management, and financial services. The supply chain management business includes bulk trade, logistics services, auto distribution, and commercial retail business. The real estate management business includes high quality residential development and commercial real estate development based on key cities. The scope of financial services includes futures and derivatives, small and medium-sized micro-enterprise-based financial services platform and investment. The company was founded on February 19, 1993 and is headquartered in Xiamen, China.', '2019-09-27 09:03:20', '2019-09-27 09:03:20', 1, 1),
(10538, 1, 'Xiamen Xinde Co. Ltd. A (000701)', 13, 68, 47, '-', 'http://www.xindeco.com/', 'Xiamen Xinde Co., Ltd. engages in the operation of electronic information industry covering optoelectronics and telecommunications network business. The optoelectronics business includes research and development, production, and sale of light-emitting diode packaging and application product. The telecommunications network includes research and development, manufacture, and application services of radio-frequency identification tags, reading and writing equipment products, and security video surveillance products. The firm involves in bulk trade and automobile supply chains, real estate, and financial services. The company was founded in May 1984 and is headquartered in Xiamen, China.', '2019-09-27 09:03:20', '2019-09-27 09:03:20', 1, 1),
(10539, 1, 'Yamadai Corp. (7426)', 13, 68, 114, '-', 'http://www.yamadai.com/', 'Yamadai Corp. engages in the sale of housing and construction materials. Its operations are carried out through the following segments: Housing Materials, Home, and Leasing. The Housing Materials segment deals with the wholesale and retail of residential construction and housing materials, artificial drying, preservation treatment, and computer cutting of wood. The Home segment engages in the design, construction, sale, and brokerage of residential buildings. The Leasing segment deals with real estate leasing and brokerage operations. The company was founded on August 5, 1964 and is headquartered in Ishinomaki, Japan.', '2019-09-27 09:03:20', '2019-09-27 09:03:20', 1, 1),
(10540, 1, 'Yamae Hisano Co. Ltd. (8108)', 13, 68, 114, '-', 'http://www.yamaehisano.co.jp/index_h.html', 'Yamae Hisano Co., Ltd. engages in the manufacture and wholesale of processed food products, frozen food, grains and alcoholic drinks. It is also engages in agricultural product processing and side dishes production for convenience stores and mass retailers. Its operations are carried out through the following segments: Food Product-related, Food Ingredient & Feed and Livestock related, House and Real Estate related, and Others. The Food Product related segment deals with dry state processed food like seasonings, noodles, powdered items, green tea and imported food; fresh and frozen food like agricultural, seafood and livestock products; and alcoholic beverages like Japanese sake, spirits, beer, liqueur, and imported alcoholic beverages. The Food Ingredient & Feed and Livestock related segment covers wheat, sugar, starch, and cornstarch among others; and mixed feeds and fish feeds. The House and Real Estate related segment include house construction materials like timber, housing equipment, and real estate leasing. The Others segment handles the transportation, fuel-related, rent-a-car, information processing, and insurances services. The company was founded on April 27, 1950 and is headquartered in Fukuoka, Japan.', '2019-09-27 09:03:21', '2019-09-27 09:03:21', 1, 1),
(10541, 1, 'Yinson Holdings Bhd (YINSON)', 13, 68, 136, '-', 'https://www.yinson.com.my/', 'Yinson Holdings Bhd. is an investment holding company, which engages in the provision of floating, production, storage, and offloading services. It operates through the Offshore and Marine, and Other Operations segment. The Offshore and Marine segment comprises providing vessel and marine related services. The Other Operations segment includes investment, management services, and treasury services. The company was founded by Lim Han Weng in 1983 and is headquartered in Kuala Lumpur, Malaysia.', '2019-09-27 09:03:21', '2019-09-27 09:03:21', 1, 1),
(10542, 1, 'Yogya Enterprises Ltd. (539097)', 13, 68, 105, '-', 'http://www.yogya.co.in/index.php/about-us-2/', 'Yogya Group is a diversified group and one of the fastest growing. Our Group had a turnover of more than 80 Cr in FY 2015-16 . Our Vision is to become dominant player in our areas of interest. Our Business Interests fall under the following verticals: Trading, IT Infrastructure, Financial Services, Consulting and Information technology. Yogya Group is headed by Mr. Rajeev Gupta, an MBA graduate with diverse interests and a focused vision to deliver value to the end user. He is having more than 18 years of experience in Financial Services, Equity Research, Information Technology and Trading Business. Mr. Gupta, with his multi-functional experience, guides in forming short-term as well a long-term strategies for our group', '2019-09-27 09:03:21', '2019-09-27 09:03:21', 1, 1),
(10543, 1, 'YuuZoo Corp. Ltd. (AFC)', 13, 68, 210, '-', '-', 'Yuuzoo Corp Ltd. provides on-line social networking software and services for businesses. Its products include YuuPay and YuuCard. YuuPay provides merchants and businesses their payment needs. YuuCard is a mobile e-wallet application that helps merchants to forward loyalty programs to consumers and to keep track of discount offers. The company was founded on March 22, 2005 and is headquartered in Singapore.', '2019-09-27 09:03:21', '2019-09-27 09:03:21', 1, 1),
(10544, 1, 'Zero One Technology Co. Ltd. (3029)', 13, 68, 228, '-', 'https://www.zerone.com.tw/', 'Zero One Technology Co. Ltd. engages in the provision of software and hardware solutions. Its products include information technology equipment market sales channels, web server equipment, storage devices, network management, information security, cloud services, video surveillance, system management, application management, virtual program, unified communications, audio-visual equipment, server, and digital monitoring. The company was founded on June 27, 1980 and is headquartered in Taipei, Taiwan.', '2019-09-27 09:03:21', '2019-09-27 09:03:21', 1, 1),
(10545, 1, 'Zhuhai Port Co. Ltd. (000507)', 13, 68, 47, '-', '-', 'Zhuhai Port Co. Ltd. engages in the port logistics operations. Its main business includes electric power & energy and industrial manufacturing. The company Industrial manufacturing is composed of manufacturing and selling of chemical fiber, polyester and composite materials. Its other business include real estate management, investment consulting and pharmaceuticals production. Zhuhai Port was founded on March 9, 1989 and is headquartered in Zhuhai, China.', '2019-09-27 09:03:21', '2019-09-27 09:03:21', 1, 1);
